        public static ReadOnlyDictionary<PBEMove, PBELocalizedString> Descriptions { get; } = new ReadOnlyDictionary<PBEMove, PBELocalizedString>(new Dictionary<PBEMove, PBELocalizedString>()
        {
            { PBEMove.None, new PBELocalizedString("―\n―\n―\n―\n―", "", "\n\n", "-", "", "", "\n") },
            { PBEMove.Pound, new PBELocalizedString("ながい　しっぽや　てなどを　つかって\nあいてを　はたいて　こうげきする。\n", "긴 꼬리나 손 등을 사용하여\n상대를 때려서 공격한다.", "Écrase l'ennemi avec les pattes\navant, la queue, etc.", "Ein Hieb mit den Vorderbeinen\noder dem Schweif.", "Golpea con las patas o la cola.", "Colpisce il nemico con la coda o le zampe\nanteriori.", "The target is physically pounded with\na long tail or a foreleg, etc.") },
            { PBEMove.KarateChop, new PBELocalizedString("するどい　チョップで\nあいてを　たたいて　こうげきする。　\nきゅうしょに　あたりやすい。", "날카로운 당수로\n상대를 때려서 공격한다.\n급소에 맞기 쉽다.", "L'ennemi est tranché violemment.\nTaux de critiques élevé.", "Gute Möglichkeit, einen Volltreffer\nzu landen.", "Da un golpe cortante.\nSuele ser crítico.", "Colpisce il nemico con un colpo netto.\nProbabile brutto colpo.", "The target is attacked with a sharp chop.\nCritical hits land more easily.") },
            // { PBEMove.3, new PBELocalizedString("おうふく　ビンタで\nあいてを　たたいて　こうげきする。\n\xFF12ー\xFF15かいの　あいだ　れんぞくで　だす。", "연속 뺨치기로\n상대를 때려서 공격한다.\n2-5회 동안 연속으로 쓴다.", "Gifle rapidement l'ennemi\nde 2 à 5 fois d'affilée.", "Trifft das Ziel 2- bis 5-mal hintereinander\nmit einem Duplexhieb.", "Abofetea de dos a cinco veces seguidas.", "Schiaffeggia il nemico da due a cinque\nvolte di fila.", "The target is slapped repeatedly, back\nand forth, two to five times in a row.") },
            // { PBEMove.4, new PBELocalizedString("どとうの　パンチで\nあいてを　なぐりつけて　こうげきする。\n\xFF12ー\xFF15かいの　あいだ　れんぞくで　だす。", "노도 같은 펀치로\n상대를 세게 때려서 공격한다.\n2-5회 동안 연속으로 쓴다.", "Une tornade de coups de poing\nqui frappe de 2 à 5 fois d'affilée.", "Trifft das Ziel 2- bis 5-mal hintereinander\nmit kräftigen Hieben.", "Pega de dos a cinco veces seguidas.", "Colpisce il nemico con una scarica di pugni\nda due a cinque volte di fila.", "The target is hit with a flurry of punches\nthat strike two to five times in a row.") },
            { PBEMove.MegaPunch, new PBELocalizedString("ちからを　こめた　パンチで\nあいてを　こうげきする。\n", "힘을 담은 펀치로\n상대를 공격한다.", "L'ennemi reçoit un coup de poing\nd'une puissance incroyable.", "Ein unglaublich kräftiger Hieb.", "Un puñetazo de gran potencia.", "Colpisce il nemico con un pugno poderoso.", "The target is slugged by a punch thrown\nwith muscle-packed power.") },
            // { PBEMove.6, new PBELocalizedString("あいての　からだに\nこばんを　なげつけて　こうげきする。\nせんとうの　あとで　おかねが　もらえる。", "상대의 몸에\n돈을 세게 던져서 공격한다.\n배틀 후에 돈을 받을 수 있다.", "Des pièces sont lancées sur l'ennemi.\nPermet d'obtenir de l'argent à la fin\ndu combat.", "Das Ziel wird mit Münzen beworfen. Das\nGeld wird nach dem Kampf aufgesammelt.", "Arroja monedas al objetivo.\nLas recupera al final del combate.", "Colpisce il nemico con una gran quantità\ndi monete recuperabili dopo la lotta.", "Numerous coins are hurled at the\ntarget to inflict damage.\nMoney is earned after the battle.") },
            { PBEMove.FirePunch, new PBELocalizedString("ほのおを　こめた　パンチで\nあいてを　こうげきする。\nやけど　じょうたいに　することが　ある。", "불꽃을 담은 펀치로\n상대를 공격한다.\n화상 상태로 만들 때가 있다.", "Un coup de poing enflammé vient\nfrapper l'ennemi. Peut le brûler.", "Feuriger Schlag, der dem Ziel eventuell\nVerbrennungen zufügt.", "Puñetazo ardiente.\nPuede quemar.", "Colpisce il nemico con un pugno ardente\nche può scottarlo.", "The target is punched with a fiery fist.\nIt may also leave the target with a burn.") },
            { PBEMove.IcePunch, new PBELocalizedString("れいきを　こめた　パンチで\nあいてを　こうげきする。\nこおり　じょうたいに　することが　ある。", "냉기를 담은 펀치로\n상대를 공격한다.\n얼음 상태로 만들 때가 있다.", "Un coup de poing glacé vient\nfrapper l'ennemi. Peut le geler.", "Ein eisiger Schlag, der das Ziel\neventuell einfriert.", "Puñetazo helado.\nPuede congelar.", "Colpisce il nemico con un pugno di ghiaccio\nche può congelarlo.", "The target is punched with an icy fist.\nIt may also leave the target frozen.") },
            { PBEMove.ThunderPunch, new PBELocalizedString("でんげきを　こめた　パンチで\nあいてを　こうげきする。\nまひ　じょうたいに　することが　ある。", "전격을 담은 펀치로\n상대를 공격한다.\n마비 상태로 만들 때가 있다.", "Un coup de poing électrique vient\nfrapper l'ennemi. Peut le paralyser.", "Ein elektrischer Schlag, der das Ziel\neventuell paralysiert.", "Puñetazo eléctrico.\nPuede paralizar.", "Colpisce il nemico con un pugno elettrico\nche può paralizzarlo.", "The target is punched with an electrified\nfist. It may also leave the target\nwith paralysis.") },
            { PBEMove.Scratch, new PBELocalizedString("かたく　とがった　するどい　ツメで\nあいてを　ひっかいて　こうげきする。\n", "단단하고 뾰족한 날카로운 손톱으로\n상대를 할퀴어서 공격한다.", "Lacère l'ennemi avec des griffes acérées\npour lui infliger des dégâts.", "Das Ziel wird mit scharfen\nKlauen zerkratzt.", "Araña con afiladas garras.", "Infligge danni al nemico con artigli\nacuminati, duri e affilati.", "Hard, pointed, and sharp claws rake\nthe target to inflict damage.") },
            { PBEMove.ViceGrip, new PBELocalizedString("あいてを　りょうがわから　はさんで\nダメージを　あたえる。\n", "상대를 양쪽에서 집어서\n데미지를 준다.", "L'ennemi est attrapé et compressé\npar les côtés.", "Das Ziel wird umklammert\nund zusammengequetscht.", "Atrapa y atenaza al objetivo.", "Stringe il nemico in una morsa usando\nenormi e possenti tenaglie.", "The target is gripped and squeezed from\nboth sides to inflict damage.") },
            { PBEMove.Guillotine, new PBELocalizedString("おおきな　ハサミで\nあいてを　きりさいて　こうげきする。\nあたれば　いちげきで　ひんしに　する。", "큰 집게로\n상대를 베어 갈라 공격한다.\n맞으면 일격에 기절한다.", "De méchantes pinces lacèrent\nl'ennemi, le mettant K.O. sur\nle coup s'il est touché.", "Kräftige Scheren-Attacke. Führt beim\nZiel sofort zum K.O.", "Ataque con pinzas que debilita al oponente\nde un golpe si acierta.", "Attacca il nemico con pericolose tenaglie.\nSe l'attacco va a segno, il nemico va\nsubito KO.", "A vicious, tearing attack with big pincers.\nThe target will faint instantly\nif this attack hits.") },
            // { PBEMove.13, new PBELocalizedString("かぜの　やいばを　つくり\n\xFF12ターンめに　あいてを　こうげきする。\nきゅうしょに　あたりやすい。", "바람의 칼날을 만들어\n2턴째에 상대를 공격한다.\n급소에 맞기 쉽다.", "Attaque en 2 tours.\nDes lames de vent frappent l'ennemi au\n2⒅ tour. Taux de critiques élevé.", "Eine Attacke, die über zwei Runden\ngeht. Hohe Volltrefferquote.", "Primero se prepara y en el segundo turno\nataca al oponente con ráfagas de viento\ncortante. Alta probabilidad de ser crítico.", "Chi la usa genera un turbine al primo\nturno e attacca al secondo.\nProbabile brutto colpo.", "A two-turn attack. Blades of wind hit\nopposing Pokémon on the second turn.\nCritical hits land more easily.") },
            { PBEMove.SwordsDance, new PBELocalizedString("たたかいのまいを　はげしく　おどって\nきあいを　たかめる。\nじぶんの　こうげきを　ぐーんと　あげる。", "싸움의 춤을 격렬하게 추며\n기세를 높인다.\n자신의 공격을 크게 올린다.", "Danse frénétique qui exalte l'esprit\ncombatif. Augmente beaucoup\nl'Attaque du lanceur.", "Ein wilder Kampftanz, der den eigenen\nAngriffs-Wert stark erhöht.", "Baile frenético que aumenta mucho\nel Ataque.", "Danza frenetica che incrementa lo spirito\ncombattivo. Chi la usa aumenta di molto\nil suo Attacco.", "A frenetic dance to uplift the fighting\nspirit. It sharply raises the user's\nAttack stat.") },
            { PBEMove.Cut, new PBELocalizedString("カマや　ツメなどで\nあいてを　きりつけて　こうげきする。\nほそいきも　きることが　できる。", "낫이나 손톱 등으로\n상대를 베어 공격한다.\n가느다란 나무도 자를 수 있다.", "Coupe l'ennemi avec des lames\nou des griffes. Hors combat,\npermet de couper des arbres fins.", "Ein Basisangriff mit Schere oder Klaue.\nDamit können kleine Bäume gefällt werden.", "Corta con garras, guadañas, etc.\nTambién sirve para cortar árboles\nfinos.", "Attacca il nemico con artigli o falci\naffilate. Fuori dalla lotta si usa per\ntagliare piccoli alberi.", "The target is cut with a scythe or a claw.\nIt can also be used to cut down\nthin trees.") },
            { PBEMove.Gust, new PBELocalizedString("つばさで　おこした　はげしい　かぜを\nあいてに　ぶつけて　こうげきする。\n", "날개로 일으킨 격한 바람을\n상대에게 부딪쳐서 공격한다.", "Le lanceur bat des ailes pour\ngénérer une bourrasque\nqui blesse l'ennemi.", "Trifft das Ziel mit einem Windstoß\ndurch einen Flügelschlag.", "Crea un tornado con las alas y lo lanza\ncontra el objetivo.", "Infligge danni al nemico con una folata\ndi vento sollevata dalle ali.", "A gust of wind is whipped up by wings and\nlaunched at the target to inflict damage.") },
            { PBEMove.WingAttack, new PBELocalizedString("おおきく　ひろげた　りっぱな　つばさを\nあいてに　ぶつけて　こうげきする。\n", "크게 펼친 훌륭한 날개를\n상대에게 부딪쳐서 공격한다.", "L'ennemi est frappé par de larges ailes\ndéployées pour infliger des dégâts.", "Trifft das Ziel mit ausgebreiteten\nFlügeln.", "Golpea al objetivo con unas grandes alas.", "Infligge danni al nemico spiegando\ndelle grandi ali possenti.", "The target is struck with large, imposing\nwings spread wide to inflict damage.") },
            { PBEMove.Whirlwind, new PBELocalizedString("あいてを　ふきとばして\nひかえの　ポケモンを　ひきずりだす。\nやせいの　ばあいは　せんとうが　おわる。", "상대를 날려버려서\n교대할 포켓몬을 끌어낸다.\n야생의 경우에는 배틀이 끝난다.", "Éjecte le Pokémon ennemi\net le remplace par un autre.\nDans la nature, met fin au combat.", "Weht das Ziel weg und ersetzt es durch ein\nanderes Pokémon. In der Wildnis endet\nder Kampf.", "Se lleva al objetivo, que es cambiado\npor otro Pokémon. Si es un Pokémon\nsalvaje, acaba el combate.", "Il bersaglio lascia il campo e viene\nsostituito. Mette fine alle lotte contro\nsingoli Pokémon selvatici.", "The target is blown away and switched.\nIn the wild, a battle against a single\nPokémon ends.") },
            { PBEMove.Fly, new PBELocalizedString("\xFF11ターンめで　そらへ　とび\n\xFF12ターンめに　あいてを　こうげきする。\nしっている　まちに　とぶことも　できる。", "1턴째에 하늘을 날아\n2턴째에 상대를 공격한다.\n알고 있는 도시로 날아갈 수 있다.", "Le lanceur s'envole au 1⑩ tour et\nfrappe au 2⒅. Permet aussi de voler\njusqu'à une ville déjà visitée.", "Steigt in Runde 1 empor und trifft das\nZiel in Runde 2. Ermöglicht Flug in\njede bekannte Stadt.", "Primer turno: vuela. Segundo turno:\nataca. Fuera de combate, permite ir\na sitios ya conocidos.", "Chi la usa si alza in volo per attaccare\nal turno seguente. Fuori dalla lotta\npermette di volare in città già visitate.", "The user soars, then strikes its target\non the second turn. It can also be\nused for flying to any familiar town.") },
            // { PBEMove.20, new PBELocalizedString("ながい　からだや　つるなどを　つかい\n\xFF14ー\xFF15ターンの　あいだ　\nあいてを　しめつけて　こうげきする。", "긴 몸이나 덩굴 등을 써서\n4-5턴 동안\n상대를 조여 공격한다.", "Ligote l'ennemi avec les tentacules\nou le corps pour l'écraser\ndurant 4 à 5 tours.", "Umklammert und quetscht das\nZiel über 2 bis 5 Runden.", "Ata y oprime de cuatro a cinco turnos.", "Il lungo corpo o i tentacoli di chi la usa\nlegano e stritolano il nemico per quattro\no cinque turni.", "Things such as long bodies or tentacles\nare used to bind and squeeze\nthe target for four to five turns.") },
            { PBEMove.Slam, new PBELocalizedString("ながい　しっぽや　つるなどを　つかい\nあいてを　たたきつけて　こうげきする。\n", "긴 꼬리나 덩굴 등을 사용해\n상대를 힘껏 쳐서 공격한다.", "Fouette l'ennemi avec la queue, une\nliane, etc. pour infliger des dégâts.", "Schlag mit einem langen Schweif,\neiner Ranke oder Ähnlichem.", "Golpea con las extremidades.", "Infligge danni al nemico con una coda,\nuna liana o simili.", "The target is slammed with a long tail,\nvines, etc., to inflict damage.") },
            { PBEMove.VineWhip, new PBELocalizedString("ムチのように　しなる　ほそながい　つるで\nあいてを　たたきつけて　こうげきする。\n", "채찍처럼 휘어지는 가늘고 긴 덩굴로\n상대를 힘껏 쳐서 공격한다.", "Fouette l'ennemi avec de fines lianes\npour infliger des dégâts.", "Peitschenähnlicher Schlag mit Ranken.", "Azota al objetivo con ramas finas.", "Infligge danni al nemico con liane sottili\nsimili a fruste.", "The target is struck with slender,\nwhiplike vines to inflict damage.") },
            { PBEMove.Stomp, new PBELocalizedString("おおきな　あしで\nあいてを　ふみつけて　こうげきする。\nあいてを　ひるませる　ことが　ある。", "큰 발로\n상대를 짓밟아서 공격한다.\n상대를 풀죽게 만들 때가 있다.", "Écrase l'ennemi avec un énorme pied.\nPeut aussi l'apeurer.", "Stampfen mit dem Fuß. Das Ziel\nschreckt eventuell zurück.", "Tremendo pisotón que puede hacer\nretroceder al objetivo.", "Colpisce il nemico con un grosso piede\ne può anche farlo tentennare.", "The target is stomped with a big foot.\nIt may also make the target flinch.") },
            // { PBEMove.24, new PBELocalizedString("\xFF12ほんの　あしで　あいてを　けとばして\nこうげきする。\xFF12かい　れんぞくで\nダメージを　あたえる。", "2개의 다리로 상대를 걷어차서\n공격한다. 2회 연속으로\n데미지를 준다.", "Deux coups de pied qui frappent l'ennemi\ndeux fois d'affilée.", "Der Anwender tritt in einer Runde\nzweimal schnell zu.", "Una patada doble.\nGolpea dos veces.", "Colpisce il nemico due volte con un paio di\nrapidi calci inferti con entrambi i piedi.", "The target is quickly kicked twice in\nsuccession using both feet.") },
            { PBEMove.MegaKick, new PBELocalizedString("ものすごい　ちからを　こめた　キックで\nあいてを　けとばして　こうげきする。\n", "굉장한 힘을 담은 킥으로\n상대를 걷어차서 공격한다.", "Un coup de pied superpuissant\net intense qui frappe l'ennemi.", "Das Ziel wird mit einem extrem\nheftigen Tritt angegriffen.", "Patada de extrema fuerza.", "Colpisce il nemico con un calcio sferrato\ncon la forza di muscoli poderosi.", "The target is attacked by a kick launched\nwith muscle-packed power.") },
            // { PBEMove.26, new PBELocalizedString("たかい　ジャンプからの　キックで\nあいてを　こうげきする。\nはずすと　じぶんが　ダメージを　うける。", "높이 점프해서 킥으로\n상대를 공격한다.\n빗나가면 자신이 데미지를 입는다.", "Le lanceur s'envole pour décocher\nun coup de pied sauté. S'il échoue,\nle lanceur se blesse.", "Der Angreifer hüpft hoch und tritt zu.\nBei Misserfolg schadet er sich selbst.", "Da un salto y pega una patada.\nSi falla, se lesiona.", "Permette di saltare in alto per attaccare\ncon un calcio. Se non va a buon fine, chi\nla usa si ferisce.", "The user jumps up high, then strikes\nwith a kick. If the kick misses, the\nuser hurts itself.") },
            // { PBEMove.27, new PBELocalizedString("からだを　すばやく　かいてん　させながら\nあいてを　けとばして　こうげきする。\n", "몸을 재빨리 회전시키며\n상대를 걷어차서 공격한다.", "Le lanceur effectue un coup de pied\ntournoyant et extrêmement rapide.\nPeut apeurer l'ennemi.", "Heftiger Tritt aus einer schnellen\nDrehbewegung. Lässt das Ziel\neventuell zurückschrecken.", "Una patada rápida y circular.\nTambién puede hacer retroceder\nal objetivo.", "Chi la usa infierisce sul nemico con\nun calcio rotante. Può anche farlo\ntentennare.", "The user lashes out with a quick, spinning\nkick. It may also make the target flinch.") },
            { PBEMove.SandAttack, new PBELocalizedString("あいての　かおに　すなを　かけて　\nめいちゅうりつを　さげる。\n", "상대의 얼굴에 모래를 뿌려서\n명중률을 떨어뜨린다.", "Lance du sable au visage de l'ennemi\npour baisser sa Précision.", "Senkt Genauigkeit des Zieles,\nindem ihm Sand ins Gesicht\ngeworfen wird.", "Arroja arena a la cara y baja la Precisión.", "Getta sabbia in faccia al nemico e ne\nriduce la precisione.", "Sand is hurled in the target's face,\nreducing its accuracy.") },
            { PBEMove.Headbutt, new PBELocalizedString("あたまを　つきだして\nまっすぐ　つっこんで　こうげきする。\nあいてを　ひるませる　ことが　ある。", "머리를 내밀어\n곧장 돌진하여 공격한다.\n상대를 풀죽게 만들 때가 있다.", "Le lanceur donne un coup de tête.\nPeut apeurer l'ennemi.\n", "Rammt das Ziel mit einer Kopfnuss.\nZiel schreckt eventuell zurück.", "Lanza un potente cabezazo que puede\nhacer retroceder al objetivo.", "Chi la usa si lancia diritto di testa contro\nil nemico. Può anche farlo tentennare.", "The user sticks out its head and attacks\nby charging straight into the target.\nIt may also make the target flinch.") },
            { PBEMove.HornAttack, new PBELocalizedString("するどく　とがった　つので\nあいてを　こうげきする。\n", "날카롭고 뾰족한 뿔로\n상대를 공격한다.", "Frappe l'ennemi d'un coup de corne\npointue pour infliger des dégâts.", "Spießt das Ziel mit einem spitzen\nHorn auf.", "Ataca al objetivo con una cornada.", "Danneggia il nemico infilzandolo con un\ncorno affilato.", "The target is jabbed with a sharply\npointed horn to inflict damage.") },
            // { PBEMove.31, new PBELocalizedString("つのや　くちばしで\nあいてを　つついて　こうげきする。\n\xFF12ー\xFF15かいの　あいだ　れんぞくで　だす。", "뿔이나 부리로\n상대를 찔러서 공격한다.\n2-5회 동안 연속으로 쓴다.", "Frappe l'ennemi 2 à 5 fois d'affilée\navec un bec ou une corne.", "Spießt das Ziel 2- bis 5-mal mit spitzem\nHorn oder Schnabel auf.", "Cornea al objetivo de dos a cinco veces.", "Infilza il nemico con corna affilate o\nun becco da due a cinque volte di fila.", "The target is jabbed repeatedly with a\nhorn or beak two to five times in a row.") },
            { PBEMove.HornDrill, new PBELocalizedString("かいてんする　つのを\nあいてに　つきさして　こうげきする。\nあたれば　いちげきで　ひんしに　する。", "회전하는 뿔을\n상대에게 꿰찔러서 공격한다.\n맞으면 일격에 기절한다.", "Un coup de corne en vrille qui empale\nl'ennemi, le mettant K.O. sur le coup\ns'il est touché.", "K.O.-Attacke, die ein Horn als\nBohrer einsetzt.", "Ataque con taladro que fulmina\nen un golpe al objetivo si le toca.", "Colpisce il nemico con un corno perforante\ncome un trapano. Se il colpo va a segno,\nil nemico va KO.", "The user stabs the target with a horn\nthat rotates like a drill.\nIf it hits, the target faints instantly.") },
            { PBEMove.Tackle, new PBELocalizedString("あいてに　むかって　からだ　ぜんたいで\nぶつかって　いき　こうげきする。\n", "상대를 향해서 몸 전체를\n부딪쳐가며 공격한다.", "Le lanceur charge l'ennemi et\nle percute de tout son corps.", "Trifft das Ziel mit vollem\nKörpereinsatz.", "Embiste con todo el cuerpo.", "Attacco fisico che colpisce il nemico\ninvestendolo con tutto il corpo.", "A physical attack in which the user\ncharges and slams into the target\nwith its whole body.") },
            { PBEMove.BodySlam, new PBELocalizedString("からだ　ぜんたいで\nあいてに　のしかかり　こうげきする。\nまひ　じょうたいに　することが　ある。", "몸 전체로\n상대를 덮쳐 눌러 공격한다.\n마비 상태로 만들 때가 있다.", "Le lanceur se laisse tomber sur l'ennemi\nde tout son poids. Peut le paralyser.", "Trifft das Ziel mit vollem\nKörpereinsatz. Bewirkt\neventuell Paralyse.", "Salta sobre el objetivo con todo su peso.\nPuede paralizar.", "Chi la usa carica il nemico con tutto\nil corpo. Può causarne anche la paralisi.", "The user drops onto the target\nwith its full body weight. It may also\nleave the target with paralysis.") },
            // { PBEMove.35, new PBELocalizedString("ながい　からだや　つるなどを　つかって\n\xFF14ー\xFF15ターンの　あいだ\nあいてに　まきついて　こうげきする。", "긴 몸이나 덩굴을 사용해\n4-5턴 동안\n상대를 휘감아 공격한다.", "Le lanceur ligote l'ennemi avec des\nlianes ou son corps pour l'écraser\ndurant 4 à 5 tours.", "Umwickelt das Ziel über 4 bis 5 Runden\nmit Ranken oder Ähnlichem und fügt\nihm Schaden zu.", "Oprime al objetivo de cuatro a cinco\nturnos con ramas o con su cuerpo.", "Il lungo corpo o le liane di chi la usa\navvolgono e stritolano il nemico per\nquattro o cinque turni.", "A long body or vines are used to wrap and\nsqueeze the target for four to five turns.") },
            { PBEMove.TakeDown, new PBELocalizedString("すごい　いきおいで\nあいてに　ぶつかって　こうげきする。\nじぶんも　すこし　ダメージを　うける。", "굉장한 기세로\n상대에게 부딪쳐 공격한다.\n자신도 조금 데미지를 입는다.", "Une charge violente qui blesse aussi\nlégèrement le lanceur.", "Rücksichtslose Attacke, bei der sich\nder Angreifer selbst leicht verletzt.", "Carga desmedida que también hiere\nal agresor.", "Carica spericolata con tutto il corpo\ncontro il nemico. Danneggia un po'\nanche chi la usa.", "A reckless, full-body charge attack for\nslamming into the target.\nIt also damages the user a little.") },
            // { PBEMove.37, new PBELocalizedString("\xFF12ー\xFF13ターンの　あいだ\nあばれまくって　あいてを　こうげきする。\nあばれた　あとは　こんらん　する。", "2-3턴 동안\n마구 난동부려서 상대를 공격한다.\n난동부린 뒤에는 혼란에 빠진다.", "Une attaque furieuse qui dure de 2 à 3\ntours. Le lanceur devient confus.", "Attacke über 2 bis 3 Runden,\ndie den Angreifer verwirrt.", "Ataca de dos a tres turnos y acaba\nconfundiendo al agresor.", "Assale e attacca il nemico per due o tre\nturni, ma confonde chi la usa.", "The user rampages and attacks for two\nto three turns. It then becomes\nconfused, however.") },
            { PBEMove.DoubleEdge, new PBELocalizedString("いのちを　かけて\nあいてに　とっしんして　こうげきする。\nじぶんも　かなり　ダメージを　うける。", "목숨을 걸고\n상대에게 돌진하여 공격을 한다.\n자신도 상당한 데미지를 입는다.", "Une dangereuse charge. Inflige aussi des\ndégâts assez importants au lanceur.", "Lebensgefährlicher Angriff, bei dem\nsich der Angreifer selbst verletzt.", "Ataque arriesgado que también hiere\nal agresor.", "Carica spietata e pericolosa che\ndanneggia molto anche chi la usa.", "A reckless, life-risking tackle.\nIt also damages the user by a fairly large\namount, however.") },
            { PBEMove.TailWhip, new PBELocalizedString("しっぽを　さゆうに　かわいく　ふって\nゆだんを　さそう。\nあいての　ぼうぎょを　さげる。", "꼬리를 좌우로 귀엽게 흔들어\n방심을 유도한다.\n상대의 방어를 떨어뜨린다.", "Le lanceur remue son adorable queue\npour tromper la vigilance de l'ennemi\net baisser sa Défense.", "Hieb mit dem Schweif. Senkt die\nVerteidigung des Gegners.", "Agita la cola para bajar la Defensa\ndel contrincante.", "Chi la usa agita la coda per distrarre\ni nemici, riducendone la Difesa.", "The user wags its tail cutely, making\nopposing Pokémon less wary and\nlowering their Defense stat.") },
            { PBEMove.PoisonSting, new PBELocalizedString("どくの　ある　ハリを\nあいてに　つきさして　こうげきする。\nどく　じょうたいに　することが　ある。", "독이 있는 침을\n상대에게 꿰찔러서 공격한다.\n독 상태로 만들 때가 있다.", "Un dard toxique qui transperce l'ennemi.\nPeut aussi l'empoisonner.", "Angriff mit Giftstachel. Das Ziel\nwird eventuell vergiftet.", "Lanza un aguijón tóxico que puede\nenvenenar al objetivo.", "Colpisce il nemico con un aculeo tossico\nche può anche avvelenarlo.", "The user stabs the target\nwith a poisonous stinger.\nThis may also poison the target.") },
            // { PBEMove.41, new PBELocalizedString("\xFF12ほんの　ハリを　あいてに　つきさし\n\xFF12かい　れんぞくで　ダメージ。\nどく　じょうたいに　することが　ある。", "2개의 침을 상대에게 꿰찔러\n2회 연속으로 데미지를 준다.\n독 상태로 만들 때가 있다.", "Un double coup de dard qui\ntransperce l'ennemi 2 fois d'affilée.\nPeut aussi l'empoisonner.", "Stacheln an den Vorderbeinen\ntreffen das Ziel zweimal.\nZiel wird eventuell vergiftet.", "Pincha dos veces con dos espinas.\nPuede envenenar.", "Colpisce il nemico due volte di seguito\ncon un paio di aghi. Può anche avvelenarlo.", "The user damages the target twice in\nsuccession by jabbing it with two spikes.\nIt may also poison the target.") },
            // { PBEMove.42, new PBELocalizedString("するどい　ハリを\nあいてに　はっしゃして　こうげきする。\n\xFF12ー\xFF15かいの　あいだ　れんぞくで　だす。", "날카로운 침을\n상대에게 발사해서 공격한다.\n2-5회 동안 연속으로 쓴다.", "Envoie une rafale de dards.\nPeut toucher de 2 à 5 fois.", "Spitze Nadeln treffen das Ziel\n2- bis 5-mal hintereinander.", "Lanza finas púas que hieren de dos\na cinco veces.", "Il nemico viene colpito da due a cinque\nvolte con spilli appuntiti in rapida\nsuccessione.", "Sharp spikes are shot at the target\nin rapid succession.\nThey hit two to five times in a row.") },
            { PBEMove.Leer, new PBELocalizedString("するどい　めつきで　おびえさせて\nあいての　ぼうぎょを　さげる。\n", "날카로운 눈초리로 겁을 주어\n상대의 방어를 떨어뜨린다.", "Le lanceur fait les gros yeux à l'ennemi\npour l'intimider et baisser sa Défense.", "Gegnerischer Verteidigungs-Wert wird\ndurch angsteinflößenden Blick gesenkt.", "Intimida al objetivo para bajar\nsu Defensa.", "Terrorizza i nemici con uno sguardo\nfulminante e intimidatorio riducendone\nla Difesa.", "The user gains an intimidating leer with\nsharp eyes. The opposing team's\nDefense stats are reduced.") },
            { PBEMove.Bite, new PBELocalizedString("するどく　とがった　はで\nかみついて　こうげきする。\nあいてを　ひるませる　ことが　ある。", "날카롭고 뾰족한 이빨로\n물어서 공격한다.\n상대를 풀죽게 만들 때가 있다.", "L'ennemi est mordu par de tranchantes\ncanines. Peut l'apeurer.", "Beißt zu und lässt das Ziel\neventuell zurückschrecken.", "Un voraz bocado que puede hacer\nretroceder al objetivo.", "Il nemico viene morso da denti affilatissimi\nche possono farlo tentennare.", "The target is bitten\nwith viciously sharp fangs.\nIt may make the target flinch.") },
            { PBEMove.Growl, new PBELocalizedString("かわいい　なきごえを　きかせて\nきを　ひき　ゆだんを　させて\nあいての　こうげきを　さげる。", "귀여운 울음소리를 들려주고\n관심을 끌어 방심한 사이에\n상대의 공격을 떨어뜨린다.", "Le lanceur pousse un cri tout mimi\npour tromper la vigilance de l'ennemi\net baisser son Attaque.", "Der Anwender nimmt den Gegner\nfür sich ein und senkt dessen\nAngriffs-Wert.", "Dulce gruñido que reduce el Ataque\ndel contrincante.", "Distrae i nemici con un ruggito potente e\nne riduce l'Attacco.", "The user growls in an endearing way,\nmaking the opposing team less wary.\nThe foes' Attack stats are lowered.") },
            { PBEMove.Roar, new PBELocalizedString("あいてを　にがして\nひかえの　ポケモンを　ひきずりだす。\nやせいの　ばあいは　せんとうが　おわる。", "상대를 도망가게 해서\n교대할 포켓몬을 끌어낸다.\n야생의 경우에는 배틀이 끝난다.", "Effraie le Pokémon ennemi et\nle remplace par un autre. Dans\nla nature, met fin au combat.", "Verjagt das Ziel und ersetzt es\ndurch ein anderes Pokémon.\nBeendet den Kampf in der Wildnis.", "Se lleva al objetivo, que es cambiado\npor otro Pokémon. Si es un Pokémon\nsalvaje, acaba el combate.", "Il bersaglio lascia il campo e viene\nsostituito. Mette fine alle lotte contro\nsingoli Pokémon selvatici.", "The target is scared off and switched.\nIn the wild, a battle against a single\nPokémon ends.") },
            { PBEMove.Sing, new PBELocalizedString("ここちよい　きれいな\nうたごえを　きかせて\nあいてを　ねむり　じょうたいに　する。", "기분 좋은 예쁜\n노랫소리를 들려주고\n상대를 잠듦 상태로 만든다.", "Une berceuse plonge l'ennemi\ndans un profond sommeil.", "Ein Lied, das das Ziel in tiefen\nSchlaf versetzt.", "Cancioncilla que hace dormir\nprofundamente al objetivo.", "Dolce ninnananna, cantata da una voce\nsuadente, che fa addormentare il nemico.", "A soothing lullaby is sung in a calming\nvoice that puts the target into a deep\nslumber.") },
            { PBEMove.Supersonic, new PBELocalizedString("とくしゅな　おんぱを\nからだから　はっして　\nあいてを　こんらん　させる。", "특수한 음파를\n몸에서 발산하여\n상대를 혼란시킨다.", "Le lanceur produit d'étranges ondes\nsonores qui rendent confus.", "Ausstoß bizarrer Schallwellen.\nDas Ziel wird verwirrt.", "Raras ondas sónicas que confunden\nal objetivo.", "Chi la usa genera dal proprio corpo\nstrane onde acustiche che possono\nconfondere il nemico.", "The user generates odd sound waves from\nits body. It may confuse the target.") },
            { PBEMove.SonicBoom, new PBELocalizedString("しょうげきはを\nあいてに　ぶつけて　こうげきする。\n\xFF12\xFF10の　ダメージを　きまって　あたえる。", "충격파를\n상대에 부딪쳐서 공격한다.\n언제나 20의 데미지를 준다.", "Une onde de choc destructrice qui\ninflige toujours 20 PV de dégâts.", "Das Ziel wird von einer Schockwelle\ngetroffen, die stets 20 KP Schaden\nanrichtet.", "Lanza ondas de choque que restan\n20 PS al objetivo.", "Il nemico viene colpito da onde acustiche\ndevastanti che gli provocano un danno\ncostante pari a 20 PS.", "The target is hit with a destructive shock\nwave that always inflicts 20 HP damage.") },
            // { PBEMove.50, new PBELocalizedString("あいての　うごきを　とめて\nちょくぜんに　だしていた　わざを\n\xFF14ターンの　あいだ　つかえなく　する。", "상대의 움직임을 막아\n바로 전에 쓴 기술을\n4턴 동안 사용할 수 없게 만든다.", "Empêche l'ennemi d'employer à nouveau\nsa dernière attaque. Dure quatre tours.", "Die zuletzt eingesetzte Attacke\ndes Zieles wird für mehrere Runden\nblockiert.", "Desactiva el último movimiento del\nobjetivo durante cuatro turnos.", "Per quattro turni impedisce al bersaglio\ndi riutilizzare l'ultima mossa usata.", "For four turns, this move prevents the\ntarget from using the move it last used.") },
            { PBEMove.Acid, new PBELocalizedString("つよい　さんを　あいてに　かけて\nこうげきする。あいての　とくぼうを\nさげることが　ある。", "강한 산을 상대에게 끼얹어\n공격한다. 상대의 특수방어를\n떨어뜨릴 때가 있다.", "Le lanceur attaque l'ennemi avec un jet\nd'acide corrosif. Peut aussi baisser\nla Défense Spéciale de l'ennemi.", "Versprüht ätzende Flüssigkeit, die\neventuell die Spezial-Verteidigung\ndes Zieles senkt.", "Rocía con un ácido corrosivo.\nPuede bajar la Defensa Especial.", "Colpisce i nemici spruzzando un acido\ncorrosivo. Può anche ridurne la Difesa\nSpeciale.", "The opposing team is attacked with a spray\nof harsh acid. The acid may also lower\nthe targets' Sp. Def stats.") },
            { PBEMove.Ember, new PBELocalizedString("ちいさな　ほのおを\nあいてに　はっしゃして　こうげきする。\nやけど　じょうたいに　することが　ある。", "작은 불꽃을\n상대에게 발사하여 공격한다.\n화상 상태로 만들 때가 있다.", "L'ennemi est attaqué par de faibles\nflammes. Peut aussi le brûler.", "Schwache Feuer-Attacke, durch die das\nZiel eventuell Verbrennungen erleidet.", "Ataca con llamas pequeñas que\npueden causar quemaduras.", "Il nemico viene colpito da fiammelle\nche possono anche scottarlo.", "The target is attacked with small flames.\nIt may also leave the target with a burn.") },
            { PBEMove.Flamethrower, new PBELocalizedString("はげしい　ほのおを\nあいてに　はっしゃして　こうげきする。\nやけど　じょうたいに　することが　ある。", "세찬 불꽃을\n상대에게 발사하여 공격한다.\n화상 상태로 만들 때가 있다.", "L'ennemi reçoit un torrent de flammes.\nPeut aussi le brûler.", "Starke Feuer-Attacke, durch die das\nZiel eventuell Verbrennungen\nerleidet.", "Ataca con una gran ráfaga de fuego que\npuede causar quemaduras.", "Il nemico viene colpito da intense\nfiammate che possono anche scottarlo.", "The target is scorched with an intense\nblast of fire. It may also leave the target\nwith a burn.") },
            // { PBEMove.54, new PBELocalizedString("しろいきりで　からだを　おおう。\n\xFF15ターンの　あいだ　あいてに\nのうりょくを　さげられなく　なる。", "하얀 안개로 몸을 덮는다.\n5턴 동안 상대에 의해\n능력이 떨어지지 않게 된다.", "Une brume blanche enveloppe l'équipe\ndu lanceur et empêche la réduction\ndes stats pour 5 tours.", "Anwender schützt das Team mit einem\nNebel. Verhindert Statussenkungen\nfür fünf Runden.", "Rodea de fina niebla al usuario y\nprotege las características de su\nequipo durante cinco turnos.", "Chi la usa attira una nebbia che blocca\nla riduzione delle statistiche della sua\nsquadra per cinque turni.", "The user cloaks its body with a white mist\nthat prevents any of its stats from being\ncut for five turns.") },
            { PBEMove.WaterGun, new PBELocalizedString("みずを　いきおいよく\nあいてに　はっしゃして　こうげきする。\n", "물을 기세 좋게\n상대에게 발사하여 공격한다.", "De l'eau est projetée sur l'ennemi\nen arc de cercle.", "Das Ziel wird mit Wasser bespritzt.", "Ataca disparando agua con gran potencia.", "Il nemico è colpito da un potente getto\nd'acqua.", "The target is blasted with a\nforceful shot of water.") },
            { PBEMove.HydroPump, new PBELocalizedString("たいりょうの　みずを\nはげしい　いきおいで\nあいてに　はっしゃして　こうげきする。", "대량의 물을\n세찬 기세로\n상대에게 발사하여 공격한다.", "Un puissant jet d'eau est\ndirigé sur l'ennemi.", "Spritzt eine Menge Wasser mit\nHochdruck auf das Ziel.", "Lanza una gran masa de agua a presión\npara atacar.", "Il nemico è travolto da un potente getto\nd'acqua spruzzato ad altissima pressione.", "The target is blasted by a huge volume\nof water launched under great pressure.") },
            { PBEMove.Surf, new PBELocalizedString("おおきな　なみで　じぶんの\nまわりに　いるものを　こうげきする。\nみずの　うえも　およいで　すすめる。", "큰 파도로 자신의\n주위에 있는 포켓몬을 공격한다.\n물 위도 헤엄쳐서 나아간다.", "Une énorme vague s'abat sur le\nchamp de bataille. Permet aussi\nde voyager sur l'eau.", "Eine Welle bricht über alle Pokémon in der\nNähe des Anwenders herein. Macht Surfen\nmöglich.", "Inunda el campo de batalla con una ola\ngigante. Fuera de batalla sirve para\nmoverse sobre el agua.", "Un'onda enorme sommerge il campo\ndi lotta. Fuori dalla lotta si usa\nper spostarsi sull'acqua.", "It swamps the area around the user\nwith a giant wave.\nIt can also be used for crossing water.") },
            { PBEMove.IceBeam, new PBELocalizedString("こごえる　ビームを\nあいてに　はっしゃして　こうげきする。\nこおり　じょうたいに　することが　ある。", "냉동빔을\n상대에게 발사하여 공격한다.\n얼음 상태로 만들 때가 있다.", "Un rayon de glace frappe l'ennemi.\nPeut aussi le geler.", "Das Ziel wird von einem Eisstrahl\ngetroffen und friert eventuell ein.", "Rayo de hielo que puede llegar a congelar.", "Il nemico è colpito da un raggio di energia\ngelida che può anche congelarlo.", "The target is struck with an icy-cold\nbeam of energy.\nIt may also freeze the target solid.") },
            { PBEMove.Blizzard, new PBELocalizedString("はげしい　ふぶきを\nあいてに　ふきつけて　こうげきする。\nこおり　じょうたいに　することが　ある。", "세찬 눈보라를\n상대에게 내뿜어 공격한다.\n얼음 상태로 만들 때가 있다.", "Une violente tempête de neige\nest déclenchée sur l'ennemi.\nPeut aussi le geler.", "Ein Schneesturm wütet, der das\nZiel einfrieren kann.", "Tormenta de hielo que puede llegar\na congelar.", "Colpisce i bersagli con una tremenda\ntempesta di ghiaccio che può anche\ncongelarli.", "A howling blizzard is summoned to strike\nthe opposing team. It may also freeze\nthem solid.") },
            { PBEMove.Psybeam, new PBELocalizedString("ふしぎな　こうせんを\nあいてに　はっしゃして　こうげきする。\nこんらん　させることが　ある。", "이상한 광선을\n상대에게 발사하여 공격한다.\n혼란시킬 때가 있다.", "Un étrange rayon frappe l'ennemi.\nPeut aussi le rendre confus.", "Feuert einen Strahl ab, der das\nZiel verwirren kann.", "Extraño rayo que puede causar confusión.", "Colpisce il nemico con un raggio speciale.\nPuò anche confonderlo.", "The target is attacked with a peculiar ray.\nIt may also cause confusion.") },
            { PBEMove.BubbleBeam, new PBELocalizedString("あわを　いきおいよく\nあいてに　はっしゃして　こうげきする。\nすばやさを　さげる　ことが　ある。", "거품을 기세 좋게\n상대에게 발사하여 공격한다.\n스피드를 떨어뜨릴 때가 있다.", "Des bulles sont envoyées avec\npuissance sur l'ennemi. Peut\naussi baisser sa Vitesse.", "Versprüht Blasen, die eventuell den\nInitiative-Wert des Zieles senken.", "Diluvio de burbujas que puede bajar\nla Velocidad.", "Colpisce il nemico con una forte scarica\ndi bolle. Può anche ridurne la Velocità.", "A spray of bubbles is forcefully ejected\nat the opposing team. It may also lower\ntheir Speed stats.") },
            { PBEMove.AuroraBeam, new PBELocalizedString("にじいろの　ビームを\nあいてに　はっしゃして　こうげきする。\nこうげきを　さげる　ことが　ある。", "무지개색의 빔을\n상대에게 발사하여 공격한다.\n공격을 떨어뜨릴 때가 있다.", "Envoie un rayon arc-en-ciel sur l'ennemi.\nPeut aussi baisser son Attaque.", "Regenbogenfarbener Strahl,\nder eventuell den Angriffs-Wert\ndes Zieles senkt.", "Rayo multicolor que puede reducir\nel Ataque.", "Colpisce il nemico con un raggio dai\ncolori dell'iride. Può anche ridurne\nl'Attacco.", "The target is hit with a rainbow-colored\nbeam. This may also lower the target's\nAttack stat.") },
            // { PBEMove.63, new PBELocalizedString("つよい　こうせんを\nあいてに　はっしゃして　こうげきする。\nつぎの　ターンは　うごけなく　なる。", "강한 광선을\n상대에게 발사하여 공격한다.\n다음 턴은 움직일 수 없다.", "Projette un puissant rayon sur l'ennemi.\nLe lanceur doit se reposer\nau tour suivant.", "Starke Attacke, die den Angreifer\nzwingt, eine Runde auszusetzen.", "Es eficaz, pero el atacante deberá\ndescansar en el siguiente turno.", "Colpisce il nemico con un potente raggio.\nChi la usa salta il turno successivo per\nrecuperare energia.", "The target is attacked with a powerful\nbeam. The user must rest on the next\nturn to regain its energy.") },
            { PBEMove.Peck, new PBELocalizedString("するどく　とがった　くちばしや　つので　\nあいてを　つついて　こうげきする。\n", "날카롭고 뾰족한 부리나 뿔로\n상대를 쪼아서 공격한다.", "Frappe l'ennemi d'un bec pointu ou\nd'une corne pour infliger des dégâts.", "Greift das Ziel mit dem Schnabel\noder Horn an.", "Ensarta al objetivo con un cuerno o pico\npunzante.", "Colpisce il nemico con un becco appuntito\no un corno.", "The target is jabbed with a sharply\npointed beak or horn.") },
            { PBEMove.DrillPeck, new PBELocalizedString("かいてん　しながら　とがった　くちばしを\nあいてに　つきさして　こうげきする。\n", "회전하면서 뾰족한 부리를\n상대에게 꿰찔러 공격한다.", "Une attaque utilisant le bec\ncomme une perceuse.", "Korkenzieherangriff, bei dem der\nSchnabel als Bohrer dient.", "Picotazo giratorio y perforador\nmuy potente.", "Attacco a spirale con un becco aguzzo\nche fa da trapano.", "A corkscrewing attack with the\nsharp beak acting as a drill.") },
            { PBEMove.Submission, new PBELocalizedString("じめんに　じぶんごと\nあいてを　なげつけて　こうげきする。\nじぶんも　すこし　ダメージを　うける。", "땅에 자신과 함께\n상대를 내던져 공격한다.\n자신도 조금 데미지를 입는다.", "Le lanceur agrippe l'ennemi et\nl'écrase au sol. Blesse aussi\nlégèrement le lanceur.", "Harte Körperattacke, bei der sich\nder Angreifer selbst leicht verletzt.", "Tira al objetivo al suelo.\nTambién hiere al agresor.", "Chi la usa carica il nemico in modo\nspericolato, ma danneggia anche\nse stesso.", "The user grabs the target and recklessly\ndives for the ground. It also hurts the\nuser slightly.") },
            { PBEMove.LowKick, new PBELocalizedString("あしを　つよく　けり　あいてを\nころばせて　こうげきする。あいてが\nおもいほど　いりょくが　あがる。", "발을 강하게 걸고\n상대를 넘어뜨려 공격한다.\n상대가 무거울수록 위력이 올라간다.", "Un puissant coup de pied bas qui fauche\nl'ennemi. Il est plus efficace contre\nles ennemis lourds.", "Tritt, der das Ziel umwirft. Je schwerer\ndas Ziel ist, desto mehr Schaden fügt\nihm die Attacke zu.", "Patada baja. Cuanto más pesa\nel objetivo, más daño causa.", "Un calcio basso e potente che fa cadere\nil nemico. Danneggia maggiormente i nemici\npiù pesanti.", "A powerful low kick that makes the target\nfall over. It inflicts greater damage on\nheavier targets.") },
            // { PBEMove.68, new PBELocalizedString("あいてから　うけた　ぶつり　こうげきの\nダメージを　\xFF12ばいに　して\nおなじ　あいてに　かえす。", "상대로부터 받은 물리공격의\n데미지를 2배로 만들어\n같은 상대에게 돌려준다.", "Une riposte qui répond à toute\nattaque physique en infligeant\nle double de dégâts.", "Kontert physischen Treffer und fügt dem\nGegner das Doppelte des Schadens zu,\nden der Anwender erlitten hat.", "Devuelve un golpe físico por duplicado.", "Mossa che contrasta ogni attacco fisico,\narrecando il doppio del danno ricevuto.", "A retaliation move that counters any\nphysical attack, inflicting double the\ndamage taken.") },
            { PBEMove.SeismicToss, new PBELocalizedString("いんりょくを　つかい　なげとばす。\nじぶんの　レベルと　おなじ　ダメージを\nあいてに　あたえる。", "인력을 사용해 내던진다.\n자신의 레벨과 똑같은 데미지를\n상대에게 준다.", "L'ennemi est projeté grâce au pouvoir de\nla gravité. Inflige des dégâts équivalents\nau niveau du lanceur.", "Ziel wird mit der Kraft der Gravitation\numgeworfen. Richtet Schaden gemäß Level\ndes Angreifers an.", "La gravedad derriba al objetivo.\nSe restarán tantos PS como nivel\ntenga el agresor.", "Colpisce il bersaglio con la forza di\ngravità. Infligge un danno pari al livello\ndi chi la usa.", "The target is thrown using the power of\ngravity. It inflicts damage equal to\nthe user's level.") },
            { PBEMove.Strength, new PBELocalizedString("こんしんの　ちからで\nあいてを　なぐりつけて　こうげきする。\nおもたい　いわを　おすことも　できる。", "혼신의 힘으로\n상대를 세게 때려서 공격한다.\n무거운 돌을 밀 수도 있다.", "Le lanceur cogne l'ennemi de toutes\nses forces. Permet aussi de déplacer\ndes rochers.", "Das Ziel wird extrem stark getroffen.\nMacht Verschieben von Felsen möglich.", "Potente puñetazo.\nFuera de combate sirve\npara mover piedras.", "Colpisce il nemico con un'enorme energia.\nFuori dalla lotta si usa per spostare i\nmassi.", "The target is slugged with a punch thrown\nat maximum power. It can also be used\nto move heavy boulders.") },
            { PBEMove.Absorb, new PBELocalizedString("ようぶんを　すいとり　こうげきする。\nあいてに　あたえた　ダメージの\nはんぶんの　\xFF28\xFF30を　かいふくできる。", "양분을 흡수하여 공격한다.\n상대에게 입힌 데미지의\n절반에 해당하는 HP를 회복할 수 있다.", "Une attaque qui convertit la moitié\ndes dégâts infligés en PV.", "Attacke, die die Hälfte des\nSchadens absorbiert.", "Absorbe la mitad del daño producido\nen el objetivo para restaurar los PS\ndel usuario.", "Mossa che assorbe PS. Chi la usa recupera\nuna quantità di PS pari alla metà del danno\ninferto.", "A nutrient-draining attack. The user's\nHP is restored by half the damage taken\nby the target.") },
            { PBEMove.MegaDrain, new PBELocalizedString("ようぶんを　すいとり　こうげきする。\nあいてに　あたえた　ダメージの\nはんぶんの　\xFF28\xFF30を　かいふくできる。", "양분을 흡수하여 공격한다.\n상대에게 입힌 데미지의\n절반에 해당하는 HP를 회복할 수 있다.", "Une attaque qui convertit la moitié\ndes dégâts infligés en PV.", "Attacke, die die Hälfte des\nSchadens absorbiert.", "Absorbe la mitad del daño producido\nen el objetivo para restaurar los PS\ndel usuario.", "Mossa che assorbe PS. Chi la usa recupera\nuna quantità di PS pari alla metà del danno\ninferto.", "A nutrient-draining attack. The user's\nHP is restored by half the damage taken\nby the target.") },
            { PBEMove.LeechSeed, new PBELocalizedString("うえつけた　あいての　\xFF28\xFF30を\nまいターン　すこしだけ　すいとり\nじぶんの　\xFF28\xFF30を　かいふく　する。", "씨가 뿌려진 상대의 HP를\n매 턴 조금씩 흡수하여\n자신의 HP를 회복한다.", "Une graine est semée sur l'ennemi.\nÀ chaque tour, elle lui dérobe des PV\nque le lanceur récupère.", "Ziel wird bepflanzt und verliert jede\nRunde KP, die ein Pokémon aus dem\nTeam des Anwenders heilen.", "Planta semillas que absorben PS\npara recuperar la salud del usuario\nen cada turno.", "Vengono piantati semi sul bersaglio. Questi\nsottraggono PS a ogni turno permettendo\na chi la usa di curarsi.", "A seed is planted on the target. It steals\nsome HP from the target every turn.") },
            { PBEMove.Growth, new PBELocalizedString("からだを　いっきに\nおおきく　せいちょう　させて\nこうげきと　とくこうを　あげる。", "몸을 일시에\n크게 성장시켜\n공격과 특수공격을 올린다.", "Le corps du lanceur se développe.\nAugmente l'Attaque et l'Attaque Spéciale.", "Der Körper wächst. Dadurch steigen\nAngriff und Spezial-Angriff.", "El cuerpo del usuario crece a\nmarchas forzadas y aumenta\nel Ataque y el Ataque Especial.", "Provoca la crescita immediata del corpo\ne l'aumento dell'Attacco e dell'Attacco\nSpeciale di chi la usa.", "The user's body grows all at once,\nraising the Attack and Sp. Atk stats.") },
            { PBEMove.RazorLeaf, new PBELocalizedString("はっぱを　とばして　\nあいてを　きりつけて　こうげきする。\nきゅうしょに　あたりやすい。", "잎사귀를 날려\n상대를 베어 공격한다.\n급소에 맞기 쉽다.", "Des feuilles aiguisées comme des\nrasoirs entaillent l'ennemi.\nTaux de critiques élevé.", "Trifft das Ziel mit Blättern.\nHohe Volltrefferquote.", "Corta con hojas afiladas.\nSuele ser crítico.", "Foglie taglienti sferzano i nemici.\nProbabile brutto colpo.", "Sharp-edged leaves are launched\nto slash at the opposing team.\nCritical hits land more easily.") },
            // { PBEMove.76, new PBELocalizedString("\xFF11ターンめに　ひかりを　いっぱいに\nあつめ　\xFF12ターンめに　ひかりの　たばを\nはっしゃして　こうげきする。", "1턴째에 빛을 가득 모아\n2턴째에 빛의 다발을\n발사하여 공격한다.", "Absorbe la lumière au premier tour\net envoie un rayon puissant au\ntour suivant.", "Absorbiert Licht in Runde 1.\nIn Runde 2 erfolgt der Angriff.", "Primer turno: absorbe luz.\nSegundo turno: ataca.", "Chi la usa assorbe luce al primo turno per\nproiettare un raggio intenso al turno\nsuccessivo.", "A two-turn attack. The user gathers\nlight, then blasts a bundled beam on the\nsecond turn.") },
            { PBEMove.PoisonPowder, new PBELocalizedString("どくの　ある　こなを\nたくさん　ふりまいて\nあいてを　どく　じょうたいに　する。", "독이 있는 가루를\n많이 흩뿌려서\n상대를 독 상태로 만든다.", "Une poudre toxique empoisonne l'ennemi.", "Verstreut giftigen Puder auf das Ziel.", "Polvo tóxico que envenena al objetivo.", "Investe il bersaglio con una nuvola di\npolvere tossica che avvelena.", "The user scatters a cloud of poisonous\ndust on the target. It may poison\nthe target.") },
            { PBEMove.StunSpore, new PBELocalizedString("しびれる　こなを\nたくさん　ふりまいて\nあいてを　まひ　じょうたいに　する。", "저리 가루를\n많이 흩뿌려서\n상대를 마비 상태로 만든다.", "Le lanceur répand sur l'ennemi une\npoudre qui le paralyse.", "Verstreut lähmenden Puder.", "Esparce polvo que paraliza al objetivo.", "Investe il bersaglio con una nuvola di\npolvere che paralizza.", "The user scatters a cloud of paralyzing\npowder. It may leave the target\nwith paralysis.") },
            { PBEMove.SleepPowder, new PBELocalizedString("ねむくなる　こなを\nたくさん　ふりまいて\nあいてを　ねむり　じょうたいに　する。", "잠이 오는 가루를\n많이 흩뿌려서\n상대를 잠듦 상태로 만든다.", "Le lanceur répand une poudre\nsoporifique qui endort la cible.", "Verstreut Schlafpuder, der das\nZiel eventuell in Schlaf versetzt.", "Esparce polvo que duerme al objetivo.", "Investe il bersaglio con una grande nuvola\ndi polvere soporifera che lo fa\naddormentare.", "The user scatters a big cloud\nof sleep-inducing dust\naround the target.") },
            // { PBEMove.80, new PBELocalizedString("\xFF12ー\xFF13ターンの　あいだ　はなを\nまきちらして　あいてを　こうげきする。\nまきちらした　あとは　こんらん　する。", "2-3턴 동안 꽃을\n흩뿌려서 상대를 공격한다.\n흩뿌린 뒤에는 혼란에 빠진다.", "Le lanceur attaque en projetant\ndes pétales pendant 2 à 3 tours\navant de céder à la confusion.", "Angriff mit Blütenblättern für 2 bis 3\nRunden. Angreifer wird verwirrt.", "Lanza pétalos de dos a tres turnos\ny acaba confundiendo al atacante.", "Attacca il nemico cospargendolo di petali\nper due o tre turni, ma chi la usa rimane\nconfuso.", "The user attacks the target by scattering\npetals for two to three turns.\nThe user then becomes confused.") },
            { PBEMove.StringShot, new PBELocalizedString("くちから　ふきだした　いとを　まきつけて\nあいての　すばやさを　さげる。\n", "입에서 뿜어낸 실을 휘감아서\n상대의 스피드를 떨어뜨린다.", "Le lanceur crache de la\nsoie pour ligoter l'ennemi\net baisser sa Vitesse.", "Umwickelt Gegner in der Nähe mit\nFäden aus dem Mund und senkt\nden Initiative-Wert.", "Lanza seda al objetivo y reduce\nsu Velocidad.", "Chi la usa produce della seta che avvolge\ni nemici e ne riduce la Velocità.", "The targets are bound with silk blown\nfrom the user's mouth. This silk reduces\nthe targets' Speed stat.") },
            { PBEMove.DragonRage, new PBELocalizedString("いかりの　しょうげきはを\nあいてに　ぶつけて　こうげきする。\n\xFF14\xFF10の　ダメージを　きまって　あたえる。", "분노의 충격파를\n상대에게 부딪쳐서 공격한다.\n언제나 40의 데미지를 준다.", "La colère du lanceur déclenche une onde\nde choc destructrice qui inflige\ntoujours 40 PV de dégâts.", "Stößt eine wutgeladene Schockwelle aus,\ndie stets 40 KP Schaden anrichtet.", "Ráfaga de furiosas ondas de choque\nque quitan 40 PS.", "Colpisce il nemico con un'onda d'urto\ngenerata dall'ira. Questo attacco\nprovoca sempre un danno di 40 PS.", "This attack hits the target with a shock\nwave of pure rage. This attack always\ninflicts 40 HP damage.") },
            // { PBEMove.83, new PBELocalizedString("はげしく　うずをまく　ほのおの　なかに\n\xFF14ー\xFF15ターンの　あいだ\nあいてを　とじこめて　こうげきする。", "세차게 소용돌이치는 불꽃 속에\n4-5턴 동안\n상대를 가두어 공격한다.", "Un tourbillon de flammes emprisonne\nl'ennemi pendant 4 à 5 tours.", "Das Ziel wird für 4 bis 5 Runden in\neinem Feuerkreis gefangen.", "Un aro de fuego que atrapa al objetivo\nde cuatro a cinco turnos.", "Intrappola il bersaglio in un turbine di\nfuoco che dura per quattro o cinque turni.", "The target becomes trapped within a\nfierce vortex of fire that rages for four\nto five turns.") },
            { PBEMove.ThunderShock, new PBELocalizedString("でんきの　しげきを\nあいてに　あびせて　こうげきする。\nまひ　じょうたいに　することが　ある。", "전기 자극을\n상대에게 날려서 공격한다.\n마비 상태로 만들 때가 있다.", "Une décharge électrique tombe sur\nl'ennemi. Peut aussi le paralyser.", "Eine Elektro-Attacke, die das\nZiel eventuell paralysiert.", "Ataque eléctrico que puede paralizar\nal objetivo.", "Danneggia il bersaglio con una scarica\nelettrica che può anche paralizzarlo.", "A jolt of electricity is hurled\nat the target to inflict damage. It may\nalso leave the target with paralysis.") },
            { PBEMove.Thunderbolt, new PBELocalizedString("つよい　でんげきを\nあいてに　あびせて　こうげきする。\nまひ　じょうたいに　することが　ある。", "강한 전격을\n상대에게 날려서 공격한다.\n마비 상태로 만들 때가 있다.", "Une grosse décharge électrique tombe\nsur l'ennemi. Peut aussi le paralyser.", "Eine starke Elektro-Attacke, die das\nZiel eventuell paralysiert.", "Potente ataque eléctrico que puede\nparalizar al objetivo.", "Il bersaglio viene colpito da una potente\nscarica elettrica che può anche\nparalizzarlo.", "A strong electric blast is loosed at the\ntarget. It may also leave the target\nwith paralysis.") },
            { PBEMove.ThunderWave, new PBELocalizedString("よわい　でんげきを　あびせる　ことで\nあいてを　まひ　じょうたいに　する。\n", "약한 전격을 날려서\n상대를 마비 상태로 만든다.", "Un faible choc électrique frappe\nl'ennemi. Si l'attaque touche,\ncelui-ci est paralysé.", "Ein schwacher Stromstoß, der\ndas Ziel paralysiert.", "Una ligera descarga que paraliza\nal objetivo si lo alcanza.", "Il nemico viene colpito da una debole\nscarica elettrica che, se va a segno,\nne causa la paralisi.", "A weak electric charge is launched at\nthe target. It causes paralysis if it hits.") },
            { PBEMove.Thunder, new PBELocalizedString("はげしい　かみなりを\nあいてに　おとして　こうげきする。\nまひ　じょうたいに　することが　ある。", "강한 번개를\n상대에게 떨어뜨려 공격한다.\n마비 상태로 만들 때가 있다.", "La foudre tombe sur l'ennemi\npour lui infliger des dégâts.\nPeut aussi le paralyser.", "Eine verheerende Elektro-Attacke,\ndie das Ziel eventuell paralysiert.", "Un poderoso rayo que daña al objetivo\ny puede paralizarlo.", "Il nemico è colpito da un lampo molto\nviolento che può anche paralizzarlo.", "A wicked thunderbolt is dropped\non the target to inflict damage. It may\nalso leave the target with paralysis.") },
            { PBEMove.RockThrow, new PBELocalizedString("ちいさな　いわを　もちあげて\nあいてに　なげつけて　こうげきする。\n", "작은 바위를 들어올려\n상대에게 내던져서 공격한다.", "Le lanceur lâche une\npierre sur l'ennemi.", "Das Ziel wird mit einem kleinen\nStein beworfen.", "Tira una pequeña roca al objetivo.", "Chi la usa solleva una roccia e la\nlancia contro il nemico.", "The user picks up and throws a small\nrock at the target to attack.") },
            { PBEMove.Earthquake, new PBELocalizedString("じしんの　しょうげきで　じぶんの\nまわりに　いるものを　こうげきする。\n", "지진의 충격으로 자신의\n주위에 있는 포켓몬을 공격한다.", "Le lanceur provoque un tremblement\nde terre touchant tous les Pokémon\nautour de lui.", "Ein mächtiges Beben, das die anderen\nPokémon in der Nähe des Anwenders\ntrifft.", "Un terremoto que afecta a los Pokémon\nde alrededor en combate.", "Chi la usa provoca un potente sisma\nche colpisce gli altri Pokémon in campo.", "The user sets off an earthquake that\nstrikes those around it.") },
            { PBEMove.Fissure, new PBELocalizedString("じわれの　さけめに\nあいてを　おとして　こうげきする。\nあたれば　いちげきで　ひんしに　する。", "땅이 갈라진 곳에\n상대를 떨어뜨려 공격한다.\n맞으면 일격에 기절한다.", "Le lanceur fait tomber l'ennemi dans une\ncrevasse. Si cette attaque réussit,\nelle met K.O. sur le coup.", "Das Ziel wird in eine Erdspalte\ngeworfen. Ist die Attacke erfolgreich,\nführt sie zu einem K.O.", "Abre una grieta en el suelo y mete al\nobjetivo en ella. Fulmina en un golpe.", "Chi la usa crea una spaccatura nel terreno\ne cerca di gettarvici dentro il nemico. Se\nva a segno, il nemico va KO.", "The user opens up a fissure in the ground\nand drops the target in.\nThe target instantly faints if it hits.") },
            { PBEMove.Dig, new PBELocalizedString("\xFF11ターンめに　もぐり　\xFF12ターンめで\nあいてを　こうげきする。どうくつ\nからの　だっしゅつも　できる。", "1턴째에 파고들어 2턴째에\n상대를 공격한다.\n동굴에서 탈출할 수도 있다.", "Le lanceur creuse au 1⑩ tour et\nfrappe au 2⒅. Permet aussi de\ns'échapper d'un donjon.", "In Runde 1 eingraben und in Runde 2 an-\ngreifen. Macht Flucht aus Höhlen möglich.", "Primer turno: cava.\nSegundo turno: ataca.\nTambién sirve para salir de ciertas zonas.", "Chi la usa scava al primo turno e attacca\nal successivo. Fuori dalla lotta fa uscire\nda alcuni luoghi.", "The user burrows, then attacks\non the second turn.\nIt can also be used to exit dungeons.") },
            { PBEMove.Toxic, new PBELocalizedString("あいてを　もうどくの\nじょうたいに　する。ターンが　すすむほど\nどくの　ダメージが　ふえていく。", "상대를 맹독의 상태로 만든다.\n턴이 진행될수록\n독의 데미지가 증가한다.", "Empoisonne gravement l'ennemi. Les dégâts\ndus au poison augmentent à chaque tour.", "Vergiftet das Ziel mit einem potenten\nToxin schwer. Vergiftung wird von Runde\nzu Runde stärker.", "Envenena gravemente al objetivo y causa\nun daño mayor en cada turno.", "Iperavvelena il nemico con una potente\ntossina. Il danno peggiora ad ogni turno.", "A move that leaves the target\nbadly poisoned.\nIts poison damage worsens every turn.") },
            { PBEMove.Confusion, new PBELocalizedString("よわい　ねんりきを\nあいてに　おくって　こうげきする。\nあいてを　こんらん　させることが　ある。", "약한 염동력을\n상대에게 보내어 공격한다.\n상대를 혼란시킬 때가 있다.", "Une faible vague télékinésique\nfrappe l'ennemi. Peut aussi le\nplonger dans la confusion.", "Das Ziel wird von schwacher\ntelekinetischer Energie getroffen\nund eventuell verwirrt.", "Débil ataque telequinético que puede\ncausar confusión.", "Colpisce il nemico con una leggera forza\ntelecinetica e può anche confonderlo.", "The target is hit by a weak telekinetic\nforce. It may also leave the\ntarget confused.") },
            { PBEMove.Psychic, new PBELocalizedString("つよい　ねんりきを　あいてに　おくって\nこうげきする。あいての　とくぼうを\nさげることが　ある。", "강한 염동력을 상대에게 보내어\n공격한다. 상대의 특수방어를\n떨어뜨릴 때가 있다.", "Une puissante force télékinésique\nfrappe l'ennemi. Peut aussi faire\nbaisser sa Défense Spéciale.", "Starke Psycho-Attacke, die eventuell die\nSpezial-Verteidigung des Zieles senkt.", "Fuerte ataque telequinético que puede\nbajar la Defensa Especial del objetivo.", "Il nemico viene colpito da una potente\nforza telecinetica che può anche ridurne\nla Difesa Speciale.", "The target is hit by a strong telekinetic\nforce. It may also reduce the target's\nSp. Def stat.") },
            { PBEMove.Hypnosis, new PBELocalizedString("ねむけを　さそう　あんじを　かけて\nあいてを　ねむり　じょうたいに　する。\n", "졸음을 유도하는 암시를 걸어서\n상대를 잠듦 상태로 만든다.", "Le lanceur hypnotise l'ennemi pour le\nplonger dans un profond sommeil.", "Hypno-Attacke, die das Ziel\nin Schlaf versetzt.", "Ataque hipnótico que hace dormir\nprofundamente al objetivo.", "Chi la usa si avvale della suggestione\nipnotica per far addormentare il nemico.", "The user employs hypnotic suggestion\nto make the target fall into a deep sleep.") },
            { PBEMove.Meditate, new PBELocalizedString("ねむっている　ちからを\nからだの　おくから　ひきだして\nじぶんの　こうげきを　あげる。", "잠들어 있는 힘을\n몸속에서 끌어내어\n자신의 공격을 올린다.", "Le lanceur médite pour éveiller son\npouvoir latent et augmenter son Attaque.", "Anwender aktiviert Kräfte, die tief in\nseinem Inneren schlummern, und\nsteigert so seinen Angriffs-Wert.", "El usuario reposa y medita para potenciar\nel Ataque.", "Chi la usa medita per risvegliare la propria\nforza interiore e migliorare l'Attacco.", "The user meditates to awaken the power\ndeep within its body and raise its\nAttack stat.") },
            { PBEMove.Agility, new PBELocalizedString("ちからを　ぬいて　からだを　かるくして\nこうそくで　うごく。\nじぶんの　すばやさを　ぐーんと　あげる。", "힘을 빼고 몸을 가볍게 해서\n고속으로 움직인다.\n자신의 스피드를 크게 올린다.", "Le lanceur se relaxe et allège son corps\npour augmenter considérablement\nsa Vitesse.", "Entspannt den Körper, um den\nInitiative-Wert stark zu steigern.", "Relaja el cuerpo para ganar\nmucha Velocidad.", "Chi la usa rilassa e alleggerisce il proprio\ncorpo per far salire di molto la Velocità.", "The user relaxes and lightens its body to\nmove faster. It sharply boosts\nthe Speed stat.") },
            { PBEMove.QuickAttack, new PBELocalizedString("めにも　とまらぬ　ものすごい　はやさで\nあいてに　つっこむ。\nかならず　せんせい　こうげき　できる。", "눈에 보이지 않는 굉장한 속도로\n상대에게 돌진한다.\n반드시 선제공격할 수 있다.", "Le lanceur fonce sur l'ennemi si rapidement\nqu'on parvient à peine à le discerner.\nFrappe en premier.", "Sehr schneller Angriff mit\nErstschlaggarantie.", "Ataque rápido que permite golpear\nen primer lugar.", "Chi la usa colpisce sempre per primo e\nad una tale velocità da rendersi quasi\ninvisibile.", "The user lunges at the target at a speed\nthat makes it almost invisible. It is sure\nto strike first.") },
            // { PBEMove.99, new PBELocalizedString("わざを　だしたときに　こうげきを\nうけると　いかりの　ちからで\nこうげきが　あがる。", "기술을 썼을 때 공격을\n받으면 분노의 힘으로\n공격이 올라간다.", "Une fois activée, cette capacité augmente\nl'Attaque du lanceur à mesure que celui-ci\nsubit des attaques.", "Erhöht Angriff des Anwenders, wenn\ndieser getroffen wird, solange die\nAttacke aktiviert ist.", "Al usarse, aumenta el Ataque del\nusuario cada vez que es golpeado.", "Questa mossa ha il potere di aumentare\nla statistica Attacco ogni volta che chi\nla usa viene colpito durante una lotta.", "As long as this move is in use, the power\nof rage raises the Attack stat each\ntime the user is hit in battle.") },
            { PBEMove.Teleport, new PBELocalizedString("やせい　ポケモンとの　せんとうを\nやめる。さいごに　はいった\nポケセンの　ある　まちにも　いける。", "야생 포켓몬과 배틀을 그만둔다.\n마지막에 들어갔던\n포켓몬센터가 있는 도시에도 갈 수 있다.", "Permet de fuir un Pokémon sauvage.\nPermet aussi de revenir au dernier\nCentre Pokémon visité.", "Flieht sofort vor wilden Pokémon.\nWarp zum letzten Pokémon-Center.", "Permite huir al instante de combates\ncontra Pokémon salvajes o viajar\nal último Centro Pokémon visitado.", "Fa fuggire dai Pokémon selvatici.\nFuori dalla lotta porta all'ultimo\nCentro Pokémon visitato.", "Use it to flee from any wild Pokémon.\nIt can also warp to the last Pokémon\nCenter visited.") },
            { PBEMove.NightShade, new PBELocalizedString("おそろしい　まぼろしを　みせて\nじぶんの　レベルと　おなじ　だけの\nダメージを　あいてに　あたえる。", "무시무시한 환상을 보게 해서\n자신의 레벨과 똑같은 만큼의\n데미지를 상대에게 준다.", "Le lanceur invoque un mirage. Inflige des\ndégâts équivalents au niveau du lanceur.", "Das Ziel sieht eine Illusion. Richtet\nSchaden gemäß dem Level des\nAnwenders an.", "Produce un espejismo ante el\nobjetivo, que pierde tantos PS\ncomo nivel tenga el agresor.", "Fa apparire un orribile miraggio al nemico\ne infligge un danno pari al livello di chi\nla usa.", "The user makes the target see a\nfrightening mirage. It inflicts damage\nmatching the user's level.") },
            // { PBEMove.102, new PBELocalizedString("あいてが　さいごに　つかった　わざを\nせんとうの　あいだ\nじぶんの　わざに　することが　できる。", "상대가 마지막에 사용한 기술을\n배틀을 하는 동안\n자신의 기술로 만들 수 있다.", "Le lanceur copie la dernière capacité\nutilisée par la cible et la conserve\ntant qu'il reste au combat.", "Kopiert die zuvor ausgeführte Attacke\ndes Zieles. Kann im Kampf bis zur\nAuswechslung verwendet werden.", "Copia el último movimiento usado por\nel objetivo. Dicho movimiento se podrá usar\nmientras el Pokémon no sea cambiado.", "Copia l'ultima mossa usata dal bersaglio.\nLa mossa copiata si può utilizzare fino\nalla sostituzione del Pokémon.", "The user copies the target's last move.\nThe move can be used during battle\nuntil the Pokémon is switched out.") },
            { PBEMove.Screech, new PBELocalizedString("おもわず　みみを　ふさぎたくなる\nいやなおとを　だして\nあいての　ぼうぎょを　がくっと　さげる。", "그만 귀를 막아버리고 싶은\n싫은 소리를 내어\n상대의 방어를 크게 떨어뜨린다.", "Cri strident qui baisse beaucoup\nla Défense ennemie.", "Stößt einen Schrei aus, um die\nVerteidigung des Zieles stark\nzu senken.", "Alarido agudo que reduce mucho\nla Defensa del objetivo.", "Stridio assordante che riduce di molto\nla Difesa del nemico.", "An earsplitting screech harshly reduces\nthe target's Defense stat.") },
            { PBEMove.DoubleTeam, new PBELocalizedString("すばやい　うごきで　ぶんしんを　つくり\nあいてを　まどわせて\nかいひりつを　あげる。", "재빠른 움직임으로 분신을 만들어\n상대를 혼란시켜\n회피율을 올린다.", "Le lanceur se déplace si vite qu'il\ncrée des copies illusoires de lui,\naugmentant son Esquive.", "Erzeugt durch schnelle Bewegungen\nEbenbilder, um den Fluchtwert zu erhöhen.", "Crea copias de sí mismo para mejorar\nla Evasión.", "Chi la usa si muove in fretta e crea copie\nillusorie di se stesso che aumentano\nla capacità di elusione.", "By moving rapidly, the user makes illusory\ncopies of itself to raise its evasiveness.") },
            { PBEMove.Recover, new PBELocalizedString("さいぼうを　さいせい　させて\nじぶんの　さいだい　\xFF28\xFF30の\nはんぶんの　\xFF28\xFF30を　かいふく　する。", "세포를 재생시켜\n자신의 최대 HP의\n절반만큼 HP를 회복한다.", "Un soin qui permet au lanceur de récupérer\njusqu'à la moitié de ses PV max.", "Eine Selbstheilung. KP des Anwenders\nwerden um 50 % des maximalen Wertes\naufgefüllt.", "Restaura hasta la mitad de los PS máximos.", "Mossa autocurativa. Chi la usa recupera\nmetà dei PS massimi.", "Restoring its own cells, the user\nrestores its own HP by half of\nits max HP.") },
            { PBEMove.Harden, new PBELocalizedString("ぜんしんに　ちからを　こめて\nからだを　かたくして\nじぶんの　ぼうぎょを　あげる。", "전신에 힘을 담아\n몸을 단단하게 해서\n자신의 방어를 올린다.", "Le lanceur contracte tous ses muscles\npour augmenter sa Défense.", "Stärkt die Muskulatur und\nerhöht den Verteidigungs-Wert.", "Tensa la musculatura del usuario\npara aumentar la Defensa.", "Tutti i muscoli del corpo si tonificano\nper aumentare la Difesa.", "The user stiffens all the muscles in its\nbody to raise its Defense stat.") },
            { PBEMove.Minimize, new PBELocalizedString("からだを　ちぢめて　ちいさく　みせて\nじぶんの　かいひりつを\nぐーんと　あげる。", "몸을 축소하여 작게 보임으로써\n자신의 회피율을 크게 올린다.", "Le lanceur comprime son corps pour se\nfaire tout petit et augmenter fortement\nson Esquive.", "Anwender schrumpft, um seinen\nFluchtwert stark zu erhöhen.", "El usuario mengua para aumentar\nmucho la Evasión.", "Il corpo di chi la usa si comprime e diventa\npiù piccolo. La sua capacità di elusione\naumenta di molto.", "The user compresses its body\nto make itself look smaller,\nwhich sharply raises its evasiveness.") },
            { PBEMove.SmokeScreen, new PBELocalizedString("けむりや　スミなどを　ふきかけて\nあいての　めいちゅうりつを　さげる。\n", "연기나 먹물을 내뿜어\n상대의 명중률을 떨어뜨린다.", "Le lanceur disperse un nuage d'encre ou\nde fumée. Réduit la Précision de l'ennemi.", "Senkt Genauigkeit des Zieles mit\nRauch, Tinte oder Ähnlichem.", "Baja la Precisión del objetivo con una nube\nde humo o tinta.", "Nuvola di fumo o inchiostro che riduce\nla precisione del nemico.", "The user releases an obscuring cloud\nof smoke or ink. It reduces the\ntarget's accuracy.") },
            { PBEMove.ConfuseRay, new PBELocalizedString("あやしい　ひかりを　\nあいてに　みせて　まどわせる。\nあいてを　こんらん　させる。", "이상한 빛을\n상대에게 비춰 당황하게 한다.\n상대를 혼란시킨다.", "Un rayon sinistre qui plonge l'ennemi\ndans un état de confusion.", "Ein fieser Strahl, der das Ziel\nverwirrt.", "Rayo siniestro que confunde al objetivo.", "Colpisce il nemico con un raggio funesto\nche lo confonde.", "The target is exposed to a sinister\nray that triggers confusion.") },
            { PBEMove.Withdraw, new PBELocalizedString("からに　もぐりこんで　みをまもり\nじぶんの　ぼうぎょを　あげる。\n", "껍질에 숨어 몸을 보호하여\n자신의 방어를 올린다.", "Le lanceur se recroqueville dans sa\ncarapace, ce qui augmente sa Défense.", "Rückzug in den harten Panzer.\nErhöht den Verteidigungs-Wert.", "El usuario se protege en su coraza y sube\nla Defensa.", "Il corpo si ritira nel suo duro guscio\nper aumentare la Difesa.", "The user withdraws its body into its hard\nshell, raising its Defense stat.") },
            { PBEMove.DefenseCurl, new PBELocalizedString("からだを　まるめて　ちぢこまり\nじぶんの　ぼうぎょを　あげる。\n", "몸을 둥글게 웅크려서\n자신의 방어를 올린다.", "Le lanceur s'enroule pour cacher ses\npoints faibles, ce qui augmente sa Défense.", "Verbirgt Schwächen durch Einrollen und\nhebt gleichzeitig den Verteidigungs-Wert.", "Se enrosca para ocultar su punto débil.\nSube la Defensa.", "Chi la usa si raggomitola per nascondere\ni punti deboli e aumentare la propria\nDifesa.", "The user curls up to conceal weak spots\nand raise its Defense stat.") },
            { PBEMove.Barrier, new PBELocalizedString("がんじょうな　かべを　つくって\nじぶんの　ぼうぎょを　ぐーんと　あげる。\n", "튼튼한 장막을 만들어\n자신의 방어를 크게 올린다.", "Le lanceur érige un mur solide qui\naugmente fortement sa Défense.", "Erzeugt eine Barriere, die den\nVerteidigungs-Wert stark erhöht.", "Crea una barrera para aumentar\nmucho la Defensa.", "Innalza una barriera resistente che\naumenta molto la Difesa.", "The user throws up a sturdy wall that\nsharply raises its Defense stat.") },
            { PBEMove.LightScreen, new PBELocalizedString("\xFF15ターンの　あいだ　ふしぎな　かべで\nあいてから　うける　とくしゅ　こうげきの\nダメージを　よわめる。", "5턴 동안 이상한 장막으로\n상대로부터 받는 특수공격의\n데미지를 약하게 한다.", "Un fabuleux mur de lumière qui réduit les\ndégâts causés par les attaques spéciales\ndurant 5 tours.", "Erzeugt eine Lichtwand und senkt Schaden\ndurch Spezial-Angriffe für fünf Runden.", "Pared de luz que reduce durante\ncinco turnos el daño producido\npor los ataques especiales.", "Innalza una barriera di luce fantastica\nper ridurre i danni degli attacchi\nspeciali alla squadra per cinque turni.", "A wondrous wall of light is put up to\nsuppress damage from special attacks\nfor five turns.") },
            // { PBEMove.114, new PBELocalizedString("くろいきりを　だして　せんとうに\nでている　ポケモン　ぜんいんの\nのうりょく　へんかを　もとに　もどす。", "흑안개를 뿜어 배틀에\n참가 중인 포켓몬 전원의\n능력 변화를 원래대로 돌린다.", "Un brouillard qui annule les\nchangements de stats de tous\nles Pokémon au combat.", "Erzeugt einen dunklen Nebel. Alle\nVeränderungen der Statuswerte der\nKampfteilnehmer werden annulliert.", "Neblina que elimina los cambios\nde características de todos\nlos Pokémon en combate.", "Chi la usa crea una nube nera che annulla\nogni modifica delle statistiche di tutti\ni Pokémon in campo.", "The user creates a haze that eliminates\nevery stat change among all the Pokémon\nengaged in battle.") },
            { PBEMove.Reflect, new PBELocalizedString("\xFF15ターンの　あいだ　ふしぎな　かべで\nあいてから　うける　ぶつり　こうげきの\nダメージを　よわめる。", "5턴 동안 이상한 장막으로\n상대로부터 받는 물리공격의\n데미지를 약하게 한다.", "Un fabuleux mur de lumière qui réduit les\ndégâts causés par les attaques physiques\ndurant 5 tours.", "Eine mysteriöse Wand, die fünf Runden den\nSchaden von physischen gegnerischen\nTreffern reduziert.", "Pared de luz que reduce durante\ncinco turnos el daño producido\npor los ataques físicos.", "Innalza una barriera di luce fantastica\nper ridurre i danni degli attacchi fisici\nalla squadra per cinque turni.", "A wondrous wall of light is put up to\nsuppress damage from physical attacks\nfor five turns.") },
            { PBEMove.FocusEnergy, new PBELocalizedString("ふかく　いきを　すい　きあいを　こめる。\nじぶんの　こうげきが\nきゅうしょに　あたりやすく　なる。", "깊게 숨을 들이마셔 기합을 넣는다.\n자신의 공격이\n급소에 맞기 쉬워진다.", "Le lanceur prend une profonde inspiration\net se concentre pour augmenter son taux\nde critiques.", "Anwender atmet ein und bündelt Kraft.\nDie Volltrefferquote steigt dadurch.", "Concentra energía para aumentar\nlas posibilidades de un golpe crítico.", "Chi la usa fa un profondo respiro e si\nconcentra per rendere più probabili\ni brutti colpi.", "The user takes a deep breath and\nfocuses so that critical hits land\nmore easily.") },
            // { PBEMove.117, new PBELocalizedString("\xFF12ターンの　あいだ　こうげきに　たえて\nうけた　ダメージを　\xFF12ばいに　して\nあいてに　かえす。", "2턴 동안 공격을 견뎌\n입은 데미지를 2배로 만들어\n상대에게 돌려준다.", "Le lanceur encaisse les coups durant 2\ntours et réplique en infligeant le double\ndes dégâts subis.", "Erträgt zwei Runden Angriffe und schlägt\ndann mit dem doppelten Wert des erlittenen\nSchadens zurück.", "Espera dos turnos para atacar\ncon el doble de potencia del\ndaño recibido.", "Chi la usa subisce attacchi per due turni\ne poi restituisce il danno moltiplicato\nper due.", "The user endures attacks for two\nturns, then strikes back to cause\ndouble the damage taken.") },
            { PBEMove.Metronome, new PBELocalizedString("ゆびをふり　じぶんの　のうを　しげきして\nすべての　わざの　なかから\nどれか　\xFF11つを　くりだす。", "손가락을 흔들어 자신의 뇌를\n자극해서 모든 기술 중\n어느 하나를 날린다.", "Agite un doigt et stimule le cerveau\npour utiliser presque n'importe\nquelle capacité au hasard.", "Bewegt Finger, um das Gehirn zu\nstimulieren. Wählt zufällig eine\nAttacke aus.", "El usuario mueve un dedo y\nestimula su cerebro para usar\nal azar casi cualquier movimiento.", "Chi la usa fa di no con un dito e stimola il\ncervello a usare a caso una delle tante\nmosse esistenti.", "The user waggles a finger and stimulates\nits brain into randomly using nearly\nany move.") },
            // { PBEMove.119, new PBELocalizedString("あいての　つかった　わざを　まねして\nじぶんも　おなじ　わざを　つかう。\n", "상대가 사용한 기술을 흉내 내어\n자신도 똑같은 기술을 쓴다.", "Le lanceur riposte à l'attaque de l'ennemi\navec la même attaque.", "Kopiert die letzte Attacke des\nZieles und greift es an.", "Contraataca con el mismo movimiento\nempleado por el objetivo.", "Chi la usa colpisce il bersaglio copiandone\nl'ultima mossa usata.", "The user counters the target by mimicking\nthe target's last move.") },
            { PBEMove.Selfdestruct, new PBELocalizedString("ばくはつを　おこして　じぶんの\nまわりに　いるものを　こうげきする。\nつかった　あとに　ひんしに　なる。", "폭발을 일으켜서 자신의\n주위에 있는 포켓몬을 공격한다.\n쓰고 나서 기절하게 된다.", "Le lanceur explose en blessant\ntous les Pokémon autour de lui.\nLe lanceur tombe K.O.", "Anwender sprengt sich, richtet\nrundum Riesenschaden an und\nwird dabei besiegt.", "El atacante explota y hiere a todos\na su alrededor. El usuario se debilita\nde inmediato.", "Chi la usa esplode e infligge danni agli\naltri Pokémon in campo, ma poi va KO.", "The user attacks everything around it\nby causing an explosion.\nThe user faints upon using this move.") },
            { PBEMove.EggBomb, new PBELocalizedString("おおきな　タマゴを　ちから　いっぱい\nあいてに　なげつけて　こうげきする。\n", "큰 알을 온 힘을 다해\n상대에게 내던져서 공격한다.", "De toutes ses forces, le lanceur\njette un gros œuf sur l'ennemi\npour lui infliger des dégâts.", "Ein großes Ei wird auf das Ziel\nabgefeuert, um ihm zu schaden.", "Arroja un huevo al objetivo con\ngran fuerza.", "Colpisce il nemico con un grande uovo\nscaraventato con enorme forza.", "A large egg is hurled at the target\nwith maximum force to inflict damage.") },
            { PBEMove.Lick, new PBELocalizedString("ながい　したで\nあいてを　なめまわして　こうげきする。\nまひ　じょうたいに　することが　ある。", "긴 혀로\n상대를 핥아서 공격한다.\n마비 상태로 만들 때가 있다.", "Un grand coup de langue qui inflige des\ndégâts à l'ennemi. Peut aussi le paralyser.", "Leck-Attacke mit langer Zunge.\nDas Ziel wird eventuell\nparalysiert.", "Una lengua ataca al objetivo.\nPuede causar parálisis.", "Una lingua lunga infligge danni al nemico e\npuò anche paralizzarlo.", "The target is licked with a long tongue,\ncausing damage. It may also leave\nthe target with paralysis.") },
            { PBEMove.Smog, new PBELocalizedString("よごれた　ガスを\nあいてに　ふきつけて　こうげきする。\nどく　じょうたいに　することが　ある。", "더러운 가스를\n상대에게 내뿜어 공격한다.\n독 상태로 만들 때가 있다.", "Le lanceur attaque à l'aide d'une\néruption de gaz répugnants.\nPeut aussi empoisonner l'ennemi.", "Angriff mit Gas. Das Ziel kann\neventuell vergiftet werden.", "El objetivo es atacado con gases tóxicos\nque pueden llegar a envenenar.", "Colpisce il nemico con una scarica di gas\nmaleodoranti. Può anche avvelenarlo.", "The target is attacked with a\ndischarge of filthy gases.\nIt may also poison the target.") },
            { PBEMove.Sludge, new PBELocalizedString("きたない　ヘドロを\nあいてに　なげつけて　こうげきする。\nどく　じょうたいに　することが　ある。", "더러운 오물을\n상대에게 내던져서 공격한다.\n독 상태로 만들 때가 있다.", "Des détritus toxiques sont projetés sur\nl'ennemi. Peut aussi l'empoisonner.", "Wirft Schlamm auf das Ziel,\ndas eventuell vergiftet wird.", "Arroja residuos al objetivo.\nPuede llegar a envenenar.", "Lancio di fango malsano che arreca danno\nal nemico. Può anche avvelenarlo.", "Unsanitary sludge is hurled at the target.\nIt may also poison the target.") },
            { PBEMove.BoneClub, new PBELocalizedString("てに　もった　ホネで\nあいてを　なぐりつけて　こうげきする。\nあいてを　ひるませる　ことが　ある。", "손에 들고 있는 뼈로\n상대를 세게 때려서 공격한다.\n상대를 풀죽게 만들 때가 있다.", "Le lanceur frappe l'ennemi à grands\ncoups d'os. Peut aussi apeurer l'ennemi.", "Schlägt das Ziel mit einer Keule\nund verschreckt es eventuell.", "Aporrea con un hueso.\nPuede hacer retroceder al objetivo.", "Chi la usa colpisce il nemico con un osso e\npuò farlo anche tentennare.", "The user clubs the target with a bone.\nIt may also make the target flinch.") },
            { PBEMove.FireBlast, new PBELocalizedString("だいのじの　ほのおで\nあいてを　やきつくす。\nやけど　じょうたいに　することが　ある。", "큰 대자의 불꽃으로\n상대를 불태운다.\n화상 상태로 만들 때가 있다.", "Un déluge de flammes ardentes submerge\nl'ennemi. Peut aussi le brûler.", "Feuersbrunst, die das Ziel versengt\nund ihm eventuell eine Verbrennung\nzufügt.", "Llama intensa que chamusca\ny puede causar quemaduras.", "Investe il nemico con un'intensa fiammata\nche fa terra bruciata. Può anche\nscottarlo.", "The target is attacked with an intense\nblast of all-consuming fire.\nIt may also leave the target with a burn.") },
            { PBEMove.Waterfall, new PBELocalizedString("すごい　いきおいで　あいてに　つっこむ。\nあいてを　ひるませる　ことが　ある。\nたきも　およいで　のぼれる。", "굉장한 기세로 상대에게 돌진한다.\n상대를 풀죽게 만들 때가 있다.\n폭포도 거슬러 올라갈 수 있다.", "Le lanceur charge l'ennemi à une vitesse\nremarquable, ce qui peut l'apeurer.\nPermet aussi de franchir une cascade.", "Eine mächtige Attacke, durch die das\nZiel evtl. zurückschreckt. Wasserfälle\nkönnen damit erklommen werden.", "Embiste con un gran impulso que puede\nhacer retroceder. También sirve para\nremontar cascadas.", "Carica il nemico a grande velocità e può\nfarlo tentennare. Fuori dalla lotta fa\nrisalire le cascate.", "The user charges at the target\nand may make it flinch.\nIt can also be used to climb a waterfall.") },
            // { PBEMove.128, new PBELocalizedString("とても　がんじょうな　ぶあつい　からに\n\xFF14ー\xFF15ターンの　あいだ\nあいてを　はさんで　こうげきする。", "매우 튼튼하고 두꺼운 껍질에\n4-5턴 동안\n상대를 끼워서 공격한다.", "Le lanceur piège l'ennemi dans sa dure\ncoquille et l'écrase pendant 4 à 5 tours.", "Fängt und quetscht das Ziel über\n4 bis 5 Runden durch die harte Schale\ndes Anwenders.", "Atrapa y atenaza con fuerza durante\ncuatro o cinco turnos.", "Chi la usa intrappola e stritola il nemico\ncon la sua corazza spessa e forte per\nquattro o cinque turni.", "The target is clamped and squeezed by\nthe user's very thick and sturdy shell for\nfour to five turns.") },
            { PBEMove.Swift, new PBELocalizedString("ほしがたの　ひかりを　はっしゃして\nあいてを　こうげきする。\nこうげきは　かならず　めいちゅう　する。", "별 모양의 빛을 발사해서\n상대를 공격한다.\n공격은 반드시 명중한다.", "Le lanceur envoie des rayons d'étoiles.\nTouche toujours l'ennemi.", "Verschießt sternförmige Strahlen,\ndie stets treffen, auf Gegner in\nder Umgebung.", "Lanza rayos en forma de estrella que no\nfallan nunca.", "Colpisce i nemici con raggi a forma\ndi stella. Questo attacco è infallibile.", "Star-shaped rays are shot at the opposing\nteam. This attack never misses.") },
            // { PBEMove.130, new PBELocalizedString("\xFF11ターンめに　あたまを　ひっこめて\nぼうぎょを　あげる。\n\xFF12ターンめに　あいてを　こうげきする。", "1턴째에 머리를 움츠려\n방어를 올린다.\n2턴째에 상대를 공격한다.", "Le lanceur baisse la tête pour augmenter\nsa Défense au 1⑩ tour et percuter\nl'ennemi au 2⒅.", "Der Anwender erhöht in Runde 1\nseine Verteidigung und greift in\nRunde 2 an.", "Primer turno: se prepara\ny sube la Defensa del usuario.\nSegundo turno: da el cabezazo.", "Chi la usa ritira la testa per aumentare\nla Difesa e poi attacca al turno\nsuccessivo.", "The user tucks in its head to raise its\nDefense in the first turn, then\nrams the target on the next turn.") },
            // { PBEMove.131, new PBELocalizedString("するどい　ハリを\nあいてに　はっしゃして　こうげきする。\n\xFF12ー\xFF15かいの　あいだ　れんぞくで　だす。", "날카로운 침을\n상대에게 발사해서 공격한다.\n2-5회 동안 연속으로 쓴다.", "Envoie une rafale de dards.\nPeut toucher de 2 à 5 fois.", "Spitze Nadeln treffen das\nZiel 2- bis 5-mal.", "Lanza finas púas que hieren de dos\na cinco veces.", "Il nemico viene colpito da due a cinque\nvolte in rapida successione da spilli\nappuntiti.", "Sharp spikes are shot at the target\nin rapid succession.\nThey hit two to five times in a row.") },
            // { PBEMove.132, new PBELocalizedString("しょくしゅや　ツタ　などを　からみつけて\nこうげきする。あいての　すばやさを\nさげることが　ある。", "촉수나 덩굴 등을 휘감아서\n공격한다. 상대의 스피드를\n떨어뜨릴 때가 있다.", "De longs tentacules ou lianes attaquent\nl'ennemi. Peut aussi baisser sa Vitesse.", "Angriff mit langen Tentakeln oder Ranken.\nSenkt eventuell den Initiative-Wert.", "Constriñe para herir y puede bajar\nla Velocidad.", "Colpisce il nemico con lunghi tentacoli\no piante rampicanti. Può anche ridurne\nla Velocità.", "The target is attacked with long, creeping\ntentacles or vines.\nIt may also lower the target's Speed stat.") },
            { PBEMove.Amnesia, new PBELocalizedString("あたまを　からにして\nいっしゅん　なにかを　わすれる　ことで\nじぶんの　とくぼうを　ぐーんと　あげる。", "머리를 비워서 순간적으로\n무언가를 잊어버림으로써\n자신의 특수방어를 크게 올린다.", "Le lanceur fait le vide dans son esprit\npour oublier ses soucis. Augmente\nfortement sa Défense Spéciale.", "Gedächtnisverlust, der die\nSpezial-Verteidigung stark\nerhöht.", "El usuario olvida sus preocupaciones\ny aumenta mucho la Defensa Especial.", "Chi la usa svuota per un po' la mente per\ndimenticare i problemi. La Difesa Speciale\naumenta di molto.", "The user temporarily empties its mind to\nforget its concerns.\nIt sharply raises the user's Sp. Def stat.") },
            { PBEMove.Kinesis, new PBELocalizedString("スプーンを　まげて　ちゅういを　ひき\nあいての　めいちゅうりつを　さげる。\n", "숟가락을 휘어서 주의를 끌어\n상대의 명중률을 낮춘다.", "Le lanceur distrait l'ennemi en pliant\nune cuillère. Peut baisser la Précision\nde l'ennemi.", "Lenkt Ziel durch Verbiegen\neines Löffels ab. Senkt\ndessen Genauigkeit.", "Dobla una cuchara para distraer\nal objetivo y bajar su nivel de Precisión.", "Chi la usa distrae il bersaglio piegando\nun cucchiaio e ne riduce la precisione.", "The user distracts the target\nby bending a spoon.\nIt lowers the target's accuracy.") },
            { PBEMove.Softboiled, new PBELocalizedString("さいだい　\xFF28\xFF30の　はんぶん\nじぶんの　\xFF28\xFF30を　かいふく　する。\nなかまに　\xFF28\xFF30を　わけることも　できる。", "자신의 최대 HP 절반을\n회복한다. 동료의 HP를\n회복시킬 수도 있다.", "Le lanceur récupère jusqu'à la moitié de\nses PV max. En dehors des combats, permet\nde transférer des PV du lanceur à un allié.", "KP des Anwenders werden um 50 %\nder maximalen KP aufgefüllt. Heilung\ndes Teams außerhalb von Kämpfen.", "Restaura la mitad de los PS máximos del\nusuario. Fuera de combate se usa para\ntransferir parte de sus PS a un aliado.", "Chi la usa recupera metà dei propri PS\nmassimi. Fuori dalla lotta può anche far\ntrasferire PS ai propri compagni.", "The user restores its own HP\nby up to half of its maximum HP.\nMay also be used in the field to heal HP.") },
            // { PBEMove.136, new PBELocalizedString("ジャンプからの　ひざげりで\nあいてを　こうげきする。\nはずすと　じぶんが　ダメージを　うける。", "점프해서 무릎차기로\n상대를 공격한다.\n빗나가면 자신이 데미지를 입는다.", "Le lanceur s'élance pour effectuer un\ncoup de genou sauté. S'il échoue, le\nlanceur se blesse.", "Sprungtritt mit Knie. Bei Misserfolg\nverletzt sich der Anwender selbst.", "Salta muy alto y lanza una patada.\nSi falla, dañará al usuario.", "Chi la usa colpisce il nemico con una\nginocchiata in volo: se fallisce, subisce\ndanni.", "The target is attacked with a knee kick\nfrom a jump. If it misses, the user is hurt\ninstead.") },
            { PBEMove.Glare, new PBELocalizedString("おなかの　もようで　おびえさせて\nあいてを　まひの　じょうたいに　する。\n", "배의 무늬로 겁을 주어\n상대를 마비 상태로 만든다.", "Le lanceur intimide l'ennemi grâce à son\nregard terrifiant pour le paralyser.", "Schüchtert Ziel mit dem Muster\nauf seinem Bauch ein, sodass dieses\nparalysiert wird.", "Intimida y asusta al objetivo con la mirada\npara dejarlo paralizado.", "Chi la usa spaventa il nemico con\nuno sguardo terrificante e ne causa\nla paralisi.", "The user intimidates the target with the\npattern on its belly to cause paralysis.") },
            { PBEMove.DreamEater, new PBELocalizedString("ねている　あいての　ゆめを　たべて\nこうげきする。　ダメージの　はんぶんの\n\xFF28\xFF30を　かいふく　する。", "잠자고 있는 상대의 꿈을 먹어\n공격한다. 데미지의 절반을\nHP로 회복한다.", "Le lanceur mange le rêve de l'ennemi\nendormi. Le lanceur récupère en PV\nla moitié des dégâts infligés.", "Attacke gegen schlafendes Ziel.\nDie Hälfte des zugefügten Schadens\nwird dem Anwender gutgeschrieben.", "Restaura al usuario la mitad del daño\ncausado a un objetivo dormido.", "Attacco che funziona solo su un nemico\nche dorme. Chi lo usa riceve metà dei PS\npersi dal nemico.", "The user eats the dreams of a sleeping\ntarget. It absorbs half the damage\ncaused to heal the user's HP.") },
            { PBEMove.PoisonGas, new PBELocalizedString("どくガスを　あいての　かおに　ふきかけて\nどくの　じょうたいに　する。\n", "독가스를 상대의 얼굴에 내뿜어\n독 상태로 만든다.", "Un nuage de gaz toxique est projeté au\nvisage de l'ennemi. Peut l'empoisonner.", "Hüllt Gegner in der Umgebung\nin Gas ein, das sie vergiftet.", "Lanza una nube de gas tóxico al objetivo.\nProduce envenenamiento.", "Spruzza in faccia al nemico una nuvola\ndi gas tossico che avvelena.", "A cloud of poison gas is sprayed\nin the face of opposing Pokémon.\nIt may poison those hit.") },
            // { PBEMove.140, new PBELocalizedString("まるい　ものを\nあいてに　なげつけて　こうげきする。\n\xFF12ー\xFF15かいの　あいだ　れんぞくで　だす。", "둥근 것을\n상대에게 내던져서 공격한다.\n2-5회 동안 연속으로 쓴다.", "Projette de 2 à 5 grosses boules\nsur l'ennemi.", "Wirft 2- bis 5-mal runde Gegenstände\nauf das Ziel.", "Arroja esferas al objetivo entre dos y\ncinco veces seguidas.", "Piovono enormi sfere sulla testa del nemico\nda due a cinque volte di fila.", "Round objects are hurled at the target\nto strike two to five times in a row.") },
            { PBEMove.LeechLife, new PBELocalizedString("ちを　すいとって　あいてを\nこうげきする。　あたえた　ダメージの\nはんぶんの　\xFF28\xFF30を　かいふく　できる。", "피를 빨아서 상대를\n공격한다. 준 데미지의\n절반을 HP로 회복한다.", "Une attaque qui aspire le sang de l'ennemi.\nLa moitié des dégâts sont convertis en\nPV pour le lanceur.", "Die Hälfte des zugefügten Schadens\nwird dem Anwender gutgeschrieben.", "Restaura al usuario la mitad del daño\ncausado al objetivo.", "Mossa succhiasangue. Chi la usa recupera\nuna quantità di PS pari alla metà del danno\ninferto.", "The user drains the target's blood.\nThe user's HP is restored by half the\ndamage taken by the target.") },
            { PBEMove.LovelyKiss, new PBELocalizedString("おそろしい　かおで　キスを　せまる。\nあいてを　ねむり　じょうたいに　する。\n", "무서운 얼굴로 키스한다.\n상대를 잠듦 상태로 만든다.", "Le lanceur fait un bisou à l'ennemi\nen prenant une mine effrayante.\nEndort l'ennemi.", "Anwender zwingt dem Ziel einen\nKuss auf, der Schlaf verursacht.", "Con una cara que asusta, da un beso\nal objetivo y lo adormece.", "Chi la usa intimidisce il nemico con\nuna faccia paurosa e gli schiocca\nun bacio che lo fa addormentare.", "With a scary face, the user tries to\nforce a kiss on the target. If it\nsucceeds, the target falls asleep.") },
            // { PBEMove.143, new PBELocalizedString("\xFF12ターンめに　あいてを　こうげきする。\nたまに　ひるませる。\nきゅうしょにも　あたりやすい。", "2턴째에 상대를 공격한다.\n가끔 풀죽게 만든다.\n급소에도 맞기 쉽다.", "Une attaque en 2 tours au taux de\ncritiques élevé. Peut aussi apeurer\nl'ennemi.", "Anwender greift in der zweiten Runde\nmit hoher Volltrefferquote an. Ziel\nschreckt eventuell zurück.", "Ataque en dos turnos que suele ser\ncrítico. Puede hacer retroceder\nal objetivo.", "Un attacco in due turni e probabile\nbrutto colpo. Può anche far tentennare\nil nemico.", "A second-turn attack move where\ncritical hits land more easily.\nIt may also make the target flinch.") },
            { PBEMove.Transform, new PBELocalizedString("あいての　ポケモンに　へんしん\nすることで　あいてと　まったく\nおなじ　わざが　つかえる。", "상대 포켓몬으로 변신하여\n상대와 완전히 똑같은\n기술을 사용할 수 있다.", "Le lanceur devient une copie de sa cible\net obtient la même palette de capacités.", "Anwender verwandelt sich in ein Abbild des\nZieles und kann so auf die gleichen\nAttacken zugreifen.", "El usuario se transforma en una copia del\nobjetivo, con los mismos movimientos.", "Chi la usa si trasforma in una copia\nesatta del bersaglio per sfruttarne\nle caratteristiche.", "The user transforms into a copy of the\ntarget right down to having\nthe same move set.") },
            { PBEMove.Bubble, new PBELocalizedString("むすうの　あわを　あいてに　ふきかけて\nこうげきする。あいての　すばやさを\nさげることが　ある。", "매우 많은 거품을 상대에게 내뿜어\n공격한다. 상대의 스피드를\n떨어뜨릴 때가 있다.", "Des bulles frappent l'ennemi.\nPeut réduire sa Vitesse.", "Angriff mit Blasen. Initiative-Wert des\nGegners wird eventuell gesenkt.", "Lanza burbujas al contrincante y puede\nreducir su Velocidad.", "Una pioggia di bolle investe i nemici e può\nanche ridurne la Velocità.", "A spray of countless bubbles is jetted at\nthe opposing team. It may also lower the\ntargets' Speed stats.") },
            { PBEMove.DizzyPunch, new PBELocalizedString("リズミカルに　パンチを　くりだして\nあいてを　こうげきする。\nこんらん　させることが　ある。", "리드미컬한 펀치를 날려\n상대를 공격한다.\n혼란시킬 때가 있다.", "Un enchaînement de coups de poing\ncadencés. Peut aussi rendre confus.", "Rhythmische Schläge, die das Ziel\nverwirren können.", "Rítmicos puñetazos que pueden causar\nconfusión.", "Colpisce il bersaglio con una sequenza\ndi pugni che può anche confonderlo.", "The target is hit with rhythmically\nlaunched punches that may also\nleave it confused.") },
            { PBEMove.Spore, new PBELocalizedString("さいみん　こうかの　ある\nほうしを　パラパラと　ふりまき\nあいてを　ねむり　じょうたいに　する。", "최면 효과가 있는\n포자를 훌훌 흩뿌려서\n상대를 잠듦 상태로 만든다.", "Le lanceur répand un nuage de\nspores qui endort.", "Erzeugt eine Wolke aus einschläfernden\nSporen.", "Esparce esporas que inducen al sueño.", "Nube di spore che fa sempre addormentare\nil nemico.", "The user scatters bursts of spores\nthat induce sleep.") },
            { PBEMove.Flash, new PBELocalizedString("まぶしい　ひかりで　\nあいての　めいちゅうりつを　さげる。\nくらい　どうくつも　あかるく　てらせる。", "눈이 부신 빛으로\n상대의 명중률을 떨어뜨린다.\n어두운 동굴도 밝게 비춰준다.", "Explosion lumineuse qui fait baisser la\nPrécision de l'ennemi. Permet aussi\nd'éclairer les grottes.", "Erzeugt helles Licht, das die\nGenauigkeit des Zieles senkt\nund Höhlen ausleuchten kann.", "Luz cegadora que baja la Precisión\ndel objetivo. Fuera de combate sirve\npara iluminar.", "Investe il nemico con un flash che ne\nriduce la precisione. Fuori dalla lotta\nserve per illuminare le grotte.", "The user flashes a bright light that cuts\nthe target's accuracy.\nIt can also be used to illuminate caves.") },
            { PBEMove.Psywave, new PBELocalizedString("ふしぎな　ねんぱを\nあいてに　はっしゃして　こうげきする。\nつかう　たびに　ダメージが　かわる。", "이상한 염력파를\n상대에게 발사하여 공격한다.\n사용할 때마다 데미지가 바뀐다.", "Une étrange onde d'énergie chaude\nfrappe l'ennemi. Cette attaque est\nd'intensité variable.", "Anwender erzeugt eine mysteriöse\nEnergiewelle, deren Intensität von\nMal zu Mal unterschiedlich ausfällt.", "Ataque con una onda de energía\nde intensidad variable.", "Colpisce il nemico con una strana onda\npsichica. Ha un'intensità variabile.", "The target is attacked with an odd\npsychic wave.\nThe attack varies in intensity.") },
            // { PBEMove.150, new PBELocalizedString("こうげきも　せずに　ピョン　ピョンと\nはねるだけで　なにも　おこらない　……。\n", "공격도 하지 않고 팔딱팔딱 튈 뿐\n아무 일도 일어나지 않는다...", "Le lanceur barbote et éclabousse les\nenvirons. Cette capacité n'a aucun effet.", "Nur ein Platscher, der überhaupt\nnichts bewirkt.", "No tiene ningún efecto. Solo salpica.", "Chi la usa sguazza nell'acqua, senza\nottenere alcun effetto.", "The user just flops and splashes around\nto no effect at all...") },
            { PBEMove.AcidArmor, new PBELocalizedString("さいぼうの　へんかで　えきじょうに　なり\nじぶんの　ぼうぎょを　ぐーんと　あげる。\n", "세포의 변화로 액체가 되어\n자신의 방어를 크게 올린다.", "Le lanceur modifie sa structure\nmoléculaire pour se liquéfier et\naugmenter fortement sa Défense.", "Verflüssigt Körperzellen des Anwenders.\nErhöht den Verteidigungs-Wert stark.", "Transforma la estructura celular\npara hacerse líquido y aumenta\nmucho la Defensa.", "Chi la usa altera la sua struttura\ncellulare passando allo stato liquido:\nla Difesa sale di molto.", "The user alters its cellular structure to\nliquefy itself, sharply raising its\nDefense stat.") },
            { PBEMove.Crabhammer, new PBELocalizedString("おおきな　ハサミを\nあいてに　たたきつけて　こうげきする。　\nきゅうしょに　あたりやすい。", "큰 집게를\n상대에게 내리쳐서 공격한다.\n급소에 맞기 쉽다.", "Une grande pince martèle l'ennemi.\nTaux de critiques élevé.", "Schlägt mit Schere zu.\nHohe Volltrefferquote.", "Golpea con fuerza con unas pinzas.\nSuele ser crítico.", "Colpisce il nemico con una grande tenaglia.\nProbabile brutto colpo.", "The target is hammered with a large pincer.\nCritical hits land more easily.") },
            { PBEMove.Explosion, new PBELocalizedString("おおきな　ばくはつで　じぶんの\nまわりに　いるものを　こうげきする。\nつかった　あとに　ひんしに　なる。", "큰 폭발로 자신의\n주위에 있는 포켓몬을 공격한다.\n쓰고 나서는 기절한다.", "Le lanceur explose et inflige des\ndégâts à tous les Pokémon autour\nde lui. Met K.O. le lanceur.", "Anwender explodiert, richtet bei allen\nPokémon in seiner Umgebung großen\nSchaden an und wird besiegt.", "El atacante explota y hiere a todos\na su alrededor. El usuario se debilita\nde inmediato.", "Chi la usa esplode per infliggere danni\nagli altri Pokémon attorno, ma va KO.", "The user explodes to inflict damage on\nthose around it.\nThe user faints upon using this move.") },
            // { PBEMove.154, new PBELocalizedString("ツメや　カマなどで\nあいてを　ひっかいて　こうげきする。\n\xFF12ー\xFF15かいの　あいだ　れんぞくで　だす。", "발톱이나 낫 등으로\n상대를 할퀴어서 공격한다.\n2-5회 동안 연속으로 쓴다.", "L'ennemi est lacéré par des faux\nou des griffes de 2 à 5 fois.", "Beharkt das Ziel 2- bis 5-mal mit\nscharfen Klauen oder Sicheln.", "Araña rápidamente de dos a cinco veces.", "Colpisce il nemico con artigli o falci\naffilate da due a cinque volte in rapida\nsuccessione.", "The target is raked with sharp claws or\nscythes for two to five times in\nquick succession.") },
            // { PBEMove.155, new PBELocalizedString("てに　もった　ホネを　あいてに　なげつけ\nいきと　かえりで　\xFF12かい　れんぞくで\nダメージを　あたえる。", "손에 들고 있는 뼈를 상대에게 날려서\n날아갈 때와 돌아올 때 2회 연속\n데미지를 준다.", "Le lanceur projette son os comme un\nboomerang. Cette attaque frappe à\nl'aller et au retour.", "Ein Bumerang aus Knochen, der\nzweimal trifft.", "Lanza un hueso a modo de bumerán\nque golpea dos veces.", "Chi la usa lancia l'osso che tiene. L'osso\ncolpisce due volte e ritorna come un vero\ne proprio boomerang.", "The user throws the bone it holds. The\nbone loops to hit the target twice,\ncoming and going.") },
            { PBEMove.Rest, new PBELocalizedString("\xFF12ターンの　あいだ　ねむり　つづける。\nじぶんの　\xFF28\xFF30と　じょうたいいじょうを\nすべて　かいふく　する。", "2턴 동안 계속 잠잔다.\n자신의 HP와 상태 이상을\n모두 회복한다.", "Le lanceur dort pendant 2 tours. Il\nregagne tous ses PV et n'a plus de\nproblèmes de statut.", "Anwender wird vollkommen\ngeheilt und schläft die\nfolgenden zwei Runden.", "Restaura todos los PS y cura todos los\nproblemas de estado del usuario.\nDuerme los dos próximos turnos.", "Chi la usa dorme per due turni.\nRecupera, però, tutti i PS e risolve\ntutti i suoi problemi di stato.", "The user goes to sleep for two turns.\nIt fully restores the user's HP and heals\nany status problem.") },
            { PBEMove.RockSlide, new PBELocalizedString("おおきな　いわを\nはげしく　ぶつけて　こうげきする。\nあいてを　ひるませる　ことが　ある。", "큰 바위를\n세차게 부딪쳐서 공격한다.\n상대를 풀죽게 만들 때가 있다.", "Envoie de gros rochers sur l'ennemi\npour infliger des dégâts.\nPeut aussi l'apeurer.", "Schleudert riesige Felsen auf\nGegner in der Umgebung, die\neventuell zurückschrecken.", "Lanza grandes pedruscos.\nPuede hacer retroceder al objetivo.", "I nemici vengono colpiti da grandi massi\nche possono anche farli tentennare.", "Large boulders are hurled at the opposing\nteam to inflict damage. It may also make\nthe targets flinch.") },
            { PBEMove.HyperFang, new PBELocalizedString("するどい　まえばで\nつよく　かみついて　こうげきする。\nあいてを　ひるませる　ことが　ある。", "날카로운 앞니로\n강하게 물어서 공격한다.\n상대를 풀죽게 만들 때가 있다.", "Le lanceur mord l'ennemi à l'aide de\nses incisives aiguisées. Peut aussi\napeurer l'ennemi.", "Angriff mit scharfen Reißzähnen.\nZiel schreckt eventuell zurück.", "Ataque con finos colmillos.\nPuede hacer retroceder al objetivo.", "Chi la usa morde il nemico con i suoi incisivi\naffilati. Può anche farlo tentennare.", "The user bites hard on the target\nwith its sharp front fangs.\nIt may also make the target flinch.") },
            { PBEMove.Sharpen, new PBELocalizedString("からだの　かどを　ふやして\nカクカクに　なることで\nじぶんの　こうげきを　あげる。", "몸의 각을 늘려서\n더욱 각지게 하여\n자신의 공격을 올린다.", "Le lanceur réduit son nombre de polygones\npour accentuer ses angles et augmenter\nson Attaque.", "Anwender senkt die Polygonzahl,\num Kanten zu erzeugen, die den\nAngriffs-Wert erhöhen.", "El perfil del usuario se hace más afilado\ny su Ataque mejora.", "Chi la usa riduce il numero di poligoni sul\nproprio corpo per accentuarne gli spigoli\ne aumentare l'Attacco.", "The user reduces its polygon count to\nmake itself more jagged, raising the\nAttack stat.") },
            // { PBEMove.160, new PBELocalizedString("じぶんの　タイプを\nおぼえている　わざの　なかの\nどれか　\xFF11つと　おなじ　タイプに　する。", "자신의 타입을\n배운 기술 중 어느 하나와\n같은 타입으로 바꾼다.", "Le lanceur change de type pour prendre\ncelui de l'une de ses capacités.", "Wandelt den Typ des Anwenders in den Typ\neiner Attacke des Anwenders um.", "Cambia el tipo del usuario por el de uno\nde sus movimientos.", "Il tipo di chi la usa muta in quello di una\nsua mossa a caso.", "The user changes its type to become the\nsame type as one of its moves.") },
            // { PBEMove.161, new PBELocalizedString("\xFF13つの　こうせんで　こうげきする。\nまひか　やけどか　こおりじょうたいの\nどれかに　することが　ある。", "3개의 광선으로 공격한다.\n마비, 화상 또는 얼음 상태 중\n어느 하나로 만들 때가 있다.", "Le lanceur envoie trois boules d'énergie\nsimultanément. Peut aussi paralyser,\nbrûler ou geler l'ennemi.", "Feuert drei Strahlen ab. Verursacht\neventuell Paralyse, Verbrennung\noder Einfrieren.", "Ataque triple que puede paralizar,\nquemar o congelar al objetivo.", "Colpisce il nemico con tre sfere simultanee\ncapaci di paralizzarlo, scottarlo o forse\ncongelarlo.", "The user strikes with a simultaneous\nthree-beam attack. May also burn, freeze,\nor leave the target with paralysis.") },
            { PBEMove.SuperFang, new PBELocalizedString("するどい　まえばで\nはげしく　かみついて　こうげきする。\nあいての　\xFF28\xFF30は　はんぶんに　なる。", "날카로운 앞니로\n강하게 물어서 공격한다.\n상대의 HP는 절반이 된다.", "Une vilaine morsure d'incisives qui réduit\nde moitié les PV de l'ennemi.", "Greift mit scharfen Reißzähnen an.\nKP des Zieles werden halbiert.", "Finos colmillos que reducen a la mitad\nlos PS del objetivo.", "Chi la usa salta sul nemico azzannandolo\ncon i suoi incisivi affilati e facendogli\nperdere metà dei PS.", "The user chomps hard on the\ntarget with its sharp front fangs.\nIt cuts the target's HP to half.") },
            { PBEMove.Slash, new PBELocalizedString("ツメや　カマ　などで\nあいてを　きりさいて　こうげきする。\nきゅうしょに　あたりやすい。", "발톱이나 낫 등으로\n상대를 베어 갈라서 공격한다.\n급소에 맞기 쉽다.", "Un coup de griffe ou autre tranche\nl'ennemi. Taux de critiques élevé.", "Hieb mit Klauen oder Ähnlichem.\nHohe Volltrefferquote.", "Ataca con cuchillas o con pinzas.\nSuele dar un golpe crítico.", "Attacca il nemico con artigli, falci o altro.\nProbabile brutto colpo.", "The target is attacked with a slash\nof claws or blades.\nCritical hits land more easily.") },
            { PBEMove.Substitute, new PBELocalizedString("じぶんの　\xFF28\xFF30を　すこし　けずって\nぶんしんを　だす。\nぶんしんは　じぶんの　みがわりに　なる。", "자신의 HP를 조금 깎아서\n분신을 만든다.\n분신은 자신의 대타가 된다.", "Le lanceur fait une copie de lui-même en\nsacrifiant quelques PV. La copie sert de\nleurre.", "Anwender setzt eine kleine Menge an KP\nein, um einen Doppelgänger zu erzeugen,\nder für ihn Schläge einsteckt.", "Utiliza parte de los PS propios para crear\nun sustituto que actúa como señuelo.", "Chi la usa crea una copia di se stesso\nusando alcuni PS. La copia serve come\nesca per il nemico.", "The user makes a copy of itself using\nsome of its HP.\nThe copy serves as the user's decoy.") },
            { PBEMove.Struggle, new PBELocalizedString("じぶんの　\xFF30\xFF30が　なくなると\nあがいて　あいてを　こうげきする。\nじぶんも　すこし　ダメージを　うける。", "자신의 PP가 떨어지면\n발버둥쳐 상대를 공격한다.\n자신도 조금 데미지를 입는다.", "Une attaque désespérée, lancée\nquand le lanceur n'a plus de PP.\nLe blesse aussi légèrement.", "Angriff nur bei verbrauchten AP.\nAnwender verletzt sich selbst leicht.", "Solo se usa como último recurso\nal acabarse los PP.\nHiere un poco al agresor.", "Mossa da usare solo in caso estremo,\nquando non si hanno più PP. Danneggia\nanche chi la usa.", "An attack that is used in desperation\nonly if the user has no PP. It also hurts\nthe user slightly.") },
            // { PBEMove.166, new PBELocalizedString("あいてが　つかった　わざを\nじぶんの　ものに　する。\n\xFF11かい　つかうと　スケッチは　きえる。", "상대가 쓴 기술을\n자신의 것으로 만든다.\n한 번 사용하면 스케치는 사라진다.", "Le lanceur apprend le dernier coup\nutilisé par la cible. Gribouille disparaît\naprès utilisation.", "Anwender lernt die letzte Attacke\ndes Zieles dauerhaft. Nachahmer\nverschwindet nach Gebrauch.", "Aprende de forma permanente\nel último movimiento del objetivo.\nEs de un solo uso.", "Permette a chi la usa di imparare l'ultima\nmossa usata dal bersaglio. La nuova mossa\nappresa sostituisce Schizzo.", "It enables the user to permanently learn\nthe move last used by the target.\nOnce used, Sketch disappears.") },
            // { PBEMove.167, new PBELocalizedString("\xFF13かい　れんぞくで　キックを　くりだして\nこうげきする。わざが　あたる　たびに\nいりょくは　あがる。", "3회 연속으로 킥을 날려\n공격한다. 기술이 맞을 때마다\n위력이 올라간다.", "Une salve de 1 à 3 coups de pied dont la\npuissance augmente à chaque coup porté.", "Tritt das Ziel 1- bis 3-mal nacheinander.\nDie Härte der Tritte nimmt von Treffer zu\nTreffer zu.", "Patea hasta tres veces seguidas y\ncada vez más fuerte.", "Chi la usa esegue fino a tre calci\nconsecutivi la cui potenza aumenta\nad ogni colpo.", "A consecutive three-kick attack that\nbecomes more powerful with each\nsuccessive hit.") },
            // { PBEMove.168, new PBELocalizedString("こうげきと　どうじに　どうぐを　ぬすむ。\nじぶんが　どうぐを　もっている　ばあいは\nぬすめない。", "공격과 동시에 도구를 훔친다.\n자신이 도구를 지니고 있을 경우에는\n훔칠 수 없다.", "Le lanceur attaque la cible et vole\nson objet. Le lanceur ne peut rien\nvoler s'il tient déjà un objet.", "Erlaubt es, das Item des Zieles zu\nstehlen, solang der Anwender selbst\nkeins bei sich trägt.", "Ataca y le quita al objetivo el objeto\nque lleve. Si el agresor lleva\nun objeto, no robará el del objetivo.", "Chi la usa attacca il bersaglio e può\nrubargli uno strumento, se non ne tiene\ngià uno.", "The user attacks and steals the target's\nheld item simultaneously.\nIt can't steal if the user holds an item.") },
            // { PBEMove.169, new PBELocalizedString("ネバネバした　ほそい　いとを\nグルグルと　からませて　あいてを\nせんとうから　にげられなく　する。", "끈적끈적하고 가는 실을\n칭칭 휘감아 상대를\n배틀에서 도망칠 수 없게 한다.", "Le lanceur enserre l'ennemi à l'aide d'une\nfine soie gluante pour l'empêcher de fuir\nle combat.", "Wickelt das Ziel ein. Flucht oder\nTausch unmöglich.", "Enreda al objetivo para evitar que\nabandone la batalla.", "Copre il nemico con un filo di seta sottile\ne appiccicoso. Il nemico non può fuggire.", "The user ensnares the target with thin,\ngooey silk so it can't flee from battle.") },
            // { PBEMove.170, new PBELocalizedString("あいての　うごきを　こころで　かんじて\nつぎの　こうげきが　かならず\nあいてに　あたるように　する。", "상대의 움직임을 마음으로 읽고\n다음 공격이 반드시\n상대에게 명중되게 한다.", "Le lanceur analyse les mouvements de\nl'ennemi pour être sûr de toucher\nau coup suivant.", "Ahnt Bewegungen des Zieles voraus,\num zu gewährleisten, dass die\nnächste eigene Attacke trifft.", "El usuario adivina los movimientos\ndel objetivo para hacer que su siguiente\nataque no falle.", "Chi la usa prevede i movimenti del nemico\nper mandare a segno l'attacco successivo.", "The user senses the target's movements\nwith its mind to ensure its next\nattack does not miss the target.") },
            // { PBEMove.171, new PBELocalizedString("ねむり　じょうたいの　あいてに\nあくむを　みせて　まいターン　すこしずつ\n\xFF28\xFF30を　へらしていく。", "잠듦 상태의 상대에게\n악몽을 꾸게 하여 매 턴 조금씩\nHP를 떨어뜨려 간다.", "Un cauchemar qui inflige des dégâts à\nchaque tour à un ennemi endormi.", "Dem schlafenden Ziel wird durch einen\nAlptraum in jeder Runde Schaden\nzugefügt, solang es schläft.", "El objetivo dormido sufre una pesadilla\nque le hace perder PS en cada turno.", "Il nemico addormentato ha un incubo e\nperde PS ad ogni turno.", "A sleeping target sees a nightmare\nthat inflicts some damage every turn.") },
            { PBEMove.FlameWheel, new PBELocalizedString("ほのおを　まとい\nあいてに　とっしんして　こうげきする。\nやけど　じょうたいに　することが　ある。", "불꽃을 둘러\n상대에게 돌진하여 공격한다.\n화상 상태로 만들 때가 있다.", "Le lanceur s'entoure de feu et charge\nl'ennemi. Peut aussi brûler l'ennemi.", "Feuer-Attacke, die das Ziel eventuell\nverbrennt.", "Ataca envuelto en fuego.\nPuede causar quemaduras.", "Chi la usa si copre di fuoco e carica\nil nemico. Può anche scottarlo.", "The user cloaks itself in fire and\ncharges at the target.\nIt may also leave the target with a burn.") },
            { PBEMove.Snore, new PBELocalizedString("じぶんが　ねている　ときに\nざつおんを　だして　こうげきする。　\nあいてを　ひるませる　ことが　ある。", "자신이 잠들어있을 때\n소음을 내어 공격한다.\n상대를 풀죽게 만들 때가 있다.", "Une attaque qui ne fonctionne que si le\nlanceur est endormi. Le boucan peut aussi\napeurer l'ennemi.", "Attacke nur im Schlaf möglich.\nZiel schreckt eventuell zurück.", "Fuerte ronquido que solo puede usarse\ndormido. Puede hacer retroceder\nal objetivo.", "Mossa da usare solo mentre si dorme.\nIl chiasso assordante può anche far\ntentennare il nemico.", "An attack that can be used only if the\nuser is asleep. The harsh noise may also\nmake the target flinch.") },
            { PBEMove.Curse, new PBELocalizedString("つかう　ポケモンが\nゴーストタイプと　それいがい　とでは\nこうかが　かわる。", "기술을 쓰는 포켓몬이\n고스트타입일 때와 그 이외의\n타입일 때는 효과가 다르다.", "Une capacité à l'effet différent selon que\nle lanceur est un Pokémon Spectre ou non.", "Attacke, deren Wirkung davon abhängt, ob\nder Anwender ein Geist-Pokémon ist.", "Un movimiento que tiene efectos\ndistintos si el usuario es de tipo\nFantasma o no.", "Una mossa che agisce in modo diverso\nse chi la usa è di tipo Spettro.", "A move that works differently for the\nGhost type than for all other types.") },
            { PBEMove.Flail, new PBELocalizedString("じたばた　あばれて　こうげきする。\nじぶんの　\xFF28\xFF30が　すくないほど\nわざの　いりょくは　あがる。", "바둥바둥 난동부려서 공격한다.\n자신의 HP가 적을수록\n기술의 위력이 올라간다.", "Le lanceur fait tournoyer son fléau.\nPlus ses PV sont bas, plus l'attaque\nest puissante.", "Attacke richtet mehr Schaden\nan, wenn eigene KP niedrig sind.", "Ataque frenético.\nCuantos menos PS tenga el usuario,\nmás daño produce.", "Chi la usa si dimena per attaccare. È più\nefficace se i suoi PS sono bassi.", "The user flails about aimlessly to attack.\nIt becomes more powerful the less HP\nthe user has.") },
            // { PBEMove.176, new PBELocalizedString("あいてが　さいごに　つかった　わざに\nていこう　できる　ように\nじぶんの　タイプを　へんか　させる。", "상대가 마지막으로 쓴 기술에\n저항할 수 있도록\n자신의 타입을 변화시킨다.", "Le lanceur change de type pour être\nrésistant au type de la dernière\nattaque lancée par sa cible.", "Anwender ändert Typ und wird gegen\nletzten Angriffstyp resistent.", "El usuario cambia de tipo para hacerse\nresistente al último tipo de movimiento\nusado por el objetivo.", "Chi la usa cambia tipo per rendersi\nresistente al tipo dell'ultima mossa\nusata dal bersaglio.", "The user changes its type to make itself\nresistant to the type of the attack the\nopponent used last.") },
            { PBEMove.Aeroblast, new PBELocalizedString("くうきの　うずを\nはっしゃして　こうげきする。\nきゅうしょに　あたりやすい。", "공기의 소용돌이를\n발사하여 공격한다.\n급소에 맞기 쉽다.", "Le lanceur projette une tornade sur\nl'ennemi pour infliger des dégâts. Taux\nde critiques élevé.", "Erzeugt Luftstrudel gegen das Ziel.\nHohe Volltrefferquote.", "Lanza un chorro de aire que suele dar\nun golpe crítico.", "Colpisce il nemico con un vortice d'aria\nper danneggiarlo. Probabile brutto colpo.", "A vortex of air is shot at the target to\ninflict damage.\nCritical hits land more easily.") },
            // { PBEMove.178, new PBELocalizedString("わたのような　フワフワの　ほうしを\nまとわり　つかせて\nあいての　すばやさを　がくっと　さげる。", "솜처럼 폭신폭신한 포자를\n착 달라붙게 해서\n상대의 스피드를 크게 떨어뜨린다.", "Le lanceur libère des spores cotonneuses\nqui collent à l'ennemi et baissent\nfortement sa Vitesse.", "Wattebäusche heften sich an das\nZiel. Der Initiative-Wert sinkt stark.", "Adhiere esporas al objetivo para reducir\nmucho su Velocidad.", "Rilascia spore simili al cotone che si\nattaccano al nemico e riducono di molto\nla sua Velocità.", "The user releases cotton-like spores\nthat cling to the target,\nharshly reducing its Speed stat.") },
            { PBEMove.Reversal, new PBELocalizedString("ちからを　ふりしぼり　こうげきする。\nじぶんの　\xFF28\xFF30が　すくないほど\nわざの　いりょくは　あがる。", "힘을 쥐어짜서 공격한다.\n자신의 HP가 적을수록\n기술의 위력이 올라간다.", "Le lanceur ne retient plus ses coups. Plus\nses PV sont bas et plus l'attaque est\npuissante.", "Richtet mehr Schaden an,\nwenn eigene KP niedrig sind.", "Ataque desesperado que causa\nmás daño cuantos menos PS\ntenga el usuario.", "Chi la usa attacca con tutte le sue forze.\nPiù i PS sono bassi, maggiore è la potenza\ndi questa mossa.", "An all-out attack that becomes more\npowerful the less HP the user has.") },
            // { PBEMove.180, new PBELocalizedString("あいてが　さいごに　つかった　わざに\nうらみを　いだいて\nそのわざの　\xFF30\xFF30を　\xFF14だけ　へらす。", "상대가 마지막으로\n사용한 기술에 원한을 품어\n그 기술의 PP를 4만큼 줄인다.", "Le lanceur exprime son ressentiment\nen retirant 4 PP de la dernière attaque\nde l'ennemi.", "AP der letzten Attacke des Zieles\nwerden um 4 gesenkt.", "Da rienda suelta a su rencor\npara reducir cuatro PP del último\nmovimiento usado por el objetivo.", "Chi la usa sfoga la propria rabbia\nsull'ultima mossa usata dal bersaglio\ne le sottrae quattro PP.", "The user unleashes its grudge on the move\nlast used by the target by cutting 4 PP\nfrom it.") },
            { PBEMove.PowderSnow, new PBELocalizedString("つめたい　こなゆきを\nあいてに　ふきつけて　こうげきする。\nこおり　じょうたいに　することが　ある。", "차가운 가랑눈을\n상대에게 내뿜어 공격한다.\n얼음 상태로 만들 때가 있다.", "Le lanceur projette de la neige\npoudreuse. Peut aussi geler l'ennemi.", "Angriff mit Schnee. Gegner wird\neventuell eingefroren.", "Lanza nieve que puede llegar\na congelar.", "Attacca i nemici con una raffica di neve\nfarinosa e può anche congelarli.", "The user attacks with a chilling gust\nof powdery snow.\nIt may also freeze the targets.") },
            { PBEMove.Protect, new PBELocalizedString("あいての　こうげきを\nまったく　うけない。\nれんぞくで　だすと　しっぱい　しやすい。", "상대의 공격을\n전혀 받지 않는다.\n연속으로 쓰면 실패하기 쉽다.", "Le lanceur esquive toutes les attaques.\nPlus la capacité est utilisée de fois à la\nsuite, plus elle risque d'échouer.", "Anwender weicht jeder Attacke aus.\nScheitert eventuell bei Wiederholung.", "Frena todos los ataques, pero puede\nfallar si se usa repetidamente.", "Permette di eludere tutti gli attacchi.\nSe usata in successione può fallire.", "It enables the user to evade all attacks.\nIts chance of failing rises if it is used in\nsuccession.") },
            { PBEMove.MachPunch, new PBELocalizedString("めにも　とまらぬ　ものすごい　はやさで\nパンチを　くりだす。\nかならず　せんせい　こうげき　できる。", "눈에 보이지 않는 굉장한 속도로\n펀치를 날린다.\n반드시 선제공격을 할 수 있다.", "Coup de poing fulgurant.\nFrappe en premier.", "Extrem schneller Hieb, der stets\nzuerst trifft.", "Puñetazo que se da rápido para golpear\nprimero.", "Chi la usa tira un pugno a velocità\nimpressionante e colpisce di sicuro\nper primo.", "The user throws a punch at blinding\nspeed. It is certain to strike first.") },
            { PBEMove.ScaryFace, new PBELocalizedString("おそろしい　かおで　にらみ　おびえさせて\nあいての　すばやさを　がくっと　さげる。\n", "무서운 얼굴로 노려보고 겁주어\n상대의 스피드를 크게 떨어뜨린다.", "Une grimace qui effraie l'ennemi et\nréduit fortement sa Vitesse.", "Jagt dem Ziel mit einer Grimasse\nAngst ein. Dessen Initiative-Wert\nsinkt stark.", "Asusta al objetivo para reducir mucho\nsu Velocidad.", "Chi la usa spaventa il nemico con una\nfaccia terribile e ne riduce di molto\nla Velocità.", "The user frightens the target with a scary\nface to harshly reduce its Speed stat.") },
            { PBEMove.FaintAttack, new PBELocalizedString("さりげなく　あいてに　ちかづき\nゆだんした　すきを　みて　なぐりつける。\nこうげきは　かならず　めいちゅう　する。", "슬금슬금 상대에게 다가가\n방심한 틈을 타서 세게 때린다.\n공격은 반드시 명중한다.", "Le lanceur s'approche l'air de rien avant\nde frapper par surprise. N'échoue jamais.", "Anwender nähert sich mit Unschuldsmiene\ndem Ziel und schlägt zu, sobald dieses\nunachtsam wird. Ein Treffer ist gewiss.", "Engaña al objetivo para acercarse\ny dar un puñetazo que no falla.", "Chi la usa si avvicina al nemico facendo\nfinta di niente, per poi scagliare un pugno\ninfallibile a tradimento.", "The user approaches the target\ndisarmingly, then throws a sucker punch.\nIt hits without fail.") },
            { PBEMove.SweetKiss, new PBELocalizedString("てんしのように　かわいく　キスして\nあいてを　こんらん　させる。\n", "천사처럼 귀엽게 키스하여\n상대를 혼란시킨다.", "Le lanceur envoie un bisou si mignon\net désarmant qu'il plonge l'ennemi dans\nla confusion.", "Anwender küsst Ziel, das durch\ndiese Niedlichkeit verwirrt wird.", "Da un beso con tal dulzura que\ncausa confusión.", "Chi la usa bacia il nemico con una dolcezza\nangelica, confondendolo.", "The user kisses the target with a sweet,\nangelic cuteness that causes confusion.") },
            // { PBEMove.187, new PBELocalizedString("じぶんの　\xFF28\xFF30を　さいだい　\xFF28\xFF30の\nはんぶん　へらして　じぶんの　こうげきを\nさいだいに　あげる。", "자신의 HP를 최대 HP의\n절반으로 감소시켜 자신의 공격을\n최대로 올린다.", "Améliore l'Attaque au maximum en\nsacrifiant la moitié des PV max.", "Der Anwender maximiert den Angriffs-Wert\nauf Kosten der Hälfte seiner maximalen KP.", "Reduce la mitad de los PS máximos\npara mejorar al máximo el Ataque.", "Chi la usa massimizza l'Attacco in cambio\ndi metà dei PS massimi.", "The user maximizes its Attack stat in\nexchange for HP equal to half its max HP.") },
            { PBEMove.SludgeBomb, new PBELocalizedString("きたない　ヘドロを\nあいてに　なげつけて　こうげきする。\nどく　じょうたいに　することが　ある。", "더러운 오물을\n상대에게 내던져서 공격한다.\n독 상태로 만들 때가 있다.", "Des détritus toxiques sont projetés sur\nl'ennemi. Peut aussi l'empoisonner.", "Wirft Schlamm auf das Ziel. Dieses wird\neventuell vergiftet.", "Arroja residuos al objetivo.\nPuede llegar a envenenar.", "Chi la usa attacca lanciando fango\nsul bersaglio. Può anche avvelenarlo.", "Unsanitary sludge is hurled at the target.\nIt may also poison the target.") },
            { PBEMove.MudSlap, new PBELocalizedString("あいての　かおなどに\nドロを　なげつけて　こうげきする。\nめいちゅうりつを　さげる。", "상대의 얼굴 등에\n진흙을 내던져서 공격한다.\n명중률을 떨어뜨린다.", "Le lanceur envoie de la boue au visage\nde l'ennemi pour infliger des dégâts\net baisser sa Précision.", "Schadet dem Ziel durch Matsch.\nDessen Genauigkeit sinkt.", "Echa lodo en la cara para bajar\nla Precisión.", "Chi la usa butta fango in faccia al nemico\nper arrecargli danni e ridurne\nla precisione.", "The user hurls mud in the target's face to\ninflict damage and lower its accuracy.") },
            { PBEMove.Octazooka, new PBELocalizedString("あいての　かおなどに\nすみを　ふきかけて　こうげきする。\nめいちゅうりつを　さげることが　ある。", "상대의 얼굴 등에\n먹물을 내뿜어 공격한다.\n명중률을 떨어뜨릴 때가 있다.", "Le lanceur attaque en projetant de\nl'encre au visage de l'ennemi. Peut aussi\nbaisser la Précision de l'ennemi.", "Schießt mit Tinte, um Schaden anzurichten\nund die Genauigkeit zu senken.", "Dispara tinta a la cara.\nPuede bajar la Precisión.", "Chi la usa spruzza inchiostro in faccia al\nnemico. Può anche ridurne la precisione.", "The user attacks by spraying ink in the\ntarget's face or eyes.\nIt may also lower the target's accuracy.") },
            { PBEMove.Spikes, new PBELocalizedString("あいての　あしもとに　まきびしを\nしかける。こうたいで　でてきた　あいての\nポケモンに　ダメージを　あたえる。", "상대의 발밑에 압정을\n뿌린다. 교체된 상대\n포켓몬에게 데미지를 준다.", "Le lanceur disperse des piquants sur le\nsol pour blesser tout ennemi qui entre\nau combat.", "Der Anwender verteilt Stacheln, die\ngegnerische Pokémon verletzen,\ndie in den Kampf gerufen werden.", "Esparce púas en el equipo rival.\nLas púas hieren a los Pokémon\nrivales que entran en combate.", "Chi la usa piazza sul terreno una trappola\ndi punte che danneggia i nemici quando\nscendono in campo.", "The user lays a trap of spikes at the\nopposing team's feet. The trap hurts\nPokémon that switch into battle.") },
            { PBEMove.ZapCannon, new PBELocalizedString("たいほうの　ような\nでんきを　はっしゃして　こうげきする。\nあいてを　まひの　じょうたいに　する。", "대포처럼\n전기를 발사해서 공격한다.\n상대를 마비 상태로 만든다.", "Un boulet de canon électrifié qui inflige\ndes dégâts et paralyse l'ennemi.", "Kanonenähnlicher Elektro-Schuss,\nder schadet und paralysiert.", "Dispara una descarga eléctrica que causa\ndaño y parálisis.", "Chi la usa provoca un'esplosione elettrica\nche infligge danni e paralizza il nemico.", "The user fires an electric blast like a\ncannon to inflict damage and\ncause paralysis.") },
            // { PBEMove.193, new PBELocalizedString("ゴーストタイプに　こうかがない　わざや\nかいひりつの　たかい　あいてに\nこうげきが　あたるように　なる。", "고스트타입에 효과가 없는 기술이나\n회피율이 높은 상대라 할지라도\n공격이 맞게 된다.", "Permet de toucher un Pokémon Spectre\navec n'importe quelle capacité et de\ntoucher un ennemi insaisissable.", "Erlaubt es, Geist-Pokémon mit Normal-\nund Kampf-Attacken anzugreifen.\nIgnoriert den Fluchtwert des Zieles.", "Permite atacar con cualquier movimiento\na objetivos de tipo Fantasma y golpear\na Pokémon evasivos.", "Chi la usa rende i Pokémon di tipo Spettro\nvulnerabili a qualsiasi tipo di mossa e può,\ninoltre, colpire i nemici sfuggenti.", "Enables a Ghost-type target to be hit by\nNormal- and Fighting-type attacks. It also\nenables an evasive target to be hit.") },
            // { PBEMove.194, new PBELocalizedString("わざを　だしたあと　こうげきを　うけて\nひんしに　なったとき\nこうげき　あいても　ひんしに　する。", "기술을 쓴 뒤 공격을 받아\n기절했을 때\n길동무의 대상도 기절하게 한다.", "Quand cette capacité est activée,\nelle met K.O. un ennemi qui porte\nun coup fatal au lanceur.", "Wird der Anwender nach Einsatz dieser\nAttacke besiegt, führt dies auch\nbeim Gegner zum K.O.", "Si el usuario se debilita por un ataque\nrival antes de usar otro movimiento,\nel Pokémon rival se debilitará también.", "Se chi la usa va KO prima del proprio turno,\nchi ha sferrato il colpo da KO fa la stessa\nfine.", "When this move is used, if the user faints,\nthe Pokémon that landed the knockout\nhit also faints.") },
            // { PBEMove.195, new PBELocalizedString("うたを　きいた　ポケモンは\n\xFF13ターン　たつと　ひんしに　なる。\nこうたいすると　こうかは　なくなる。", "노래를 들은 포켓몬은\n3턴이 지나면 기절한다.\n교체되면 효과가 없어진다.", "Tout Pokémon qui entend ce requiem\nest K.O. dans 3 tours à moins qu'il\nne quitte le combat.", "Wer diese Musik hört, wird nach drei\nRunden besiegt. Rettung ist durch\nEintausch eines neuen Pokémon möglich.", "Si un Pokémon escucha este canto\ny no es cambiado por otro en\ntres turnos, acaba debilitándose.", "Ogni Pokémon che sente questo canto va\nKO in tre turni, se non lo si sostituisce.", "Any Pokémon that hears this song\nfaints in three turns, unless it switches\nout of battle.") },
            { PBEMove.IcyWind, new PBELocalizedString("つめたい　れいきを\nあいてに　ふきつけて　こうげきする。\nあいての　すばやさを　さげる。", "차가운 냉기를\n상대에게 내뿜어 공격한다.\n상대의 스피드를 떨어뜨린다.", "Une bourrasque de vent froid blesse\nl'ennemi. Réduit aussi sa Vitesse.", "Eis-Attacke, die dem Gegner Schaden\nzufügt und seinen Initiative-Wert senkt.", "Ataque con aire helado que baja\nla Velocidad del objetivo.", "Chi la usa attacca i nemici con una folata\ndi aria gelida e ne riduce anche\nla Velocità.", "The user attacks with a gust of\nchilled air. It also reduces the targets'\nSpeed stat.") },
            { PBEMove.Detect, new PBELocalizedString("あいての　こうげきを\nまったく　うけない。\nれんぞくで　だすと　しっぱい　しやすい。", "상대의 공격을\n전혀 받지 않는다.\n연속으로 쓰면 실패하기 쉽다.", "Le lanceur esquive toutes les attaques.\nPlus la capacité est utilisée de fois à la\nsuite, plus elle risque d'échouer.", "Anwender weicht jeder Attacke aus.\nScheitert eventuell bei Wiederholung.", "Frena todos los ataques, pero puede\nfallar si se usa repetidamente.", "Permette di eludere tutti gli attacchi.\nSe usata in successione può fallire.", "It enables the user to evade all attacks.\nIts chance of failing rises if it is used\nin succession.") },
            // { PBEMove.198, new PBELocalizedString("かたい　ホネで\nあいてを　なぐりつけて　こうげきする。\n\xFF12ー\xFF15かいの　あいだ　れんぞくで　だす。", "단단한 뼈로\n상대를 세게 때려서 공격한다.\n2-5회 동안 연속으로 쓴다.", "Le lanceur frappe l'ennemi\n2 à 5 fois avec un os.", "Greift Ziel 2- bis 5-mal in Folge mit\neinem harten Knochen an.", "Hueso en ristre, aporrea al objetivo\nde dos a cinco veces.", "Chi la usa colpisce il nemico con un osso\nda due a cinque volte di fila.", "The user strikes the target with a hard\nbone two to five times in a row.") },
            // { PBEMove.199, new PBELocalizedString("しょうじゅんを　しっかり　あわせて\nつぎの　こうげきが　かならず　\nあいてに　あたるように　する。", "조준을 잘 맞춰\n다음 공격이 반드시\n상대에게 명중하도록 한다.", "Verrouille l'ennemi pour ne\npas le rater au tour suivant.", "Visiert das Ziel an und trifft in der\nnächsten Runde garantiert.", "Fija el blanco para que el siguiente\nataque no falle.", "Chi la usa punta il nemico con precisione.\nLa mossa successiva andrà a segno.", "The user takes sure aim at the target.\nIt ensures the next attack does not fail\nto hit the target.") },
            // { PBEMove.200, new PBELocalizedString("\xFF12ー\xFF13ターンの　あいだ\nあばれまくって　こうげきする。\nあばれた　あとは　こんらん　する。", "2-3턴 동안\n마구 난동부려서 공격한다.\n난동부린 뒤에는 혼란에 빠진다.", "Le lanceur laisse éclater sa rage et\nattaque pendant 2 à 3 tours avant de\ncéder à la confusion.", "Attacke über 2 bis 3 Runden,\ndie den Angreifer verwirrt.", "Ataca de dos a tres turnos y acaba\nconfundiendo al agresor.", "Chi la usa sfoga la sua ira e attacca\nil nemico per due o tre turni prima di\nessere lasciato in preda alla confusione.", "The user rampages and attacks for two\nto three turns.\nIt then becomes confused, however.") },
            { PBEMove.Sandstorm, new PBELocalizedString("\xFF15ターンの　あいだ　すなあらしで\nいわ　じめん　はがねタイプ　いがいの\nポケモンに　ダメージを　あたえる。", "5턴 동안 모래바람으로\n바위, 땅, 강철타입 이외의\n포켓몬에게 데미지를 준다.", "Une tempête de sable de 5 tours\nqui blesse tous les Pokémon sauf\nles types Roche, Sol et Acier.", "Sandsturm für fünf Runden. Fügt Pokémon\nvon jedem Typ außer Gestein, Boden und\nStahl Schaden zu.", "Tormenta de arena que dura cinco\nturnos y hiere a todos, excepto\na los de tipo Roca, Tierra y Acero.", "Causa una tempesta di sabbia per cinque\nturni che danneggia tutti i tipi in campo\nesclusi Terra, Roccia e Acciaio.", "A five-turn sandstorm is summoned\nto hurt all combatants except the\nRock, Ground, and Steel types.") },
            { PBEMove.GigaDrain, new PBELocalizedString("ようぶんを　すいとり　こうげきする。\nあたえた　ダメージの\nはんぶんの　\xFF28\xFF30を　かいふく　できる。", "양분을 흡수하여 공격한다.\n입힌 데미지의 절반에 해당하는\nHP를 회복할 수 있다.", "Une attaque qui convertit la moitié\ndes dégâts infligés en PV.", "Das Ziel wird angegriffen und die\nHälfte des zugefügten Schadens\ndem Angreifer als KP gutgeschrieben.", "Un ataque que absorbe nutrientes.\nQuien lo usa recupera la mitad de\nlos PS del daño que produce.", "Mossa che assorbe PS. Chi la usa recupera\nuna quantità di PS pari alla metà del danno\ninferto.", "A nutrient-draining attack. The user's\nHP is restored by half the damage\ntaken by the target.") },
            // { PBEMove.203, new PBELocalizedString("こうげきを　うけても\n\xFF28\xFF30を　かならず　\xFF11だけ　のこせる。\nれんぞくで　だすと　しっぱい　しやすい。", "공격을 받아도\nHP를 반드시 1만큼은 남긴다.\n연속으로 쓰면 실패하기 쉽다.", "Le lanceur résiste aux attaques avec\n1 PV. Peut échouer si utilisée plusieurs\nfois de suite.", "Nach fatalen Attacken bleibt stets\n1 KP übrig. Misserfolg bei Wiederholung\nmöglich.", "Resiste cualquier ataque y deja\nal menos un PS. Puede fallar\nsi se usa repetidamente.", "Chi la usa resta con un PS anche se\nsubisce un colpo da KO in quel turno.\nUsata in successione può fallire.", "The user endures any attack with at least\n1 HP. Its chance of failing rises if it is\nused in succession.") },
            { PBEMove.Charm, new PBELocalizedString("かわいく　みつめて　ゆだんを　さそい\nあいての　こうげきを　がくっと　さげる。\n", "귀엽게 바라보고 방심을 유도하여\n상대의 공격을 크게 떨어뜨린다.", "Le lanceur fait les yeux doux\npour berner l'ennemi et réduire\nconsidérablement son Attaque.", "Betört das Ziel und reduziert\ndessen Angriff stark.", "Engatusa al objetivo y reduce bastante\nsu Ataque.", "Ammalia il nemico con lo sguardo per\nrenderlo meno cauto. Ne riduce molto\nl'Attacco.", "The user gazes at the target rather\ncharmingly, making it less wary.\nThe target's Attack is harshly lowered.") },
            // { PBEMove.205, new PBELocalizedString("\xFF15ターンの　あいだ　ころがりつづけて\nこうげきする。わざが　あたる　たびに\nいりょくが　あがる。", "5턴 동안 구르기를 반복하여\n공격한다. 기술이 맞을 때마다\n위력이 올라간다.", "Un rocher roule sur l'ennemi pendant 5\ntours. L'attaque gagne en puissance\nà chaque coup.", "Attacke, die fünf Runden dauert.\nDie Härte nimmt von Mal zu Mal zu.", "El atacante rueda contra el objetivo\ndurante cinco turnos, cada vez\ncon mayor fuerza.", "Chi la usa colpisce il nemico rotolando\nper cinque turni, con aumento progressivo\ndella potenza ogni volta che va a segno.", "The user continually rolls into the target\nover five turns. It becomes stronger\neach time it hits.") },
            // { PBEMove.206, new PBELocalizedString("あいての　\xFF28\xFF30が　\nかならず　\xFF11だけ　のこる　ように\nてかげん　して　こうげきする。", "상대의 HP가\n반드시 1만큼 남도록\n조절하여 공격한다.", "Le lanceur retient ses coups pour\nque l'ennemi garde au moins 1 PV et\nne tombe pas K.O.", "Ein Angriff, der dem Ziel\nzumindest 1 KP lässt.", "Ataque moderado que no debilita\nal objetivo y le deja al menos un PS.", "Chi la usa trattiene il colpo per impedire\nal nemico di andare KO, lasciandolo con\nalmeno un PS.", "A restrained attack that prevents the\ntarget from fainting.\nThe target is left with at least 1 HP.") },
            { PBEMove.Swagger, new PBELocalizedString("あいてを　おこらせて　こんらん　させる。\nいかりで　あいての　こうげきは\nぐーんと　あがってしまう。", "상대를 화내게 해서 혼란시킨다.\n분노로 상대의 공격은\n크게 올라가 버린다.", "Fait enrager la cible et la plonge dans\nla confusion, mais augmente fortement\nson Attaque.", "Verwirrt das Ziel und erhöht\ndessen Angriffs-Wert stark.", "Provoca confusión en el objetivo,\npero también sube mucho su Ataque.", "Chi la usa provoca il bersaglio e lo\nconfonde, facendo aumentare però\ndi molto il suo Attacco.", "The user enrages and confuses the target.\nHowever, it also sharply raises the\ntarget's Attack stat.") },
            { PBEMove.MilkDrink, new PBELocalizedString("さいだい　\xFF28\xFF30の　はんぶん\nじぶんの　\xFF28\xFF30を　かいふく　する。\nなかまに　\xFF28\xFF30を　わけることも　できる。", "자신의 최대 HP 절반을\n회복한다. 동료의 HP를\n회복시킬 수도 있다.", "Le lanceur récupère jusqu'à la moitié de\nses PV max. En dehors des combats, permet\nde transférer des PV du lanceur à un allié.", "KP des Anwenders werden um 50 % der\nmaximalen KP aufgefüllt. Heilung eines Ver-\nbündeten außerhalb von Kämpfen möglich.", "Restaura la mitad de los PS máximos del\nusuario. Fuera de combate se usa para\ntransferir parte de sus PS a un aliado.", "Chi la usa recupera metà dei propri PS\nmassimi. Fuori dalla lotta può anche far\ntrasferire PS ai propri compagni.", "The user restores its own HP\nby up to half of its maximum HP.\nMay also be used in the field to heal HP.") },
            { PBEMove.Spark, new PBELocalizedString("でんきを　まとい\nあいてに　とっしんして　こうげきする。\nまひ　じょうたいに　することが　ある。", "전기를 둘러\n상대에게 돌진하여 공격한다.\n마비 상태로 만들 때가 있다.", "Lance une charge électrique sur\nl'ennemi. Peut aussi le paralyser.", "Elektro-Hieb, der das Ziel\nparalysieren kann.", "Ataque eléctrico que puede llegar\na paralizar.", "Colpisce il nemico con una carica elettrica\ne può anche paralizzarlo.", "The user throws an electrically charged\ntackle at the target. It may also leave\nthe target with paralysis.") },
            // { PBEMove.210, new PBELocalizedString("カマや　ツメ　などで　あいてを\nきりつけて　こうげきする。れんぞくで\nあてると　いりょくが　あがる。", "낫이나 발톱 등으로 상대를\n베어 공격한다.\n연속으로 맞히면 위력이 올라간다.", "Un coup de faux ou de griffe dont\nla force augmente quand il touche\nplusieurs fois d'affilée.", "Eine Attacke mit Scheren oder Klauen,\nderen Härte bei aufeinanderfolgenden\nTreffern zunimmt.", "Ataque con garras o guadaña que crece\nen intensidad si se usa repetidas veces.", "Colpisce il nemico con falci o artigli. Se\nusata in successione aumenta di potenza\nogni volta che va a segno.", "The target is slashed with scythes or\nclaws. Its power increases if it hits\nin succession.") },
            { PBEMove.SteelWing, new PBELocalizedString("かたい　つばさを　あいてに　たたきつけて\nこうげきする。じぶんの　ぼうぎょが\nあがることが　ある。", "단단한 날개를 상대에게 부딪쳐서\n공격한다. 자신의 방어가\n올라갈 때가 있다.", "Le lanceur frappe l'ennemi avec des\nailes d'acier. Peut aussi augmenter\nla Défense du lanceur.", "Trifft das Ziel mit Stahlflügeln.\nVerteidigungs-Wert des Anwenders\nsteigt eventuell.", "Alas macizas que golpean al objetivo\ny pueden subir la Defensa\ndel usuario.", "Colpisce il nemico con ali d'acciaio. Può\nanche aumentare la Difesa di chi la usa.", "The target is hit with wings of steel.\nIt may also raise the user's Defense stat.") },
            // { PBEMove.212, new PBELocalizedString("すいこまれる　ような　くろい　まなざしで\nじっと　みつめて　あいてを\nせんとうから　にげられなく　する。", "빨려들어갈 것 같은 까만 눈빛으로\n가만히 응시하여 상대를\n배틀에서 도망갈 수 없게 한다.", "Le lanceur pétrifie l'ennemi en lui lançant\nun regard noir. Il devient incapable de\ns'enfuir.", "Böser Blick, der die Flucht des\nZieles vereitelt.", "Mal de ojo que impide al objetivo huir\nde la batalla.", "Chi la usa blocca il nemico con uno sguardo\noscuro e ammaliante, impedendogli la fuga.", "The user pins the target with a dark,\narresting look.\nThe target becomes unable to flee.") },
            // { PBEMove.213, new PBELocalizedString("♂なら♀を　♀なら♂を　ゆうわくして\nメロメロに　する。\nあいては　わざが　だしにくく　なる。", "수컷은 암컷을 암컷은 수컷을 유혹하여\n헤롱헤롱하게 만든다.\n상대가 기술을 쓰기 어려워진다.", "Si l'ennemi est du sexe opposé, il tombe\namoureux et rechigne alors à attaquer.", "Angriff auf Anwender vom anderen\nGeschlecht wird unwahrscheinlich.", "Si el objetivo es del sexo opuesto,\nse enamorará y bajará la posibilidad\nde que ataque.", "Se il nemico è del sesso opposto, s'infatua\ne attacca con meno probabilità.", "If it is the opposite gender of the user,\nthe target becomes infatuated and less\nlikely to attack.") },
            // { PBEMove.214, new PBELocalizedString("じぶんが　おぼえている　わざの　うち\nどれか　\xFF11つを　くりだす。\nじぶんが　ねている　ときだけ　つかえる。", "자신이 배운 기술 중\n하나를 무작위로 날린다.\n자신이 잠들어 있을 때만 쓸 수 있다.", "Le lanceur utilise un de ses coups\nau hasard pendant qu'il dort.", "Anwender setzt per Zufall eine ihm\nbekannte Attacke im Schlaf ein.", "Mientras duerme, usa uno de sus\nmovimientos elegido al azar.", "Chi la usa sfodera a caso una delle proprie\nmosse mentre sta dormendo.", "While it is asleep, the user randomly uses\none of the moves it knows.") },
            // { PBEMove.215, new PBELocalizedString("ここちよい　すずの　ねいろを　きかせて\nみかた　ぜんいんの\nじょうたい　いじょうを　かいふく　する。", "기분 좋은 방울소리를\n들려주어 같은 편 전원의\n상태 이상을 회복한다.", "Carillon apaisant qui soigne les problèmes\nde statut de tous les Pokémon de l'équipe.", "Läutet beruhigend und heilt alle\nStatusprobleme im Team.", "Tañido que cura los problemas de estado\nde todos los Pokémon del equipo.", "Chi la usa produce uno scampanellio che\nrisolve i problemi di stato dei Pokémon\ndi tutta la squadra.", "The user makes a soothing bell chime\nto heal the status problems of all the\nparty Pokémon.") },
            { PBEMove.Return, new PBELocalizedString("トレーナーの　ために　ぜんりょくで\nあいてを　こうげきする。\nなついて　いるほど　いりょくは　あがる。", "트레이너를 위해 전력으로\n상대를 공격한다.\n친밀할수록 위력이 올라간다.", "Une attaque furieuse dont la puissance\naugmente quand le Pokémon apprécie\nson Dresseur.", "Angriff, dessen Kraft bei Freundschaft\nzum Trainer größer wird.", "Cuanto mayor sea la amistad con el\nEntrenador, más poderoso será\neste ataque.", "Mossa che diventa tanto più potente\nquanto maggiore è il grado di affezione\ndel Pokémon per il proprio Allenatore.", "A full-power attack that grows more\npowerful the more the user likes\nits Trainer.") },
            // { PBEMove.217, new PBELocalizedString("わなを　しかけた　はこを\nあいてに　わたして　こうげきする。\xFF28\xFF30が\nかいふくして　しまうことも　ある。", "덫을 설치한 상자를\n상대에게 건네어 공격한다.\nHP가 회복해버릴 때도 있다.", "Le lanceur attaque en offrant un cadeau\npiégé à la cible. Peut à l'inverse\nrestaurer certains de ses PV.", "Eine Bombe als Geschenk. Kann auch\nKP des Zieles wiederherstellen.", "Quien lo usa ataca al objetivo dándole\nun regalo con bomba trampa.\nSin embargo, a veces restaura sus PS.", "Chi la usa dà un regalo bomba al bersaglio.\nA volte, però, può fargli recuperare PS.", "The user attacks by giving the target a\ngift with a hidden trap. It restores\nHP sometimes, however.") },
            { PBEMove.Frustration, new PBELocalizedString("ふまんを　はらすため　ぜんりょくで\nあいてを　こうげきする。なついて\nいないほど　いりょくは　あがる。", "불만을 풀기 위해 전력으로\n상대를 공격한다.\n친밀하지 않을수록 위력이 올라간다.", "Moins le Pokémon aime son Dresseur, plus\ncette attaque est puissante.", "Die Attacke wird stärker, je weniger der\nAnwender seinen Trainer mag.", "Cuanto menor sea la amistad con el\nEntrenador, más poderoso será\neste ataque.", "Mossa che diventa tanto più potente\nquanto minore è il grado di affezione\ndel Pokémon per il proprio Allenatore.", "A full-power attack that grows more\npowerful the less the user likes\nits Trainer.") },
            // { PBEMove.219, new PBELocalizedString("\xFF15ターンの　あいだ\nふしぎな　ちからに　まもられて\nじょうたい　いじょうに　ならなくなる。", "5턴 동안\n이상한 힘의 보호를 받아\n상태 이상이 되지 않는다.", "Champ protecteur empêchant tous les\nproblèmes de statut pendant 5 tours.", "Team des Anwenders ist fünf Runden\nvor Statusproblemen geschützt.", "Crea un campo protector que evita\nproblemas de estado durante cinco turnos.", "Chi la usa crea un campo protettivo che\ndifende tutta la squadra dai problemi di\nstato per cinque turni.", "The user creates a protective field that\nprevents status problems for five turns.") },
            { PBEMove.PainSplit, new PBELocalizedString("じぶんの　\xFF28\xFF30と　あいての　\xFF28\xFF30を\nあわせて　それを　じぶんと　あいてで\nなかよく　わける。", "자신의 HP와 상대의 HP를\n합친 것을 자신과 상대가\n사이좋게 나눈다.", "Le lanceur ajoute ses PV à ceux de\nsa cible et les répartit équitablement.", "Addiert KP von Anwender und\nZiel. Teilt sie gerecht auf.", "Suma los PS del usuario a los del objetivo\ny los reparte a partes iguales.", "Chi la usa somma i propri PS a quelli\ndi un altro Pokémon per poi dividerli\nin parti uguali.", "The user adds its HP to the target's HP,\nthen equally shares the combined HP\nwith the target.") },
            { PBEMove.SacredFire, new PBELocalizedString("しんぴの　ほのおで\nあいてを　やきつくして　こうげきする。\nやけど　じょうたいに　することが　ある。", "신비한 불꽃으로\n상대를 태워서 공격한다.\n화상 상태로 만들 때가 있다.", "Un feu mystique d'une intensité\nredoutable attaque l'ennemi.\nPeut aussi le brûler.", "Mystische Feuer-Attacke, durch die\ndas Ziel eventuell Verbrennungen\nerleidet.", "Fuego místico de gran intensidad\nque puede causar quemaduras.", "Colpisce il nemico con un fuoco mistico di\nenorme intensità che può anche causargli\nuna scottatura.", "The target is razed with a mystical fire\nof great intensity. It may also leave the\ntarget with a burn.") },
            { PBEMove.Magnitude, new PBELocalizedString("じめんを　ゆらして　じぶんの\nまわりに　いるものを　こうげきする。\nわざの　いりょくは　いろいろ　かわる。", "땅을 흔들어서 자신의\n주위에 있는 포켓몬을 공격한다.\n기술의 위력이 여러모로 바뀐다.", "Un tremblement de terre d'intensité\nvariable qui affecte tous les Pokémon\nalentour. L'efficacité varie.", "Erdbebenartiger Angriff von zufälliger\nStärke gegen andere Pokémon in der\nUmgebung des Anwenders.", "Sacudida sísmica de intensidad\nvariable que afecta a los Pokémon\nadyacentes en combate.", "Chi la usa scatena un terremoto\nd'intensità variabile che danneggia\ngli altri Pokémon in campo.", "The user looses a ground-shaking quake\naffecting everyone around the user.\nIts power varies.") },
            { PBEMove.DynamicPunch, new PBELocalizedString("こんしんの　ちからで\nパンチを　くりだして　こうげきする。\nあいてを　かならず　こんらん　させる。", "혼신의 힘으로\n펀치를 날려서 공격한다.\n상대를 반드시 혼란시킨다.", "Le lanceur rassemble ses forces et\nenvoie un coup de poing à l'ennemi.\nS'il est touché, il est confus.", "Kräftiger Schlag, der das Ziel\nbei Erfolg verwirrt.", "Puñetazo con toda la fuerza concentrada.\nCausa confusión si atina.", "Colpisce il nemico con un pugno davvero\nforte. Se va a segno, lo confonde.", "The user punches the target with full,\nconcentrated power.\nIt confuses the target if it hits.") },
            { PBEMove.Megahorn, new PBELocalizedString("かたくて　りっぱな　つので　おもいっきり\nあいてを　つきさして　こうげきする。\n", "단단하고 훌륭한 뿔로 마음껏\n상대를 꿰찔러서 공격한다.", "Le lanceur utilise ses gigantesques\ncornes pour charger l'ennemi.", "Brutaler Ramm-Angriff mit spitzem,\nbeeindruckendem Horn.", "Violenta embestida con cuernos\nimponentes.", "Chi la usa utilizza il suo robusto e\nimponente corno per colpire il nemico\ncon tutto se stesso.", "Using its tough and impressive horn,\nthe user rams into the target\nwith no letup.") },
            { PBEMove.DragonBreath, new PBELocalizedString("ものすごい　いきを\nあいてに　ふきつけて　こうげきする。\nまひ　じょうたいに　することが　ある。", "굉장한 숨결을\n상대에게 내뿜어 공격한다.\n마비 상태로 만들 때가 있다.", "Le lanceur souffle fort sur l'ennemi pour\ninfliger des dégâts. Peut aussi le\nparalyser.", "Fegt das Ziel mit zerstörerisch\nheißem Atem weg. Paralysiert\ndas Ziel eventuell.", "Poderosa ráfaga de aliento que golpea\nal objetivo y puede paralizarlo.", "Investe il nemico con una raffica\npotentissima che arreca danni.\nPuò anche paralizzarlo.", "The user exhales a mighty gust that\ninflicts damage. It may also leave the\ntarget with paralysis.") },
            // { PBEMove.226, new PBELocalizedString("ひかえの　ポケモンと　いれかわる。\nのうりょく　へんかは　かわった\nポケモンが　そのまま　うけつぐ。", "교대 포켓몬과 바뀐다.\n능력 변화는 바뀐 포켓몬이\n그대로 이어받는다.", "Le lanceur échange sa place et tout\nchangement de stat avec un Pokémon\nde l'équipe.", "Tauscht Pokémon aus. Alle\nStatusveränderungen\nbleiben bestehen.", "Cambia el puesto con un compañero y le\npasa los cambios de características.", "Chi la usa è sostituito da un Pokémon\ndella squadra, che eredita anche ogni\nmodifica alle statistiche.", "The user switches places with a party\nPokémon in waiting, passing along any\nstat changes.") },
            // { PBEMove.227, new PBELocalizedString("あいてが　さいごに　つかった　わざを\n\xFF13ターンの　あいだ\nずっと　ださせる。", "상대가 마지막으로 사용한\n기술을 3턴 동안\n계속 쓰게 한다.", "Oblige l'ennemi à répéter la dernière\ncapacité utilisée durant 3 tours.", "Das Ziel wiederholt letzte Attacke drei\nRunden lang.", "El objetivo repite su último movimiento\ndurante tres turnos.", "Chi la usa obbliga per tre turni il nemico a\nripetere l'ultima mossa eseguita.", "The user compels the target\nto keep using only the move\nit last used for three turns.") },
            // { PBEMove.228, new PBELocalizedString("あいて　ポケモンが　いれかわる　ときに\nわざを　だしていると\nばいの　いりょくで　こうげき　できる。", "상대 포켓몬이 교체될 때\n기술을 쓰면 2배의 위력으로\n공격할 수 있다.", "Une attaque qui inflige deux fois plus de\ndégâts à un ennemi qui quitte le combat.", "Die Attacke richtet beim Ziel doppelten\nSchaden an, falls es ausgetauscht wird.", "Hace el doble de daño al objetivo que pide\nel relevo.", "Una mossa d'attacco che infligge un danno\ndoppio se il nemico è in fase di\nsostituzione.", "An attack move that inflicts double damage\nif used on a target that is switching out\nof battle.") },
            // { PBEMove.229, new PBELocalizedString("かいてんして　あいてを　こうげきする。\nしめつける　まきつく　やどりぎのタネ\nまきびし　なども　ふきとばせる。", "회전해서 상대를 공격한다.\n조이기, 김밥말이, 씨뿌리기,\n압정뿌리기 등도 날려버린다.", "Une attaque tournoyante pouvant aussi\nannuler par ex. Étreinte, Ligotage,\nVampigraine ou Picots.", "Trifft das Ziel mit einer Dreh-Attacke.\nBefreit sich unter anderem von Wickel,\nKlammergriff, Egelsamen und Stachler.", "Ataque giratorio que puede eliminar\nmovimientos como Atadura,\nRepetición, Drenadoras y Púas.", "Attacco rotante che elimina gli effetti di\nmosse come Legatutto, Avvolgibotta, Punte\ne Parassiseme.", "A spin attack that can also eliminate\nsuch moves as Bind, Wrap, Leech Seed,\nand Spikes.") },
            { PBEMove.SweetScent, new PBELocalizedString("かおりで　あいての　かいひりつを\nさげる。くさむら　などで　つかうと\nポケモンが　よってくる。", "향기로 상대의 회피율을 떨어뜨린다.\n풀밭 등에서 쓰면\n포켓몬이 다가온다.", "Un doux parfum qui réduit l'Esquive\nde l'ennemi. Attire aussi\nles Pokémon sauvages.", "Lockt Gegner an und senkt deren\nFluchtwert. Lockt im Gras auch\nwilde Pokémon an.", "Engatusa al objetivo para reducir\nsu Evasión. En la hierba alta sirve\npara atraer Pokémon salvajes.", "Un dolce profumo che riduce l'elusione dei\nnemici. Fuori dalla lotta attira i Pokémon\nselvatici.", "A sweet scent that lowers the opposing\nteam's evasiveness. It also lures wild\nPokémon if used in grass, etc.") },
            { PBEMove.IronTail, new PBELocalizedString("かたい　しっぽで　あいてを　たたきつけて\nこうげきする。あいての　ぼうぎょを\nさげることが　ある。", "단단한 꼬리로\n상대를 힘껏 쳐서 공격한다.\n상대의 방어를 떨어뜨릴 때가 있다.", "Attaque l'ennemi avec une queue de fer.\nPeut aussi baisser la Défense de l'ennemi.", "Attacke mit hartem Eisenschweif.\nSenkt eventuell den Verteidigungs-Wert\ndes Zieles.", "Ataca con una cola férrea y puede bajar\nla Defensa del objetivo.", "Il nemico viene colpito da una robusta\ncoda d'acciaio. Può anche ridurne\nla Difesa.", "The target is slammed with a steel-hard\ntail. It may also lower the target's\nDefense stat.") },
            { PBEMove.MetalClaw, new PBELocalizedString("こうてつの　ツメで　あいてを　きりさいて\nこうげきする。じぶんの　こうげきが\nあがることが　ある。", "강철의 발톱으로\n상대를 베어 갈라 공격한다.\n자신의 공격이 올라갈 때도 있다.", "Attaque avec des griffes d'acier. Peut\naussi augmenter l'Attaque du lanceur.", "Klauen-Attacke, die eventuell den\nAngriffs-Wert des Anwenders erhöht.", "Ataque con garras de acero que puede\naumentar el Ataque del usuario.", "Colpisce il nemico con artigli d'acciaio.\nPuò anche aumentare l'Attacco di chi\nla usa.", "The target is raked with steel claws.\nIt may also raise the user's Attack stat.") },
            { PBEMove.VitalThrow, new PBELocalizedString("あいてより　あとに　こうげきする。\nそのかわり　じぶんの　こうげきは\nかならず　めいちゅうする。", "상대보다 나중에 공격한다.\n그 대신 자신의 공격은\n반드시 명중한다.", "Le lanceur porte son coup en\ndernier. En échange, cette\ncapacité n'échoue jamais.", "Anwender greift als Letzter an, hat dafür\naber eine Treffergarantie beim eigenen\nAngriff.", "El usuario ataca el último,\npero no falla.", "Chi la usa attacca per ultimo, ma il colpo\nè sempre infallibile.", "The user attacks last.\nIn return, this throw move is\nguaranteed not to miss.") },
            { PBEMove.MorningSun, new PBELocalizedString("じぶんの　\xFF28\xFF30を　かいふく　する。\nてんきに　よって\nかいふくの　りょうが　へんか　する。", "자신의 HP를 회복한다.\n날씨에 따라\n회복량이 변한다.", "Un soin qui restaure des PV au lanceur.\nSon efficacité varie en fonction de la\nmétéo.", "Füllt KP des Anwenders auf.\nDie Menge hängt vom Wetter ab.", "Restaura PS del usuario.\nLa cantidad varía según\nel tiempo que haga.", "Chi la usa recupera PS. Il numero di PS\nrecuperati dipende dalle condizioni\natmosferiche.", "The user restores its own HP.\nThe amount of HP regained varies\nwith the weather.") },
            { PBEMove.Synthesis, new PBELocalizedString("じぶんの　\xFF28\xFF30を　かいふく　する。\nてんきに　よって\nかいふくの　りょうが　へんか　する。", "자신의 HP를 회복한다.\n날씨에 따라\n회복량이 변한다.", "Un soin qui restaure des PV au lanceur.\nSon efficacité varie en fonction de la\nmétéo.", "Füllt KP des Anwenders auf.\nDie Menge hängt vom Wetter ab.", "Restaura PS del usuario.\nLa cantidad varía según\nel tiempo que haga.", "Chi la usa recupera PS. Il numero di PS\nrecuperati dipende dalle condizioni\natmosferiche.", "The user restores its own HP.\nThe amount of HP regained varies\nwith the weather.") },
            { PBEMove.Moonlight, new PBELocalizedString("じぶんの　\xFF28\xFF30を　かいふく　する。\nてんきに　よって\nかいふくの　りょうが　へんか　する。", "자신의 HP를 회복한다.\n날씨에 따라\n회복량이 변한다.", "Un soin qui restaure des PV au lanceur.\nSon efficacité varie en fonction de la\nmétéo.", "Füllt KP des Anwenders auf.\nDie Menge hängt vom Wetter ab.", "Restaura PS del usuario.\nLa cantidad varía según\nel tiempo que haga.", "Chi la usa recupera PS. Il numero di PS\nrecuperati dipende dalle condizioni\natmosferiche.", "The user restores its own HP.\nThe amount of HP regained varies\nwith the weather.") },
            { PBEMove.HiddenPower, new PBELocalizedString("わざを　つかった　ポケモンに　よって\nあいてに　あたえる\nわざの　タイプと　いりょくが　かわる。", "기술을 배운 포켓몬의\n숨겨진 능력으로\n기술 타입과 위력이 바뀐다.", "Attaque dont la puissance et le type\ndépendent du Pokémon qui l'utilise.", "Wirkung und Typ der Attacke\nhängen vom Anwender ab.", "Ataque único cuyo tipo y potencia varían\nsegún el agresor.", "Mossa singolare che cambia tipo e\npotenza a seconda del Pokémon che\nla usa.", "A unique attack that varies in type and\nintensity depending on the Pokémon\nusing it.") },
            { PBEMove.CrossChop, new PBELocalizedString("りょうて　チョップを\nあいてに　たたきつけて　こうげきする。\nきゅうしょに　あたりやすい。", "양손으로 당수를\n상대에게 힘껏 쳐서 공격한다.\n급소에 맞기 쉽다.", "Le lanceur délivre un coup double en\ncroisant les avant-bras. Taux de\ncritiques élevé.", "Doppelter Hieb mit den Unterarmen.\nHohe Volltrefferquote.", "Corte doble que suele propinar\nun golpe crítico.", "Investe il nemico con un colpo sferrato\ncon entrambe le braccia incrociate.\nProbabile brutto colpo.", "The user delivers a double chop with its\nforearms crossed.\nCritical hits land more easily.") },
            // { PBEMove.239, new PBELocalizedString("たつまきを　おこして\nあいてを　まきこみ　こうげきする。\nあいてを　ひるませる　ことが　ある。", "회오리를 일으켜\n상대를 끌어들여 공격한다.\n상대를 풀죽게 만들 때가 있다.", "Déclenche un terrible ouragan sur\nl'ennemi. Peut aussi l'apeurer.", "Trifft Gegner in der Umgebung mit\nheftigem Wirbelsturm, welche\neventuell zurückschrecken.", "Crea un violento tornado\npara hacer trizas al enemigo.\nPuede hacerle retroceder.", "Un potente tornado si abbatte sul nemico.\nPuò anche farlo tentennare.", "The user whips up a vicious tornado\nto tear at the opposing team.\nIt may also make targets flinch.") },
            { PBEMove.RainDance, new PBELocalizedString("\xFF15ターンの　あいだ　あめを　ふらせて\nみずタイプの\nわざの　いりょくを　あげる。", "5턴 동안 비를 내리게 하여\n물타입 기술의\n위력을 올린다.", "Invoque de fortes pluies qui durent\n5 tours et améliorent les capacités\nde type Eau.", "Anwender erzeugt starken Regen.\nDie Stärke von Wasser-Attacken\nerhöht sich fünf Runden lang.", "Genera una fuerte lluvia que refuerza\nlos movimientos de tipo Agua durante\ncinco turnos.", "Chi la usa provoca una forte pioggia per\ncinque turni, potenziando le mosse di\ntipo Acqua.", "The user summons a heavy rain\nthat falls for five turns,\npowering up Water-type moves.") },
            { PBEMove.SunnyDay, new PBELocalizedString("\xFF15ターンの　あいだ　ひざしを\nつよくして　ほのおタイプの\nわざの　いりょくを　あげる。", "5턴 동안 햇살을\n강하게 해서 불꽃타입\n기술의 위력을 올린다.", "Fait briller le soleil pendant 5 tours et\naméliore les capacités de type Feu.", "Die Sonne brennt unbarmherzig fünf\nRunden lang. Dadurch werden Attacken\nvom Typ Feuer verstärkt.", "Quien lo usa intensifica el sol durante\ncinco turnos, lo que potencia los\nmovimientos de tipo Fuego.", "Chi la usa intensifica i raggi solari per\ncinque turni, potenziando le mosse di tipo\nFuoco.", "The user intensifies the sun for\nfive turns, powering up\nFire-type moves.") },
            { PBEMove.Crunch, new PBELocalizedString("するどい　はで　あいてを　かみくだいて\nこうげきする。あいての　ぼうぎょを\nさげることが　ある。", "날카로운 이빨로\n상대를 깨물어 부숴서 공격한다.\n상대의 방어를 떨어뜨릴 때가 있다.", "Le lanceur mord l'ennemi de ses\ncrocs pointus. Peut aussi baisser\nla Défense de l'ennemi.", "Beißt mit scharfen Reißzähnen\nzu und senkt eventuell die\nVerteidigung.", "Tritura con afilados colmillos y puede\nbajar la Defensa del objetivo.", "Il nemico viene morso con denti affilati.\nPuò anche ridurne la Difesa.", "The user crunches up the target\nwith sharp fangs. It may also lower\nthe target's Defense stat.") },
            // { PBEMove.243, new PBELocalizedString("あいてから　うけた　とくしゅ　こうげきの\nダメージを　\xFF12ばいに　して\nそのあいてに　かえす。", "상대에게 받은 특수공격의\n데미지를 2배로 만들어\n그 상대에게 돌려준다.", "Une riposte qui contre n'importe quelle\nattaque spéciale en infligeant le double\ndes dégâts subis.", "Kontert den Spezial-Angriff des Gegners\nmit doppeltem Schaden.", "Responde a un ataque especial\nocasionando el doble del daño\nrecibido.", "Mossa che replica ogni attacco speciale,\narrecando il doppio del danno ricevuto.", "A retaliation move that counters any\nspecial attack, inflicting double the\ndamage taken.") },
            { PBEMove.PsychUp, new PBELocalizedString("じぶんに　あんじを　かけることで\nのうりょく　へんかの　じょうたいを\nあいてと　おなじにする。", "자신에게 암시를 걸어서\n능력 변화 상태를\n상대와 똑같은 상태로 만든다.", "Une autohypnose qui permet au lanceur\nde copier les changements de\nstats de la cible.", "Der Anwender hypnotisiert sich selbst, um\ndie Statusveränderungen des Zieles\nzu kopieren.", "Quien lo usa se hipnotiza y copia\ncualquier cambio que haya en las\ncaracterísticas de su objetivo.", "Chi la usa s'ipnotizza per copiare ogni\nmodifica alle statistiche del bersaglio.", "The user hypnotizes itself into\ncopying any stat change made\nby the target.") },
            { PBEMove.ExtremeSpeed, new PBELocalizedString("めにも　とまらぬ　ものすごい　はやさで\nあいてに　とっしんして　こうげきする。\nかならず　せんせい　こうげき　できる。", "눈에 보이지 않는 굉장한 속도로\n상대에게 돌진하여 공격한다.\n반드시 선제공격을 할 수 있다.", "Le lanceur charge à une vitesse\nrenversante. Cette attaque a\ntoujours l'initiative.", "Extrem schnelle und kraftvolle\nAttacke, die stets zuerst trifft.", "Ataque muy rápido que siempre\nse realiza el primero.", "Chi la usa carica il nemico a velocità\nimpressionante ed attacca sempre per\nprimo.", "The user charges the target at blinding\nspeed. This attack always goes\nbefore any other move.") },
            { PBEMove.AncientPower, new PBELocalizedString("げんしの　ちからで　こうげきする。\nじぶんの　すべての\nのうりょくが　あがることが　ある。", "원시의 힘으로 공격한다.\n자신의 모든\n능력이 오를 때가 있다.", "Une attaque préhistorique qui peut\naugmenter toutes les stats du lanceur\nd'un seul coup.", "Angriff mit antiker Kraft, der alle\nStatuswerte erhöhen kann.", "Ataque prehistórico que puede subir todas\nlas características.", "Colpisce il nemico con una forza\nprimordiale. Può aumentare tutte\nle statistiche.", "The user attacks with a prehistoric power.\nIt may also raise all the user's stats\nat once.") },
            { PBEMove.ShadowBall, new PBELocalizedString("くろいかげの　かたまりを　なげつけて\nこうげきする。あいての　とくぼうを\nさげることが　ある。", "까만 그림자의 덩어리를 내던져서\n공격한다. 상대의 특수방어를\n떨어뜨릴 때가 있다.", "Projette une grande ombre sur\nl'ennemi. Peut aussi faire baisser\nsa Défense Spéciale.", "Bewirft das Ziel mit gruseligem Ball und\nsenkt eventuell die Spezial-Verteidigung.", "Lanza una bola oscura que puede bajar\nla Defensa Especial del objetivo.", "Lancia sul nemico una sfera nera.\nPuò anche ridurne la Difesa Speciale.", "The user hurls a shadowy blob at the\ntarget. It may also lower the target's\nSp. Def stat.") },
            // { PBEMove.248, new PBELocalizedString("わざを　つかった　\xFF12ターン　あとに\nあいてに　ねんりきの\nかたまりを　おくって　こうげきする。", "기술을 사용한 2턴 뒤에\n상대에게 염동력의\n덩어리를 보내어 공격한다.", "De l'énergie psychique vient frapper\nl'ennemi 2 tours après l'utilisation\nde cette capacité.", "Zwei Runden, nachdem Seher eingesetzt\nwurde, erfolgt der Angriff.", "Concentra energía psíquica para golpear\nal objetivo dos turnos después.", "Due turni dopo l'utilizzo di questa mossa,\nil nemico viene attaccato con energia\npsichica.", "Two turns after this move is used,\na hunk of psychic energy\nattacks the target.") },
            { PBEMove.RockSmash, new PBELocalizedString("いわを　くだくような\nパンチで　こうげきする。あいての\nぼうぎょを　さげる　ことが　ある。", "바위를 깨는 듯한\n펀치로 공격한다. 상대의\n방어를 떨어뜨릴 때가 있다.", "Porte un coup dévastateur à l'ennemi.\nPeut briser des rochers fissurés.\nPeut baisser la Défense.", "Steinbrechende Attacke, die den\nVerteidigungs-Wert des Zieles\nsenken kann.", "Ataca con puñetazos que pueden\nromper rocas. Puede bajar\nla Defensa del objetivo.", "Il nemico viene colpito da un pugno in\ngrado di frantumare anche la roccia.\nPuò anche ridurne la Difesa.", "The user attacks with a punch that can\nshatter a rock. It may also lower the\ntarget's Defense stat.") },
            // { PBEMove.250, new PBELocalizedString("はげしく　うずをまく　みずの　なかに\n\xFF14ー\xFF15ターンの　あいだ\nあいてを　とじこめて　こうげきする。", "세차게 소용돌이치는\n물속에 4-5턴 동안\n상대를 가두어 공격한다.", "Piège l'ennemi dans une trombe\nd'eau pendant 4 à 5 tours.", "Das Ziel wird für 4 bis 5 Runden in einer\nWasserhose gefangen.", "Una tromba de agua atrapa al objetivo\ndurante cuatro o cinco turnos.", "Intrappola il nemico in un turbine d'acqua\nche dura per quattro o cinque turni\ninfliggendogli dei danni ogni turno.", "Traps foes in a violent swirling\nwhirlpool for four to five turns.") },
            // { PBEMove.251, new PBELocalizedString("みかた　ぜんいんで　こうげきする。\nなかまの　ポケモンが　おおいほど\nわざの　こうげきかいすうが　ふえる。", "같은 편 전원이 공격한다.\n동료 포켓몬이 많을수록\n기술의 공격 횟수가 증가한다.", "Le lanceur appelle tous les Pokémon de\nson équipe à attaquer. Plus ils sont\nnombreux, plus il y a d'attaques.", "Das gesamte Team nimmt aktiv am Kampf\nteil. Je mehr Pokémon, desto höher die\nAnzahl der Angriffe.", "Ataque de todo el equipo Pokémon.\nCuantos más haya, más veces ataca.", "Chi la usa chiama in aiuto i Pokémon della\nsquadra: più ce ne sono, maggiore è\nil numero di attacchi.", "The user gets all party Pokémon to attack\nthe target. The more party Pokémon,\nthe greater the number of attacks.") },
            // { PBEMove.252, new PBELocalizedString("せんせい　こうげきで　あいてを\nひるませる。せんとうに　でたら\nすぐに　ださないと　せいこう　しない。", "선제공격으로 상대를 풀죽게 한다.\n배틀에 나가서\n바로 쓰지 않으면 성공할 수 없다.", "Permet de frapper en premier et\napeure l'ennemi. Ne fonctionne\nqu'au premier tour.", "Diese Attacke trifft zuerst. Das Ziel\nschreckt zurück. Gelingt nur in der\nersten Runde eines Kampfes.", "Ataca primero y, además, hace retroceder\nal objetivo. Solo sirve en el primer turno.", "Mossa che fa agire per primo e fa\ntentennare il nemico. Funziona solo\nappena sceso in campo.", "An attack that hits first and makes the\ntarget flinch. It only works the first turn\nthe user is in battle.") },
            // { PBEMove.253, new PBELocalizedString("\xFF13ターンの　あいだ\nさわいで　あいてを　こうげきする。\nそのあいだは　だれも　ねむれなく　なる。", "3턴 동안\n소란피워 공격한다.\n그 동안은 아무도 잠들지 않게 된다.", "Le lanceur attaque en rugissant durant\n3 tours. Pendant ce temps, personne\nne peut s'endormir.", "Anwender greift an, indem er über drei\nRunden hinweg einen Aufruhr erzeugt.\nVerhindert Schlaf.", "Ataca de forma alborotada durante tres\nturnos. Mantiene despiertos a todos.", "Chi la usa attacca per tre turni con un\nfrastuono che non fa dormire nessuno.", "The user attacks in an uproar for\nthree turns. Over that time,\nno one can fall asleep.") },
            // { PBEMove.254, new PBELocalizedString("ちからを　たくわえて　じぶんの\nぼうぎょと　とくぼうを　あげる。\nさいだい　\xFF13かいまで　たくわえられる。", "힘을 비축해서 자신의\n방어와 특수방어를 올린다.\n최대 3회까지 비축할 수 있다.", "Le lanceur accumule de la puissance et\naugmente sa Défense et sa Défense\nSpéciale. Peut être utilisé 3 fois.", "Lädt Kraft für später auf. Erhöht\nVerteidigung und Spezial-Verteidigung.\nKann bis zu dreimal eingesetzt werden.", "Acumula energía y sube la Defensa y\nla Defensa Especial. Puede utilizarse\nhasta tres veces.", "Chi la usa accumula energia aumentando\nla Difesa e la Difesa Speciale.\nSi può utilizzare tre volte.", "The user charges up power and raises\nboth its Defense and Sp. Def. The move\ncan be used three times.") },
            // { PBEMove.255, new PBELocalizedString("たくわえた　ちからを　あいてに　ぶつけて\nこうげきする。たくわえて　いるほど\nいりょくが　あがる。", "비축된 힘을\n상대에게 부딪쳐서 공격한다.\n비축된 만큼 위력이 올라간다.", "Libère dans une attaque la puissance\nprécédemment accumulée avec Stockage.", "Entlädt die Kraft, die während des\nEinsatzes von Horter gesammelt wurde.", "Libera de una vez la energía acumulada\ncon Reserva.", "Tutta l'energia accumulata in precedenza\ncon Accumulo è rilasciata nell'attacco.\nMaggiore è l'energia, più danni si arrecano.", "The power stored using the move Stockpile\nis released at once in an attack. The more\npower is stored, the greater the damage.") },
            // { PBEMove.256, new PBELocalizedString("たくわえた　ちからを　のみこんで\nじぶんの　\xFF28\xFF30を　かいふく　する。\nたくわえて　いるほど　かいふく　する。", "비축된 힘을 꿀꺽해서\n자신의 HP를 회복한다.\n비축된 만큼 회복한다.", "Le lanceur absorbe la puissance accumulée\navec Stockage pour restaurer ses PV.", "Absorbiert die gehortete Kraft,\num KP aufzufüllen.", "Absorbe la energía acumulada\ncon Reserva y restaura PS.", "Chi la usa assorbe l'energia raccolta\ncon la mossa Accumulo e recupera PS.\nMaggiore è l'energia, più PS si recuperano.", "The power stored using the move Stockpile\nis absorbed by the user to heal its HP.\nStoring more power heals more HP.") },
            { PBEMove.HeatWave, new PBELocalizedString("あつい　いきを\nあいてに　ふきつけて　こうげきする。\nやけど　じょうたいに　することが　ある。", "뜨거운 숨결을\n상대에게 내뿜어 공격한다.\n화상 상태로 만들 때가 있다.", "Le lanceur provoque une vague de\nchaleur. Peut aussi brûler l'ennemi.", "Gegner wird von Sturm aus heißer\nLuft getroffen und verbrennt sich\neventuell.", "Provoca un viento abrasador que puede\nquemar al objetivo.", "Chi la usa investe il nemico con una folata\ndi vento caldo. Può anche scottarlo.", "The user attacks by exhaling hot breath\non the opposing team. It may also leave\ntargets with a burn.") },
            { PBEMove.Hail, new PBELocalizedString("\xFF15ターンの　あいだ　あられを　ふらして\nこおりタイプで　ない　ポケモン\nぜんいんに　ダメージを　あたえる。", "5턴 동안 싸라기눈을 내리게 해\n얼음타입이 아닌 포켓몬\n모두에게 데미지를 준다.", "Invoque une tempête de grêle qui dure 5\ntours. Ne blesse pas les Pokémon de type\nGlace.", "Hagelsturm für fünf Runden. Schadet\nallen, außer Eis-Pokémon.", "Tormenta de granizo que dura cinco\nturnos. Hiere a todos, excepto a\nlos de tipo Hielo.", "Chi la usa causa una grandinata che dura\ncinque turni. Danneggia tutti i Pokémon\ntranne quelli di tipo Ghiaccio.", "The user summons a hailstorm lasting five\nturns. It damages all Pokémon except the\nIce type.") },
            // { PBEMove.259, new PBELocalizedString("あいてに　いちゃもんを　つけて　\nおなじ　わざを　\xFF12かい　れんぞくで\nだせなくする。", "상대에게 트집을 잡아서\n똑같은 기술을 2회 연속으로\n쓸 수 없게 한다.", "Le lanceur irrite l'ennemi pour\nl'empêcher d'utiliser la même\ncapacité 2 fois de suite.", "Erzürnt das Ziel, um wiederholten\nEinsatz derselben Attacke zu\nverhindern.", "Atormenta y enfurece al objetivo, que no\npuede usar dos veces seguidas\nel mismo movimiento.", "Chi la usa tormenta e fa infuriare\nil nemico, impedendogli di usare\nla stessa mossa due volte di seguito.", "The user torments and enrages the\ntarget, making it incapable of using\nthe same move twice in a row.") },
            { PBEMove.Flatter, new PBELocalizedString("あいてを　おだてて　こんらん　させる。\nどうじに　あいての　とくこうも\nあげて　しまう。", "상대를 부추겨서 혼란시킨다.\n동시에 상대의 특수공격도\n올라가 버린다.", "Rend la cible confuse, mais\naugmente son Attaque Spéciale.", "Schmeichelt dem Ziel, um es zu verwirren.\nErhöht dessen Spezial-Angriff.", "Halaga al objetivo y lo confunde, pero\ntambién sube su Ataque Especial.", "Adula il bersaglio e lo confonde, ma ne\naumenta l'Attacco Speciale.", "Flattery is used to confuse the target.\nHowever, it also raises the target's\nSp. Atk stat.") },
            { PBEMove.WillOWisp, new PBELocalizedString("ぶきみで　あやしい　ほのおを　はなって\nあいてを　やけどの　じょうたいに　する。\n", "으스스하고 괴상한 불꽃을 쏘아\n상대를 화상 상태로 만든다.", "Lance une sinistre flamme violette à\nl'ennemi pour lui infliger une brûlure.", "Angriff mit unheimlicher Flamme,\ndie das Ziel verbrennt.", "Siniestra llama morada que produce\nquemaduras.", "Fiamme intense di colore viola causano\nuna scottatura al nemico.", "The user shoots a sinister, bluish-white\nflame at the target to inflict a burn.") },
            // { PBEMove.262, new PBELocalizedString("じぶんは　ひんしに　なるが　そのかわりに\nあいての　こうげきと　とくこうを\nがくっと　さげる。", "자신은 기절하게 되지만 그 대신\n상대의 공격과 특수공격을\n크게 떨어뜨린다.", "Le lanceur est mis K.O., mais l'Attaque\net l'Attaque Spéciale de l'ennemi baissent\nbeaucoup.", "Der Anwender wird besiegt und senkt\nden Angriffs-Wert und den Spezial-\nAngriff des Zieles stark.", "El usuario se debilita, pero baja mucho\ntanto el Ataque como el Ataque Especial\ndel objetivo.", "Chi la usa va KO. Tuttavia, riduce di molto\nl'Attacco e l'Attacco Speciale del nemico.", "The user faints when using this move.\nIn return, it harshly lowers the target's\nAttack and Sp. Atk.") },
            { PBEMove.Facade, new PBELocalizedString("じぶんが　どく　まひ　やけど\nじょうたいの　とき　あいてに　くりだすと\nわざの　いりょくが　\xFF12ばいに　なる。", "자신이 독, 마비, 화상\n상태일 때 날리면\n기술의 위력이 2배가 된다.", "Une attaque dont la puissance double\nlorsque le lanceur est empoisonné,\nparalysé ou brûlé.", "Doppelte Stärke nach Verbrennung,\nParalyse oder Vergiftung.", "Ataca con el doble de potencia\nsi el usuario está quemado,\nparalizado o envenenado.", "Mossa d'attacco che raddoppia la potenza\nse chi la usa è scottato, avvelenato\no paralizzato.", "An attack move that doubles its power if\nthe user is poisoned, burned, or\nhas paralysis.") },
            // { PBEMove.264, new PBELocalizedString("せいしんを　たかめて　パンチを\nくりだす。わざを　だす　までに\nこうげきを　うけると　しっぱい　する。", "정신력을 높여 펀치를 날린다.\n기술을 쓰기 전에\n공격을 받으면 실패한다.", "Le lanceur se concentre avant\nd'attaquer. Échoue s'il est touché\navant d'avoir frappé.", "Anwender konzentriert sich, bevor er\nangreift. Wird er vorher getroffen, ist\ndie Attacke erfolglos.", "Se concentra para dar un puñetazo.\nFalla si se sufre un golpe antes de su uso.", "Chi la usa prende la mira prima di sferrare\nun pugno. Fallirà se verrà colpito prima\ndi eseguire la mossa.", "The user focuses its mind before\nlaunching a punch. It will fail if the user\nis hit before it is used.") },
            // { PBEMove.265, new PBELocalizedString("まひ　じょうたいの　あいてには\nいりょくが　\xFF12ばいに　なるが\nかわりに　あいての　まひが　なおる。", "마비 상태의 상대에게는\n위력이 2배가 되지만\n대신 상대의 마비가 풀린다.", "Cette attaque est doublement efficace\nsur les Pokémon paralysés, mais elle\nsoigne leur paralysie.", "Doppelt wirksam gegen paralysierte\nGegner, heilt sie aber auch davon.", "Hace el doble de daño a objetivos\nparalizados, pero también cura\nla parálisis.", "Infligge un danno doppio ad un bersaglio\nparalizzato, ma ne cura anche la paralisi.", "This attack inflicts double damage on a\ntarget with paralysis. It also cures the\ntarget's paralysis, however.") },
            // { PBEMove.266, new PBELocalizedString("じぶんに　ちゅうもく　させて\nあいてからの　こうげきを\nすべて　じぶんに　むけさせる。", "자신에게 주목시켜\n상대로부터의 공격을\n모두 자신에게 향하게 한다.", "Attire l'attention. Les ennemis\nn'attaquent que le lanceur.", "Zieht Aufmerksamkeit auf sich.\nGegner greift nur Anwender an.", "Llama la atención para concentrar\ntodos los ataques de todos los del\nequipo rival hacia sí mismo.", "Chi la usa attrae l'attenzione su di sé,\ncostringendo i nemici a sceglierlo sempre\ncome bersaglio.", "The user draws attention to itself,\nmaking all targets take aim\nonly at the user.") },
            // { PBEMove.267, new PBELocalizedString("しぜんの　ちからで　こうげきする。\nつかう　ばしょで\nでてくる　わざが　へんかする。", "자연의 힘으로 공격한다.\n사용하는 장소에 따라\n나오는 기술이 변화한다.", "Une attaque qui tire sa force de la\nnature. Son type varie selon le terrain.", "Angriff mit der Kraft der Natur, dessen\nTyp vom Ort abhängt, wo er durchgeführt\nwird.", "Usa el poder de la naturaleza.\nSu efecto varía según el entorno\nde combate.", "Mossa che fa uso della forza della natura.\nIl suo effetto varia in base all'ambiente.", "An attack that makes use of nature's\npower. Its effects vary depending on the\nuser's environment.") },
            // { PBEMove.268, new PBELocalizedString("つぎの　ターンに　だす　でんきタイプの\nわざの　いりょくを　あげる。\nじぶんの　とくぼうも　あがる。", "다음 턴에 쓸 전기타입\n기술의 위력을 올린다.\n자신의 특수방어도 올라간다.", "Le lanceur concentre sa puissance pour\nsa prochaine attaque Électrik.\nAugmente sa Défense Spéciale.", "Lädt Energie für die kommende\nElektro-Attacke auf. Erhöht die\nSpezial-Verteidigung.", "Recarga energía para potenciar el\nsiguiente movimiento de tipo Eléctrico.\nTambién sube la Defensa Especial.", "Potenzia la mossa di tipo Elettro usata\nsubito dopo. Aumenta anche la Difesa\nSpeciale di chi la usa.", "The user boosts the power of the Electric\nmove it uses on the next turn. It also\nraises the user's Sp. Def stat.") },
            // { PBEMove.269, new PBELocalizedString("あいてを　おこらせる。\xFF13ターンの\nあいだ　あいては　ダメージを\nあたえる　わざしか　だせなく　なる。", "상대를 화나게 한다.\n3턴 동안 상대는 데미지를\n주는 기술밖에 쓸 수 없게 된다.", "Provoque l'ennemi. L'oblige à n'utiliser\nque des attaques pendant 3 tours.", "Bringt das Ziel in Rage. Dieses\nkann über drei Runden hinweg nur\nnoch angreifen.", "Enfurece al objetivo para que solo\nuse movimientos de ataque\ndurante tres turnos.", "Provoca il nemico, inducendolo ad usare\nsolo mosse d'attacco per tre turni.", "The target is taunted into a rage that\nallows it to use only attack moves\nfor three turns.") },
            { PBEMove.HelpingHand, new PBELocalizedString("なかまを　たすける。\nてだすけ　された　ポケモンの　わざの\nいりょくは　いつもより　おおきく　なる。", "동료를 돕는다.\n도움받은 포켓몬이 쓰는 기술의\n위력은 여느 때보다 커진다.", "Une capacité qui augmente la puissance\nd'attaque de l'allié pendant un tour.", "Anwender steigert die Kraft eines\nAngriffes eines Freundes.", "El usuario ayuda a un aliado\nreforzando la potencia de\nsu ataque.", "Mossa che aumenta la potenza dell'attacco\ndi un alleato.", "The user assists an ally by boosting\nthe power of its attack.") },
            // { PBEMove.271, new PBELocalizedString("あいての　すきを　ついて\nじぶんと　あいての\nもちものを　こうかんする。", "상대의 빈틈을 노려\n자신과 상대가 지닌 물건을\n교환한다.", "Le lanceur prend la cible au dépourvu et\nl'oblige à échanger son objet contre\nle sien.", "Erwischt das Ziel auf dem falschen Fuß.\nGehaltene Items werden mit Anwender\ngetauscht.", "Engaña al objetivo desprevenido e\nintercambia objetos.", "Chi la usa coglie il bersaglio in\ncontropiede e l'obbliga a cambiare\nil suo strumento con il proprio.", "The user catches the target off guard\nand swaps its held item with its own.") },
            // { PBEMove.272, new PBELocalizedString("あいてに　なりきって　じぶんも　あいてと\nおなじ　とくせいに　へんかする。\n", "상대의 역할을 하여 자신도 상대와\n같은 특성으로 변화한다.", "Imite la cible et copie\nsa capacité spéciale.", "Parodiert das Ziel und kopiert seine\nFähigkeit.", "Imita al objetivo por completo y copia\nsu habilidad.", "Chi la usa mima in tutto il bersaglio,\ncopiandone l'abilità.", "The user mimics the target completely,\ncopying the target's natural Ability.") },
            // { PBEMove.273, new PBELocalizedString("つぎの　ターンに　\nじぶんの　\xFF28\xFF30を　さいだい　\xFF28\xFF30の　\nはんぶん　かいふく　する。", "다음 턴에\n자신의 HP를 최대 HP의\n절반만큼 회복한다.", "Un vœu qui permet de récupérer la\nmoitié des PV max au tour suivant.", "Ein Wunsch füllt in der nächsten Runde\n50 % der KP des Anwenders bei diesem\noder einem eingewechselten Pokémon auf.", "Cumple el deseo de restaurar la mitad\nde los PS máximos en el siguiente turno.", "Permette di recuperare metà dei PS massimi\nal turno successivo.", "One turn after this move is used,\nthe target's HP is restored by\nhalf the user's maximum HP.") },
            // { PBEMove.274, new PBELocalizedString("おおいそぎで　みかたの　たすけを　かりて\nひかえの　ポケモンが　おぼえている\nわざを　どれか　\xFF11つ　つかう。", "서둘러서 같은 편의 도움을 받아\n교대 포켓몬이 기억하고 있는\n기술 중 하나를 쓴다.", "Le lanceur se dépêche d'utiliser une\ncapacité au hasard parmi celles des\nPokémon de l'équipe.", "Greift zufällig mit einer Attacke eines\nTeampartners an.", "Usa un movimiento de un miembro del equipo\nelegido al azar.", "Chi la usa utilizza in fretta e a caso una\ndelle mosse degli altri Pokémon della\nsquadra.", "The user hurriedly and randomly uses a\nmove among those known by other\nPokémon in the party.") },
            // { PBEMove.275, new PBELocalizedString("だいちに　ねを　はり　まいターン\nじぶんの　\xFF28\xFF30を　かいふく　する。\nねを　はっているので　いれかえられない。", "대지에 뿌리를 박아\n매 턴마다 자신의 HP를 회복한다.\n뿌리 박고 있으므로 교체할 수 없다.", "Le lanceur plante ses racines et récupère\ndes PV à chaque tour. Une fois enraciné, il\nne peut plus fuir.", "Verwurzelung füllt jede Runde KP auf.\nAustausch ist unmöglich.", "Echa raíces para recuperar PS en cada\nturno, pero impide el relevo.", "Chi la usa mette delle radici che gli fanno\nrecuperare PS ad ogni turno. Non può\nessere sostituito.", "The user lays roots that restore\nits HP on every turn. Because it is\nrooted, it can't switch out.") },
            { PBEMove.Superpower, new PBELocalizedString("すごい　ちからを　はっきして\nあいてを　こうげきする。じぶんの\nこうげきと　ぼうぎょが　さがる。", "엄청난 힘을 발휘하여\n상대를 공격한다. 자신의\n공격과 방어가 떨어진다.", "Une attaque puissante, mais qui baisse\nl'Attaque et la Défense du lanceur.", "Starke Attacke, die sowohl Angriff als\nauch Verteidigung des Anwenders senkt.", "Ataque de gran potencia, pero que reduce\nel Ataque y la Defensa del agresor.", "Chi la usa attacca il nemico con grande\nforza, ma il suo Attacco e la sua Difesa\npeggiorano.", "The user attacks the target with great\npower. However, it also lowers the\nuser's Attack and Defense.") },
            // { PBEMove.277, new PBELocalizedString("じょうたい　いじょうに　なる　ワザや\nやどりぎのタネ　などを\nだされたとき　あいてに　はねかえす。", "상대가 상태 이상이 되는 기술이나\n씨뿌리기 등을 썼을 때 되받아친다.", "Une barrière qui renvoie les capacités\ncomme Vampigraine et celles affectant\nle statut et les stats.", "Egelsamen und alle Attacken mit Status\nverändernden Effekten prallen ab.", "Barrera capaz de devolver al agresor\nmovimientos como Drenadoras y otros que\nalteran el estado o las características.", "Una barriera rimanda al mittente l'effetto\ndi mosse come Parassiseme e di mosse\nche influenzano lo stato.", "A barrier reflects back to the target\nmoves like Leech Seed and moves\nthat damage status.") },
            // { PBEMove.278, new PBELocalizedString("せんとうちゅうに　つかって　なくなった\nじぶんの　もちものを　さいせい　させて\nつかえるように　する。", "배틀 중에 사용하여 없어진\n자신의 지닌 물건을 재생시켜\n사용할 수 있게 한다.", "Recycle un objet tenu à usage unique\ndéjà utilisé lors du combat pour pouvoir\nl'utiliser à nouveau.", "Recycling eines getragenen Items, das\nzuvor im Kampf verwendet wurde.", "Recicla y así recupera el objeto\nequipado de un solo uso que ya\nha sido empleado en el combate.", "Chi la usa ricicla uno strumento tenuto,\ngià usato nella lotta, e lo può riutilizzare.", "The user recycles a held item that\nhas been used in battle so it can be\nused again.") },
            // { PBEMove.279, new PBELocalizedString("あいてから　わざを　うけていると\nその　あいてに　たいして\nあたえる　ダメージが　\xFF12ばいに　なる。", "상대에게 기술을 받으면\n그 상대에게 주는 데미지가\n2배가 된다.", "Une attaque deux fois plus puissante\nsi le lanceur a été blessé par l'ennemi\ndurant ce tour.", "Schaden verdoppelt sich, wenn Anwender\nin der Runde bereits Schaden vom Ziel des\nAngriffes genommen hat.", "Ataque que produce el doble de daño si\nel usuario es herido en el mismo turno.", "Mossa d'attacco che infligge un danno\ndoppio se si è stati colpiti dal nemico\nnello stesso turno.", "An attack move that inflicts double the\ndamage if the user has been hurt by the\nopponent in the same turn.") },
            { PBEMove.BrickBreak, new PBELocalizedString("しゅとうを　いきおいよく　ふりおろして\nあいてを　こうげきする。ひかりのかべや\nリフレクターも　はかいできる。", "수도로 기세 좋게 내려쳐서\n상대를 공격한다. 빛의장막이나\n리플렉터도 파괴할 수 있다.", "Une attaque avec le tranchant de la main.\nPermet aussi de briser les barrières\ncomme Mur Lumière et Protection.", "Ein beherzter Handkantenschlag.\nDurchbricht Barrieren wie Lichtschild\nund Reflektor.", "Potente ataque que también es capaz\nde destruir barreras como Pantalla\nde Luz y Reflejo.", "Colpisce il nemico con una mano e rompe\nbarriere come Riflesso e Schermoluce.", "The user attacks with a swift chop. It\ncan also break any barrier such as Light\nScreen and Reflect.") },
            // { PBEMove.281, new PBELocalizedString("おおきな　あくびで　ねむけを　さそう。\nつぎの　ターンに\nあいてを　ねむり　じょうたいに　する。", "큰 하품으로 졸음을 유도한다.\n다음 턴에 상대를\n잠듦 상태로 만든다.", "Fait bâiller l'ennemi qui\ns'endort au tour suivant.", "Angreifer gähnt und das Ziel schläft in der\nnächsten Runde ein.", "Gran bostezo que induce al sueño\nal objetivo en el siguiente turno.", "Chi la usa fa un grande sbadiglio che\naddormenta il nemico al turno seguente.", "The user lets loose a huge yawn that\nlulls the target into falling asleep\non the next turn.") },
            // { PBEMove.282, new PBELocalizedString("あいての　もちものを　はたき　おとして\nせんとうが　おわるまで\nつかえなく　する。", "상대의 지닌 물건을 탁 쳐서 떨어뜨려\n배틀이 끝날 때까지\n사용할 수 없게 한다.", "Le lanceur fait tomber l'objet tenu\npar l'ennemi pour le rendre inutilisable\ndurant le combat.", "Schlägt das Item des Zieles weg\nund vereitelt so dessen Gebrauch\nwährend des Kampfes.", "Impide al objetivo usar el objeto que lleva\ndurante el combate.", "Attacco che blocca anche lo strumento\ntenuto dal nemico, impedendone l'uso\nnella lotta.", "The user slaps down the target's\nheld item, preventing that item\nfrom being used in the battle.") },
            { PBEMove.Endeavor, new PBELocalizedString("あいての　\xFF28\xFF30が　じぶんの　\xFF28\xFF30と\nおなじ　くらいに　なるように\nダメージを　あたえる。", "상대의 HP가 자신의 HP와\n같아지도록\n데미지를 준다.", "Une attaque qui réduit les PV de\nl'ennemi au niveau des PV du lanceur.", "Trifft nur, wenn KP des Anwenders geringer\nals KP des Zieles sind. Senkt dessen\nKP auf Niveau der KP des Anwenders.", "Reduce los PS del objetivo para que igualen\na los del atacante.", "Attacco che riduce i PS del nemico a una\nquantità pari ai PS di chi la usa.", "An attack move that cuts down the\ntarget's HP to equal the user's HP.") },
            { PBEMove.Eruption, new PBELocalizedString("いかりを　ばくはつ　させて　あいてを\nこうげきする。じぶんの　\xFF28\xFF30が　すくない\nほど　わざの　いりょくは　さがる。", "분노를 폭발시켜 상대를\n공격한다. 자신의 HP가\n적을수록 기술의 위력이 떨어진다.", "Le lanceur laisse exploser sa colère.\nPlus ses PV sont bas et moins l'attaque\nest puissante.", "Explosiver Angriff. Je höher die KP\ndes Anwenders sind, desto mehr Schaden\nwird angerichtet.", "Furia explosiva. Cuanto menor sea\nel número de PS del usuario, menos\ndaño hará el ataque.", "Attacco impetuoso ed esplosivo la cui\npotenza è proporzionale ai PS di chi\nlo usa.", "The user attacks the opposing team with\nexplosive fury. The lower the user's HP,\nthe less powerful this attack becomes.") },
            // { PBEMove.285, new PBELocalizedString("ちょうのうりょくで　じぶんの　とくせいと\nあいての　とくせいを　いれかえる。\n", "초능력으로 자신의 특성과\n상대의 특성을 바꾼다.", "Le lanceur utilise ses pouvoirs psychiques\npour échanger sa capacité spéciale\navec la cible.", "Anwender tauscht Fähigkeit mit\ndem Ziel.", "Usa el poder psíquico para intercambiar\nhabilidades con el objetivo.", "Chi la usa sfrutta le sue facoltà mentali\nper scambiare l'abilità con il bersaglio.", "The user employs its psychic power to\nexchange Abilities with the target.") },
            // { PBEMove.286, new PBELocalizedString("あいてが　じぶんと　おなじ　わざを\nおぼえていたら　あいてだけ\nそのわざを　つかえなく　する。", "상대가 자신과 같은 기술을\n기억하고 있으면 상대만\n그 기술을 사용할 수 없게 한다.", "Si l'ennemi et le lanceur ont des\ncapacités en commun, l'ennemi ne\npourra pas les utiliser.", "Hindert Gegner am Einsatz von Attacken,\ndie der Anwender selbst auch kennt.", "Impide a los contrincantes usar ataques\nconocidos por el usuario durante\nel combate.", "Chi la usa impedisce al nemico di usare\nmosse che conoscono entrambi.", "If the opponents know any move also known\nby the user, the opponents are prevented\nfrom using it.") },
            // { PBEMove.287, new PBELocalizedString("からだを　やすめて　じぶんが　おっている\nどく　まひ　やけどの\nじょうたい　いじょうを　なおす。", "몸을 쉬게 하여 자신이 입은\n독, 마비, 화상의\n상태 이상을 치료한다.", "Le lanceur se repose pour guérir\nd'un empoisonnement, d'une brûlure\nou d'une paralysie.", "Selbstheilung bei Vergiftung,\nParalyse und Verbrennung.", "Descansa para curar parálisis,\nenvenenamiento o quemaduras.", "Chi la usa riposa per curarsi da\navvelenamento, paralisi e scottatura.", "The user rests to cure itself of a\npoisoning, burn, or paralysis.") },
            // { PBEMove.288, new PBELocalizedString("あいての　わざで　ひんしに　されたとき\nおんねんを　かけて\nそのわざの　\xFF30\xFF30を　\xFF10に　する。", "상대의 기술로 기절하면\n원념을 담아\n그 기술의 PP를 0으로 만든다.", "Si le lanceur est mis K.O., sa rancune\népuise les PP de la capacité utilisée\npour le mettre K.O.", "Bei K.O. des Anwenders werden die AP der\nAttacke, durch die er besiegt wurde,\nauf null herabgesetzt.", "Si el usuario se debilita al recibir un\nataque, todos los PP de este último\nataque serán eliminados.", "Se chi la usa va KO, i PP della mossa\nnemica che lo ha messo fuori gioco\nsi azzerano.", "If the user faints, the user's grudge\nfully depletes the PP of the opponent's\nmove that knocked it out.") },
            // { PBEMove.289, new PBELocalizedString("あいてが　つかおうと　した\nかいふくわざや　のうりょく　へんかの\nわざを　うばって　じぶんに　つかう。", "상대가 사용하려고 한\n회복 기술이나 능력 변화의\n기술을 빼앗아 자신에게 쓴다.", "Le lanceur vole l'effet des capacités\nde soin ou de changement de stats\nutilisées par la cible.", "Raubt den Effekt der heilenden\noder Werte verändernden Attacke\ndes Gegners.", "Roba el efecto de movimientos de curación\no de cambio de características que intente\nusar un combatiente.", "Chi la usa ruba e utilizza la mossa\ncurativa o modifica-statistiche che\nil bersaglio stava per usare.", "The user steals the effects of any\nhealing or stat-changing move the\nopponent attempts to use.") },
            // { PBEMove.290, new PBELocalizedString("ひみつの　ちからで　\nあいてを　こうげきする。つかう　ばしょで\nついかこうかが　へんかする。", "비밀의 힘으로 상대를\n공격한다. 사용 장소에 따라\n추가 효과가 변화한다.", "Les effets de cette attaque varient en\nfonction de l'environnement.", "Angriff, der abhängig vom Anwendungsort\neinen unterschiedlichen Zusatzeffekt\nbesitzt.", "Ataque con poder secreto cuyos efectos\nsecundarios varían según el entorno\nde combate.", "Attacco che può avere un effetto\naggiuntivo a seconda del luogo\nin cui si trova chi lo usa.", "The user attacks the target with a\nsecret power. Its added effects vary\ndepending on the user's environment.") },
            { PBEMove.Dive, new PBELocalizedString("\xFF11ターンめで　もぐり　\xFF12ターンめに\nうきあがって　こうげきする。うみの\nおくふかくに　もぐる　ことも　できる。", "1턴째에 잠수했다가 2턴째에\n떠올라 공격한다.\n바닷속 깊숙이 잠수할 수도 있다.", "Le lanceur plonge sous l'eau au\n1⑩ tour et frappe au 2⒅. Permet\naussi de plonger au fond de l'eau.", "Taucht in Runde 1 ab und greift in\nRunde 2 aus der Tiefe an. Ermöglicht\nTauchgänge zum Meeresgrund.", "Primer turno: se sumerge en el mar.\nSegundo turno: emerge y ataca.", "Chi la usa si tuffa in acqua per emergere e\nattaccare al turno seguente. Fuori dalla\nlotta permette di immergersi sott'acqua.", "Diving on the first turn, the user floats\nup and attacks on the second turn.\nIt can be used to dive deep in the ocean.") },
            // { PBEMove.292, new PBELocalizedString("ひらいた　りょうてで\nあいてを　つっぱって　こうげきする。\n\xFF12ー\xFF15かいの　あいだ　れんぞくで　だす。", "펼친 양손으로\n상대를 번갈아 쳐서 공격한다.\n2-5회 동안 연속으로 쓴다.", "Un déluge de coups adressés avec la\npaume qui frappe de 2 à 5 fois d'affilée.", "Schläge mit geradem Arm, die\ndas Ziel 2- bis 5-mal treffen.", "Empujones directos que golpean de dos\na cinco veces seguidas.", "Raffica di ceffoni che colpisce da due a\ncinque volte di fila.", "The user looses a flurry of open-palmed\narm thrusts that hit two to five times in\na row.") },
            // { PBEMove.293, new PBELocalizedString("みずべや　くさむら　どうくつなど\nいる　ばしょに　あわせて\nじぶんの　タイプを　かえる。", "물가나 풀밭, 동굴 등\n있는 장소에 맞춰서\n자신의 타입을 바꾼다.", "Modifie le type du lanceur en fonction\ndu terrain, comme une berge, une\ngrotte, l'herbe, etc.", "Der Typ des Anwenders passt sich\nder Umgebung an, sei es im Wasser,\nim Gras oder in einer Höhle.", "Modifica el tipo del Pokémon según\nel terreno de combate donde esté.", "Modifica il tipo di chi la usa a seconda del\nluogo, ad esempio sull'acqua, nell'erba\no in una grotta.", "The user's type is changed depending on\nits environment, such as at water's edge,\nin grass, or in a cave.") },
            { PBEMove.TailGlow, new PBELocalizedString("てんめつする　ひかりを　ながめて\nじぶんの　せいしんを　とういつし\nとくこうを　ぐぐーんと　あげる。", "깜빡거리는 빛을 바라보고\n자신의 정신을 통일하여\n특수공격을 매우 크게 올린다.", "Le lanceur regarde un flash lumineux\nfixement. Augmente considérablement\nson Attaque Spéciale.", "Ein blinkendes Licht, das den\nSpezial-Angriff drastisch erhöht.", "Se concentra en una ráfaga de luz que\nsube muchísimo el Ataque Especial.", "Chi la usa fissa una luce forte per\nconcentrarsi e aumentare moltissimo\nl'Attacco Speciale.", "The user stares at flashing lights to\nfocus its mind, drastically raising its\nSp. Atk stat.") },
            { PBEMove.LusterPurge, new PBELocalizedString("まばゆい　ひかりを　かいほうして　\nこうげきする。あいての　とくぼうを\nさげることが　ある。", "눈부신 빛을 개방하여\n공격한다. 상대의 특수방어를\n떨어뜨릴 때가 있다.", "Le lanceur libère un éclair lumineux.\nPeut aussi baisser la Défense\nSpéciale de l'ennemi.", "Angriff mit grellem Licht, der die\nSpezial-Verteidigung des Zieles\neventuell senkt.", "Fogonazo de luz que puede bajar\nla Defensa Especial del objetivo.", "Chi la usa scatena un'esplosione\nabbagliante che può anche ridurre\nla Difesa Speciale del Pokémon colpito.", "The user lets loose a damaging burst\nof light. It may also reduce the target's\nSp. Def stat.") },
            { PBEMove.MistBall, new PBELocalizedString("きりじょうの　うもうで　つつみこみ　\nこうげきする。あいての　とくこうを\nさげることが　ある。", "안개의 깃털로 둘러싸\n공격한다. 상대의 특수공격을\n떨어뜨릴 때가 있다.", "Une bulle de brume inflige des dégâts\nà l'ennemi. Peut aussi réduire son\nAttaque Spéciale.", "Angriff mit einer Kugel aus Wasser,\ndie Nebel enthält. Senkt eventuell den\nSpezial-Angriff des Zieles.", "Banco de niebla que puede bajar\nel Ataque Especial del objetivo.", "Una sfera coperta di nebbia danneggia\nil nemico. Può anche ridurne l'Attacco\nSpeciale.", "A mistlike flurry of down envelops and\ndamages the target. It may also lower\nthe target's Sp. Atk.") },
            { PBEMove.FeatherDance, new PBELocalizedString("うもうを　ふりまいて\nあいての　からだに　からませる。\nあいての　こうげきを　がくっと　さげる。", "깃털을 흩뿌려\n상대의 몸에 휘감는다.\n상대의 공격을 크게 떨어뜨린다.", "Une montagne de plumes ensevelit\nl'ennemi et réduit considérablement\nson Attaque.", "Hüllt das Ziel in Daunen und senkt\ndessen Angriffs-Wert stark.", "Envuelve al objetivo con un manto de\nplumas para reducir mucho su Ataque.", "Chi la usa copre il nemico con un manto\ndi piume che riduce di molto il suo Attacco.", "The user covers the target's body with a\nmass of down that harshly lowers its\nAttack stat.") },
            { PBEMove.TeeterDance, new PBELocalizedString("フラフラと　ダンスを　おどって\nじぶんの　まわりに　いるものを\nこんらん　じょうたいに　させる。", "흔들흔들 댄스를 춰서\n주위에 있는 포켓몬을\n혼란 상태로 만든다.", "Danse qui rend confus tous les\nPokémon autour du lanceur.", "Ein Wackeltanz, der andere\nPokémon in der Umgebung\ndes Anwenders verwirrt.", "Danza histérica que confunde a los\nPokémon que están alrededor\ndel usuario.", "Chi la usa esegue una danza goffa che\nconfonde tutti i Pokémon attorno.", "The user performs a wobbly dance that\nconfuses the Pokémon around it.") },
            { PBEMove.BlazeKick, new PBELocalizedString("こうげきした　あいてを\nやけど　じょうたいに　することが　ある。\nきゅうしょにも　あたりやすい。", "공격한 상대를\n화상 상태로 만들 때가 있다.\n급소에도 맞기 쉽다.", "Le lanceur envoie un coup de pied\nau taux de critiques élevé.\nPeut aussi brûler la cible.", "Starker Tritt mit hoher Volltrefferquote.\nVerursacht eventuell Verbrennung.", "Patada que suele ser un golpe crítico\ny puede causar quemaduras.", "Chi la usa tira un calcio. Probabile brutto\ncolpo. Può anche scottare il bersaglio.", "The user launches a kick that lands a\ncritical hit more easily.\nIt may also leave the target with a burn.") },
            // { PBEMove.300, new PBELocalizedString("どろを　かぶって　どろどろに　なる。\nじぶんが　いるあいだ\nでんきタイプの　わざを　よわめる。", "진흙투성이가 된다. 기술을 쓴\n포켓몬이 배틀에 나와 있는 동안\n전기타입의 기술을 약하게 만든다.", "Le lanceur se couvre de boue\npour affaiblir les capacités\nÉlectrik quand il combat.", "Schwächt Elektro-Attacken, solang\nder Anwender am Kampf teilnimmt.", "El usuario se cubre de lodo y debilita\nlos movimientos de tipo Eléctrico\nmientras está en combate.", "Chi la usa si ricopre di fango indebolendo\nle mosse di tipo Elettro finché resta\nin campo.", "The user covers itself with mud. It\nweakens Electric-type moves while the\nuser is in the battle.") },
            // { PBEMove.301, new PBELocalizedString("\xFF15ターンの　あいだ　ころがりつづけて\nあいてを　こうげきする。わざが\nあたるたび　いりょくが　あがる。", "5턴 동안 구르기를 반복하여\n상대를 공격한다. 기술이 맞을 때마다\n위력이 올라간다.", "Envoie une balle de glace pendant 5 tours.\nL'attaque gagne en puissance\nà chaque coup.", "Attacke, die fünf Runden dauert.\nDie Härte nimmt von Mal zu Mal zu.", "El atacante rueda contra el objetivo\ndurante cinco turnos, cada vez\ncon mayor fuerza.", "Chi la usa attacca il nemico rotolando\nper cinque turni, con aumento progressivo\ndella potenza ogni volta che va a segno.", "The user continually rolls into the target\nover five turns. It becomes stronger\neach time it hits.") },
            { PBEMove.NeedleArm, new PBELocalizedString("トゲの　うでを\nはげしく　ふるって　こうげきする。\nあいてを　ひるませる　ことが　ある。", "바늘팔을\n세차게 흔들어 공격한다.\n상대를 풀죽게 만들 때가 있다.", "Le lanceur attaque en fouettant l'ennemi\nde ses bras épineux. Peut aussi l'apeurer.", "Angriff mit dornigen Armen. Das Ziel\nschreckt eventuell zurück.", "Pega con brazos de pinchos y puede\nhacer retroceder al objetivo.", "Chi la usa attacca colpendo il nemico\ncon i suoi arti pieni di spine. Può far\ntentennare il Pokémon colpito.", "The user attacks by wildly swinging its\nthorny arms. It may also make the\ntarget flinch.") },
            { PBEMove.SlackOff, new PBELocalizedString("なまけて　やすむ。\nじぶんの　\xFF28\xFF30を　さいだい　\xFF28\xFF30の\nはんぶん　かいふく　する。", "게으름 피우며 쉰다.\n자신의 HP를 최대 HP의\n절반만큼 회복한다.", "Le lanceur se tourne les pouces et\nrécupère jusqu'à la moitié de ses PV max.", "Durch Müßiggang werden KP des\nAnwenders um 50 % der maximalen\nKP aufgefüllt.", "El usuario se relaja y restaura la mitad\nde sus PS máximos.", "Chi la usa si rilassa recuperando metà\ndei propri PS massimi.", "The user slacks off, restoring its own HP\nby up to half of its maximum HP.") },
            { PBEMove.HyperVoice, new PBELocalizedString("うるさく　ひびく　おおきな　しんどうを\nあいてに　あたえて　こうげきする。\n", "시끄럽게 울려서 큰 진동을\n상대에게 전달하여 공격한다.", "Le lanceur pousse un cri dont l'écho\nterrifiant a le pouvoir d'infliger\ndes dégâts.", "Laute Attacke mit Schallwellen.", "Grito desgarrador que inflige\ndaño al objetivo.", "Chi la usa lancia un urlo straziante che\ndanneggia i nemici.", "The user lets loose a horribly echoing\nshout with the power to inflict damage.") },
            { PBEMove.PoisonFang, new PBELocalizedString("どくの　ある　キバで\nあいてに　かみついて　こうげきする。\nもうどくを　おわせる　ことが　ある。", "독이 있는 이빨로\n상대를 물어서 공격한다.\n맹독을 주입할 때가 있다.", "Le lanceur mord l'ennemi de ses crocs\ntoxiques. Peut aussi l'empoisonner\ngravement.", "Angriff mit giftigen Reißzähnen.\nDas Ziel wird eventuell\nschwer vergiftet.", "Colmillos tóxicos que pueden envenenar\ngravemente al objetivo.", "Chi la usa morde il nemico con denti\navvelenati che possono anche\niperavvelenarlo.", "The user bites the target with toxic\nfangs. It may also leave the target\nbadly poisoned.") },
            { PBEMove.CrushClaw, new PBELocalizedString("かたく　するどい　ツメで　きりさいて\nこうげきする。あいての　ぼうぎょを\nさげることが　ある。", "단단하고 날카로운 손톱으로\n베어 갈라서 공격한다.\n상대의 방어를 떨어뜨릴 때가 있다.", "Lacère l'ennemi avec des griffes\nsolides et aiguisées.\nPeut aussi baisser sa Défense.", "Angriff mit scharfen Klauen. Senkt\neventuell den Verteidigungs-Wert.", "Hace trizas al objetivo con garras\nafiladas y puede bajar su Defensa.", "Colpisce il nemico con artigli robusti e\naffilati che possono ridurne la Difesa.", "The user slashes the target with hard\nand sharp claws.\nIt may also lower the target's Defense.") },
            // { PBEMove.307, new PBELocalizedString("ばくはつの　ほのおで\nあいてを　やきつくして　こうげきする。\nつぎの　ターンは　うごけなく　なる。", "폭발하는 불꽃으로\n상대를 태워서 공격한다.\n다음 턴은 움직일 수 없다.", "Une explosion ardente souffle\nl'adversaire. Le lanceur doit\nse reposer au tour suivant.", "Das Ziel wird von starker Explosion\ngetroffen. Angreifer setzt eine\nRunde aus.", "Explosión de fuego. El atacante debe\ndescansar el siguiente turno.", "Potente esplosione che danneggia\nil nemico, ma fa saltare il turno\nsuccessivo a chi la provoca.", "The target is razed by a fiery explosion.\nThe user must rest on the\nnext turn, however.") },
            // { PBEMove.308, new PBELocalizedString("みずの　たいほうを\nあいてに　はっしゃして　こうげきする。\nつぎの　ターンは　うごけなく　なる。", "물의 대포를\n상대에게 발사해서 공격한다.\n다음 턴은 움직일 수 없다.", "Une trombe d'eau heurte l'ennemi.\nLe lanceur doit se reposer au tour\nsuivant.", "Das Ziel wird von Wasserkanone\ngetroffen. Angreifer setzt eine\nRunde aus.", "Disparo de agua. El atacante debe\ndescansar el siguiente turno.", "Colpisce il nemico con un potente getto\nd'acqua. Chi la usa salta il turno\nsuccessivo.", "The target is hit with a watery blast.\nThe user must rest on the\nnext turn, however.") },
            { PBEMove.MeteorMash, new PBELocalizedString("すいせいの　ごとく　パンチを　くりだして\nあいてを　こうげきする。じぶんの　\nこうげきが　あがることが　ある。", "혜성과 같은 펀치를 날려서\n상대를 공격한다. 자신의\n공격이 올라갈 때가 있다.", "Un coup de poing lancé à la vitesse d'un\nmétéore. Peut aussi augmenter l'Attaque\ndu lanceur.", "Angriff mit einem harten, schnellen\nSchlag. Erhöht eventuell Angriffs-Wert\ndes Anwenders.", "Puñetazo que impacta como un meteorito\ny puede subir el Ataque del agresor.", "Colpisce il nemico con un pugno veloce\ncome una meteora. Può far pure salire\nl'Attacco di chi la usa.", "The target is hit with a hard punch fired\nlike a meteor. It may also raise\nthe user's Attack.") },
            { PBEMove.Astonish, new PBELocalizedString("おおきな　こえなどで\nふいに　おどろかして　こうげきする。\nあいてを　ひるませる　ことが　ある。", "큰 소리 등으로\n불시에 놀래켜서 공격한다.\n상대를 풀죽게 만들 때가 있다.", "Le lanceur attaque l'ennemi en poussant\nun cri terrifiant. Peut aussi l'apeurer.", "Anwender greift mit einem Schrei an.\nEin Angriff, der das Ziel eventuell\nzurückschrecken lässt.", "Impresiona tanto que puede hacer\nretroceder al objetivo.", "Chi la usa attacca il bersaglio emettendo\nun verso terrificante. Può anche farlo\ntentennare.", "The user attacks the target while shouting\nin a startling fashion.\nIt may also make the target flinch.") },
            { PBEMove.WeatherBall, new PBELocalizedString("つかった　ときの　てんきに　よって\nわざの　タイプと　いりょくが　かわる。\n", "사용했을 때의 날씨에 따라서\n기술 타입과 위력이 바뀐다.", "Une attaque dont la puissance et le type\nvarient en fonction du temps qu'il fait.", "Typ und Stärke der Attacke sind\nvom Wetter zum Zeitpunkt der\nAnwendung abhängig.", "El tipo y fuerza del ataque varían según\nel tiempo que haga.", "Mossa d'attacco che varia tipo e forza in\nbase alle condizioni atmosferiche.", "An attack move that varies in power and\ntype depending on the weather.") },
            // { PBEMove.312, new PBELocalizedString("ここちよい　やすらぐ　かおりを　かがせて\nみかた　ぜんいんの\nじょうたい　いじょうを　かいふく　する。", "기분 좋은 평온한 향기를 맡게 하여\n같은 편 모두의 상태 이상을 회복한다.", "Le lanceur libère un parfum apaisant\nqui guérit tous les problèmes de\nstatut de l'équipe.", "Heilt alle Statusprobleme des Teams\nmit beruhigendem Duft.", "Cura todos los problemas de estado\ndel equipo con un suave aroma.", "Chi la usa rilascia un dolce profumo\nche risolve tutti i problemi di stato\ndella sua squadra.", "The user releases a soothing scent that\nheals all status problems affecting\nthe user's party.") },
            { PBEMove.FakeTears, new PBELocalizedString("ないた　ふりをして　なみだを　ながす。\nこまらせる　ことで\nあいての　とくぼうを　がくっと　さげる。", "우는 척을 하며 눈물을 흘린다.\n난처하게 만들어\n상대의 특수방어를 크게 떨어뜨린다.", "Le lanceur fait semblant de pleurer\npour troubler l'ennemi et baisser\nfortement sa Défense Spéciale.", "Täuscht Weinen vor, um die\nSpezial-Verteidigung des Zieles\nstark zu senken.", "Lágrimas de cocodrilo que bajan mucho\nla Defensa Especial del objetivo.", "Chi la usa inscena un pianto teatrale per\ncommuovere il nemico. Ne riduce di molto la\nDifesa Speciale.", "The user feigns crying to fluster\nthe target, harshly lowering its\nSp. Def stat.") },
            { PBEMove.AirCutter, new PBELocalizedString("するどい　かぜで\nあいてを　きりつけて　こうげきする。\nきゅうしょに　あたりやすい。", "날카로운 바람으로\n상대를 베어 공격한다.\n급소에 맞기 쉽다.", "Le lanceur appelle des vents tranchants\nqui lacèrent l'ennemi.\nTaux de critiques élevé.", "Greift mit rasierklingenartigem\nWind an. Hohe Volltrefferquote.", "Viento cortante que azota.\nSuele ser un golpe crítico.", "Chi la usa provoca un vento tagliente che\nsferza i nemici. Probabile brutto colpo.", "The user launches razor-like wind to\nslash the opposing team.\nCritical hits land more easily.") },
            { PBEMove.Overheat, new PBELocalizedString("フルパワーで　あいてを　こうげきする。\nつかうと　はんどうで\nじぶんの　とくこうが　がくっと　さがる。", "풀 파워로 상대를 공격한다.\n쓰면 반동으로\n자신의 특수공격이 크게 떨어진다.", "Attaque l'ennemi à pleine puissance.\nLe contrecoup baisse énormément\nl'Attaque Spéciale du lanceur.", "Angriff mit voller Kraft, der den\nSpezial-Angriff des Anwenders durch\nden Rückstoß stark senkt.", "Ataque en toda regla que baja mucho\nel Ataque Especial de quien lo usa.", "Chi la usa sferra un potente attacco,\nma il contraccolpo riduce di molto\nil suo Attacco Speciale.", "The user attacks the target at full power.\nThe attack's recoil harshly reduces the\nuser's Sp. Atk stat.") },
            // { PBEMove.316, new PBELocalizedString("ゴーストタイプに　こうかがない　わざや\nかいひりつの　たかい　あいてに\nこうげきが　あたるように　なる。", "고스트타입에 효과가 없는 기술이나\n회피율이 높은 상대라 할지라도\n공격이 맞게 된다.", "Permet de toucher un Pokémon Spectre\navec n'importe quelle capacité et de\ntoucher un ennemi insaisissable.", "Erlaubt es, Geist-Pokémon mit Normal-\nund Kampf-Attacken anzugreifen.\nIgnoriert den Fluchtwert des Zieles.", "Permite atacar con cualquier movimiento\na objetivos de tipo Fantasma y golpear\na Pokémon evasivos.", "Chi la usa rende i Pokémon di tipo Spettro\nvulnerabili a qualsiasi tipo di mossa e può,\ninoltre, colpire i nemici sfuggenti.", "Enables a Ghost-type target to be hit with\nNormal- and Fighting-type attacks. It also\nenables an evasive target to be hit.") },
            { PBEMove.RockTomb, new PBELocalizedString("がんせきを　なげつけて　こうげきする。\nあいての　うごきを　ふうじることで\nすばやさを　さげる。", "암석을 내던져서 공격한다.\n상대의 움직임을 봉인함으로써\n스피드를 떨어뜨린다.", "Des rochers frappent l'ennemi. Réduit\naussi sa Vitesse en l'empêchant\nde se déplacer.", "Angriff mit Felsen. Bei Erfolg wird der\nInitiative-Wert des Zieles gesenkt.", "Tira rocas que detienen al objetivo y\nbajan su Velocidad.", "Colpisce il nemico con rocce. Inoltre,\nlo rallenta riducendone la Velocità.", "Boulders are hurled at the target. It also\nlowers the target's Speed by preventing\nits movement.") },
            { PBEMove.SilverWind, new PBELocalizedString("かぜに　りんぷんを　のせて　あいてを\nこうげきする。じぶんの　すべての\nのうりょくが　あがることが　ある。", "바람에 날개 가루를 날려서 상대를\n공격한다. 자신의 모든\n능력이 올라갈 때가 있다.", "Vent qui projette des écailles poudreuses\nsur l'ennemi. Peut aussi monter toutes\nles stats du lanceur.", "Angriff mit Silberstaub. Eventuell\nwerden alle Statuswerte des\nAnwenders erhöht.", "Fuerte viento con polvo de escamas.\nPuede subir todas las características\nde quien lo usa.", "Attacca con un forte vento di polvere di\nsquame. Tutte le statistiche di chi la\nusa possono salire.", "The target is attacked with powdery\nscales blown by wind.\nIt may also raise all the user's stats.") },
            { PBEMove.MetalSound, new PBELocalizedString("きんぞくを　こすって　でるような\nいやな　おとを　きかせる。\nあいての　とくぼうを　がくっと　さげる。", "금속을 긁을 때 나는 듯한\n싫은 소리를 들려준다.\n상대의 특수방어를 크게 떨어뜨린다.", "Un cri horrible tel un crissement\nmétallique qui réduit fortement\nla Défense Spéciale de l'ennemi.", "Stößt einen spitzen Schrei aus, der\ndie Spezial-Verteidigung des Zieles\nstark senkt.", "Horrible chirrido metálico que baja mucho\nla Defensa Especial del objetivo.", "Orribile stridio, simile a quello prodotto\ndal metallo, che riduce di molto\nla Difesa Speciale del nemico.", "A horrible sound like scraping metal\nharshly reduces the target's\nSp. Def stat.") },
            { PBEMove.GrassWhistle, new PBELocalizedString("ここちよい　ふえの　ねいろを　きかせて\nあいてを　ねむりの　じょうたいに　する。\n", "기분 좋은 피리 소리를 들려주어\n상대를 잠듦 상태로 만든다.", "Le lanceur joue une douce mélodie qui\nplonge l'ennemi dans un profond sommeil.", "Versetzt das Ziel durch eine\nschöne Melodie in Tiefschlaf.", "Agradable melodía que adormece\nal objetivo.", "Una dolce melodia culla il nemico e\nlo costringe ad addormentarsi.", "The user plays a pleasant melody that\nlulls the target into a deep sleep.") },
            { PBEMove.Tickle, new PBELocalizedString("からだを　くすぐり　わらわせる　ことで\nあいての　こうげきと　ぼうぎょを\nさげる。", "몸을 간질여 웃게 만들어서\n상대의 공격과 방어를 떨어뜨린다.", "Le lanceur chatouille l'ennemi, ce qui\nbaisse son Attaque et sa Défense.", "Bringt das Ziel zum Lachen und senkt\ndadurch dessen Angriff und Verteidigung.", "Hace reír al objetivo para bajar el Ataque\ny la Defensa.", "Chi la usa solletica il nemico e lo fa\nridere, riducendo il suo Attacco e la\nsua Difesa.", "The user tickles the target into laughing,\nreducing its Attack and Defense stats.") },
            { PBEMove.CosmicPower, new PBELocalizedString("うちゅう　から　しんぴの　ちからを\nとりこむ　ことで　じぶんの\nぼうぎょと　とくぼうを　あげる。", "우주로부터 신비한 힘을\n손에 넣음으로써\n자신의 방어와 특수방어를 올린다.", "Le lanceur absorbe un pouvoir mystique\nspatial qui augmente sa Défense\net sa Défense Spéciale.", "Erhöht Verteidigung und\nSpezial-Verteidigung durch\neine mystische Kraft.", "Sube la Defensa y la Defensa Especial\npropias con energía mística.", "Chi la usa assorbe una forza mistica\ndallo spazio che aumenta la Difesa\ne la Difesa Speciale.", "The user absorbs a mystical power from\nspace to raise its Defense and\nSp. Def stats.") },
            { PBEMove.WaterSpout, new PBELocalizedString("しおを　ふきつけて　こうげきする。\nじぶんの　\xFF28\xFF30が　すくないほど\nわざの　いりょくは　さがる。", "바닷물을 내뿜어 공격한다.\n자신의 HP가 적을수록\n기술의 위력이 떨어진다.", "Le lanceur attaque avec un jet d'eau.\nMoins il a de PV et moins l'attaque\nest puissante.", "Wasser-Attacke, die wirkungsvoller ist,\nwenn KP des Anwenders hoch sind.", "Chorro de agua. Cuantos menos PS\ntenga el usuario, menos dañino será.", "Lancia un getto d'acqua contro i nemici.\nLa potenza è proporzionale al numero di PS\ndi chi la usa.", "The user spouts water to damage the\nopposing team. The lower the user's HP,\nthe less powerful it becomes.") },
            { PBEMove.SignalBeam, new PBELocalizedString("ふしぎな　ひかりを\nはっしゃして　こうげきする。\nあいてを　こんらん　させることが　ある。", "이상한 빛을\n발사해서 공격한다.\n상대를 혼란시킬 때가 있다.", "Le lanceur projette un rayon de\nlumière sinistre. Peut aussi\nrendre l'ennemi confus.", "Strahlenattacke, die das Ziel\neventuell verwirrt.", "Ataca con un rayo de luz siniestro.\nPuede confundir al objetivo.", "Chi la usa attacca con uno strano raggio\ndi luce che può anche confondere\nil Pokémon colpito.", "The user attacks with a sinister beam of\nlight. It may also confuse the target.") },
            { PBEMove.ShadowPunch, new PBELocalizedString("かげに　まぎれて　パンチを　くりだす。\nこうげきは　かならず　めいちゅう　する。\n", "그림자에 섞여 펀치를 날린다.\n공격은 반드시 명중한다.", "Le lanceur surgit des ombres et donne\nun coup de poing. N'échoue jamais.", "Angriff mit der Faust aus dem\nSchattenreich. Ausweichen\nunmöglich.", "Puñetazo ineludible procedente\nde las sombras.", "Il nemico riceve un pugno proveniente\ndalle tenebre. Questa mossa è infallibile.", "The user throws a punch from the shadows.\nThe punch lands without fail.") },
            { PBEMove.Extrasensory, new PBELocalizedString("みえない　ふしぎな　ちからを\nおくって　こうげきする。\nあいてを　ひるませる　ことが　ある。", "보이지 않는 이상한 힘을\n보내어 공격한다.\n상대를 풀죽게 만들 때가 있다.", "Le lanceur attaque avec un pouvoir\nétrange et invisible. Peut aussi\napeurer l'ennemi.", "Besonderer Angriff mit einer unsichtbaren\nKraft, die das Ziel eventuell\nzurückschrecken lässt.", "Energía muy extraña que puede\nhacer retroceder al objetivo.", "Chi la usa attacca con una misteriosa\nforza invisibile. Può far tentennare\nil nemico.", "The user attacks with an odd,\nunseeable power.\nIt may also make the target flinch.") },
            { PBEMove.SkyUppercut, new PBELocalizedString("そらに　むかうような　たかい　アッパーで\nあいてを　つきあげて　こうげきする。\n", "하늘을 향하는 듯한 높은 업퍼로\n상대를 밀어올려 공격한다.", "Le lanceur attaque avec un uppercut.\nIl envoie son poing vers le ciel de\ntoutes ses forces.", "Kinnhaken, der das Ziel gen\nHimmel schickt.", "Gancho ascendente de gran ímpetu.", "Chi la usa attacca il nemico con un\nmontante che può arrivare fino in cielo.", "The user attacks the target with an\nuppercut thrown skyward with force.") },
            // { PBEMove.328, new PBELocalizedString("はげしく　ふきあれる　すなあらしの\nなかに　\xFF14ー\xFF15ターンの　あいだ\nあいてを　とじこめて　こうげきする。", "세차게 불어대는\n모래바람 속에 4-5턴 동안\n상대를 가두어 공격한다.", "Le lanceur emprisonne l'ennemi dans\nune tempête de sable terrifiante qui\ndure de 4 à 5 tours.", "Das Ziel leidet für 4 bis 5\nRunden in einer Sandhose.", "Enreda al objetivo en un remolino de arena\nde cuatro a cinco turnos.", "Chi la usa intrappola il nemico in un turbine\ndi sabbia per quattro o cinque turni.", "The user traps the target inside a harshly\nraging sandstorm for four to five turns.") },
            { PBEMove.SheerCold, new PBELocalizedString("ぜったいれいどの　つめたさで\nあいてを　こうげきする。\nあたれば　いちげきで　ひんしに　する。", "절대영도의 추위로\n상대를 공격한다.\n맞으면 일격에 기절한다.", "Une vague de froid glacial frappe\nl'ennemi. S'il est touché, il est mis\nK.O. sur le coup.", "Angriff mit Kälte, die das Ziel\nbei Erfolg besiegt.", "Ataque de frío polar que debilita\nal objetivo si le alcanza.", "Ondata di freddo penetrante che, se va\na segno, fa andare KO il nemico.", "The target is attacked with a blast of\nabsolute-zero cold.\nThe target instantly faints if it hits.") },
            { PBEMove.MuddyWater, new PBELocalizedString("にごった　みずを\nあいてに　はっしゃして　こうげきする。\nめいちゅうりつを　さげることが　ある。", "탁해진 물을\n상대에게 발사하여 공격한다.\n명중률을 떨어뜨릴 때가 있다.", "Le lanceur attaque en projetant de l'eau\nboueuse. Peut aussi réduire la Précision\nde l'ennemi.", "Greift mit Matsch an und senkt\neventuell die Genauigkeit des\nGegners.", "Ataque con agua lodosa que puede\nbajar la Precisión.", "Chi la usa attacca con un getto di fango\nche può anche ridurre la precisione\ndei nemici.", "The user attacks by shooting muddy water\nat the opposing team.\nIt may also lower the targets' accuracy.") },
            // { PBEMove.331, new PBELocalizedString("タネを　いきおいよく\nあいてに　はっしゃして　こうげきする。\n\xFF12ー\xFF15かいの　あいだ　れんぞくで　だす。", "씨앗을 기세 좋게\n상대에게 발사하여 공격한다.\n2-5회 동안 연속으로 쓴다.", "Le lanceur mitraille l'ennemi avec une\nrafale de graines. De 2 à 5 rafales sont\nlancées à la suite.", "Der Anwender wirft 2- bis 5-mal\nin rascher Folge Samen auf das\nZiel.", "Dispara rápido de dos a cinco ráfagas\nde semillas de manera consecutiva.", "Chi la usa spara da due a cinque raffiche\ndi semi contro il nemico in successione.", "The user forcefully shoots seeds at the\ntarget. Two to five seeds are shot in\nrapid succession.") },
            { PBEMove.AerialAce, new PBELocalizedString("すばやい　うごきで\nあいてを　ほんろうして　きりつける。\nこうげきは　かならず　めいちゅう　する。", "재빠른 움직임으로\n상대를 농락해 벤다.\n공격은 반드시 명중한다.", "Le lanceur prend l'ennemi de vitesse\net le lacère. N'échoue jamais.", "Eine extrem schnelle Attacke, der\ndas Ziel nicht ausweichen kann.", "El usuario lanza un ataque muy rápido\ne ineludible.", "Chi la usa attacca il nemico a grande\nvelocità. Questa mossa è infallibile.", "The user confounds the target with speed,\nthen slashes.\nThe attack lands without fail.") },
            // { PBEMove.333, new PBELocalizedString("するどい　つららを\nあいてに　はっしゃして　こうげきする。\n\xFF12ー\xFF15かいの　あいだ　れんぞくで　だす。", "날카로운 고드름을\n상대에게 발사하여 공격한다.\n2-5회 동안 연속으로 쓴다.", "Le lanceur jette des pics de glace sur\nl'ennemi, de 2 à 5 fois de suite.", "Feuert 2 bis 5 Eiszapfen auf\ndas Ziel.", "Ataca lanzando de dos a cinco ráfagas\nconsecutivas de carámbanos.", "Chi la usa spara ghiaccioli affilati contro\nil nemico da due a cinque volte di fila.", "The user launches sharp icicles at the\ntarget. It strikes two to five times in\na row.") },
            { PBEMove.IronDefense, new PBELocalizedString("ひふを　てつのように\nかたくする　ことで\nじぶんの　ぼうぎょを　ぐーんと　あげる。", "피부를 쇠처럼\n단단하게 함으로써\n자신의 방어를 크게 올린다.", "L'épiderme du lanceur devient dur comme\ndu fer, ce qui augmente considérablement\nsa Défense.", "Anwender stärkt den Körper, um den\nVerteidigungs-Wert stark zu erhöhen.", "Fortalece el cuerpo como si fuera\nde hierro y sube mucho la Defensa.", "Il corpo di chi la usa si indurisce come\nil ferro, facendone salire di molto la\nDifesa.", "The user hardens its body's surface\nlike iron, sharply raising its\nDefense stat.") },
            // { PBEMove.335, new PBELocalizedString("りょうてを　ひろげて　たちはだかり\nあいての　にげみちを　ふさいで\nにげられなく　する。", "양팔을 벌려 막아서서\n상대의 도주로를 가로막아\n도망칠 수 없게 한다.", "Le lanceur bloque la route de l'ennemi\npour empêcher sa fuite.", "Anwender versperrt den Fluchtweg des\nZieles.", "Le corta el paso al objetivo para que\nno pueda escapar.", "Chi la usa sbarra la strada al nemico\nimpedendone la fuga o la sostituzione.", "The user blocks the target's way with arms\nspread wide to prevent escape.") },
            { PBEMove.Howl, new PBELocalizedString("おおごえで　ほえて　きあいを　たかめ\nじぶんの　こうげきを　あげる。\n", "큰 소리로 짖고 기합을 높여\n자신의 공격을 올린다.", "Le lanceur hurle pour se rassurer, ce qui\naugmente son Attaque.", "Anwender jault, um seinen Kampfgeist\nund seinen Angriffs-Wert zu erhöhen.", "Aullido que sube el ánimo y aumenta\nel Ataque.", "Chi la usa emette un verso molto forte\nper darsi coraggio e aumentare l'Attacco.", "The user howls loudly to raise its spirit,\nboosting its Attack stat.") },
            { PBEMove.DragonClaw, new PBELocalizedString("するどく　とがった　きょだいな　ツメで\nあいてを　きりさいて　こうげきする。\n", "날카롭고 뾰족한 거대한 발톱으로\n상대를 베어 갈라서 공격한다.", "Le lanceur lacère l'ennemi de ses\ngrandes griffes aiguisées.", "Das Ziel wird mit riesigen, scharfen\nKlauen stark verletzt.", "Araña al objetivo con garras afiladas.", "Chi la usa attacca con artigli affilati che\ngraffiano il nemico rapidamente e con\ngrande forza.", "The user slashes the target with huge,\nsharp claws.") },
            // { PBEMove.338, new PBELocalizedString("おおきな　じゅもくで\nあいてを　たたきつけて　こうげきする。\nつぎの　ターンは　うごけなく　なる。", "큰 나무로\n상대를 힘껏 쳐서 공격한다.\n다음 턴은 움직일 수 없게 된다.", "Un violent coup de racines s'abat sur\nl'ennemi. Immobilise le lanceur au tour\nsuivant.", "Angriff mit dickem Ast. Der Angreifer\nmuss eine Runde aussetzen.", "Golpea con una enorme planta.\nQuien lo usa no puede moverse\nen el siguiente turno.", "Un groviglio di radici colpisce il nemico.\nChi la usa salta il turno successivo.", "The user slams the target with\nan enormous tree.\nThe user can't move on the next turn.") },
            { PBEMove.BulkUp, new PBELocalizedString("からだに　ちからを　こめて　きんにくを\nぶあつく　することで　じぶんの\nこうげきと　ぼうぎょを　あげる。", "몸에 힘을 담아\n근육을 두껍게 해서\n자신의 공격과 방어를 올린다.", "Le lanceur tend ses muscles pour se\ngonfler, ce qui booste son Attaque\net sa Défense.", "Pumpt den Körper auf, um den Angriff\nund die Verteidigung zu erhöhen.", "Robustece el cuerpo para subir el Ataque\ny la Defensa.", "Chi la usa tende i muscoli per gonfiare\nil corpo, aumentando Difesa e Attacco.", "The user tenses its muscles to bulk up\nits body, boosting both its Attack and\nDefense stats.") },
            // { PBEMove.340, new PBELocalizedString("そらたかく　とびはねて\n\xFF12ターンめに　あいてを　こうげきする。\nまひ　じょうたいに　することが　ある。", "하늘 높이 뛰어올라\n2턴째에 상대를 공격한다.\n마비 상태로 만들 때가 있다.", "Le lanceur bondit très haut et plonge\nsur l'ennemi au 2⒅ tour. Peut aussi\nparalyser l'ennemi.", "Angreifer springt und landet in der\nnächsten Runde auf dem Ziel. Das\nZiel wird eventuell paralysiert.", "Primer turno: bota.\nSegundo turno: golpea.\nPuede paralizar.", "Chi la usa balza in alto e ricade sul nemico\ndopo un turno. Può anche paralizzare\nil bersaglio.", "The user bounces up high, then drops on\nthe target on the second turn. It may\nalso leave the target with paralysis.") },
            { PBEMove.MudShot, new PBELocalizedString("どろの　かたまりを\nあいてに　なげつけて　こうげきする。\nどうじに　あいての　すばやさを　さげる。", "진흙 덩어리를\n상대에게 내던져서 공격한다.\n동시에 상대의 스피드를 떨어뜨린다.", "Le lanceur attaque en projetant\nde la boue sur l'ennemi. Réduit\naussi la Vitesse de la cible.", "Angriff mit Lehm, der den Initiative-Wert\ndes Zieles senkt.", "El usuario lanza lodo al objetivo y reduce\nsu Velocidad.", "Chi la usa attacca lanciando fango sul\nbersaglio, riducendone anche la Velocità.", "The user attacks by hurling a blob of mud\nat the target.\nIt also reduces the target's Speed.") },
            { PBEMove.PoisonTail, new PBELocalizedString("しっぽで　たたく。\nどく　じょうたいに　することが　あり\nきゅうしょにも　あたりやすい。", "꼬리로 때린다.\n독 상태로 만들 때가 있고\n급소에도 맞기 쉽다.", "Attaque à taux de critiques élevé.\nPeut aussi empoisonner l'ennemi.", "Angriff mit hoher Volltrefferquote.\nDiese Schweifattacke vergiftet das\nZiel eventuell.", "Puede envenenar y dar un golpe crítico.", "Chi la usa colpisce con la coda e può\navvelenare il nemico. Probabile brutto\ncolpo.", "The user hits the target with its tail.\nIt may also poison the target.\nCritical hits land more easily.") },
            // { PBEMove.343, new PBELocalizedString("かわいく　あまえながら\nあいてに　ちかづき\nもっている　どうぐを　うばう。", "귀엽게 애교부리며\n상대에게 다가가\n지니고 있는 도구를 뺏는다.", "Le lanceur s'approche de la cible avec\nun air angélique afin de dérober l'objet\nqu'elle tient.", "Bittet charmant um das gehaltene Item\ndes Zieles und stiehlt es dann.", "Se acerca con ternura al objetivo, pero le\nataca pudiendo robar el objeto que lleve.", "Chi la usa attacca il bersaglio sorridendo\ne gli ruba lo strumento che tiene.\n", "The user endearingly approaches\nthe target, then steals the target's\nheld item.") },
            { PBEMove.VoltTackle, new PBELocalizedString("でんきを　まとって　とっしんする。\nじぶんも　かなり ダメージを　うける\nまひ　じょうたいに　することが　ある。", "전기를 한데 모아 돌진한다.\n자신도 상당한 데미지를 입는다.\n마비 상태로 만들 때가 있다.", "Le lanceur électrifie son corps avant de\ncharger. Le choc blesse aussi beaucoup\nle lanceur et peut paralyser l'ennemi.", "Angriff mit Elektro-Tackle. Der Anwender\nverletzt sich dabei. Das Ziel wird\neventuell paralysiert.", "Quien lo usa electrifica su cuerpo para\nluego atacar. Se hiere mucho a sí mismo,\npero puede paralizar al objetivo.", "Chi la usa si carica di elettricità e poi\nattacca. Può paralizzare il nemico.\nIl contraccolpo causa seri danni.", "The user electrifies itself, then charges.\nIt causes considerable damage to the user\nand may leave the target with paralysis.") },
            { PBEMove.MagicalLeaf, new PBELocalizedString("あいてを　ついせきする\nふしぎな　はっぱを まきちらす。\nこうげきは　かならず　めいちゅう　する。", "상대를 추적하는\n이상한 잎사귀를 흩뿌린다.\n공격은 반드시 명중한다.", "Le lanceur disperse d'étranges feuilles\nqui poursuivent l'ennemi. N'échoue jamais.", "Magischer Blattangriff, dem nicht\nauszuweichen ist.", "Esparce extrañas hojas que persiguen\nal objetivo. No se puede esquivar.", "Chi la usa sparpaglia strane foglie che\ninseguono il nemico. Attacco infallibile.", "The user scatters curious leaves\nthat chase the target.\nThis attack will not miss.") },
            // { PBEMove.346, new PBELocalizedString("みずを　かぶって　びしょびしょに　なる。\nじぶんが　いるあいだ\nほのおタイプの　わざを　よわめる。", "흠뻑 젖어 버린다. 기술을 쓴 포켓몬이\n배틀에 나와 있는 동안 불꽃타입의\n기술을 약하게 만든다.", "Le lanceur s'asperge d'eau. Affaiblit\nles capacités Feu quand le lanceur\nest au combat.", "Schwächt Feuer-Attacken, solang\nder Anwender am Kampf teilnimmt.", "El usuario se moja y, mientras esté\nen combate, los movimientos de tipo\nFuego se debilitan.", "Chi la usa s'impregna d'acqua indebolendo\nle mosse di tipo Fuoco finché resta\nin campo.", "The user soaks itself with water. The move\nweakens Fire-type moves while the user\nis in the battle.") },
            { PBEMove.CalmMind, new PBELocalizedString("しずかに　せいしんを　とういつし\nこころを　しずめる　ことで　じぶんの\nとくこうと　とくぼうを　あげる。", "조용히 정신을 통일하고\n마음을 가라앉혀서 자신의\n특수공격과 특수방어를 올린다.", "Le lanceur se concentre et fait le vide\ndans son esprit pour monter son\nAttaque Spéciale et sa Défense Spéciale.", "Erhöht Spezial-Angriff und\nSpezial-Verteidigung durch\nKonzentration.", "Aumenta la concentración y calma\nel espíritu para subir el Ataque Especial\ny la Defensa Especial.", "Chi la usa, meditando, placa il proprio\nspirito per aumentare l'Attacco Speciale\ne la Difesa Speciale.", "The user quietly focuses its mind and\ncalms its spirit to raise its Sp. Atk and\nSp. Def stats.") },
            { PBEMove.LeafBlade, new PBELocalizedString("はっぱを　つるぎのように　あやつり\nあいてを　きりつけて　こうげきする。\nきゅうしょに　あたりやすい。", "잎사귀를 칼처럼 이용해\n상대를 베어 공격한다.\n급소에 맞기 쉽다.", "Une feuille coupante comme une lame\nentaille l'ennemi. Taux de critiques élevé.", "Hieb mit scharfkantigem\nBlatt. Hohe Volltrefferquote.", "Acuchilla con una hoja fina.\nSuele dar un golpe crítico.", "Colpisce il nemico usando una foglia\naffilata come una spada. Probabile\nbrutto colpo.", "The user handles a sharp leaf like a\nsword and attacks by cutting its target.\nCritical hits land more easily.") },
            { PBEMove.DragonDance, new PBELocalizedString("しんぴてきで　ちからづよい　まいを\nはげしく　おどる。じぶんの\nこうげきと　すばやさを　あげる。", "신비롭고 힘센 춤을\n격렬하게 춘다. 자신의\n공격과 스피드를 올린다.", "Une danse mystique dont le rythme\neffréné augmente l'Attaque et la\nVitesse du lanceur.", "Ein mystischer Tanz, der den\nAngriffs- und Initiative-Wert\nerhöht.", "Danza mística que sube el Ataque\ny la Velocidad.", "Danza mistica e vigorosa che aumenta\nl'Attacco e la Velocità di chi la usa.", "The user vigorously performs a mystic,\npowerful dance that boosts its Attack and\nSpeed stats.") },
            // { PBEMove.350, new PBELocalizedString("かたい　がんせきを\nあいてに　はっしゃして　こうげきする。\n\xFF12ー\xFF15かいの　あいだ　れんぞくで　だす。", "단단한 암석을\n상대에게 발사하여 공격한다.\n2-5회 동안 연속으로 쓴다.", "Le lanceur projette un rocher sur\nl'ennemi de 2 à 5 fois d'affilée.", "Wirft 2- bis 5-mal in Folge Felsblöcke\nauf das Ziel.", "Lanza pedruscos al objetivo de dos a cinco\nveces consecutivas.", "Colpisce il nemico con dei massi pesanti\nlanciati in rapida successione. Il numero\ndi massi varia da due a cinque.", "The user hurls hard rocks at the target.\nTwo to five rocks are launched in quick\nsuccession.") },
            { PBEMove.ShockWave, new PBELocalizedString("でんげきを　すばやく\nあいてに　あびせる。\nこうげきは　かならず　めいちゅう　する。", "전격을 재빠르게\n상대에게 날린다.\n공격은 반드시 명중한다.", "Le lanceur envoie un choc électrique\nrapide à l'ennemi. Impossible à esquiver.", "Angriff mit schnellem Elektro-Schlag.\nAusweichen nicht möglich.", "Ataque eléctrico muy rápido e ineludible.", "Chi la usa colpisce il nemico con una scossa\ndi elettricità. È impossibile eludere questa\nmossa.", "The user strikes the target with a quick\njolt of electricity.\nThis attack cannot be evaded.") },
            { PBEMove.WaterPulse, new PBELocalizedString("みずの　しんどうを\nあいてに　あたえて　こうげきする。\nあいてを　こんらん　させることが　ある。", "물의 진동을\n상대에게 가하여 공격한다.\n상대를 혼란시킬 때가 있다.", "Le lanceur envoie un puissant\njet d'eau sur l'ennemi. Peut\nrendre l'ennemi confus.", "Angriff mit Wasserwelle, die das\nZiel eventuell verwirren kann.", "Ataca con un potente chorro de agua.\nPuede confundir al objetivo.", "Il nemico viene colpito da un getto d'acqua\npotentissimo che può anche confonderlo.", "The user attacks the target with\na pulsing blast of water.\nIt may also confuse the target.") },
            // { PBEMove.353, new PBELocalizedString("わざを　つかった　\xFF12ターン　あとに\nむすうの　ひかりの　たばで\nあいてを　こうげきする。", "기술을 사용한 2턴 뒤에\n무수한 빛의 다발이\n상대를 공격한다.", "Le lanceur génère une sphère lumineuse\nqu'il projette sur l'ennemi 2 tours\nplus tard.", "Angriff mit gebündeltem Licht erfolgt\nzwei Runden nach Attackeneinsatz.", "Concentra un haz de luz y ataca\ndos turnos después.", "Intensa luce solare che colpisce il nemico\ndopo due turni dall'uso della mossa.", "Two turns after this move is used, the\nuser blasts the target with a\nconcentrated bundle of light.") },
            { PBEMove.PsychoBoost, new PBELocalizedString("フルパワーで　あいてを　こうげきする。\nつかうと　はんどうで\nじぶんの　とくこうが　がくっと　さがる。", "풀 파워로 상대를 공격한다.\n쓰면 반동으로\n자신의 특수공격이 크게 떨어진다.", "Attaque l'ennemi à pleine puissance.\nLe contrecoup baisse énormément\nl'Attaque Spéciale du lanceur.", "Angriff mit voller Kraft, der den\nSpezial-Angriff des Anwenders durch\nden Rückstoß stark senkt.", "Ataque en toda regla que baja mucho\nel Ataque Especial de quien lo usa.", "Chi la usa sferra un potente attacco,\nma il contraccolpo riduce di molto\nil suo Attacco Speciale.", "The user attacks the target at full power.\nThe attack's recoil harshly reduces the\nuser's Sp. Atk stat.") },
            // { PBEMove.355, new PBELocalizedString("じめんに　おりて　からだを　やすめる。\nさいだい　\xFF28\xFF30の　はんぶんの\n\xFF28\xFF30を　かいふく　する。", "땅에 내려와 몸을 쉬게 한다.\n최대 HP의 절반만큼\nHP를 회복한다.", "Le lanceur atterrit et se repose.\nRestaure jusqu'à la moitié\nde ses PV max.", "Anwender landet und ruht sich aus.\nKP des Anwenders werden um 50 %\nder maximalen KP aufgefüllt.", "Aterriza sobre la superficie para\ndescansar. Recupera hasta la\nmitad del total de sus PS.", "Chi la usa sta fermo e riposa, recuperando\nmetà dei propri PS massimi.", "The user lands and rests its body.\nIt restores the user's HP by up to\nhalf of its max HP.") },
            // { PBEMove.356, new PBELocalizedString("\xFF15ターンの　あいだ\nじゅうりょくを　つよくして　ふゆうや\nそらへ　とぶ　わざを　つかえなく　する。", "5턴 동안 중력을\n강하게 해서 부유나 하늘을 나는\n기술을 사용할 수 없게 한다.", "La gravité augmente pendant 5 tours,\nce qui empêche les capacités volantes\net annule Lévitation.", "Die Gravitation wird für fünf Runden\nerhöht. Macht Fliegen unmöglich und\nverhindert Schwebe.", "La gravedad aumenta durante cinco\nturnos, lo que impide acciones\nque impliquen volar o levitar.", "Intensifica la gravità per cinque turni.\nLe mosse che fanno volare e Levitazione\nsono inutilizzabili.", "Gravity is intensified for five turns,\nmaking moves involving flying unusable\nand negating Levitate.") },
            // { PBEMove.357, new PBELocalizedString("あくタイプに　こうかがない　わざや\nかいひりつの　たかい　あいてに\nこうげきが　あたるように　なる。", "악타입에 효과가 없는 기술이나\n회피율이 높은 상대라 할지라도\n공격이 맞게 된다.", "Permet de toucher un Pokémon Ténèbres\navec toute capacité et de toucher un\nennemi insaisissable.", "Erlaubt es, Unlicht-Pokémon mit\nPsycho-Attacken anzugreifen.\nIgnoriert den Fluchtwert des Zieles.", "Permite atacar con cualquier movimiento\na objetivos de tipo Siniestro y golpear\na Pokémon evasivos.", "Chi la usa rende i Pokémon di tipo Buio\nvulnerabili a qualsiasi tipo di mossa e può,\ninoltre, colpire i nemici sfuggenti.", "Enables a Dark-type target to be hit by\nPsychic-type attacks. It also enables\nan evasive target to be hit.") },
            // { PBEMove.358, new PBELocalizedString("ねむり　じょうたいの　あいてに\nおおきな　ダメージを　あたえる。　\nかわりに　あいては　ねむりから　さめる。", "잠듦 상태의 상대에게\n큰 데미지를 준다.\n대신 상대는 잠에서 깬다.", "Cette attaque inflige d'importants\ndégâts à un Pokémon endormi.\nMais elle le réveille également.", "Richtet großen Schaden bei einem\nschlafenden Ziel an, weckt es\naber auch auf.", "Inflige gran daño a objetivos dormidos.\nSin embargo, los bofetones también\nlos despiertan.", "Questa mossa infligge un danno doppio\nad un bersaglio addormentato, ma allo\nstesso tempo lo risveglia.", "This attack inflicts big damage on a\nsleeping target. It also wakes the target\nup, however.") },
            { PBEMove.HammerArm, new PBELocalizedString("つよくて　おもい　こぶしを\nふるって　ダメージを　あたえる。\nじぶんの　すばやさが　さがる。", "강하고 무거운 주먹을\n휘둘러 데미지를 준다.\n자신의 스피드가 떨어진다.", "Le lanceur lâche un puissant coup de\npoing sur l'ennemi. Réduit la vitesse\ndu lanceur.", "Anwender trifft mit einem starken Hieb.\nSenkt Initiative des Anwenders.", "Gira con fuerza el puño y da un gran\ngolpe. No obstante, baja la Velocidad.", "Chi la usa colpisce il nemico con il suo\npugno forte e pesante, ma perde Velocità.", "The user swings and hits with its strong\nand heavy fist.\nIt lowers the user's Speed, however.") },
            // { PBEMove.360, new PBELocalizedString("からだを　こうそくに　かいてん　させて\nたいあたりする。あいてより　すばやさが\nおそいほど　つよい。", "몸을 고속으로 회전시켜\n몸통박치기한다. 상대보다\n스피드가 느릴수록 위력은 올라간다.", "Le lanceur effectue une rotation et\nfrappe l'ennemi. Plus le lanceur est\nlent, plus il fait de dégâts.", "Angriff mit hoher Geschwindigkeit. Je\nniedriger die Initiative des Anwenders,\ndesto mehr Schaden.", "Embiste al objetivo con un potente ataque\ngiratorio. Cuanto más lento es\nel usuario, más daño causa.", "Chi la usa colpisce il nemico con un vortice\nrapidissimo. Più lento è chi la usa, maggiore\nè il danno.", "The user tackles the target with a\nhigh-speed spin. The slower the\nuser, the greater the damage.") },
            // { PBEMove.361, new PBELocalizedString("じぶんは　ひんしに　なるが　ひかえから\nでてくる　ポケモンの　じょうたい\nいじょうと　\xFF28\xFF30を　かいふく　する。", "자신은 기절하지만\n교대하여 나오는 포켓몬의\n상태 이상과 HP를 회복한다.", "Le lanceur tombe K.O. pour soigner les\nPV et le statut du Pokémon qui passe\naprès lui.", "Anwender geht K.O. Das an seine\nStelle tretende Pokémon hat volle\nKP. Statusprobleme werden geheilt.", "El Pokémon cae debilitado, pero su\nsustituto recupera su estado y los PS.", "Chi la usa va KO, ma il Pokémon che lo\nsostituisce recupera tutti i PS e risolve\ni problemi di stato.", "The user faints. In return, the Pokémon\ntaking its place will have its HP restored\nand status cured.") },
            { PBEMove.Brine, new PBELocalizedString("あいてが　\xFF28\xFF30の　はんぶん　くらい\nきずを　おっていると　わざの　いりょくが\n\xFF12ばいに　なる。", "상대가 HP의 절반 정도\n상처를 입고 있으면 기술의\n위력이 2배가 된다.", "Cette attaque est deux fois plus\npuissante lorsque l'ennemi a moins\nde la moitié de ses PV.", "Hat das Ziel die Hälfte oder weniger\nseiner maximalen KP, trifft diese Attacke\nmit doppelter Kraft.", "Si al objetivo le queda la mitad o menos\nde sus PS, el ataque será el doble\nde fuerte.", "Se i PS del nemico sono scesi a metà o\nmeno, questa mossa colpirà con il doppio\ndella forza.", "If the target's HP is down to about half,\nthis attack will hit with double\nthe power.") },
            // { PBEMove.363, new PBELocalizedString("きのみから　ちからを　もらい\nこうげきする。もたせた　きのみで\nわざの　タイプと　いりょくが　かわる。", "나무열매에서 힘을 얻어\n공격한다. 지니게 한 나무열매에 따라\n기술의 타입과 위력이 바뀐다.", "Avant d'attaquer, le lanceur rassemble\nses forces grâce à sa Baie. Elle\ndétermine le type et la puissance.", "Anwender zieht aus seiner derzeitigen\nBeere Kraft. Sie bestimmt Typ und\nStärke der Attacke.", "La Baya que lleva presta su fuerza\npara atacar. El tipo de ataque\ny su fuerza dependen de la Baya.", "Chi la usa trae forza dalla Bacca che\ntiene. Da questa dipendono il tipo e\nla forza dell'attacco.", "The user draws power to attack by using\nits held Berry.\nThe Berry determines its type and power.") },
            // { PBEMove.364, new PBELocalizedString("まもるや　みきりを　している\nあいてに　こうげきが　できる。\nまもりの　こうかを　かいじょ　させる。", "방어나 판별을 하고 있는\n상대에게 공격할 수 있다.\n방어 효과를 해제시킨다.", "Une attaque capable de toucher un ennemi\nqui utilise Détection ou Abri. Annule aussi\nleur effet.", "Ziele, die Schutzschild oder Scanner\nverwenden, werden getroffen. Entfernt\nEffekte dieser Attacken.", "Permite golpear a objetivos que usan\nProtección o Detección y anula\ndichos movimientos.", "Mossa che colpisce anche un nemico che ha\nusato Protezione o Individua, annullandone\ngli effetti.", "An attack that hits a target using\nProtect or Detect. It also lifts\nthe effects of those moves.") },
            // { PBEMove.365, new PBELocalizedString("くちばしで　こうげき。\nあいてが　きのみを　もっている　とき\nたべて　きのみの　こうかを　うけられる。", "부리로 공격한다.\n상대가 나무열매를 지니고 있을 때\n먹어서 나무열매의 효과를 받을 수 있다.", "Le lanceur picore la cible. Si cette\ndernière tient une Baie, le lanceur\nla mange et profite de ses effets.", "Anwender pickt das Ziel, nimmt die\nBeere, falls das Ziel eine hält,\nund erhält ihren Effekt.", "Picotea al objetivo. Si este sostiene una\nBaya, la picotea también y obtiene\nsus efectos.", "Chi la usa becca il bersaglio. Inoltre, se\nquesti tiene una Bacca, gliela ruba e ne\nsfrutta gli effetti.", "The user pecks the target. If the target\nis holding a Berry, the user eats it and\ngains its effect.") },
            // { PBEMove.366, new PBELocalizedString("はげしく　ふきあれる\nかぜのうずを　つくり　\xFF14ターンの　あいだ\nみかた　ぜんいんの　すばやさを　あげる。", "세차게 불어대는\n바람의 소용돌이를 만들어 4턴 동안\n같은 편 모두의 스피드를 올린다.", "Génère une rafale de vent qui augmente la\nVitesse des Pokémon de l'équipe pendant 4\ntours.", "Anwender erzeugt einen Wirbelwind, der\ndie Initiative aller Pokémon im Team für\nvier Runden steigert.", "Crea un fuerte remolino que aumenta\nla Velocidad de los Pokémon de tu equipo\ndurante cuatro turnos.", "Chi la usa scatena un turbine che aumenta\nla Velocità di tutti i Pokémon della squadra\nper quattro turni.", "The user whips up a turbulent whirlwind\nthat ups the Speed of all party Pokémon\nfor four turns.") },
            // { PBEMove.367, new PBELocalizedString("つぼおしで　からだを\nかっせいか　させる。のうりょくの\nどれか　\xFF11つを　ぐーんと　あげる。", "경혈을 눌러 몸을 활성화시킨다.\n능력 중 하나를 크게 올린다.", "Le lanceur effectue des pressions\npour augmenter fortement l'une\nde ses stats.", "Anwender erhöht Druck auf\nStresspunkte und steigert einen\nseiner Statuswerte stark.", "La presión en puntos clave del cuerpo\npotencia una de sus características.", "Chi la usa esercita pressione su alcuni\npunti nevralgici e aumenta di molto\nuna statistica a caso.", "The user applies pressure to stress\npoints, sharply boosting one of\nits stats.") },
            // { PBEMove.368, new PBELocalizedString("わざを　だすまえに\nさいごに　うけた　わざの　ダメージを\nおおきくして　だした　あいてに　かえす。", "기술을 쓰기 전에\n마지막으로 받은 기술의 데미지를\n늘려서 기술을 쓴 상대에게 돌려준다.", "Le lanceur attaque le dernier ennemi\nl'ayant blessé durant le même tour\nen frappant plus fort.", "Attacke mit großer Kraft gegen das\nZiel, das dem Anwender in derselben\nRunde zuletzt Schaden zufügte.", "Devuelve al objetivo el último ataque\nrecibido, pero con mucha más fuerza.", "Chi la usa si vendica sul nemico che l'ha\nappena ferito con una mossa anche più\npotente.", "The user retaliates with much greater\npower against the target\nthat last inflicted damage on it.") },
            // { PBEMove.369, new PBELocalizedString("こうげき　したあと\nものすごい　スピードで　もどってきて\nひかえ　ポケモンと　いれかわる。", "공격한 뒤\n굉장한 스피드로 돌아와서\n교대 포켓몬과 교체한다.", "Après son attaque, le lanceur revient à\ntoute vitesse et change de place avec\nun Pokémon de l'équipe prêt au combat.", "Nach der Attacke eilt der Anwender\nzurück und tauscht den Platz mit\neinem anderen Pokémon.", "Tras atacar, vuelve a toda prisa\npara dar paso a otro Pokémon\ndel equipo.", "Chi usa questa mossa si tira indietro\nper farsi sostituire dopo aver sferrato\nl'attacco.", "After making its attack, the user\nrushes back to switch places with\na party Pokémon in waiting.") },
            { PBEMove.CloseCombat, new PBELocalizedString("まもりを　すてて　あいての　ふところに\nとつげきする。じぶんの\nぼうぎょと　とくぼうが　さがる。", "방어를 포기하고 상대 깊숙이\n돌격한다. 자신의\n방어와 특수방어가 떨어진다.", "Le lanceur combat au corps à corps sans\nse protéger. Baisse aussi sa Défense et\nsa Défense Spéciale.", "Nahkampf-Attacke ohne Rücksicht\nauf Verluste. Senkt Verteidigung und\nSpezial-Verteidigung des Anwenders.", "Lucha abiertamente contra el objetivo sin\nprotegerse. También reduce la Defensa\ny la Defensa Especial del usuario.", "Chi la usa attacca abbassando la guardia.\nLa propria Difesa e la Difesa Speciale\nsi riducono.", "The user fights the target up close\nwithout guarding itself. It also cuts\nthe user's Defense and Sp. Def.") },
            // { PBEMove.371, new PBELocalizedString("ためこんで　こうげきする。\nあいてより　あとに　こうげき　できると\nわざの　いりょくは　\xFF12ばいに　なる。", "모아서 공격한다.\n상대보다 뒤에 공격할 수 있으면\n기술의 위력은 2배가 된다.", "Le lanceur charge son énergie, puis\nattaque. La puissance est doublée\nsi le lanceur agit après l'ennemi.", "Der Anwender lädt die Attacke auf.\nHandelt das Ziel vor dem Anwender,\nverdoppelt sich die Kraft der Attacke.", "El usuario contraataca con el doble\nde fuerza si el objetivo usa\nun movimiento antes.", "Chi la usa accumula forza, poi attacca.\nLa potenza raddoppia se agisce dopo\nil Pokémon nemico.", "If the user moves after the target,\nthis attack's power will be doubled.") },
            // { PBEMove.372, new PBELocalizedString("そのターンに　あいてが\nすでに　ダメージを　うけて　いたら\nわざの　いりょくは　\xFF12ばいに　なる。", "그 턴에 상대가\n이미 데미지를 입었다면\n기술의 위력은 2배가 된다.", "Cette attaque est deux fois plus\nefficace si l'ennemi a déjà été blessé\ndurant ce tour.", "Hat der Gegner während der Runde bereits\nSchaden genommen, wird die Kraft der\nAttacke verdoppelt.", "Si el objetivo ya ha sufrido daño en ese\nturno, la fuerza del ataque se duplica.", "Se il nemico ha già subito dei danni nello\nstesso turno, la potenza di questa mossa\nraddoppia.", "If the target has already taken some\ndamage in the same turn, this attack's\npower is doubled.") },
            // { PBEMove.373, new PBELocalizedString("もたせた　どうぐを　つかえなくする。\nトレーナーも　その　ポケモンには\nどうぐを　つかえない。", "지니게 한 도구를 쓸 수 없게 한다.\n트레이너도 그 포켓몬에게는\n도구를 쓸 수 없다.", "Empêche l'ennemi d'utiliser un\nobjet tenu et son Dresseur\nd'utiliser un objet sur lui.", "Verhindert, dass auf das Ziel Items\nverwendet werden.", "Impide al objetivo usar el objeto que\nlleva. Su Entrenador tampoco puede\nusar objetos sobre él.", "Impedisce al nemico di usare lo strumento\nche tiene e al suo Allenatore di usarne\naltri sul Pokémon.", "It prevents the target from using its held\nitem. Its Trainer is also prevented from\nusing items on it.") },
            // { PBEMove.374, new PBELocalizedString("もたせた　どうぐを\nすばやく　なげつけて　こうげきする。\nどうぐで　いりょくと　こうかが　かわる。", "지니게 한 도구를\n재빠르게 내던져서 공격한다.\n도구에 따라 위력과 효과가 바뀐다.", "Le lanceur envoie l'objet qu'il tient\nsur l'ennemi. La puissance et les\neffets dépendent de l'objet.", "Anwender schleudert sein Item auf\ndas Ziel. Kraft und Effekt der Attacke\nhängen vom Item ab.", "Lanza contra el objetivo el objeto que\nlleva. La fuerza del ataque y su efecto\nvarían según el objeto.", "Chi la usa lancia sul nemico lo strumento\nche tiene. La forza e l'effetto dipendono\ndallo strumento.", "The user flings its held item at the target\nto attack. Its power and effects depend\non the item.") },
            // { PBEMove.375, new PBELocalizedString("ちょうのうりょくで　あんじを　かけて\nじぶんの　うけている　じょうたい\nいじょうを　あいてに　うつす。", "초능력으로 암시를 걸어서\n자신에게 걸려 있는 상태 이상을\n상대에게 옮긴다.", "Le lanceur transfère ses problèmes de\nstatut à l'ennemi grâce à son pouvoir\nde suggestion.", "Anwender nutzt seine Suggestivkräfte, um\neigene Statusprobleme auf das Ziel zu\ntransferieren.", "Usa su poder mental para transferir\nal objetivo sus problemas de estado.", "Con la forza psichica e la suggestione,\nchi la usa può trasferire i suoi problemi\ndi stato al Pokémon colpito.", "Using its psychic power of suggestion,\nthe user transfers its status problems\nto the target.") },
            // { PBEMove.376, new PBELocalizedString("きりふだの　のこり　\xFF30\xFF30が\nすくなければ　すくないほど\nわざの　いりょくが　あがる。", "마지막수단의 남은 PP가\n적으면 적을수록\n기술의 위력이 올라간다.", "Moins cette capacité possède de PP,\nplus elle est puissante.", "Je weniger AP diese Attacke hat, desto\nmehr Angriffskraft besitzt sie.", "Cuantos menos PP tenga el movimiento,\nmayor será la fuerza para atacar.", "La potenza di questa mossa aumenta man\nmano che i suoi PP diminuiscono.", "The fewer PP this move has, the greater\nits attack power.") },
            // { PBEMove.377, new PBELocalizedString("\xFF15ターンの　あいだ　わざや\nとくせいや　もっている　どうぐによって\n\xFF28\xFF30を　かいふく　できなく　する。", "5턴 동안 기술이나 특성,\n지니고 있는 도구에 의한\nHP 회복을 할 수 없게 한다.", "Le lanceur empêche l'ennemi d'utiliser ses\ncapacités, cap. spé. ou objets tenus pour\nrécupérer des PV pendant 5 tours.", "Anwender verhindert für fünf Runden, dass\nGegner durch Attacken, Fähigkeiten oder\nItems KP regenerieren.", "Impide al objetivo usar movimientos,\nhabilidades y objetos equipados que\nrecuperan PS durante cinco turnos.", "Chi la usa impedisce al nemico di utilizzare\nmosse o abilità recupera-PS per cinque\nturni.", "For five turns, the user prevents the\nopposing team from using any moves,\nAbilities, or held items that recover HP.") },
            // { PBEMove.378, new PBELocalizedString("つよく　しめあげて　こうげきを　する。\nあいての　\xFF28\xFF30が　のこっている　ほど\nいりょくは　あがる。", "강하게 조여 공격을 한다.\n상대의 HP가 많이 남아 있을수록\n위력이 올라간다.", "Le lanceur essore l'ennemi. Plus\nl'ennemi a de PV, plus cette attaque\nest puissante.", "Anwender presst sein Ziel aus.\nJe höher die KP des Zieles, desto\nkraftvoller die Attacke.", "Estruja con fuerza al objetivo.\nCuantos más PS tenga el objetivo,\nmás fuerza tendrá el ataque.", "Chi la usa stritola con forza il nemico.\nPiù PS ha il nemico, maggiore è la potenza\ndella mossa.", "The user powerfully wrings the target.\nThe more HP the target has, the greater\nthis attack's power.") },
            // { PBEMove.379, new PBELocalizedString("ちょうのうりょくで\nじぶんの　こうげきと　ぼうぎょの　\nちからを　こうかん　する。", "초능력으로\n자신의 공격과 방어의\n힘을 교환한다.", "Le lanceur utilise ses pouvoirs psychiques\npour échanger sa stat Défense et sa\nstat Attaque.", "Anwender setzt Psycho-Kräfte ein,\num eigenen Angriffs- mit Verteidigungs-\nWert auszutauschen.", "Usa sus poderes mentales para\nintercambiar su característica de\nAtaque por Defensa.", "Mossa psichica che permette a chi la usa\ndi scambiare i valori delle sue statistiche\ndi Attacco e Difesa.", "The user employs its psychic power to\nswitch its Attack with its Defense stat.") },
            { PBEMove.GastroAcid, new PBELocalizedString("いえきを　あいての\nからだに　はきつける。ついた　いえきは\nあいての　とくせいの　こうかを　けす。", "상대의 몸에 위액을 내뱉는다.\n달라붙은 위액은 상대의\n특성 효과를 지운다.", "Le lanceur répand ses sucs digestifs sur\nl'ennemi. Le fluide neutralise la capacité\nspéciale de l'ennemi.", "Anwender greift das Ziel mit\neigenen Magensäften an. Entfernt\nEffekte von dessen Fähigkeit.", "El usuario arroja sus jugos biliares\nal objetivo, lo que anula el efecto de la\nhabilidad en uso.", "Chi la usa lancia acidi gastrici sul nemico.\nIl fluido annulla l'abilità del nemico.", "The user hurls up its stomach acids on\nthe target. The fluid eliminates the effect\nof the target's Ability.") },
            { PBEMove.LuckyChant, new PBELocalizedString("てんに　むかって　おいのりを　ささげ\nあいての　こうげきを\nきゅうしょに　あたらなく　する。", "하늘을 향해 기도를 올려\n상대의 공격을\n급소에 맞지 않게 한다.", "Le lanceur envoie une incantation vers le\nciel pour empêcher l'ennemi d'effectuer\ndes coups critiques.", "Anwender singt eine Beschwörungsformel,\ndie Volltreffer gegen ihn verhindert.", "Lanza al cielo un conjuro que impide\nal objetivo asestar golpes críticos.", "Chi la usa rivolge un incantesimo al cielo,\nimpedendo al nemico di sferrare brutti\ncolpi alla squadra.", "The user chants an incantation toward\nthe sky, preventing opposing Pokémon\nfrom landing critical hits.") },
            // { PBEMove.382, new PBELocalizedString("いりょくを　あげて　あいてが\nだそうとする　わざを　さきにだす。\nさきに　だせないと　しっぱい　する。", "위력을 올려 상대가\n쓰려고 하는 기술을 먼저 쓴다.\n먼저 쓰지 않으면 실패한다.", "Le lanceur vole la capacité prévue par\nl'ennemi et l'utilise en faisant plus de\ndégâts. Il doit frapper en premier.", "Anwender stiehlt und führt die Attacke\neines langsameren Gegners zuerst\nund mit größerer Kraft aus.", "Se adelanta al movimiento que pretende\nusar el objetivo y lo lanza antes con más\nfuerza. Si el usuario es más lento, falla.", "Chi la usa precede un nemico più lento, gli\nruba l'attacco e glielo ritorce contro con\npotenza persino maggiore.", "The user tries to cut ahead of the target\nto steal and use the target's intended\nmove with greater power.") },
            // { PBEMove.383, new PBELocalizedString("ちょくぜんに　でた　わざを　まねして\nおなじ　わざを　だす。\nわざが　でていないと　しっぱい　する。", "직전에 나온 기술을 흉내 내어\n같은 기술을 쓴다.\n기술이 나오지 않았으면 실패한다.", "Le lanceur imite la dernière capacité\nemployée. Échoue si aucune capacité\nn'a été utilisée.", "Anwender imitiert gerade verwendete\nAttacke. Dies schlägt fehl, falls zuvor\nkeine Attacke verwendet wurde.", "Imita el movimiento usado justo antes.\nEl movimiento falla si no se ha usado\naún ninguno.", "Chi la usa mima l'ultima mossa eseguita dal\nnemico. Fallisce se non è stata ancora\nusata alcuna mossa.", "The user mimics the move used immediately\nbefore it. The move fails if no other move\nhas been used yet.") },
            // { PBEMove.384, new PBELocalizedString("ちょうのうりょくで　じぶんと　あいての\nこうげきと　とくこうの\nのうりょく　へんかを　いれかえる。", "초능력으로 자신과 상대의\n공격과 특수공격의\n능력 변화를 교체한다.", "Pouvoir qui échange les modifications\nde l'Attaque Spéciale et de l'Attaque\ndu lanceur avec la cible.", "Psychische Kräfte tauschen Änderungen\nan Angriff und Spezial-Angriff mit denen\ndes Zieles.", "El usuario emplea su poder mental para\nintercambiar los cambios en Ataque y\nAtaque Especial con el objetivo.", "Chi la usa sfrutta la sua forza psichica\nper scambiare le modifiche ad Attacco e\nAttacco Speciale con il bersaglio.", "The user employs its psychic power to\nswitch changes to its Attack and\nSp. Atk with the target.") },
            // { PBEMove.385, new PBELocalizedString("ちょうのうりょくで　じぶんと　あいての\nぼうぎょと　とくぼうの\nのうりょく　へんかを　いれかえる。", "초능력으로 자신과 상대의\n방어와 특수방어의\n능력 변화를 교체한다.", "Pouvoir qui échange les modifications de\nla Défense Spéciale et de la Défense\navec la cible.", "Psychische Kräfte tauschen Änderungen\nan Verteidigung und Spezial-Verteidigung\nmit denen des Zieles.", "El usuario emplea su poder mental para\nintercambiar los cambios en Defensa y\nDefensa Especial con el objetivo.", "Chi la usa sfrutta la sua forza psichica\nper scambiare le modifiche a Difesa e a\nDifesa Speciale con il bersaglio.", "The user employs its psychic power to\nswitch changes to its Defense and\nSp. Def with the target.") },
            // { PBEMove.386, new PBELocalizedString("のうりょく　へんかで\nあいてが　パワーアップ　しているほど\nわざの　いりょくが　あがる。", "능력 변화로\n상대가 파워 업 한 만큼\n기술의 위력이 올라간다.", "Plus l'ennemi a utilisé des augmentations\nde stats et plus cette capacité est\npuissante.", "Je stärker das Ziel durch Status-\nveränderungen ist, desto stärker\nwirkt diese Attacke.", "La fuerza del ataque aumenta cuanto más\nse ha fortalecido el objetivo con cambios\nde características.", "Questa mossa diventa più potente ogni\nvolta che il nemico aumenta le proprie\nstatistiche.", "This attack's power increases\nthe more the target has powered\nup with stat changes.") },
            // { PBEMove.387, new PBELocalizedString("せんとうちゅうに　おぼえている　わざを\nすべて　つかうと　はじめて　だせる\nとっておきの　わざ。", "배틀 중에 기억하고 있는 기술을\n모두 사용하면 그때부터 쓸 수 있는\n필살기이다.", "Cette capacité ne peut être utilisée\nqu'après que le lanceur a utilisé\ntoutes les autres.", "Diese Attacke kann nur eingesetzt\nwerden, nachdem alle verfügbaren\nAttacken ausgeführt wurden.", "Este movimiento solo puede usarse tras\nhaber usado al menos una vez todos\nlos demás conocidos por el Pokémon.", "Per usare questa mossa, bisogna prima\navvalersi in lotta di tutte le altre mosse\nconosciute.", "This move can be used only after the user\nhas used all the other moves it knows\nin the battle.") },
            // { PBEMove.388, new PBELocalizedString("こころを　なやませる　タネを\nうえつける。あいてを　ねむれなく　して\nとくせいを　ふみんに　する。", "마음을 괴롭히는 씨앗을\n심는다. 상대를 잠잘 수 없게 해서\n특성을 불면으로 만든다.", "Plante sur la cible une graine qui la rend\nsoucieuse et remplace sa capacité spéciale\npar Insomnia, l'empêchant ainsi de dormir.", "Ziel wird bepflanzt. Wandelt\nFähigkeit in Insomnia um.\nVerhindert so Schlaf.", "Se planta una semilla en el objetivo que le\ncausa pesar. Evita el sueño gracias a\nla habilidad Insomnio.", "Un seme che causa ansia viene piantato\nsul bersaglio. Ne muta l'abilità in\nInsonnia e ne blocca il sonno.", "A seed that causes worry is planted on\nthe target. It prevents sleep by making\nits Ability Insomnia.") },
            { PBEMove.SuckerPunch, new PBELocalizedString("あいてより　さきに　こうげき　できる。\nあいてが　だすわざが\nこうげきわざ　でないと　しっぱい　する。", "상대보다 먼저 공격할 수 있다.\n상대가 쓴 기술이\n공격기술이 아니면 실패한다.", "Permet au lanceur de frapper en premier.\nÉchoue si l'ennemi ne prépare pas\nune attaque.", "Ermöglicht den Erstschlag. Gelingt\naber nur, wenn das Ziel gerade eine\nAttacke vorbereitet.", "Permite atacar primero.\nFalla si el objetivo no está preparando\nningún ataque.", "Chi la usa può attaccare per primo.\nFallisce se il nemico non sta preparando\nun attacco.", "This move enables the user to attack\nfirst. It fails if the target is not\nreadying an attack, however.") },
            { PBEMove.ToxicSpikes, new PBELocalizedString("あいての　あしもとに　どくびしを\nしかける。こうたいで　でてきた　あいての\nポケモンに　どくを　おわせる。", "상대의 발밑에 독압정을\n뿌린다. 교체로 나온 상대\n포켓몬에 독을 덮어씌운다.", "Lance des pics autour de l'ennemi. Ils\nempoisonnent les ennemis qui entrent\nau combat.", "Anwender legt eine Falle mit Giftdornen\naus. Gegner, die in den Kampf eingreifen,\nwerden vergiftet.", "Lanza una trampa de púas tóxicas\na los pies del objetivo. El veneno afecta\na los Pokémon que entran.", "Chi la usa piazza una trappola di punte\nche avvelenano i nemici che scendono\nin campo.", "The user lays a trap of poison spikes at\nthe opponent's feet. They poison\nopponents that switch into battle.") },
            // { PBEMove.391, new PBELocalizedString("ちょうのうりょくで\nじぶんと　あいてに　かかっている\nのうりょく　へんかを　いれかえる。", "초능력으로\n자신과 상대에 걸려있는\n능력 변화를 교체한다.", "Le lanceur utilise un pouvoir psychique\npour échanger ses changements de\nstats avec la cible.", "Anwender setzt Psycho-Kräfte ein,\num Statusveränderungen des Zieles\nmit den eigenen zu tauschen.", "Usa la fuerza mental para intercambiar\ncon el objetivo los cambios en las\ncaracterísticas.", "Chi la usa sfrutta la sua forza psichica\nper scambiare le modifiche alle statistiche\ncon il bersaglio.", "The user employs its psychic power to\nswitch stat changes with the target.") },
            // { PBEMove.392, new PBELocalizedString("じぶんの　からだの　まわりを\nみずで　つくった　ベールで　おおう。\nまいターン　\xFF28\xFF30を　かいふく　する。", "자신의 몸 주변을\n물로 만든 베일로 덮는다.\n매 턴 HP를 회복한다.", "Un voile liquide enveloppe le lanceur.\nIl récupère des PV à chaque tour.", "Anwender umgibt sich mit einem Schleier\naus Wasser. Dabei regeneriert er\neinige KP pro Runde.", "Un manto de agua cubre al Pokémon\nque lo usa. Recupera algunos PS en\ncada turno.", "Chi la usa si avvolge in un velo d'acqua.\nRecupera alcuni PS ad ogni turno.", "The user envelops itself in a veil made\nof water. It regains some HP on\nevery turn.") },
            // { PBEMove.393, new PBELocalizedString("でんきで　つくった　じりょくの　ちからで\nちゅうに　うかぶ。\n\xFF15ターンの　あいだ　ふゆう　できる。", "전기로 만든 자력의 힘으로\n허공에 뜬다.\n5턴 동안 부유할 수 있다.", "Le lanceur utilise l'électricité pour\ngénérer un champ magnétique\net léviter durant 5 tours.", "Anwender schwebt für fünf Runden\ndurch elektrisch erzeugten\nMagnetismus.", "Levita gracias a un campo magnético\ngenerado por electricidad durante\ncinco turnos.", "Chi la usa si solleva in aria per cinque\nturni grazie a un campo elettromagnetico.", "The user levitates using electrically\ngenerated magnetism for five turns.") },
            { PBEMove.FlareBlitz, new PBELocalizedString("ほのおを　まとって　とっしんする。\nじぶんも　かなり　ダメージを　うける。\nやけど　じょうたいに　することが　ある。", "불꽃을 두르고 돌진한다.\n자신도 상당한 데미지를 입는다.\n화상 상태로 만들 때가 있다.", "Le lanceur s'embrase avant de charger\nl'ennemi. Le choc blesse aussi gravement\nle lanceur. Peut brûler l'ennemi.", "Anwender hüllt sich in Flammen und stürmt\nauf das Ziel, das sich evtl. verbrennt.\nAnwender nimmt selbst großen Schaden.", "El Pokémon se cubre de llamas y carga\ncontra el objetivo, aunque él también\nrecibe daños. Puede quemar.", "Chi la usa si ricopre di fuoco e carica\nil nemico, ma subisce il contraccolpo.\nPuò anche scottare il bersaglio.", "The user cloaks itself in fire and charges\nat the target. The user sustains serious\ndamage and may leave the target burned.") },
            { PBEMove.ForcePalm, new PBELocalizedString("あいての　からだに\nしょうげきはを　あてて　こうげきする。\nまひ　じょうたいに　することが　ある。", "상대의 몸에\n충격파를 부딪쳐 공격한다.\n마비 상태로 만들 때가 있다.", "Une onde de choc frappe l'ennemi.\nPeut aussi paralyser la cible.", "Das Ziel wird mit einer Schockwelle\nangegriffen, die es eventuell\nparalysiert.", "Ataca al objetivo con una onda de choque\ny puede llegar a paralizarlo.", "Chi la usa attacca con un'onda d'urto che\npuò anche paralizzare il bersaglio.", "The target is attacked with a shock wave.\nIt may also leave the target\nwith paralysis.") },
            { PBEMove.AuraSphere, new PBELocalizedString("からだの　おくから　はどうの　ちからを\nあいてに　うちはなつ。\nこうげきは　かならず　めいちゅう　する。", "몸속에서 파동의 힘을\n끌어내 쏜다.\n공격은 반드시 명중한다.", "Le lanceur dégage une aura et projette\nde l'énergie. N'échoue jamais.", "Tief aus dem Inneren des Anwenders löst\nsich ein kraftvoller Stoß Auraenergie.\nTrifft in jedem Fall.", "Libera una descarga de la fuerza\ndel aura desde su interior.\nEs infalible.", "Chi la usa rilascia una forza eterea dal\nprofondo del corpo. La mossa è infallibile.", "The user looses a blast of aura power\nfrom deep within its body at the target.\nThis move is certain to hit.") },
            { PBEMove.RockPolish, new PBELocalizedString("じぶんの　からだを　みがいて　くうきの\nていこうを　すくなくする。すばやさを\nぐーんと　あげることが　できる。", "자신의 몸을 닦아 공기의\n저항을 적게 한다. 스피드를\n크게 올릴 수 있다.", "Le lanceur polit son corps pour\ndiminuer sa résistance au vent.\nAugmente fortement la Vitesse.", "Anwender reduziert so gut wie möglich\nden Luftwiderstand. Kann Initiative-Wert\nstark steigern.", "Reduce la resistencia puliendo su cuerpo.\nAumenta la Velocidad considerablemente.", "Chi la usa leviga il proprio corpo per\nridurne l'attrito. Aumenta di molto\nla Velocità.", "The user polishes its body to reduce drag.\nIt can sharply raise the Speed stat.") },
            { PBEMove.PoisonJab, new PBELocalizedString("どくに　そまった　しょくしゅや　うでで\nあいてを　つきさす。\nどく　じょうたいに　することが　ある。", "독에 물든 촉수나 팔로\n상대를 꿰찌른다.\n독 상태로 만들 때가 있다.", "Attaque l'ennemi avec un tentacule ou\nun bras plein de poison. Peut aussi\nl'empoisonner.", "Ziel wird mit vergiftetem Arm oder\nTentakel verletzt. Es wird dabei\neventuell vergiftet.", "Pincha al objetivo con un tentáculo o\nbrazo envenenado. Puede llegar a\nenvenenar al objetivo.", "Il nemico è colpito da un tentacolo o da\nun arto intriso di una sostanza tossica,\nche può anche avvelenarlo.", "The target is stabbed with a tentacle or\narm steeped in poison. It may also\npoison the target.") },
            { PBEMove.DarkPulse, new PBELocalizedString("からだから　あくいに\nみちた　おそろしい　オーラを　はっする。\nあいてを　ひるませる　ことが　ある。", "몸에서 악의로 가득한\n무서운 오라를 발한다.\n상대를 풀죽게 만들 때가 있다.", "Le lanceur dégage une horrible\naura chargée d'idées noires.\nPeut aussi apeurer l'ennemi.", "Anwender greift mit fürchterlicher Aura\nschlechter Gedanken an. Ziel schreckt\neventuell zurück.", "Libera una horrible aura llena de malos\npensamientos y puede hacer retroceder\nal objetivo.", "Chi la usa emana un'aura impregnata di\noscuri pensieri. Può anche far tentennare\nil Pokémon colpito.", "The user releases a horrible aura imbued\nwith dark thoughts.\nIt may also make the target flinch.") },
            { PBEMove.NightSlash, new PBELocalizedString("いっしゅんの　すきを　ついて\nあいてを　きりはらう。\nきゅうしょに　あたりやすい。", "순간적으로 틈을 노려\n상대를 베어 버린다.\n급소에 맞기 쉽다.", "Le lanceur lacère l'ennemi à la\npremière occasion. Taux de\ncritiques élevé.", "Anwender greift bei der ersten\nGelegenheit mit scharfen Klauen\nan. Hohe Volltrefferquote.", "Ataca al objetivo a la primera oportunidad.\nSuele ser crítico.", "Chi la usa colpisce il nemico appena\nsi presenta l'occasione. Probabile brutto\ncolpo.", "The user slashes the target\nthe instant an opportunity arises.\nCritical hits land more easily.") },
            { PBEMove.AquaTail, new PBELocalizedString("はげしく　あれくるう　あらなみの　ように\nおおきな　しっぽを　ふって\nあいてを　こうげきする。", "세차게 날뛰는 거친 파도와 같이\n큰 꼬리를 흔들어서\n상대를 공격한다.", "Le lanceur attaque en balançant sa\nqueue comme une lame de fond en\npleine tempête.", "Anwender attackiert mit dem Schweif,\nals ob dieser eine brutale Welle in\neinem tosenden Sturm sei.", "Ataca agitando la cola como si fuera\nuna ola rabiosa en una tormenta\ndevastadora.", "Chi la usa attacca agitando la coda\ncome se fosse una violenta ondata\nin una tempesta furiosa.", "The user attacks by swinging its tail as if\nit were a vicious wave in a raging storm.") },
            { PBEMove.SeedBomb, new PBELocalizedString("かたい　からを　もつ　おおきな　タネを\nうえから　たたきつけて\nあいてを　こうげきする。", "단단한 껍질을 가지고 있는\n큰 씨앗을 힘껏 내던져\n상대를 공격한다.", "Le lanceur fait pleuvoir un déluge\nde graines solides sur l'ennemi.", "Anwender lässt eine Menge Samen\nmit harter Schale von oben auf das\nZiel fallen.", "Lanza al objetivo una descarga de\nsemillas explosivas desde arriba.", "Chi la usa emette una raffica di semi dal\nguscio duro che colpiscono il nemico\ndall'alto.", "The user slams a barrage of hard-shelled\nseeds down on the target from above.") },
            { PBEMove.AirSlash, new PBELocalizedString("そらをも　きりさく\nくうきの　やいばで　こうげきする。\nあいてを　ひるませる　ことが　ある。", "하늘까지 베어 가르는\n공기의 칼날로 공격한다.\n상대를 풀죽게 만들 때가 있다.", "Le lanceur attaque avec une lame d'air\nqui fend tout. Peut aussi apeurer l'ennemi.", "Das Ziel wird mit einer Luftklinge\nangegriffen. Ziel schreckt\neventuell zurück.", "Ataca con una hoja de aire que incluso\ncorta el cielo. También puede hacer\nretroceder al objetivo.", "Chi la usa attacca con un vento tagliente\nche squarcia il cielo. Può anche far\ntentennare il Pokémon colpito.", "The user attacks with a blade of air that\nslices even the sky. It may also make the\ntarget flinch.") },
            { PBEMove.XScissor, new PBELocalizedString("カマや　ツメを　ハサミのように\nこうさ　させながら　あいてを　きりさく。\n", "낫이나 발톱을 가위처럼\n교차시키면서 상대를 베어 가른다.", "Le lanceur taillade l'ennemi en\nutilisant ses faux ou ses griffes\ncomme une paire de ciseaux.", "Der Anwender führt eine Attacke\naus, die einer Scherenbewegung\nähnelt.", "Cruza las guadañas o las garras\npara atacar al objetivo como si fueran\nunas tijeras.", "Chi la usa colpisce il nemico usando le sue\nfalci o i suoi artigli come se fossero delle\nforbici.", "The user slashes at the target by\ncrossing its scythes or claws as if\nthey were a pair of scissors.") },
            { PBEMove.BugBuzz, new PBELocalizedString("はねの　しんどうで　おんぱを　おこして\nこうげきする。あいての　とくぼうを\nさげることが　ある。", "날개의 진동으로 음파를 일으켜서\n공격한다. 상대의 특수방어를\n떨어뜨릴 때가 있다.", "Le lanceur fait vibrer ses ailes pour\nlancer une vague sonique. Peut aussi\nbaisser la Défense Spéciale de l'ennemi.", "Anwender schlägt mit den Flügeln und\nerzeugt eine Schockwelle. Senkt evtl.\nSpezial-Verteidigung des Zieles.", "El movimiento de las alas crea una onda\nsónica dañina. También puede disminuir\nla Defensa Especial del objetivo.", "Chi la usa fa vibrare le ali creando\nun'onda sonora pericolosa. Può anche\nridurre la Difesa Speciale del nemico.", "The user vibrates its wings to generate a\ndamaging sound wave. It may also lower\nthe target's Sp. Def stat.") },
            { PBEMove.DragonPulse, new PBELocalizedString("おおきな　くちから　しょうげきはを\nまきおこして　あいてを　こうげきする。\n", "큰 입으로 충격파를\n일으켜서 상대를 공격한다.", "Le lanceur ouvre la bouche pour envoyer\nune onde de choc qui frappe l'ennemi.", "Das Ziel wird mit einer Schockwelle\nangegriffen, die aus dem offenen Maul\ndes Anwenders kommt.", "Abre mucho la boca y libera una onda\nde choque que ataca al objetivo.", "Chi la usa spalanca la bocca e genera\nun'onda d'urto che colpisce il nemico.", "The target is attacked with a shock wave\ngenerated by the user's gaping mouth.") },
            { PBEMove.DragonRush, new PBELocalizedString("すさまじい　さっきで　いあつ　しながら\nたいあたりする。\nあいてを　ひるませる　ことが　ある。", "굉장한 살기로 위압하면서\n몸통박치기한다.\n상대를 풀죽게 만들 때가 있다.", "Le lanceur frappe l'ennemi d'un air\nmenaçant. Peut aussi apeurer l'ennemi.", "Anwender führt einen gefährlichen Angriff\naus. Das Ziel schreckt eventuell zurück.", "Ataca de forma brutal mientras intimida\nal objetivo. También puede hacerlo\nretroceder.", "Chi la usa attacca con fare minaccioso e\nin questo modo può anche far tentennare\nil nemico.", "The user tackles the target while\nexhibiting overwhelming menace.\nIt may also make the target flinch.") },
            { PBEMove.PowerGem, new PBELocalizedString("ほうせきの　ように　きらめく　ひかりを\nはっしゃして　あいてを　こうげきする。\n", "보석처럼 반짝이는 빛을\n발사하여 상대를 공격한다.", "Le lanceur attaque avec un rayon de\nlumière qui scintille comme s'il était\ncomposé de gemmes.", "Anwender attackiert mit einem Lichtstrahl,\nder funkelt, als sei er aus Juwelen.", "Ataca con un rayo de luz que centellea\ncomo si lo formaran miles de joyas.", "Chi la usa attacca con un raggio di luce\nche brilla come se fosse fatto di pietre\npreziose.", "The user attacks with a ray of light that\nsparkles as if it were made of gemstones.") },
            { PBEMove.DrainPunch, new PBELocalizedString("こぶしから　あいての　ちからを\nすいとる。あたえた　ダメージの\nはんぶんの　\xFF28\xFF30を　かいふく　できる。", "주먹으로 상대의 힘을 흡수한다.\n입힌 데미지의 절반에\n해당하는 HP를 회복할 수 있다.", "Un coup de poing qui draine l'énergie.\nConvertit la moitié des dégâts infligés\nen PV pour le lanceur.", "Entzieht dem Ziel Energie. Die Hälfte\ndes Schadens wird den KP des Anwenders\nzugerechnet.", "Un golpe que drena energía. El Pokémon\nrecupera la mitad de los PS arrebatados\nal objetivo.", "Pugno che assorbe energia. Fa recuperare\nuna quantità di PS pari alla metà del danno\ninferto.", "An energy-draining punch. The user's\nHP is restored by half the damage taken\nby the target.") },
            { PBEMove.VacuumWave, new PBELocalizedString("こぶしを　ふって\nしんくうの　なみを　まきおこす。\nかならず　せんせい　こうげき　できる。", "주먹을 흔들어\n진공의 파도를 일으킨다.\n반드시 선제공격을 할 수 있다.", "Le lanceur agite son poing pour projeter\nune onde de vide. Frappe toujours en\npremier.", "Ein Faustwirbel sendet eine\nVakuumwelle auf das Ziel.\nErstschlaggarantie.", "Gira los puños y libera una onda de vacío\ncontra el objetivo. Este movimiento\nsiempre va primero.", "Chi la usa rotea i pugni per lanciare\nun'onda di vuoto assoluto verso il nemico.\nAttacca per primo.", "The user whirls its fists to send a wave\nof pure vacuum at the target. This move\nalways goes first.") },
            { PBEMove.FocusBlast, new PBELocalizedString("きあいを　たかめて　こんしんの　ちからを\nほうしゅつする。あいての　とくぼうを\nさげることが　ある。", "기합을 높여서\n혼신의 힘을 방출한다. 상대의\n특수방어를 떨어뜨릴 때가 있다.", "Le lanceur rassemble ses forces et laisse\néclater son pouvoir. Peut aussi baisser la\nDéfense Spéciale de l'ennemi.", "Anwender erhöht seinen mentalen Fokus\nund greift dann an. Senkt eventuell\nSpezial-Verteidigung des Zieles.", "Agudiza la concentración mental y\nlibera su poder. Puede disminuir\nla Defensa Especial del objetivo.", "Chi la usa si concentra e rilascia la sua\nforza. Può ridurre la Difesa Speciale del\nPokémon colpito.", "The user heightens its mental focus and\nunleashes its power.\nIt may also lower the target's Sp. Def.") },
            { PBEMove.EnergyBall, new PBELocalizedString("しぜんから　あつめた\nいのちの　ちからを　はっしゃする。\nあいての　とくぼうを　さげることが　ある。", "자연으로부터 모은\n생명의 힘을 발사한다. 상대의\n특수방어를 떨어뜨릴 때가 있다.", "Utilise les pouvoirs de la nature pour\nattaquer l'ennemi. Peut aussi baisser\nla Défense Spéciale de l'ennemi.", "Anwender zieht Kraft aus der Natur und\nfeuert sie auf das Ziel. Senkt eventuell\nSpezial-Verteidigung des Zieles.", "Aúna fuerzas de la naturaleza y libera\nsu ataque. Puede disminuir la Defensa\nEspecial del objetivo.", "Chi la usa attinge energia dalla natura\ne la scaglia contro il nemico. Può anche\nridurne la Difesa Speciale.", "The user draws power from nature and\nfires it at the target.\nIt may also lower the target's Sp. Def.") },
            { PBEMove.BraveBird, new PBELocalizedString("はねを　おりたたみ\nていくう　ひこうで　とつげきする。\nじぶんも　かなり　ダメージを　うける。", "날개를 접어\n저공비행으로 돌격한다.\n자신도 상당한 데미지를 입는다.", "Le lanceur replie ses ailes et charge\nen rase-mottes. Le lanceur subit aussi\nde graves dégâts.", "Anwender greift aus niedriger Höhe an.\nEr erleidet bei dieser Attacke selbst\ngroßen Schaden.", "Pliega sus alas y ataca con un vuelo\nrasante. El Pokémon que lo usa\ntambién resulta seriamente dañado.", "Chi la usa si nasconde sotto le ali e carica\nda bassa quota. Tuttavia, subisce\nconsiderevoli danni.", "The user tucks in its wings and charges\nfrom a low altitude.\nThe user also takes serious damage.") },
            { PBEMove.EarthPower, new PBELocalizedString("あいての　あしもとへ　だいちの　ちからを\nほうしゅつする。あいての　とくぼうを\nさげることが　ある。", "상대의 발밑에 대지의 힘을\n방출한다. 상대의 특수방어를\n떨어뜨릴 때가 있다.", "Des éruptions volcaniques ont lieu\nsous l'ennemi. Peut aussi baisser\nla Défense Spéciale de l'ennemi.", "Der Boden unter dem Ziel erzittert\ndurch die Kraft der Erde. Senkt eventuell\nSpezial-Verteidigung.", "La tierra a los pies del objetivo erupciona\nviolentamente. Puede disminuir\nla Defensa Especial del objetivo.", "Dal terreno sotto il nemico si sprigiona\nuna forza devastante. Può anche ridurne\nla Difesa Speciale.", "The user makes the ground under\nthe target erupt with power.\nIt may also lower the target's Sp. Def.") },
            // { PBEMove.415, new PBELocalizedString("めにも　とまらぬ　はやさで\nじぶんと　あいての　\nもちものを　こうかんする。", "눈에 보이지 않는 속도로\n자신과 상대가\n지닌 물건을 교환한다.", "Le lanceur échange son objet avec\ncelui de la cible à une vitesse que\nl'œil a du mal à suivre.", "Item wird in Windeseile mit dem\nZiel getauscht.", "Intercambia con el objetivo los objetos\nque llevan tan rápido que es imposible\nverlo a simple vista.", "Chi la usa scambia lo strumento che tiene\ncon quello del bersaglio ad una velocità\nimpressionante.", "The user trades held items with the target\nfaster than the eye can follow.") },
            // { PBEMove.416, new PBELocalizedString("もてる　ちからを　すべて　つかって\nあいてに　とつげきする。\nつぎの　ターンは　うごけなく　なる。", "가진 힘을 모두 사용해서\n상대에게 돌격한다.\n다음 턴은 움직일 수 없다.", "Le lanceur charge l'ennemi de toute sa\npuissance. Il doit ensuite se reposer\nau tour suivant.", "Anwender rennt mit seiner ganzen Kraft\ngegen das Ziel an und muss dann\neine Runde ruhen.", "Carga contra el objetivo usando toda\nla fuerza que tiene. El Pokémon\ndescansa el turno siguiente.", "Chi la usa carica il nemico usando tutta\nla sua forza, ma al turno successivo\ndeve riposare.", "The user charges at the target using\nevery bit of its power.\nThe user must rest on the next turn.") },
            { PBEMove.NastyPlot, new PBELocalizedString("わるいことを　かんがえて\nあたまを　かっせいか　させる。\nじぶんの　とくこうを　ぐーんと　あげる。", "나쁜 일을 생각해서\n머리를 활성화시킨다.\n자신의 특수공격을 크게 올린다.", "Stimule l'esprit par de mauvaises pensées.\nAugmente fortement l'Attaque Spéciale\ndu lanceur.", "Anwender stimuliert sein Gehirn\nund hat finstere Gedanken.\nSteigert Spezial-Angriff stark.", "Estimula su cerebro pensando en cosas\nmalas. Aumenta considerablemente\nel Ataque Especial.", "Chi la usa stimola il cervello pensando\na cose cattive. Aumenta di molto\nl'Attacco Speciale.", "The user stimulates its brain by thinking\nbad thoughts.\nIt sharply raises the user's Sp. Atk.") },
            { PBEMove.BulletPunch, new PBELocalizedString("だんがんの　ような　はやくて　かたい\nパンチを　あいてに　くりだす。\nかならず　せんせい　こうげき　できる。", "탄환처럼 빠르고 단단한\n펀치를 상대에게 날린다.\n반드시 선제공격을 할 수 있다.", "Le lanceur envoie des coups de poing aussi\nrapides que des balles de revolver. Frappe\ntoujours en premier.", "Das Ziel wird von ultraschnellen\nHieben getroffen. Erstschlaggarantie.", "Ataca con fuertes puñetazos\ntan rápidos como proyectiles.\nEste movimiento siempre va primero.", "Chi la usa attacca con una scarica di pugni\nveloci come proiettili. Con questa mossa\nsi colpisce per primi.", "The user strikes the target\nwith tough punches as fast as bullets.\nThis move always goes first.") },
            // { PBEMove.419, new PBELocalizedString("あいてから　わざを　うけていると\nその　あいてに　たいして\nわざの　いりょくが　\xFF12ばいに　なる。", "상대로부터 기술을 받으면\n그 상대에 대해서\n기술의 위력이 2배가 된다.", "Une attaque deux fois plus puissante si le\nlanceur a été blessé par l'ennemi durant\nle tour.", "Wurde der Anwender vom Gegner in dieser\nRunde getroffen, erzeugt diese Attacke\ndoppelten Schaden.", "Este ataque inflige el doble de daño\na un objetivo que haya golpeado al usuario\nen ese mismo turno.", "Mossa d'attacco che infligge doppi danni,\nse chi la usa è stato ferito dal nemico\nnello stesso turno.", "An attack move that inflicts double the\ndamage if the user has been hurt by the\ntarget in the same turn.") },
            { PBEMove.IceShard, new PBELocalizedString("こおりの　かたまりを　いっしゅんで\nつくり　あいてに　すばやく　はなつ。\nかならず　せんせい　こうげき　できる。", "얼음 덩어리를 순식간에 만들어\n상대에게 빠르게 쏜다.\n반드시 선제공격을 할 수 있다.", "Le lanceur crée des éclats de glace qu'il\nenvoie sur l'ennemi. Frappe toujours en\npremier.", "Das Ziel wird mit Eisklumpen beworfen.\nDiese Attacke hat Erstschlaggarantie.", "Crea bolas de hielo y las lanza a gran\nvelocidad. Este movimiento siempre\nva primero.", "Chi la usa crea dei pezzi di ghiaccio e\nli lancia. Con questa mossa si colpisce\nper primi.", "The user flash freezes chunks of\nice and hurls them at the target.\nThis move always goes first.") },
            { PBEMove.ShadowClaw, new PBELocalizedString("かげから　つくった　するどい　ツメで\nあいてを　きりさく。\nきゅうしょに　あたりやすい。", "그림자로 만든 날카로운 발톱으로\n상대를 베어 가른다.\n급소에 맞기 쉽다.", "Attaque avec une griffe puissante faite\nd'ombres. Taux de critiques élevé.", "Das Ziel wird mit scharfen Klauen\naus der Schattenwelt attackiert.\nHohe Volltrefferquote.", "Ataca con una garra afilada hecha\nde sombras. Suele ser crítico.", "Chi la usa attacca con artigli d'ombra\nche colpiscono con gran forza. Probabile\nbrutto colpo.", "The user slashes with a sharp claw made\nfrom shadows.\nCritical hits land more easily.") },
            // { PBEMove.422, new PBELocalizedString("でんきを　ためた　キバで　かみつく。\nあいてを　ひるませたり\nまひ　じょうたいに　することが　ある。", "전기를 모은 이빨로 문다.\n상대를 풀죽게 하거나\n마비 상태로 만들 때가 있다.", "Le lanceur utilise une morsure électrifiée.\nPeut aussi paralyser ou apeurer l'ennemi.", "Anwender beißt mit elektrifizierten\nReißzähnen zu. Das Ziel schreckt\neventuell zurück oder wird paralysiert.", "Usa colmillos electrificados para\nmorder. Puede hacer que el objetivo\nretroceda o paralizarlo.", "Chi la usa morde con denti elettrificati\nche possono anche paralizzare o far\ntentennare il nemico.", "The user bites with electrified fangs.\nIt may also make the target flinch or\nleave it with paralysis.") },
            // { PBEMove.423, new PBELocalizedString("れいきを　ひめた　キバで　かみつく。\nあいてを　ひるませたり\nこおり　じょうたいに　することが　ある。", "냉기를 품은 이빨로 문다.\n상대를 풀죽게 하거나\n얼음 상태로 만들 때가 있다.", "Le lanceur utilise une morsure glaciale.\nPeut aussi geler ou apeurer l'ennemi.", "Anwender beißt mit eiskalten Reißzähnen\nzu. Ziel schreckt eventuell zurück oder\nfriert ein.", "Usa colmillos helados para morder.\nPuede hacer que el objetivo retroceda\no congelarlo.", "Chi la usa morde con denti ghiacciati.\nPuò anche congelare o far tentennare\nil nemico.", "The user bites with cold-infused fangs.\nIt may also make the target flinch or\nleave it frozen.") },
            // { PBEMove.424, new PBELocalizedString("ほのおを　まとった　キバで　かみつく。\nあいてを　ひるませたり\nやけど　じょうたいに　することが　ある。", "불꽃을 두른 이빨로 문다.\n상대를 풀죽게 하거나\n화상 상태로 만들 때가 있다.", "Le lanceur utilise une morsure enflammée.\nPeut aussi brûler ou apeurer l'ennemi.", "Anwender beißt mit flammenden\nReißzähnen zu. Ziel schreckt\neventuell zurück oder verbrennt sich.", "Usa colmillos en llamas para morder.\nPuede hacer que el objetivo retroceda\no reciba quemaduras.", "Chi la usa morde con denti infuocati. Può\nanche scottare o far tentennare il nemico.", "The user bites with flame-cloaked fangs.\nIt may also make the target flinch or leave\nit burned.") },
            { PBEMove.ShadowSneak, new PBELocalizedString("かげを　のばして\nあいての　はいごから　こうげきする。\nかならず　せんせい　こうげき　できる。", "그림자를 늘려\n상대의 배후에서 공격한다.\n반드시 선제공격할 수 있다.", "Le lanceur étend son ombre pour frapper\npar derrière. Frappe toujours en premier.", "Anwender erweitert Schatten und\ngreift das Ziel von hinten an.\nErstschlaggarantie.", "Extiende su sombra y ataca al objetivo\npor la espalda.\nEste movimiento siempre va primero.", "Chi la usa estende la sua ombra e attacca\nil nemico alle spalle. Con questa mossa\nsi colpisce per primi.", "The user extends its shadow and attacks\nthe target from behind.\nThis move always goes first.") },
            { PBEMove.MudBomb, new PBELocalizedString("かたい　どろのたまを\nあいてに　はっしゃして　こうげきする。\nめいちゅうりつを　さげることが　ある。", "단단한 진흙구슬을\n상대에게 발사하여 공격한다.\n명중률을 떨어뜨릴 때가 있다.", "Le lanceur attaque à l'aide d'une boule\nde boue solidifiée. Peut aussi baisser\nla Précision de l'ennemi.", "Anwender greift mit einem festen\nSchlammklumpen an. Senkt\neventuell Genauigkeit des Zieles.", "Ataca lanzando una compacta bola de\nfango. Puede bajar la Precisión\ndel objetivo.", "Chi la usa lancia una compatta palla di\nfango. Può anche ridurre la precisione\ndel Pokémon colpito.", "The user launches a hard-packed\nmud ball to attack.\nIt may also lower the target's accuracy.") },
            { PBEMove.PsychoCut, new PBELocalizedString("じったいか　させた\nこころの　やいばで　あいてを　きりさく。\nきゅうしょに　あたりやすい。", "실체화시킨\n마음의 칼날로 상대를 베어 가른다.\n급소에 맞기 쉽다.", "Le lanceur entaille l'ennemi grâce à des\nlames faites de pouvoir psychique.\nTaux de critiques élevé.", "Das Ziel wird mit Klingen attackiert,\ndie aus Psycho-Energie bestehen.\nHohe Volltrefferquote.", "Ataca al objetivo con cuchillas\nformadas por energía psíquica.\nSuele ser crítico.", "Chi la usa colpisce il nemico con lame fatte\ndi forza psichica. Probabile brutto colpo.", "The user tears at the target with blades\nformed by psychic power.\nCritical hits land more easily.") },
            { PBEMove.ZenHeadbutt, new PBELocalizedString("しねんの　ちからを\nひたいに　あつめて　こうげきする。\nあいてを　ひるませる　ことが　ある。", "사념의 힘을\n이마에 모아서 공격한다.\n상대를 풀죽게 만들 때가 있다.", "Le lanceur concentre sa volonté et\ndonne un coup de tête. Peut aussi\napeurer l'ennemi.", "Anwender konzentriert seinen\nWillen und rammt das Ziel.\nDieses schreckt eventuell zurück.", "Concentra su energía psíquica en\nla cabeza para golpear. Puede hacer\nque el objetivo retroceda.", "Chi la usa concentra la forza nella testa\ne si lancia contro il nemico. Può anche\nfarlo tentennare.", "The user focuses its willpower to its head\nand attacks the target.\nIt may also make the target flinch.") },
            { PBEMove.MirrorShot, new PBELocalizedString("みがき　あげられた　からだから\nせんこうの　ちからを　あいてに　はなつ。\nめいちゅうりつを　さげることが　ある。", "갈고 닦은 몸에서\n섬광의 힘을 상대에게 쏜다.\n명중률을 떨어뜨릴 때가 있다.", "Le corps poli du lanceur libère un\néclair d'énergie. Peut aussi baisser\nla Précision de l'ennemi.", "Anwender feuert Energiestrahl aus\nseinem Körper ab. Senkt eventuell\nGenauigkeit des Zieles.", "El usuario libera un haz de energía\ndesde su pulido cuerpo.\nPuede bajar la Precisión.", "Chi la usa rilascia fasci d'energia dal\ncorpo levigato. Può anche ridurre\nla precisione del nemico.", "The user looses a flash of energy at\nthe target from its polished body.\nIt may also lower the target's accuracy.") },
            { PBEMove.FlashCannon, new PBELocalizedString("からだの　ひかりを　いってんに　あつめて\nちからを　はなつ。あいての　とくぼうを\nさげることが　ある。", "몸의 빛을 한곳에 모아서\n힘을 쏜다. 상대의\n특수방어를 떨어뜨릴 때가 있다.", "Le lanceur concentre son énergie\nlumineuse et la fait exploser. Peut aussi\nbaisser la Défense Spéciale de l'ennemi.", "Anwender sammelt Lichtenergie und\nfeuert sie auf einmal ab. Senkt eventuell\nSpezial-Verteidigung des Zieles.", "El usuario concentra toda la luz\ndel cuerpo y la libera. Puede bajar\nla Defensa Especial del objetivo.", "Chi la usa attacca raccogliendo e\nrilasciando energia luminosa. Può\nridurre la Difesa Speciale del nemico.", "The user gathers all its light energy and\nreleases it at once. It may also lower the\ntarget's Sp. Def stat.") },
            { PBEMove.RockClimb, new PBELocalizedString("すごい　いきおいで　あいてに\nつっこみ　こうげきする。\nあいてを　こんらん　させることが　ある。", "굉장한 기세로 상대에게\n돌진하여 공격한다.\n상대를 혼란시킬 때가 있다.", "Le lanceur se jette violemment sur\nl'ennemi. Peut aussi le rendre confus.", "Eine stürmische Attacke, die das Ziel\neventuell verwirrt.", "Ataca con una gran embestida.\nPuede confundir al objetivo.", "Chi la usa carica con impeto incredibile.\nIl colpo può confondere il nemico.", "The user attacks the target by smashing\ninto it with incredible force.\nIt may also confuse the target.") },
            // { PBEMove.432, new PBELocalizedString("つよいかぜで　あいての　リフレクターや\nひかりのかべ　などを　はらいのける。\nかいひりつも　さげる。", "강한 바람으로 상대의 리플렉터나\n빛의장막 등을 제거한다.\n회피율도 떨어뜨린다.", "Un grand coup de vent qui disperse la\nProtection ou le Mur Lumière de l'ennemi.\nDiminue aussi son Esquive.", "Starker Wind hebt Attacken wie Reflektor\nund Lichtschild des Gegners auf.\nSenkt außerdem den Fluchtwert.", "Potente viento que barre el Reflejo\no Pantalla de Luz del objetivo\ny puede reducir su Evasión.", "Chi la usa spazza via barriere come\nRiflesso e Schermoluce con un forte vento\ne riduce la capacità d'elusione del nemico.", "A strong wind blows away the target's\nobstacles such as Reflect or Light Screen.\nIt also lowers the target's evasiveness.") },
            { PBEMove.TrickRoom, new PBELocalizedString("まかふしぎな　くうかんを　つくる。\n\xFF15ターンの　あいだ\nおそい　ポケモンから　こうどう　できる。", "이상한 공간을 만든다.\n5턴 동안 느린 포켓몬부터\n행동할 수 있다.", "Le lanceur crée une zone étrange où\nles Pokémon les plus lents frappent\nen 1⑩ pendant 5 tours.", "Anwender erzeugt einen bizarren Raum,\nin dem langsame Pokémon fünf Runden\nlang zuerst agieren.", "Se crea un espacio extraño en el que\nlos Pokémon lentos se mueven primero\ndurante cinco turnos.", "Chi la usa crea una dimensione in cui\ni Pokémon più lenti si muovono per primi\nper cinque turni.", "The user creates a bizarre area in which\nslower Pokémon get to move first for\nfive turns.") },
            { PBEMove.DracoMeteor, new PBELocalizedString("てんくうから　いんせきを　\nあいてに　おとす。つかうと　はんどうで\nじぶんの　とくこうが　がくっと　さがる。", "천공에서 운석을\n떨어뜨린다. 사용하면 반동으로\n자신의 특수공격이 크게 떨어진다.", "Le lanceur invoque des comètes.\nLe contrecoup réduit fortement\nson Attaque Spéciale.", "Kometen werden heraufbeschworen.\nDer Rückstoß reduziert den Spezial-\nAngriff des Anwenders stark.", "Hace que grandes cometas caigan del\ncielo. Baja mucho el Ataque Especial\nde quien lo usa.", "Attacca con meteore che cadono dal cielo.\nIl contraccolpo fa calare di molto\nl'Attacco Speciale di chi la usa.", "Comets are summoned down from the sky\nonto the target. The attack's recoil\nharshly reduces the user's Sp. Atk stat.") },
            { PBEMove.Discharge, new PBELocalizedString("まばゆい　でんげきで　じぶんの\nまわりに　いるものを　こうげきする。\nまひ　じょうたいに　することが　ある。", "눈부신 전격으로 자신의\n주위에 있는 포켓몬을 공격한다.\n마비 상태로 만들 때가 있다.", "Un flamboiement d'électricité frappe\ntous les Pokémon autour du lanceur.\nPeut aussi paralyser.", "Anwender greift die Pokémon in\nseiner Umgebung mit Elektrizität\nan. Paralysiert eventuell.", "Una deslumbradora onda eléctrica\nafecta a los Pokémon de alrededor\nen combate. Puede paralizar.", "Chi la usa colpisce i Pokémon che ha\nintorno con un bagliore elettrico.\nPuò anche paralizzarli.", "A flare of electricity is loosed to strike\nthe area around the user.\nIt may also cause paralysis.") },
            { PBEMove.LavaPlume, new PBELocalizedString("まっかな　ほのおで　じぶんの\nまわりに　いるものを　こうげきする。\nやけど　じょうたいに　することが　ある。", "새빨간 불꽃으로 자신의\n주위에 있는 포켓몬을 공격한다.\n화상 상태로 만들 때가 있다.", "Des boules de feu s'abattent sur tous\nles Pokémon autour du lanceur.\nPeut aussi brûler.", "Ein Flammeninferno, das über\nden Bereich um den Anwender\nhinwegfegt. Verbrennt eventuell.", "Un infierno de llamas daña a los Pokémon\nadyacentes en combate. Puede quemar.", "Chi la usa lancia fiamme scarlatte sugli\naltri Pokémon in campo, danneggiandoli.\nPuò anche scottarli.", "An inferno of scarlet flames torches\neverything around the user. It may\nleave targets with a burn.") },
            { PBEMove.LeafStorm, new PBELocalizedString("とがった　はっぱで　あいてに　あらしを\nおこす。つかうと　はんどうで\nじぶんの　とくこうが　がくっと　さがる。", "뾰족한 잎사귀로 상대에게 바람을\n일으킨다. 사용하면 반동으로\n자신의 특수공격이 크게 떨어진다.", "Invoque une tempête de feuilles acérées.\nLe contrecoup réduit fortement l'Attaque\nSpéciale du lanceur.", "Anwender erzeugt einen Sturm von\nscharfen Blättern. Rückstoß senkt\nSpezial-Angriff des Anwenders stark.", "Cae una lluvia de hojas afiladas.\nBaja mucho el Ataque Especial\nde quien lo usa.", "Si forma una tempesta di foglie affilate.\nIl contraccolpo riduce di molto l'Attacco\nSpeciale di chi la usa.", "The user whips up a storm of leaves around\nthe target. The attack's recoil harshly\nreduces the user's Sp. Atk stat.") },
            { PBEMove.PowerWhip, new PBELocalizedString("ツタや　しょくしゅを　はげしく　ふるって\nあいてを　たたきつけ　こうげきする。\n", "덩굴이나 촉수를 세차게 흔들어\n상대를 힘껏 쳐서 공격한다.", "Le lanceur fait virevolter violemment\nses lianes ou ses tentacules pour\nfouetter l'ennemi.", "Anwender wirbelt seine Ranken oder\nTentakel peitschenartig gegen das\nZiel.", "El usuario agita violentamente sus lianas\no tentáculos para golpear al objetivo.", "Chi la usa agita violentemente liane o\ntentacoli per sferzare il nemico.", "The user violently whirls its vines or\ntentacles to harshly lash the target.") },
            // { PBEMove.439, new PBELocalizedString("きょだいな　いわを\nあいてに　はっしゃして　こうげきする。\nつぎの　ターンは　うごけなく　なる。", "거대한 바위를\n상대에게 발사하여 공격한다.\n다음 턴은 움직일 수 없게 된다.", "Le lanceur attaque en projetant un\ngros rocher sur l'ennemi. Il doit se\nreposer au tour suivant.", "Anwender wirft einen riesigen Felsen auf\ndas Ziel. In der nächsten Runde muss\nder Anwender ruhen.", "Lanza una piedra enorme contra\nel objetivo, pero tiene que descansar\nel siguiente turno.", "Chi la usa attacca il nemico con un enorme\nmasso, ma si deve riposare al turno\nsuccessivo.", "The user launches a huge boulder at the\ntarget to attack. It must rest on the\nnext turn, however.") },
            { PBEMove.CrossPoison, new PBELocalizedString("どくの　やいばで　あいてを　きりさく。\nどく　じょうたいに　することが　あり\nきゅうしょにも　あたりやすい。", "독 칼날로 상대를 베어 가른다.\n독 상태로 만들 때가 있고\n급소에도 맞기 쉽다.", "Un coup tranchant qui peut empoisonner\nl'ennemi. Taux de critiques élevé.", "Ein schneidender Hieb, der das\nZiel eventuell vergiftet. Hat\neine hohe Volltrefferquote.", "Tajo que puede envenenar al objetivo.\nSuele ser crítico.", "Attacco con zanne avvelenate che può\nanche avvelenare il Pokémon colpito.\nProbabile brutto colpo.", "A slashing attack with a poisonous blade\nthat may also leave the target poisoned.\nCritical hits land more easily.") },
            { PBEMove.GunkShot, new PBELocalizedString("きたない　ゴミを\nあいてに　ぶつけて　こうげきする。\nどく　じょうたいに　することが　ある。", "더러운 쓰레기를\n상대에게 부딪쳐서 공격한다.\n독 상태로 만들 때가 있다.", "Le lanceur envoie des détritus sur\nl'ennemi. Peut aussi l'empoisonner.", "Anwender schießt mit Müll auf das Ziel.\nVergiftet dieses eventuell.", "Lanza contra el objetivo asquerosa\nbasura. Puede envenenar al objetivo.", "Chi la usa attacca il nemico con rifiuti\nsudici che possono anche avvelenarlo.", "The user shoots filthy garbage\nat the target to attack.\nIt may also poison the target.") },
            { PBEMove.IronHead, new PBELocalizedString("はがねの　ような\nかたい　あたまで　こうげきする。\nあいてを　ひるませる　ことが　ある。", "강철과 같은\n단단한 머리로 공격한다.\n상대를 풀죽게 만들 때가 있다.", "Le lanceur heurte l'ennemi avec sa tête\ndure comme de l'acier. Peut aussi\napeurer l'ennemi.", "Ziel wird durch stahlharten Kopf des\nAnwenders getroffen und schreckt\neventuell zurück.", "Ataca con su dura cabeza de hierro.\nPuede hacer que el objetivo retroceda.", "Chi la usa colpisce il nemico con la sua\ntesta dura come l'acciaio. Può anche\nfarlo tentennare.", "The user slams the target\nwith its steel-hard head.\nIt may also make the target flinch.") },
            { PBEMove.MagnetBomb, new PBELocalizedString("あいてに　すいつく\nはがねの　ばくだんを　はっしゃする。\nこうげきは　かならず　めいちゅう　する。", "상대에게 달라붙는\n강철의 폭탄을 발사한다.\n공격은 반드시 명중한다.", "Le lanceur projette des bombes d'acier\nqui collent à l'ennemi. N'échoue jamais.", "Ziel wird durch Haftbomben getroffen.\nDiese Attacke trifft immer.", "Lanza unas bombas de hierro que se pegan\nal adversario. No se puede esquivar.", "Chi la usa lancia bombe d'acciaio che si\nattaccano al nemico. Una mossa infallibile.", "The user launches steel bombs that\nstick to the target.\nThis attack will not miss.") },
            { PBEMove.StoneEdge, new PBELocalizedString("とがった　いわを\nあいてに　つきさして　こうげきする。\nきゅうしょに　あたりやすい。", "뾰족한 바위를\n상대에게 꿰찔러서 공격한다.\n급소에 맞기 쉽다.", "Fait surgir des pierres aiguisées sous\nl'ennemi. Taux de critiques élevé.", "Anwender sticht das Ziel mit spitzen\nSteinen. Hohe Volltrefferquote.", "Clava piedras muy afiladas al objetivo.\nSuele ser crítico.", "Chi la usa colpisce il nemico dal\nbasso con pietre affilate. Probabile\nbrutto colpo.", "The user stabs the foe with\nsharpened stones from below.\nIt has a high critical-hit ratio.") },
            // { PBEMove.445, new PBELocalizedString("♂なら♀を　♀なら♂を　ゆうわくして\nあいての　とくこうを　がくっと　さげる。\n", "수컷은 암컷을 암컷은 수컷을 유혹하여\n상대의 특수공격을 크게 떨어뜨린다.", "Si l'ennemi est de sexe opposé au\nlanceur, il est séduit et son Attaque\nSpéciale baisse fortement.", "Charme-Attacke, die Spezial-Angriff\nstark senkt, falls das Ziel dem\nanderen Geschlecht angehört.", "Si el objetivo es del sexo opuesto,\nqueda embelesado y baja mucho\nsu Ataque Especial.", "Se il nemico è del sesso opposto di chi\nla usa, sarà ammaliato e il suo Attacco\nSpeciale diminuirà di molto.", "If it is the opposite gender of the user,\nthe target is charmed into harshly\nlowering its Sp. Atk stat.") },
            { PBEMove.StealthRock, new PBELocalizedString("あいての　まわりに　むすうの　いわを\nうかべて　こうたいで　でてきた　あいての\nポケモンに　ダメージを　あたえる。", "상대의 주위에 무수한 바위를\n띄워 교체해서 나온 상대\n포켓몬에게 데미지를 준다.", "Lance des pierres flottantes autour\nde l'ennemi, qui blessent tout ennemi\nentrant au combat.", "Falle mit schwebenden Steinen.\nIn den Kampf eingreifende Gegner\nnehmen Schaden.", "Una trampa de rocas que flota\nen el aire y daña a los objetivos\nque entran en combate.", "Chi la usa piazza una trappola di rocce\nsospese che danneggia i nemici che entrano\nin lotta.", "The user lays a trap of levitating stones\naround the opponent's team. The trap\nhurts opponents that switch into battle.") },
            { PBEMove.GrassKnot, new PBELocalizedString("くさを　からませて　あいてを\nころばせる。あいてが　おもいほど\nいりょくが　あがる。", "풀을 휘감아서 상대를\n쓰러뜨린다. 상대가 무거울수록\n위력이 올라간다.", "L'ennemi est piégé dans de l'herbe qui\nle fait trébucher. Plus il est lourd,\nplus il subit de dégâts.", "Ziel wird durch Gras ins Straucheln\ngebracht. Je schwerer das Ziel,\ndesto mehr Schaden.", "Enreda al objetivo con hierba y lo derriba.\nCuanto más pesado es el objetivo,\nmás daño inflige.", "Chi la usa intrappola il nemico con l'erba\ne lo fa cadere. Danneggia maggiormente\ni nemici più pesanti.", "The user snares the target with grass and\ntrips it. The heavier the target,\nthe greater the damage.") },
            { PBEMove.Chatter, new PBELocalizedString("おぼえた　ことばで\nおんぱを　おこして　こうげきする。\nあいてを　こんらん　させることが　ある。", "기억한 말로\n음파를 일으켜서 공격한다.\n상대를 혼란시킬 때가 있다.", "Le lanceur envoie une onde musicale en\nrécitant des mots. Peut aussi rendre\nl'ennemi confus.", "Attacke mit Schallwellen.\nVerwirrt das Ziel eventuell.", "Ataca con una onda sónica compuesta\npor palabras que ha aprendido. Puede\nconfundir al objetivo.", "Chi la usa attacca creando un'onda\nsonora con le parole imparate. Può anche\nconfondere il nemico.", "The user attacks using a sound wave\nbased on words it has learned.\nIt may also confuse the target.") },
            { PBEMove.Judgment, new PBELocalizedString("むすうの　こうだんを　あいてに\nほうしゅつする。じぶんの　もつ　\nプレートに　より　タイプが　かわる。", "무수한 광탄을 상대에게 방출한다.\n자신이 가지고 있는 플레이트에 따라\n타입이 바뀐다.", "Le lanceur libère une myriade de rayons de\nlumière. Le type varie selon la Plaque\nque tient le lanceur.", "Anwender feuert unzählige Lichtstrahlen\nab. Deren Typ hängt von der gehaltenen\nTafel ab.", "Emite incontables haces de luz.\nVaría según el tipo de Tabla\nque lleve el usuario.", "Chi la usa rilascia numerosi colpi di luce.\nIl tipo varia a seconda della Lastra\ntenuta.", "The user releases countless shots of\nlight at the target. Its type varies with\nthe kind of Plate the user is holding.") },
            // { PBEMove.450, new PBELocalizedString("かみついて　こうげきする。\nあいてが　きのみを　もっている　とき\nたべて　きのみの　こうかを　うけられる。", "물어서 공격한다.\n상대가 나무열매를 지니고 있을 때\n먹어서 나무열매의 효과를 받을 수 있다.", "Le lanceur pique l'ennemi. Si ce dernier\ntient une Baie, le lanceur la dévore et\nobtient son effet.", "Anwender beißt das Ziel. Hält dieses\neine Beere, isst der Anwender sie und\nerhält ihren Effekt.", "Pica al objetivo. Si el objetivo lleva\nuna Baya, el usuario se la come y\nse beneficia de su efecto.", "Chi la usa morde il nemico. Inoltre, se\nquesti tiene una Bacca, gliela ruba e ne\nsfrutta gli effetti.", "The user bites the target. If the target\nis holding a Berry, the user eats it and\ngains its effect.") },
            { PBEMove.ChargeBeam, new PBELocalizedString("でんげきの　たばを　あいてに\nはっしゃする。でんきを　ためて　じぶんの\nとくこうを　あげることが　ある。", "전격의 다발을 상대에게\n발사한다. 전기를 모아서 자신의\n특수공격을 올릴 때가 있다.", "Le lanceur tire un rayon chargé\nd'électricité. Peut aussi augmenter\nson Attaque Spéciale.", "Ziel wird von einem Elektrostrahl\ngetroffen. Steigert eventuell Spezial-\nAngriff des Anwenders.", "Lanza un rayo eléctrico contra el\nobjetivo. Puede subir el Ataque\nEspecial de quien lo usa.", "Chi la usa lancia un fascio di elettricità\nmolto intensa. Può anche aumentare il suo\nAttacco Speciale.", "The user attacks with an electric\ncharge. The user may use any remaining\nelectricity to raise its Sp. Atk stat.") },
            { PBEMove.WoodHammer, new PBELocalizedString("かたい　どうたいを\nあいてに　たたきつけて　こうげきする。\nじぶんも　かなり　ダメージを　うける。", "단단한 몸통을\n상대에게 부딪쳐서 공격한다.\n자신도 상당한 데미지를 입는다.", "Le lanceur heurte l'ennemi de son corps\nrobuste. Inflige de sérieux dégâts au\nlanceur aussi.", "Anwender attackiert mit seinem robusten\nKörper. Er erleidet dabei auch selbst\ngroßen Schaden.", "Arremete contra el objetivo con su\nrobusto cuerpo. El agresor también\nsufre bastante daño.", "Chi la usa si lancia con tutto il corpo\ncontro il nemico, ma subisce anche\nconsiderevoli danni.", "The user slams its rugged body into the\ntarget to attack. The user also sustains\nserious damage.") },
            { PBEMove.AquaJet, new PBELocalizedString("めにも　とまらぬ　ものすごい　はやさで\nあいてに　つっこむ。\nかならず　せんせい　こうげき　できる。", "눈에 보이지 않는 굉장한 속도로\n상대에게 돌진한다.\n반드시 선제공격할 수 있다.", "Le lanceur fonce sur l'ennemi si\nrapidement qu'on parvient à peine\nà le discerner. Frappe en premier.", "Sehr schneller Angriff mit\nErstschlaggarantie.", "Ataque rápido que permite golpear\nen primer lugar.", "Chi la usa colpisce sempre per primo e\nad una tale velocità da rendersi quasi\ninvisibile.", "The user lunges at the target at a speed\nthat makes it almost invisible. It is sure\nto strike first.") },
            { PBEMove.AttackOrder, new PBELocalizedString("しもべを　よびだして\nあいてに　むかって　こうげき　させる。\nきゅうしょに　あたりやすい。", "부하를 불러내어\n상대를 향해서 공격시킨다.\n급소에 맞기 쉽다.", "Le lanceur appelle ses sous-fifres pour\nfrapper l'ennemi. Taux de critiques\nélevé.", "Anwender ruft seine Untergebenen zum\nAngriff. Hat eine hohe Volltrefferquote.", "El usuario llama a sus súbditos\npara que ataquen al objetivo.\nSuele ser crítico.", "Chi la usa raduna i suoi sgherri per\ncolpire il nemico. Probabile brutto colpo.", "The user calls out its underlings to\npummel the target.\nCritical hits land more easily.") },
            { PBEMove.DefendOrder, new PBELocalizedString("しもべを　よびだして　じぶんの　からだに\nおおい　つかせる。ぼうぎょと　とくぼうを\nあげることが　できる。", "부하를 불러내어 자신의 몸을\n뒤덮게 한다. 방어와 특수방어를\n올릴 수 있다.", "Le lanceur appelle ses sous-fifres pour\nformer un bouclier qui augmente sa Défense\net sa Défense Spéciale.", "Untergebene bilden einen lebenden Schild\num den Anwender. Steigert Verteidigung\nund Spezial-Verteidigung.", "El usuario llama a sus súbditos para\nque formen un escudo viviente.\nSube la Defensa y la Defensa Especial.", "Chi la usa raduna i suoi sgherri per creare\nuno scudo, aumentando Difesa e Difesa\nSpeciale.", "The user calls out its underlings to\nshield its body, raising its Defense\nand Sp. Def stats.") },
            { PBEMove.HealOrder, new PBELocalizedString("しもべを　よびだして　きずを　なおす。\nさいだい　\xFF28\xFF30の　はんぶん\nじぶんの　\xFF28\xFF30を　かいふく　する。", "부하를 불러내어 상처를 회복한다.\n최대 HP의 절반만큼\n자신의 HP를 회복한다.", "Le lanceur appelle ses sous-fifres pour\nle soigner. Il récupère jusqu'à la moitié\nde ses PV max.", "Untergebene heilen den Anwender. KP des\nAnwenders werden mit 50 % der max. KP\naufgefüllt.", "El usuario llama a sus súbditos para que\nlo curen. Recupera hasta la mitad de\nlos PS máximos.", "Chi la usa raduna i propri sgherri per farsi\ncurare. Recupera metà dei PS massimi.", "The user calls out its underlings to\nheal it. The user regains up to half of its\nmax HP.") },
            { PBEMove.HeadSmash, new PBELocalizedString("いのちを　かけて　こんしんの　ちからで\nあいてに　ずつきを　する。じぶんも\nものすごい　ダメージを　うける。", "목숨을 걸고 혼신의 힘으로\n상대에게 박치기를 한다.\n자신도 굉장한 데미지를 입는다.", "Le lanceur assène un coup de tête\ndésespéré. Blesse aussi gravement\nle lanceur.", "Anwender greift unter Einsatz seines\nLebens mit einem Kopfstoß an und nimmt\ndabei selbst jede Menge Schaden.", "El usuario arriesga su vida y lanza\nun cabezazo con toda su fuerza.\nEl agresor resulta seriamente dañado.", "Chi la usa attacca con tutta la potenza\ndi cui dispone, ma purtroppo subisce\ndanni considerevoli.", "The user attacks the target with a\nhazardous, full-power headbutt.\nThe user also takes terrible damage.") },
            // { PBEMove.458, new PBELocalizedString("しっぽなどを　つかい　あいてを　たたいて\nこうげきする。\xFF12かい　れんぞくで　\nダメージを　あたえる。", "꼬리 등을 써서\n상대를 때려 공격한다.\n2회 연속으로 데미지를 준다.", "Un coup de queue ou de liane qui frappe\nl'ennemi deux fois d'affilée.", "Anwender trifft das Ziel mit dem\nSchweif oder Ähnlichem. Ziel wird\ndoppelt getroffen.", "Golpea al objetivo dos veces seguidas\ncon la cola u otras partes de su cuerpo.", "Chi la usa colpisce il nemico con la coda\ndue volte di fila.", "The user slams the target with a long tail,\nvines, or tentacle.\nThe target is hit twice in a row.") },
            // { PBEMove.459, new PBELocalizedString("じかんが　ゆがむほどの　ちからを\nうちだして　あいてを　こうげきする。\nつぎの　ターンは　うごけなく　なる。", "시간이 뒤틀릴 정도의 힘을\n사용해서 상대를 공격한다.\n다음 턴은 움직일 수 없다.", "Le lanceur frappe si fort qu'il affecte\nle cours du temps. Il se repose au\ntour suivant.", "Anwender attackiert mit einer Kraft, die\nselbst die Zeit verzerrt. In der nächsten\nRunde muss er ruhen.", "Ataca al objetivo usando tal energía\nque el tiempo se distorsiona.\nEl usuario descansa el siguiente turno.", "Chi la usa colpisce il nemico con una forza\ncapace di alterare il tempo, ma deve stare\nfermo il turno dopo.", "The user blasts the target with power\nthat distorts even time.\nThe user must rest on the next turn.") },
            { PBEMove.SpacialRend, new PBELocalizedString("まわりの　くうかんごと　あいてを\nひきさき　ダメージを　あたえる。\nきゅうしょに　あたりやすい。", "주위의 공간과 더불어 상대를\n찢어서 데미지를 준다.\n급소에 맞기 쉽다.", "Le lanceur déchire l'ennemi et l'espace\nautour de lui. Taux de critiques élevé.", "Schwere, raumgreifende Attacke.\nHohe Volltrefferquote.", "Desgarra al objetivo y el espacio\na su alrededor. Suele ser crítico.", "Chi la usa lacera il nemico e lo spazio che\nlo circonda. Probabile brutto colpo.", "The user tears the target along with the\nspace around it.\nCritical hits land more easily.") },
            // { PBEMove.461, new PBELocalizedString("じぶんは　ひんしに　なるが\nひかえから　でてくる　ポケモンの\nすべての　じょうたいを　かいふく　する。", "자신은 기절하지만\n교대하여 나오는 포켓몬의\n모든 상태를 회복한다.", "Le lanceur tombe K.O. pour soigner le\nstatut et les PV du Pokémon qui prendra\nsa place au combat.", "Anwender geht K.O. Das an seine Stelle\ntretende Pokémon hat dafür volle KP/AP.\nStatusprobleme werden geheilt.", "El usuario se debilita, pero el Pokémon\nque lo sustituye recupera su estado,\nlos PS y los PP.", "Chi la usa va KO. Il Pokémon che lo\nsostituisce risolve i propri problemi\ndi stato e recupera PS e PP.", "The user faints. In return, the Pokémon\ntaking its place will have its status and\nHP fully restored.") },
            // { PBEMove.462, new PBELocalizedString("すさまじい　ちからで　あいてを　にぎり\nつぶす。あいての　\xFF28\xFF30が　のこっている\nほど　いりょくが　あがる。", "굉장한 힘으로 상대를 묵사발로\n만든다. 상대의 HP가 남아있을수록\n위력이 올라간다.", "Une force puissante écrase l'ennemi.\nPlus il lui reste de PV et plus l'attaque\nest puissante.", "Ziel wird mit großer Kraft getroffen.\nJe höher die KP des Zieles, desto\nstärker die Attacke.", "Estruja al objetivo con gran fuerza.\nCuantos más PS le queden al\nobjetivo, más fuerte será el ataque.", "Colpisce il nemico con grande forza.\nPiù PS ha il nemico, maggiore è la potenza\ndella mossa.", "The target is crushed with great force.\nThe attack is more powerful the more\nHP the target has left.") },
            // { PBEMove.463, new PBELocalizedString("はげしく　もえたぎる　ほのおの　なかに\n\xFF14ー\xFF15ターンの　あいだ\nあいてを　とじこめて　こうげきする。", "세차게 타오르는 불꽃 속에\n4-5턴 동안 상대를\n가두어 공격한다.", "L'ennemi est pris dans un tourbillon\nde feu qui dure de 4 à 5 tours.", "Das Ziel wird in einen Feuersog\ngezogen, der vier bis fünf\nRunden aktiv ist.", "El objetivo queda atrapado en una\ntormenta de fuego que dura de\ncuatro a cinco turnos.", "Intrappola il nemico in un turbine di fuoco\nche dura per quattro o cinque turni.", "The target becomes trapped\nwithin a maelstrom of fire that rages\nfor four to five turns.") },
            { PBEMove.DarkVoid, new PBELocalizedString("あんこくの　せかいに　ひきずり　おとして\nあいてを　ねむり　じょうたいに　する。\n", "암흑의 세계로 끌고 가서 떨어뜨려\n상대를 잠듦 상태로 만든다.", "L'ennemi est plongé dans les ténèbres.\nIl tombe dans un profond sommeil.", "Das Ziel wird in eine Welt der\nDunkelheit gezogen und in Schlaf\nversetzt.", "El objetivo es enviado a un mundo de\ntinieblas que lo hace dormir.", "Trascina i nemici in un mondo di totale\noscurità e li fa addormentare.", "Opposing Pokémon are dragged into\na world of total darkness that makes\nthem sleep.") },
            { PBEMove.SeedFlare, new PBELocalizedString("からだの　なかから　しょうげきはを\nはっせい　させる。あいての　とくぼうを\nがくっと　さげることが　ある。", "몸속에서 충격파를\n발생시킨다. 상대의 특수방어를\n크게 떨어뜨릴 때가 있다.", "Le corps du lanceur émet une onde de\nchoc. Peut aussi baisser grandement\nla Défense Spéciale de la cible.", "Anwender erzeugt eine Schockwelle.\nSpezial-Verteidigung des Zieles wird\nstark gesenkt.", "Una onda de choque se libera del cuerpo.\nPuede bajar severamente la Defensa\nEspecial del objetivo.", "Chi la usa genera un'onda d'urto dal\nsuo corpo. Può anche ridurre di molto\nla Difesa Speciale del bersaglio.", "The user emits a shock wave from\nits body to attack its target. It may\nharshly lower the target's Sp. Def.") },
            { PBEMove.OminousWind, new PBELocalizedString("みのけも　よだつ　とっぷうで　あいてを\nこうげきする。じぶんの　すべての\nのうりょくが　あがることが　ある。", "소름이 끼칠만한 돌풍으로 상대를\n공격한다. 자신의 모든\n능력이 올라갈 때가 있다.", "Le lanceur crée une violente bourrasque.\nPeut aussi augmenter toutes ses stats.", "Das Ziel treffen abscheuliche Winde.\nSteigert eventuell alle Statuswerte des\nAnwenders.", "Produce un viento horripilante.\nPuede subir de golpe todas\nlas características del usuario.", "Chi la usa attacca con una forte raffica\ndi vento che può aumentare tutte le sue\nstatistiche.", "The user blasts the target with a gust of\nrepulsive wind. It may also raise all the\nuser's stats at once.") },
            // { PBEMove.467, new PBELocalizedString("\xFF11ターンめで　すがたを　けして\n\xFF12ターンめに　あいてを　こうげきする。\nまもっていても　こうげきは　あたる。", "1턴째에 모습을 감춰\n2턴째에 상대를 공격한다.\n방어하고 있어도 공격은 맞는다.", "Le lanceur disparaît et frappe l'ennemi\nau second tour. Fonctionne même si\nl'ennemi se protège.", "Anwender verschwindet in Runde 1 und\nattackiert in Runde 2. Trifft auch, wenn\nsich das Ziel selbst schützt.", "En el primer turno, desaparece.\nEn el segundo, golpea al objetivo\naunque se esté protegiendo.", "Chi la usa sparisce e poi colpisce il nemico\nal turno successivo. Evita pure Protezione\no Individua.", "The user disappears, then strikes the\ntarget on the second turn.\nIt hits even if the target protects itself.") },
            { PBEMove.HoneClaws, new PBELocalizedString("ツメを　みがいて　するどく　する。\nじぶんの　こうげきと　\nめいちゅうりつを　あげる。", "손톱을 갈아 날카롭게 한다.\n자신의 공격과\n명중률을 올린다.", "Le lanceur s'aiguise les griffes.\nAugmente l'Attaque et la Précision.", "Wetzt seine Klauen, um sie zu schärfen.\nErhöht Angriff und Genauigkeit des\nAnwenders.", "El usuario se afila las garras para\naumentar su Ataque y Precisión.", "Chi la usa affila i propri artigli,\naumentando Attacco e precisione.", "The user sharpens its claws to\nboost its Attack stat and accuracy.") },
            { PBEMove.WideGuard, new PBELocalizedString("みかた　ぜんいんに　あたる　こうげきを\n\xFF11ターンの　あいだ　ふせぐ。\nれんぞくで　だすと　しっぱい　しやすい。", "같은 편 전원에게 향하는 공격을\n1턴 동안 막는다.\n연속으로 쓰면 실패하기 쉽다.", "Annule les attaques visant toute l'équipe\npendant 1 tour. Peut échouer si utilisée\nplusieurs fois de suite.", "Schützt eine Runde lang vor Angriffen,\ndie alle Pokémon auf deiner Seite treffen.\nKlappt nur selten mehrmals in Folge.", "Bloquea los ataques lanzados contra todo\ntu equipo durante un turno. Su eficacia\nmerma si se usa repetidas veces.", "Chi la usa para tutti i colpi diretti alla\nintera squadra per un turno. Se usata\nin successione può fallire.", "The user and its allies are protected from\nwide-ranging attacks for one turn. If used\nin succession, its chance of failing rises.") },
            // { PBEMove.470, new PBELocalizedString("ちょうのうりょくで　じぶんと　あいての\nぼうぎょと　とくぼうを　たして\nはんぶんに　わける。", "초능력으로 자신과 상대의\n방어와 특수방어를 더해서\n반으로 나눈다.", "Additionne la Défense et la Défense\nSpéciale du lanceur et de sa cible et les\nredistribue équitablement entre les deux.", "Durch Psycho-Kräfte werden Vert. und\nSpez.-Vert. des Anwenders und des Zieles\naddiert und in zwei gleiche Hälften geteilt.", "El usuario emplea sus poderes para hacer\nla media de su Defensa y Defensa Especial\ncon las de su objetivo y compartirlas.", "Chi la usa sfrutta la sua forza psichica\nper sommare Difesa e Difesa Speciale a\nquelle del bersaglio e dividerle equamente.", "The user employs its psychic power to\naverage its Defense and Sp. Def stats\nwith those of its target's.") },
            // { PBEMove.471, new PBELocalizedString("ちょうのうりょくで　じぶんと　あいての\nこうげきと　とくこうを　たして\nはんぶんに　わける。", "초능력으로 자신과 상대의\n공격과 특수공격을 더해서\n반으로 나눈다.", "Additionne l'Attaque Spéciale et l'Attaque\ndu lanceur et de sa cible et les\nredistribue équitablement entre les deux.", "Durch Psycho-Kräfte werden Angriff und\nSpezial-Angriff addiert und in zwei gleiche\nHälften geteilt.", "El usuario emplea sus poderes para hacer\nla media de su Ataque y Ataque Especial\ncon los de su objetivo y compartirlos.", "Chi la usa sfrutta la sua forza psichica\nper sommare Attacco e Attacco Speciale a\nquelli del bersaglio e dividerli equamente.", "The user employs its psychic power to\naverage its Attack and Sp. Atk stats\nwith those of the target's.") },
            // { PBEMove.472, new PBELocalizedString("まかふしぎな　くうかんを　つくる。\n\xFF15ターンのあいだ　すべてのポケモンの\nぼうぎょと　とくぼうが　いれかわる。", "이상한 공간을 만든다.\n5턴 동안 모든 포켓몬의\n방어와 특수방어가 바뀐다.", "Crée une zone étrange où pendant 5 tours,\nla Défense et la Défense Spéciale de tous\nles Pokémon sont inversées.", "Anwender erzeugt bizarren Raum, in dem\nüber fünf Runden die Vert. aller Pokémon\nmit ihrer Spez.-Vert. getauscht wird.", "Crea una zona misteriosa donde se\nintercambian la Defensa y Def. Especial\nen todos los Pokémon por cinco turnos.", "Chi la usa crea una dimensione in cui Difesa\ne Difesa Speciale di tutti i Pokémon\nvengono scambiate per cinque turni.", "The user creates a bizarre area in which\nPokémon's Defense and Sp. Def\nstats are swapped for five turns.") },
            { PBEMove.Psyshock, new PBELocalizedString("ふしぎな　ねんぱを　じったいかして\nあいてを　こうげきする。\nぶつりてきな　ダメージを　あたえる。", "이상한 염력파를 실체화해서\n상대를 공격한다.\n물리적인 데미지를 준다.", "Le lanceur matérialise des ondes\nmystérieuses qu'il projette sur\nl'ennemi. Inflige des dégâts physiques.", "Anwender erzeugt eine seltsame\nEnergiewelle, die dem Ziel\nphysischen Schaden zufügt.", "Crea una onda psíquica que golpea\nal objetivo y provoca un gran daño\nfísico.", "Chi la usa attacca il bersaglio facendo\nmaterializzare un misterioso raggio\npsichico che provoca danni fisici.", "The user materializes an odd\npsychic wave to attack the target.\nThis attack does physical damage.") },
            { PBEMove.Venoshock, new PBELocalizedString("とくしゅな　どくえきを　あびせかける。\nどく　じょうたいの　あいてには\nいりょくが　\xFF12ばいに　なる。", "특수한 독액을 끼얹는다.\n독 상태의 상대에게는\n위력이 2배가 된다.", "Le lanceur inocule un poison spécial\nà l'ennemi. L'effet est doublé si\nl'ennemi est déjà empoisonné.", "Überschüttet das Ziel mit einer speziellen\ntoxischen Flüssigkeit. Doppelt so stark\ngegen vergiftete Ziele.", "Ataca cubriendo al objetivo con un líquido\nvenenoso. El daño será doble si este ya\nestá envenenado.", "Lancia uno speciale liquido tossico sul\nbersaglio. Se questi è avvelenato, il\ndanno provocato raddoppia.", "The user drenches the target in a special\npoisonous liquid. Its power is doubled\nif the target is poisoned.") },
            // { PBEMove.475, new PBELocalizedString("からだの　ムダな　ぶぶんを　けずる。　\nじぶんの　すばやさを　ぐーんと　あげて\nたいじゅうも　かるく　なる。", "몸의 쓸모없는 부분을 깎는다.\n자신의 스피드를 크게 올리고\n체중도 가벼워진다.", "Le lanceur se débarrasse des parties\ninutiles de son corps. Son poids diminue\net sa Vitesse augmente fortement.", "Anwender trennt sich von überflüssigen\nKörperteilen und steigert seine Initiative\nstark. Sein Gewicht nimmt deutlich ab.", "El usuario se sacude para hacerse más\nligero y aumentar mucho su Velocidad.", "Chi la usa si libera di tutti i pesi in\neccesso, alleggerendosi e aumentando di\nmolto la propria Velocità.", "The user sheds part of its body\nto make itself lighter and sharply\nraise its Speed stat.") },
            // { PBEMove.476, new PBELocalizedString("イライラさせる　こなを　じぶんに\nふりかけて　ちゅういを　ひく。あいての\nこうげきを　すべて　じぶんに　むける。", "안절부절못하게 하는 가루를\n자신에게 뿌려서 주의를 끈다.\n상대의 공격은 모두 자신에게 향한다.", "Le lanceur s'asperge d'une poudre\nirritante pour attirer l'attention. Il\nattire toutes les attaques ennemies.", "Anwender zieht gegn. Aufmerksamkeit\nund Angriffe auf sich, indem er ein Wut\nerzeugendes Pulver über sich streut.", "Usa un polvo que irrita y centra\nen el usuario la atención y los\nataques de los rivales.", "Chi la usa attira l'attenzione dei nemici\ncospargendosi di una polvere irritante e\ndiventando bersaglio di tutti gli attacchi.", "The user scatters a cloud of irritating\npowder to draw attention to itself.\nOpponents aim only at the user.") },
            // { PBEMove.477, new PBELocalizedString("ちょうのうりょくで　あいてを　うかせる。\n\xFF13ターンの　あいだ　こうげきが\nあいてに　あたりやすく　なる。", "초능력으로 상대를 띄운다.\n3턴 동안 공격이\n상대에게 맞기 쉬워진다.", "Un pouvoir qui fait flotter l'ennemi dans\nles airs. Pendant 3 tours, il devient plus\nfacile à atteindre.", "Bringt das Ziel durch Psycho-Kräfte zum\nSchweben. Dieses lässt sich so über drei\nRunden hinweg besonders leicht treffen.", "El usuario emplea su poder mental para\nhacer flotar al objetivo, haciéndolo blanco\nfácil de sus ataques durante tres turnos.", "Chi la usa fa galleggiare in aria il\nbersaglio, rendendolo facile da\ncolpire per tre turni.", "The user makes the target float with its\npsychic power. The target is easier to\nhit for three turns.") },
            // { PBEMove.478, new PBELocalizedString("まかふしぎな　くうかんを　つくる。\n\xFF15ターンのあいだ　すべてのポケモンの\nどうぐの　こうかが　なくなる。", "이상한 공간을 만든다.\n5턴 동안 모든 포켓몬의\n도구의 효과가 사라진다.", "Le lanceur crée une zone étrange. Pendant\n5 tours, les objets tenus par tous les\nPokémon n'ont plus aucun effet.", "Anwender erzeugt einen bizarren Raum, in\ndem über fünf Runden die Wirkung aller von\nPokémon getragenen Items aufgehoben ist.", "Crea un espacio misterioso que inutiliza\ntodos los objetos de los Pokémon\ndurante cinco turnos.", "Chi la usa crea una dimensione in cui\nl'effetto degli strumenti tenuti da tutti\ni Pokémon è annullato per cinque turni.", "The user creates a bizarre area\nin which Pokémon's held items\nlose their effects for five turns.") },
            // { PBEMove.479, new PBELocalizedString("いしや　たまを　なげて　とんでいる\nあいてを　こうげきする。あいては\nうちおとされて　じめんに　おちる。", "돌이나 구슬을 던져서 날고 있는\n상대를 공격한다.\n맞은 상대는 땅에 떨어진다.", "Le lanceur jette toutes sortes\nde projectiles à un ennemi. Si ce\ndernier vole, il tombe au sol.", "Greift das Ziel mit Steinen und Wurfge-\nschossen an. Fliegende Ziele fallen dabei\nvom Himmel und landen auf dem Boden.", "El usuario ataca lanzando una piedra\no un proyectil. Puede estrellar contra\nel suelo al objetivo si vuela.", "Chi la usa lancia una pietra o un\nproiettile. Può colpire anche un\nbersaglio in volo e farlo cadere.", "The user throws a stone or projectile to\nattack an opponent. A flying Pokémon will\nfall to the ground when hit.") },
            { PBEMove.StormThrow, new PBELocalizedString("きょうれつな　いちげきを\nあいてに　くりだす。こうげきは\nかならず　きゅうしょに　あたる。", "강렬한 일격을\n상대에게 날린다. 공격은\n반드시 급소에 맞는다.", "Un coup très puissant dont l'effet\nest toujours critique.", "Ein Angriff mit voller Wucht\nund Volltreffergarantie.", "Lanza un golpe fulminante.\nSiempre resulta en un golpe crítico.", "Chi la usa sferra un colpo micidiale\nal bersaglio, stritolandolo. Brutto colpo\nassicurato.", "The user strikes the target with a fierce\nblow. This attack always results in a\ncritical hit.") },
            // { PBEMove.481, new PBELocalizedString("あたると　はじける　ほのおで　あいてを\nこうげきする。はじけた　ほのおは\nとなりの　あいてにも　ふりかかる。", "맞으면 튀는 불꽃으로 상대를\n공격한다. 튕긴 불꽃은\n옆의 상대에게도 쏟아진다.", "Quand l'attaque atteint sa cible, elle\nprojette des flammes qui touchent\ntout ennemi situé à côté.", "Bei Erfolg Angriff mit berstenden Feuer-\nblasen. Die Funken der geplatzten\nBlasen treffen auch benachbarte Ziele.", "Golpea al objetivo con una llamarada que\nafecta a sus Pokémon adyacentes.", "Chi la usa emana una fiammata che colpisce\nil bersaglio e si propaga fino a raggiungere\ni Pokémon accanto.", "The user attacks the target with a\nbursting flame. The bursting flame damages\nPokémon next to the target as well.") },
            { PBEMove.SludgeWave, new PBELocalizedString("ヘドロの　なみで　じぶんの\nまわりに　いるものを　こうげきする。\nどく　じょうたいに　することが　ある。", "오물 파도로 자신의\n주위에 있는 포켓몬을 공격한다.\n독 상태로 만들 때가 있다.", "Une vague de détritus attaque tous\nles Pokémon autour du lanceur.\nPeut aussi empoisonner.", "Greift Pokémon in der Nähe des\nAnwenders mit einer Schlammwelle an.\nDiese werden eventuell vergiftet.", "Una onda tóxica que daña a los Pokémon\nde alrededor. Puede envenenar.", "Lancia un'onda di fango che attacca\ntutti i Pokémon nelle vicinanze.\nPuò anche avvelenarli.", "It swamps the area around the user with a\ngiant sludge wave.\nIt may also poison those hit.") },
            { PBEMove.QuiverDance, new PBELocalizedString("しんぴてきで　うつくしい　まいを\nかろやかに　おどる。じぶんの　とくこうと\nとくぼうと　すばやさを　あげる。", "신비롭고 아름다운 춤을\n경쾌하게 춘다. 자신의 특수공격과\n특수방어와 스피드를 올린다.", "Une danse mystique dont le rythme parfait\naugmente l'Attaque Spéciale, la Défense\nSpéciale et la Vitesse du lanceur.", "Anwender legt behände einen mystischen,\nformvollendeten Tanz aufs Parkett. Spez.-\nAng., Spez.-Vert. und Initiative steigen.", "Danza mística que sube el Ataque Especial,\nla Defensa Especial y la Velocidad.", "Danza leggiadra ed elegante che aumenta\nl'Attacco Speciale, la Difesa Speciale\ne la Velocità di chi la usa.", "The user lightly performs a beautiful,\nmystic dance. It boosts the user's\nSp. Atk, Sp. Def, and Speed stats.") },
            { PBEMove.HeavySlam, new PBELocalizedString("おもたい　からだで　あいてに　ぶつかって\nこうげきする。じぶんが　あいてより\nおもいほど　いりょくが　あがる。", "무거운 몸으로 상대에게 부딪쳐\n공격한다. 자신이 상대보다\n무거울수록 위력이 올라간다.", "Le lanceur se jette sur l'ennemi de tout\nson poids. S'il est plus lourd que l'ennemi,\nl'effet augmente en conséquence.", "Anwender rammt das Ziel mit massivem\nKörper. Je schwerer er im Vergleich zum\nZiel ist, desto stärker die Attacke.", "El usuario golpea con todo su cuerpo.\nCuanto mayor sea su peso comparado\ncon el del objetivo, más daño causará.", "Chi la usa si lancia contro il bersaglio\ncon tutto il proprio peso. Più è pesante\nrispetto ad esso e più danni causa.", "The user slams into the target with its\nheavy body. The more the user outweighs\nthe target, the greater its damage.") },
            // { PBEMove.485, new PBELocalizedString("ふしぎな　でんぱで　まわりに　いる\nじぶんと　おなじ　タイプの　\nポケモンに　ダメージを　あたえる。", "이상한 전파로 주위에 있는\n자신과 같은 타입의\n포켓몬에게 데미지를 준다.", "Des ondes mystérieuses blessent tous\nles Pokémon alentour qui sont du même\ntype que le lanceur.", "Fügt Pokémon vom selben Typ, die sich in\nder Nähe des Anwenders aufhalten, mit\nseltsamen Druckwellen Schaden zu.", "Una extraña onda que daña a todos\nlos Pokémon adyacentes del mismo\ntipo que el que la ejecuta.", "Chi la usa infligge danni a tutti i Pokémon\ndel suo stesso tipo che ha vicino usando\nmisteriose onde elettromagnetiche.", "Using an odd shock wave, the user\ninflicts damage on any Pokémon of the same\ntype in the area around it.") },
            // { PBEMove.486, new PBELocalizedString("でんきの　かたまりを　あいてに\nぶつける。あいてより　すばやさが\nはやいほど　いりょくが　あがる。", "전기 덩어리를 상대에게 부딪쳐서\n공격한다. 상대보다 스피드가\n빠를수록 위력이 올라간다.", "Le lanceur envoie une boule d'électricité.\nSi sa Vitesse est plus grande que celle de\nl'ennemi, les dégâts augmentent d'autant.", "Je höher die Initiative des Anwenders\nim Vergleich zum Ziel ist, desto stärker\ntrifft dieses eine geballte Ladung Strom.", "Lanza una bola eléctrica. Cuanto mayor\nsea la Velocidad del usuario sobre la del\nobjetivo, mayor será el daño causado.", "Chi la usa attacca con una sfera d'energia\nelettrica. Più è rapido rispetto al\nbersaglio e più danni arreca.", "The user hurls an electric orb\nat the target. The faster the user is\nthan the target, the greater the damage.") },
            // { PBEMove.487, new PBELocalizedString("たくさんの　みずを　あびせかけて\nあいてを　みずタイプに　する。\n", "많은 물을 끼얹어서\n상대를 물타입으로 바꾼다.", "Le lanceur projette beaucoup d'eau sur\nsa cible, qui devient de type Eau.", "Überschüttet das Ziel mit Unmengen an\nWasser und ändert den Typ damit in\nWasser um.", "Potente lluvia que transforma al objetivo\nen un Pokémon de tipo Agua.", "Chi la usa proietta un lungo getto d'acqua\ncontro il bersaglio e lo rende un Pokémon\ndi tipo Acqua.", "The user shoots a torrent of water\nat the target and changes\nthe target's type to Water.") },
            { PBEMove.FlameCharge, new PBELocalizedString("ほのおを　まとい　あいてを\nこうげきする。ちからを　ためて　じぶんの\nすばやさを　あげる。", "불꽃을 둘러 상대를 공격한다.\n힘을 모아서 자신의\n스피드를 올린다.", "Le lanceur s'entoure de flammes pour\nattaquer l'ennemi. Il se concentre\net sa Vitesse augmente.", "Anwender hüllt sich in Flammen und greift\ndas Ziel an. Sammelt seine Energie und\nerhöht dadurch die eigene Initiative.", "Llamas que golpean al objetivo y\naumentan la Velocidad del atacante.", "Chi la usa si copre di fuoco e attacca\nil bersaglio. Concentrandosi aumenta,\ninoltre, la propria Velocità.", "The user cloaks itself with flame and\nattacks. Building up more power,\nit raises the user's Speed stat.") },
            { PBEMove.Coil, new PBELocalizedString("とぐろを　まいて　しゅうちゅう　する。\nじぶんの　こうげきと　ぼうぎょと　\nめいちゅうりつを　あげる。", "똬리를 틀어서 집중한다.\n자신의 공격과 방어와\n명중률을 올린다.", "Le lanceur s'enroule sur lui-même et se\nconcentre. Son Attaque, sa Défense et\nsa Précision augmentent.", "Anwender rollt sich zusammen und sammelt\nsich. Dabei werden Angriff, Verteidigung\nund Genauigkeit erhöht.", "El usuario se concentra, lo que le permite\naumentar su Ataque, Defensa y Precisión.", "Chi la usa si concentra, aumentando\nAttacco, Difesa e precisione.", "The user coils up and concentrates.\nThis raises its Attack and Defense stats\nas well as its accuracy.") },
            { PBEMove.LowSweep, new PBELocalizedString("すばやい　うごきで　あいての　あしを\nねらって　こうげきする。\nあいての　すばやさを　さげる。", "재빠른 움직임으로 상대의 다리를\n노려 공격한다.\n상대의 스피드를 떨어뜨린다.", "Un coup rapide qui vise les pieds\nde l'ennemi et diminue sa Vitesse.", "Anwender greift mit blitzschnellen\nBewegungen die Beine des Zieles\nan und senkt dessen Initiative.", "Un veloz ataque a los pies que\nreduce la Velocidad del objetivo.", "Chi la usa colpisce con un attacco fulmineo\nla parte inferiore del corpo del bersaglio,\nriducendone la Velocità.", "The user attacks the target's legs\nswiftly, reducing the target's\nSpeed stat.") },
            { PBEMove.AcidSpray, new PBELocalizedString("あいてを　とかす　えきたいを\nはきだして　こうげきする。\nあいての　とくぼうを　がくっと　さげる。", "상대를 녹이는 액체를\n토해내서 공격한다.\n상대의 특수방어를 크게 떨어뜨린다.", "Un liquide acide qui fait fondre l'ennemi.\nSa Défense Spéciale diminue beaucoup.", "Anwender greift an, indem er eine ätzende\nFlüssigkeit auf das Ziel speit. Senkt\ndessen Spezial-Verteidigung stark.", "Ataca con un líquido corrosivo,\nreduciendo mucho la Defensa\nEspecial del objetivo.", "Chi la usa attacca il bersaglio con un acido\naltamente corrosivo. Il fluido riduce\ndi molto la Difesa Speciale del bersaglio.", "The user spits fluid that works to melt\nthe target. This harshly reduces\nthe target's Sp. Def stat.") },
            { PBEMove.FoulPlay, new PBELocalizedString("あいての　ちからを　りようする。\nたたかっている　あいての　こうげきが\nたかいほど　ダメージが　あがる。", "상대의 힘을 이용한다.\n싸우고 있는 상대의 공격이\n높을수록 데미지가 올라간다.", "Le lanceur utilise la force de l'ennemi.\nPlus l'Attaque de l'ennemi est élevée,\nplus le lanceur inflige de dégâts.", "Anwender macht sich die Kraft des Zieles\nzunutze. Je höher dessen Angriff, desto\nmehr Schaden richtet die Attacke an.", "El usuario emplea la fuerza del objetivo\npara atacarlo. Cuanto mayor es el Ataque\ndel objetivo, más daño provoca.", "Chi la usa sfrutta la forza del bersaglio.\nIl danno inflitto è proporzionale\nall'Attacco dell'avversario.", "The user turns the target's power\nagainst it. The higher the target's\nAttack stat, the greater the damage.") },
            // { PBEMove.493, new PBELocalizedString("なぞの　ねんぱを　あいてに　おくる。\nねんぱを　うけとった　あいては　\nとくせいが　たんじゅんに　なる。", "수수께끼의 염력파를 상대에게\n보낸다. 염력파를 받은 상대는\n특성이 단순으로 바뀐다.", "Le lanceur envoie des ondes\nmystérieuses à l'ennemi. Sa\ncapacité spéciale devient Simple.", "Bestrahlt das Ziel mit mysteriösen\nEnergiewellen. Bei einem Treffer wird\ndessen Fähigkeit zu Wankelmut.", "Lanza una onda psíquica que hace que\nla habilidad del objetivo pase a ser Simple.", "Chi la usa emette un misterioso raggio\npsichico che trasforma l'abilità del\nPokémon colpito in Disinvoltura.", "The user's mysterious psychic wave\nchanges the target's Ability to Simple.") },
            // { PBEMove.494, new PBELocalizedString("ふしぎな　リズムで　おどる。\nうごきを　まねさせて　じぶんと　あいての\nとくせいを　おなじに　する。", "이상한 리듬으로 춤춘다.\n움직임을 흉내 내게 해서\n자신과 상대의 특성을 똑같게 만든다.", "Le lanceur danse sur un rythme étrange.\nIl force sa cible à l'imiter, ce qui lui fait\nadopter sa capacité spéciale.", "Anwender tanzt zu seltsamem Rhythmus und\nzwingt das Ziel mitzumachen. Dieses nimmt\ndabei die Fähigkeit des Anwenders an.", "Una extraña danza que hace que el usuario\ny el objetivo tengan la misma habilidad.", "Chi la usa saltella con un buffo ritmo,\ninvitando il bersaglio a imitarlo e rendendo\nla sua abilità identica alla propria.", "The user dances with an odd rhythm that\ncompels the target to mimic it, making the\ntarget's Ability the same as the user's.") },
            // { PBEMove.495, new PBELocalizedString("あいての　こうどうを　サポートして\nじぶんの　こうどうの　あとに\nつづけて　うごけるように　する。", "상대의 행동을 도와서\n자신이 행동한 뒤에 바로\n움직일 수 있도록 한다.", "S'il est le premier à agir, le lanceur\npermet à sa cible d'utiliser une\ncapacité juste après lui.", "Anwender ermöglicht dem Ziel direkt\nnach ihm zu handeln, solange der\nAnwender als Erstes zum Zug kommt.", "Si el usuario es el más rápido, permite al\nobjetivo usar un movimiento justo tras él,\nadelantándose a Pokémon más rápidos.", "Chi la usa aiuta un bersaglio più lento\npermettendogli di agire subito dopo.", "The user helps the target and makes it\nuse its move right after the user.") },
            // { PBEMove.496, new PBELocalizedString("うたで　あいてを　こうげきする。\nみんなで　りんしょう　すると　つづけて\nだすことが　でき　いりょくも　あがる。", "노래로 상대를 공격한다.\n함께 돌림노래를 하면 계속해서\n쓸 수 있고 위력도 올라간다.", "Le lanceur attaque l'ennemi en chantant.\nSi plusieurs Pokémon déclenchent cette\nattaque à la suite, l'effet augmente.", "Angriff mit Gesang. Singt der Anwender\nmit allen im Kanon, steigt die Stärke.", "Un canto que ataca al objetivo.\nCuantos más Pokémon lo usan,\nmás aumenta de potencia.", "Attacca il bersaglio con una melodia.\nSe usata durante lo stesso turno da\npiù Pokémon i danni inflitti aumentano.", "The user attacks the target with a song.\nOthers can join in the Round and make\nthe attack do greater damage.") },
            // { PBEMove.497, new PBELocalizedString("ひびく　こえで　あいてを　こうげきする。\nまいターン　だれかが　わざを\nつかい　つづけると　いりょくが　あがる。", "울리는 목소리로 상대를 공격한다.\n매 턴 누군가 기술을\n계속해서 쓰면 위력이 올라간다.", "Un cri retentissant blesse l'ennemi. Si le\nlanceur ou d'autres Pokémon l'utilisent\nà chaque tour, l'effet augmente.", "Angriff mit widerhallender Stimme. Wenn in\njeder Runde ein Teilnehmer wiederholt die\nAttacke einsetzt, steigt die Stärke.", "Un susurro que aumenta de potencia\nconforme el usuario y otros Pokémon\nlo van utilizando.", "Attacca il bersaglio con la propria voce\necheggiante. Se usata a ripetizione da uno\no più Pokémon il danno aumenta.", "The user attacks the target with an\nechoing voice. If this move is used\nevery turn, it does greater damage.") },
            // { PBEMove.498, new PBELocalizedString("すきを　みて　けんじつに　こうげきする。\nあいての　のうりょく　へんかに　\nかんけいなく　ダメージを　あたえる。", "틈을 보며 착실하게 공격한다.\n상대의 능력 변화에\n관계없이 데미지를 준다.", "Une attaque puissante quand l'ennemi\nbaisse sa garde. Inflige des dégâts sans\ntenir compte des changements de stats.", "Eine durchdachte Attacke zu rechter Zeit.\nRichtet unabhängig von den Status-\nveränderungen des Zieles Schaden an.", "Un ataque que busca los puntos débiles\ndel objetivo y puede causarle daño\naunque cambien sus características.", "Chi la usa attacca non appena il bersaglio\nabbassa la guardia. Il danno inflitto\nprescinde dalle modifiche alle statistiche.", "Looking for an opening, the user strikes\ncontinually. The target's stat changes\ndon't affect this attack's damage.") },
            // { PBEMove.499, new PBELocalizedString("とくしゅな　どろの　かたまりを\nあいてに　なげつけて　こうげきする。\nのうりょく　へんかを　もとに　もどす。", "특수한 진흙 덩어리를\n상대에게 내던져서 공격한다.\n능력 변화를 원래대로 돌린다.", "Le lanceur jette un tas de détritus\nspéciaux sur la cible. Les changements\nde stats de la cible sont annulés.", "Anwender greift das Ziel mit spezial-\ngefertigten Schlammklumpen an. Setzt\nStatusveränderungen zurück.", "Ataca al objetivo con una extraña niebla\nque elimina sus cambios de características.", "Attacca il bersaglio lanciandogli contro\nuna nuvola di fumo speciale, che annulla\nogni modifica alle statistiche.", "The user attacks by throwing a clump of\nspecial mud. All status changes are\nreturned to normal.") },
            // { PBEMove.500, new PBELocalizedString("ちくせき　された　パワーで　あいてを\nこうげきする。じぶんの　のうりょくが\nあがって　いるほど　いりょくが　あがる。", "축적된 파워로 상대를\n공격한다. 자신의 능력이\n올라가 있는 만큼 위력이 오른다.", "Le lanceur attaque l'ennemi avec une force\naccumulée. Plus les stats du lanceur sont\naugmentées, plus le coup est efficace.", "Angriff mit angesparter Energie. Je höher\ndie Statuswerte des Anwenders, desto\nstärker fällt die Attacke aus.", "Acumula poder para golpear.\nCuanto más suban las características\ndel usuario, mayor será el daño.", "Attacca il bersaglio con l'energia\naccumulata. Più sono state aumentate le\nstatistiche, maggiore è il danno inflitto.", "The user attacks the target with stored\npower. The more the user's stats are\nraised, the greater the damage.") },
            // { PBEMove.501, new PBELocalizedString("じぶんと　みかたを　あいての\nせんせい　こうげきから　まもる。\nれんぞくで　だすと　しっぱい　しやすい。", "자신과 같은 편을 상대의\n선제공격으로부터 지킨다.\n연속으로 쓰면 실패하기 쉽다.", "Le lanceur et son équipe sont protégés\ncontre les attaques prioritaires. Peut\néchouer si utilisée plusieurs fois de suite.", "Schützt Anwender und Mitstreiter vor\ngegnerischen Erstschlag-Attacken.\nGeht bei wiederholtem Einsatz oft daneben.", "Protege a todo el equipo de ataques que\nse adelantan. Puede fallar si se utiliza\nrepetidamente.", "Chi la usa protegge tutta la squadra dalle\nmosse dei nemici che fanno colpire per\nprimi. Se usata in successione può fallire.", "The user protects itself and its allies\nfrom priority moves. If used in\nsuccession, its chance of failing rises.") },
            // { PBEMove.502, new PBELocalizedString("ふしぎな　ちからで　テレポートして\nじぶんと　みかたの　いばしょを\nいれかえる。", "이상한 힘으로 순간이동하여\n자신과 같은 편이 있는 장소를\n바꾼다.", "Le lanceur se téléporte à l'aide d'un\npouvoir mystérieux. Il échange sa place\navec celle d'un allié sur le terrain.", "Wundersame Kräfte teleportieren\nden Anwender an den Platz eines\nMitstreiters.", "Un extraño poder que intercambia las\nposiciones del usuario y un aliado\nsobre el terreno de combate.", "Chi la usa si teletrasporta al posto\ndi un compagno in campo, grazie\nad un misterioso potere.", "The user teleports using a strange power\nand switches its place with one of\nits allies.") },
            { PBEMove.Scald, new PBELocalizedString("あつく　にえたぎる　みずを\nあいてに　はっしゃして　こうげきする。\nやけど　じょうたいに　することが　ある。", "뜨겁게 끓어오르는 물을\n상대에게 발사해서 공격한다.\n화상 상태로 만들 때가 있다.", "L'ennemi est attaqué par un jet d'eau\nbouillante. Peut aussi le brûler.", "Heizt dem Ziel mit einem Schwall siedend\nheißen Kochwassers ein. Das Ziel\nerleidet eventuell Verbrennungen.", "Ataca arrojando agua hirviendo\nal objetivo.\nPuede causar quemaduras.", "Chi la usa attacca il bersaglio con un\ngetto d'acqua bollente che può anche\nscottarlo.", "The user shoots boiling hot water at\nits target. It may also leave the target\nwith a burn.") },
            { PBEMove.ShellSmash, new PBELocalizedString("からを　やぶって　じぶんの　ぼうぎょ\nとくぼうを　さげるが　こうげき　とくこう\nすばやさを　ぐーんと　あげる。", "껍질을 깨서 자신의 방어와\n특수방어를 떨어뜨리지만 공격과\n특수공격, 스피드를 크게 올린다.", "Le lanceur brise sa coquille. Il baisse sa\nDéfense et Déf. Spé., mais augmente forte-\nment son Attaque, Atq. Spé. et Vitesse.", "Anwender zerbricht seine Schale und senkt\nseine Vert. und Spez.-Vert., dafür steigen\nAngr., Spez.-Angr. und Initiative stark.", "El usuario rompe su coraza y baja su\nDefensa y Def. Esp., pero aumenta mucho\nsu Ataque, Ataque Especial y Velocidad.", "Chi la usa si disfa del guscio. Difesa e\nDif. Sp. calano, ma aumentano di molto\nAttacco, Att. Sp. e Velocità.", "The user breaks its shell, lowering its\nDefense and Sp. Def stats but sharply\nraising Attack, Sp. Atk, and Speed stats.") },
            { PBEMove.HealPulse, new PBELocalizedString("いやしのはどうを　とばして\nさいだい　\xFF28\xFF30の　はんぶん\nあいての　\xFF28\xFF30を　かいふく　する。", "치유파동을 날려서\n최대 HP의 절반만큼\n상대의 HP를 회복한다.", "Une aura de bien-être fait récupérer\nla moitié de ses PV max à la cible.", "Anwender löst eine Schmerzen lindernde\nWelle aus und heilt das Ziel mit der Hälfte\nseiner maximalen KP.", "Una onda curativa restaura los PS\ndel objetivo a la mitad de su máximo.", "Chi la usa lancia un'onda rilassante che\nfa recuperare al bersaglio metà dei suoi\nPS massimi.", "The user emits a healing pulse which\nrestores the target's HP by up to\nhalf of its max HP.") },
            { PBEMove.Hex, new PBELocalizedString("たたみかける　ように　こうげきする。\nじょうたい　いじょうの　あいてに\nおおきな　ダメージを　あたえる。　", "엎친 데 덮친 격으로 공격한다.\n상태 이상인 상대에게\n큰 데미지를 준다.", "Attaque acharnée qui cause\ndavantage de dégâts à l'ennemi\ns'il a un problème de statut.", "Eine Attacke, bei der der Anwender das\nZiel bedrängt. Fügt Zielen mit\nStatusveränderungen hohen Schaden zu.", "Ataque que causa un gran daño\na los objetivos que sufren\nproblemas de estado.", "Attacco che causa un danno enorme\nse il bersaglio ha problemi di stato.", "This relentless attack does massive\ndamage to a target affected\nby status problems.") },
            // { PBEMove.507, new PBELocalizedString("\xFF11ターンめで　あいてを　そらへ　つれさり\n\xFF12ターンめに　おとして　こうげきする。\nつれさられた　あいては　うごけない。", "1턴째에 상대를 하늘로 끌고 가서\n2턴째에 떨어뜨려 공격한다.\n끌려간 상대는 움직일 수 없다.", "Le lanceur emmène l'ennemi dans les airs\nau 1⑩ tour et le lâche dans le vide au\n2⒅. L'ennemi saisi ne peut pas attaquer.", "Steigt in Runde 1 mit dem Ziel in die\nLuft auf und lässt es in Runde 2 fallen.\nDas Opfer kann dabei nicht angreifen.", "Primer turno: lanza al objetivo al aire.\nSegundo turno: lo hace caer. Mientras\nestá en el aire, no lo deja moverse.", "Porta il bersaglio in cielo e lo scaglia a\nterra al turno successivo. Il bersaglio\ncatturato non può muoversi.", "The user takes the target into the sky,\nthen drops it during the next turn.\nThe target cannot attack while in the sky.") },
            { PBEMove.ShiftGear, new PBELocalizedString("はぐるまを　まわして\nじぶんの　こうげきを　あげる　だけでなく\nすばやさも　ぐーんと　あげる。", "톱니바퀴를 돌려서 자신의\n공격을 올리는 것뿐만 아니라\n스피드도 크게 올린다.", "Le lanceur fait tourner ses engrenages.\nCeci augmente son Attaque et augmente\nfortement sa Vitesse.", "Durch Drehen der Zahnräder erhöht sich\nnicht nur der Angriffs-Wert, sondern auch\ndie Initiative des Anwenders stark.", "Al hacer girar los engranajes, el usuario\nmejora su Ataque y aumenta su Velocidad\nespectacularmente.", "Facendo ruotare gli ingranaggi, chi la usa\naumenta non solo il proprio Attacco, ma\nanche di molto la propria Velocità.", "The user rotates its gears, raising its\nAttack and sharply raising its Speed.") },
            // { PBEMove.509, new PBELocalizedString("あいてを　なげとばして\nひかえの　ポケモンを　ひきずりだす。\nやせいの　ばあいは　せんとうが　おわる。", "상대를 내던져서\n교대할 포켓몬을 끌어낸다.\n야생의 경우에는 배틀이 끝난다.", "Projette le Pokémon ennemi et le\nremplace par un autre. Dans la\nnature, met fin au combat.", "Schleudert das Ziel davon und bewirkt,\ndass ein anderes Pokémon eingewechselt\nwird. Beendet Kämpfe gegen wilde Pokémon.", "Lanza por los aires al objetivo y hace que\nsalga otro Pokémon. Si es uno salvaje,\nacaba el combate.", "Il bersaglio è scaraventato via ed è\ncostretto a lasciare il posto a un altro.\nSe è selvatico, la lotta finisce.", "The target is thrown and switched.\nIn the wild, a battle against a single\nPokémon ends.") },
            // { PBEMove.510, new PBELocalizedString("ほのおで　あいてを　こうげきする。\nあいてが　きのみを　もっている　とき\nもやして　つかえなく　する。", "불꽃으로 상대를 공격한다.\n상대가 나무열매를 지니고 있을 때\n불태워서 쓸 수 없게 만든다.", "Des flammes calcinent l'ennemi.\nS'il tient une Baie, elle est\nbrûlée et devient inutilisable.", "Eine Feuer-Attacke. Trägt das Ziel eine\nBeere bei sich, wird diese von den\nFlammen verzehrt und geht verloren.", "Llamas que golpean a los objetivos\nadyacentes. Si estos llevan Bayas, estas\nse quemarán y ya no se podrán usar.", "Attacca il nemico con una fiammata.\nSe il nemico ha una Bacca, viene\ndivorata dalle fiamme.", "The user attacks the target with fire.\nIf the target is holding a Berry, the\nBerry becomes burnt up and unusable.") },
            // { PBEMove.511, new PBELocalizedString("あいてを　おさえつけて\nこうどうの　じゅんばんを\nさいごに　する。", "상대를 억눌러서\n행동의 순서를\n마지막으로 만든다.", "Retient la cible de force,\nl'obligeant à agir en dernier.", "Anwender stemmt sich gegen das Ziel\nund bewirkt, dass dieses erst als\nLetztes angreift.", "El usuario intimida a su objetivo logrando\nque su movimiento sea el último del turno.", "Chi la usa spinge via il bersaglio,\ncostringendolo ad agire per ultimo.", "The user suppresses the target and\nmakes its move go last.") },
            { PBEMove.Acrobatics, new PBELocalizedString("かろやかに　あいてを　こうげきする。\nじぶんが　どうぐを　もっていない　とき\nおおきな　ダメージを　あたえる。　", "경쾌하게 상대를 공격한다.\n자신이 도구를 지니고 있지 않을 때\n큰 데미지를 준다.", "Attaque agile. Si le lanceur ne tient\npas d'objet, l'attaque inflige\ndavantage de dégâts.", "Ein graziler Angriff auf das Ziel. Trägt\nder Anwender kein Item bei sich, richtet\ndie Attacke großen Schaden an.", "Golpea ágilmente. Si el usuario no porta\nningún objeto, el objetivo resulta\nseriamente dañado.", "Attacca rapidamente il bersaglio.\nSe chi la usa non ha uno strumento,\ninfligge al nemico grossi danni.", "The user nimbly strikes the target.\nIf the user is not holding an item,\nthis attack inflicts massive damage.") },
            // { PBEMove.513, new PBELocalizedString("あいての　タイプを　はんしゃして\nじぶんも　おなじ　タイプに　なる。\n", "상대의 타입을 반사해서\n자신도 똑같은 타입이 된다.", "Le lanceur copie le type de la cible\net devient du même type.", "Anwender bildet das Ziel nach und\nnimmt dabei dessen Typ an.", "Cambia el tipo del Pokémon al mismo\ntipo que el del objetivo.", "Chi la usa cambia il proprio tipo in quello\ndel bersaglio.", "The user reflects the target's type,\nmaking it the same type as the target.") },
            { PBEMove.Retaliate, new PBELocalizedString("たおれた　みかたの　かたきを　うつ。\nまえの　ターンに　みかたが　たおされて\nいると　いりょくが　あがる。　", "쓰러진 같은 편의 원수를 갚는다.\n앞 턴에서 같은 편이\n쓰러졌다면 위력이 올라간다.", "Venge un Pokémon de l'équipe mis K.O.\nSi un Pokémon de l'équipe a été mis\nK.O. au tour d'avant, l'effet augmente.", "Anwender nimmt Rache für einen besiegten\nMitstreiter. Wurde in der vorigen Runde ein\nMitstreiter besiegt, steigt die Kraft.", "Venga a los amigos derrotados. Si en el\nturno anterior han derrotado a uno,\nla potencia del ataque aumentará.", "Vendica un compagno messo KO. Se ciò è\naccaduto al turno precedente, il danno\nè maggiore.", "The user gets revenge for a fainted ally.\nIf an ally fainted in the previous turn,\nthis attack's damage increases.") },
            { PBEMove.FinalGambit, new PBELocalizedString("いのちがけで　あいてを　こうげきする。\nじぶんは　ひんしに　なるが　あいてに\n\xFF28\xFF30ぶんの　ダメージを　あたえる。", "목숨을 걸고 상대를 공격한다.\n자신은 기절하게 되지만 상대에게\nHP만큼의 데미지를 준다.", "Une attaque très risquée. Le lanceur perd\ntous ses PV restants et inflige autant de\ndégâts à l'ennemi.", "Ein Angriff, der dem Ziel Schaden in Höhe\nder aktuellen KP des Anwenders zufügt.\nLetzterer wird dadurch selbst besiegt.", "El usuario se sacrifica causándole\nun daño al objetivo equivalente\na sus propios PS perdidos.", "Chi la usa attacca con tutta la potenza di\ncui dispone e va KO, ma infligge al bersaglio\nun danno pari ai PS che ha perso.", "The user risks everything to attack its\ntarget. The user faints but does damage\nequal to the user's HP.") },
            // { PBEMove.516, new PBELocalizedString("あいてが　どうぐを　もっていない　とき\nじぶんが　もっている　どうぐを\nあいてに　わたす。", "상대가 도구를 지니고 있지 않을 때\n자신이 지니고 있는 도구를\n상대에게 건넨다.", "Si la cible ne tient pas d'objet, le\nlanceur lui donne l'objet qu'il tient.", "Trägt das Ziel gerade kein Item bei sich,\nerhält es das Item, das sich aktuell im\nBesitz des Anwenders befindet.", "Entrega el objeto que lleva al objetivo\nen caso de que este no tenga ninguno.", "Chi la usa consegna il proprio strumento\nal bersaglio se ne è sprovvisto.", "The user passes its held item to the\ntarget when the target isn't holding\nan item.") },
            { PBEMove.Inferno, new PBELocalizedString("はげしい　ほのおで\nあいてを　つつみこみ　こうげきする。\nやけど　じょうたいに　する。", "격렬한 불꽃으로\n상대를 둘러싸 공격한다.\n화상 상태로 만든다.", "L'ennemi est entouré d'un torrent de\nflammes ardentes qui le brûlent.", "Anwender greift das Ziel an, indem\ner es mit dichten Flammen umhüllt.\nZiel erleidet Verbrennungen.", "Ataca con una gran ráfaga de fuego\nque causa quemaduras.", "Il bersaglio viene avvolto da intense\nfiammate che causano scottature.", "The user attacks by engulfing the target\nin an intense fire. It leaves the target\nwith a burn.") },
            // { PBEMove.518, new PBELocalizedString("みずの　はしらで　こうげきする。\nほのおと　くみあわせると　いりょくが\nあがって　そらに　にじが　かかる。", "물기둥으로 공격한다.\n불꽃과 조합하면 위력이\n올라가고 하늘에 무지개가 걸린다.", "Une masse d'eau s'abat sur l'ennemi.\nEn l'utilisant avec Aire de Feu, l'effet\naugmente et un arc-en-ciel apparaît.", "Ein Angriff mit Wassersäulen. Kombiniert\nmit Feuersäulen steigt die Wirkung\nund ein Regenbogen erscheint.", "Ataca con columnas de agua.\nCombinado con Voto Fuego, crea\nun arcoíris y aumenta su potencia.", "Attacca il nemico con una colonna d'acqua.\nSe usata con Fiammapatto, aumentano gli\neffetti e un arcobaleno appare in cielo.", "A column of water strikes the target. When\ncombined with its fire equivalent, the\ndamage increases and a rainbow appears.") },
            // { PBEMove.519, new PBELocalizedString("ほのおの　はしらで　こうげきする。\nくさと　くみあわせると　いりょくが\nあがって　あたりが　ひの　うみに　なる。", "불꽃기둥으로 공격한다.\n풀과 조합하면 위력이\n올라가고 주위가 불바다가 된다.", "Une masse de feu s'abat sur l'ennemi.\nEn l'utilisant avec Aire d'Herbe, l'effet\naugmente et une mer de feu apparaît.", "Ein Angriff mit Feuersäulen. Kombiniert mit\nPflanzsäulen steigt die Wirkung und die\nUmgebung wird zu einem Meer aus Feuer.", "Ataca con columnas de fuego.\nCombinado con Voto Planta, crea\nun mar de llamas y aumenta su potencia.", "Attacca il nemico con una colonna di fuoco.\nSe usata con Erbapatto, aumentano gli\neffetti e il campo diventa un mare di fuoco.", "A column of fire hits opposing Pokémon.\nWhen used with its Grass equivalent, its\ndamage increases into a vast sea of fire.") },
            // { PBEMove.520, new PBELocalizedString("くさの　はしらで　こうげきする。\nみずと　くみあわせると　いりょくが\nあがって　あたりが　しつげんに　なる。", "풀기둥으로 공격한다.\n물과 조합하면 위력이\n올라가고 주변이 습지초원이 된다.", "Une masse végétale s'abat sur l'ennemi.\nEn l'utilisant avec Aire d'Eau, l'effet\naugmente et un marécage apparaît.", "Ein Angriff mit Pflanzsäulen. Kombiniert\nmit Wassersäulen steigt die Wirkung\nund die Umgebung wird zu einem Sumpf.", "Ataca con columnas de hojas.\nCombinado con Voto Agua, crea\nun pantano y aumenta su potencia.", "Attacca il nemico con una colonna d'erba.\nSe usata con Acquapatto, aumentano gli\neffetti e il campo diventa una palude.", "A column of grass hits opposing Pokémon.\nWhen used with its water equivalent, its\ndamage increases into a vast swamp.") },
            // { PBEMove.521, new PBELocalizedString("こうげき　したあと\nものすごい　スピードで　もどってきて\nひかえ　ポケモンと　いれかわる。", "공격한 뒤\n굉장한 스피드로 돌아와서\n교대 포켓몬과 교체한다.", "Après son attaque, le lanceur revient à\ntoute vitesse et change de place avec\nun Pokémon de l'équipe prêt au combat.", "Anwender kehrt nach dem Angriff mit atem-\nberaubender Geschwindigkeit zurück und\ntauscht Platz mit einem anderen Pokémon.", "Tras atacar, vuelve a toda prisa para dar\npaso a otro Pokémon del equipo.", "Chi usa questa mossa fa marcia indietro\nper farsi sostituire dopo aver sferrato\nl'attacco.", "After making its attack, the user\nrushes back to switch places with\na party Pokémon in waiting.") },
            { PBEMove.StruggleBug, new PBELocalizedString("ていこう　して　あいてを　こうげきする。\nあいての　とくこうを　さげる。\n", "저항해서 상대를 공격한다.\n상대의 특수공격을 떨어뜨린다.", "Le lanceur se débat de toutes ses forces,\net baisse l'Attaque Spéciale de l'ennemi.", "Anwender leistet Widerstand und greift an.\nDer Spezial-Angriff der Ziele sinkt.", "El usuario contraataca.\nAdemás baja el Ataque Especial\nde los oponentes.", "Colpisce i nemici opponendo resistenza e\nriducendo il loro Attacco Speciale.", "While resisting, the user attacks the\nopposing Pokémon. The targets'\nSp. Atk stat is reduced.") },
            { PBEMove.Bulldoze, new PBELocalizedString("じめんを　ふみならして　じぶんの\nまわりに　いるものを　こうげきする。\nあいての　すばやさを　さげる。", "땅을 힘껏 밟아서 자신의\n주위에 있는 포켓몬을 공격한다.\n상대의 스피드를 떨어뜨린다.", "Le lanceur piétine le sol et inflige des\ndégâts à tous les Pokémon autour\nde lui. Baisse aussi la Vitesse.", "Anwender greift an, indem er den Boden\num sich herum plattwalzt. Die Initiative\naller betroffenen Pokémon sinkt.", "Ataca con una sacudida sísmica que afecta\na los Pokémon adyacentes en combate y\nbaja su Velocidad.", "Chi la usa calpesta il terreno e scatena un\nterremoto che danneggia tutti i Pokémon\nnei paraggi e ne riduce anche la Velocità.", "The user stomps down on the ground\nand attacks everything in the area. Hit\nPokémon's Speed stat is reduced.") },
            { PBEMove.FrostBreath, new PBELocalizedString("つめたい　いきを\nあいてに　ふきつけて　こうげきする。\nかならず　きゅうしょに　あたる。", "차가운 숨결을\n상대에게 내뿜어 공격한다.\n반드시 급소에 맞는다.", "Un souffle froid blesse l'ennemi.\nL'effet est toujours critique.", "Anwender greift an, indem er dem\nZiel eisigen Atem entgegenhaucht.\nVolltreffergarantie.", "Ataque con aire helado.\nSiempre resulta en un golpe crítico.", "Chi la usa attacca il bersaglio con un\nsoffio d'aria gelida. Brutto colpo\nassicurato.", "The user blows a cold breath on the\ntarget. This attack always results in\na critical hit.") },
            // { PBEMove.525, new PBELocalizedString("あいてを　はじきとばして\nひかえの　ポケモンを　ひきずりだす。\nやせいの　ばあいは　せんとうが　おわる。", "상대를 튕겨내서\n교대할 포켓몬을 끌어낸다.\n야생의 경우에는 배틀이 끝난다.", "Un coup puissant qui blesse la cible\net l'envoie balader. Dans la nature,\nmet fin au combat.", "Putzt das Ziel vom Feld und wechselt\nes mit einem anderen Pokémon aus.\nBeendet Kämpfe gegen wilde Pokémon.", "Ataca al objetivo y lo obliga a cambiarse\npor otro Pokémon. Si es uno salvaje,\nacaba el combate.", "Chi la usa fa volar via il bersaglio in modo\nche venga sostituito. Se il bersaglio è un\nPokémon selvatico, la lotta finisce.", "The target is knocked away and switched.\nIn the wild, a battle against a single\nPokémon ends.") },
            { PBEMove.WorkUp, new PBELocalizedString("じぶんを　ふるいたてて\nこうげきと　とくこうを　あげる。\n", "스스로 분발해서\n공격과 특수공격을 올린다.", "Le lanceur se rengorge.\nAugmente l'Attaque et l'Attaque Spéciale.", "Anwender erhält einen Kraftschub, der\nseinen Angriff und Spez.-Angr. erhöht.", "Movimiento que aumenta el Ataque\ny el Ataque Especial de quien lo usa.", "Chi la usa si tira su di morale, aumentando\nil proprio Attacco e l'Attacco Speciale.", "The user is roused, and its Attack\nand Sp. Atk stats increase.") },
            { PBEMove.Electroweb, new PBELocalizedString("でんきの　ネットで\nあいてを　つかまえて　こうげきする。\nあいての　すばやさを　さげる。", "전기 네트로\n상대를 붙잡아서 공격한다.\n상대의 스피드를 떨어뜨린다.", "Attrape l'ennemi dans un filet électrique.\nBaisse aussi la Vitesse de l'ennemi.", "Fängt Ziele mit einem elektrischen\nNetz und senkt deren Initiative.", "Atrapa y ataca a los objetivos con\nuna telaraña eléctrica. También\nreduce su Velocidad.", "Chi la usa attacca i nemici catturandoli\ncon una ragnatela elettrica e riducendone\nla Velocità.", "The user captures and attacks opposing\nPokémon by using an electric net. It\nreduces the targets' Speed stat.") },
            { PBEMove.WildCharge, new PBELocalizedString("でんきを　まとって\nあいてに　ぶつかって　こうげきする。\nじぶんも　すこし　ダメージを　うける。", "전기를 두르고\n상대에게 부딪쳐 공격한다.\n자신도 조금 데미지를 입는다.", "Une charge électrique violente qui blesse\naussi légèrement le lanceur.", "Anwender erzeugt Spannung und greift an,\nindem er auf Kollisionskurs geht. Er selbst\nerleidet dabei ebenfalls leichten Schaden.", "Carga eléctrica muy potente que también\nhiere ligeramente a quien la usa.", "Chi la usa si carica di elettricità per poi\nscagliarsi sul bersaglio, ma subisce dei\ndanni per il contraccolpo.", "The user shrouds itself in electricity\nand smashes into its target.\nIt also damages the user a little.") },
            { PBEMove.DrillRun, new PBELocalizedString("ドリルのように　からだを　かいてん\nしながら　あいてに　たいあたりする。\nきゅうしょに　あたりやすい。", "드릴처럼 몸을 회전시켜서\n상대에게 몸통박치기한다.\n급소에 맞기 쉽다.", "Le lanceur tourne sur lui-même comme\nune perceuse et se jette sur l'ennemi.\nTaux de critiques élevé.", "Anwender rammt das Ziel, während er\nseinen Körper wie einen Bohrer dreht.\nHohe Volltrefferquote.", "El usuario golpea usando\nsu cuerpo como un taladro.\nSuele ser crítico.", "Chi la usa si scaglia sul bersaglio ruotando\nsu se stesso come un trapano perforante.\nProbabile brutto colpo.", "The user crashes into its target while\nrotating its body like a drill.\nCritical hits land more easily.") },
            // { PBEMove.530, new PBELocalizedString("からだの　かたいぶぶんで　あいてを\nたたいて　こうげきする。\xFF12かい\nれんぞくで　ダメージを　あたえる。", "몸의 단단한 부분으로 상대를\n때려 공격한다. 2회 연속으로\n데미지를 준다.", "Le lanceur frappe l'ennemi deux fois\nd'affilée avec les parties les plus\nrobustes de son corps.", "Versetzt dem Ziel mit massiven\nExtremitäten Hiebe. Angriff erfolgt\nzweimal hintereinander.", "Golpea dos veces seguidas con la cola\nu otras partes de su cuerpo.", "Chi la usa attacca due volte il bersaglio\ncon dei colpi estremamente forti.", "The user attacks its target by hitting\nit with brutal strikes.\nThe target is hit twice in a row.") },
            { PBEMove.HeartStamp, new PBELocalizedString("かわいい　しぐさで　ゆだん　させて\nきょうれつな　いちげきを　あびせる。\nあいてを　ひるませる　ことが　ある。", "귀여운 모습으로 방심시켜서\n강렬한 일격을 날린다.\n상대를 풀죽게 만들 때가 있다.", "Déconcentre l'ennemi avec des mouvements\nmignons avant de le frapper violemment.\nPeut apeurer l'ennemi.", "Verleitet Ziel durch Kokettieren zu Un-\nachtsamkeit und verpasst ihm dann einen\nharten Schlag. Ziel schreckt evtl. zurück.", "Grácil gesto que asesta un golpe tremendo\nal objetivo y puede hacerlo retroceder.", "Chi la usa distrae il nemico con un faccino\ninnocente per poi sferrargli un colpo\ndevastante che può farlo tentennare.", "The user unleashes a vicious blow after\nits cute act makes the target less wary.\nIt may also make the target flinch.") },
            { PBEMove.HornLeech, new PBELocalizedString("つのを　つきさして　あいての　ようぶんを\nすいとる。あたえた　ダメージの\nはんぶんの　\xFF28\xFF30を　かいふく　できる。", "뿔을 꿰찔러서 상대의 양분을\n흡수한다. 입힌 데미지의 절반에\n해당하는 HP를 회복할 수 있다.", "Un coup de corne qui draine l'énergie\nde l'ennemi. Convertit la moitié des dégâts\ninfligés en PV pour le lanceur.", "Greift Ziel mit Astgeweih an und zapft\ndiesem Nährstoffe ab. Anwender wird um die\nHälfte des zugefügten Schadens geheilt.", "Un golpe que drena energía.\nEl Pokémon recupera la mitad\nde los PS arrebatados al objetivo.", "Chi la usa infilza il bersaglio con le corna\ne assorbe una quantità di PS pari a metà\ndel danno inferto.", "The user drains the target's energy with\nits horns. The user's HP is restored\nby half the damage taken by the target.") },
            // { PBEMove.533, new PBELocalizedString("ながい　つので　きりつけて　こうげきする。\nあいての　のうりょく　へんかに　\nかんけいなく　ダメージを　あたえる。", "긴 뿔로 베어 공격한다.\n상대의 능력 변화에\n관계없이 데미지를 준다.", "Un coup de lame violent qui lacère\nl'ennemi et lui inflige des dégâts quels\nque soient ses changements de stats.", "Schneideangriff mit langem Horn.\nRichtet Schaden unabhängig von\nStatusveränderungen des Zieles an.", "El usuario ataca con una espada,\nignorando cualquier cambio en\nlas características del objetivo.", "Chi la usa taglia il nemico con una spada\nmagica. Il danno inflitto ignora le modifiche\nalle statistiche del bersaglio.", "The user attacks by slicing with its long\nhorns. The target's stat changes\ndon't affect this attack's damage.") },
            { PBEMove.RazorShell, new PBELocalizedString("するどい　かいがらで　きりつけて\nこうげきする。あいての　ぼうぎょを\nさげることが　ある。", "날카로운 조개껍질로 베어\n공격한다. 상대의 방어를\n떨어뜨릴 때가 있다.", "Un coquillage aiguisé lacère l'ennemi.\nPeut aussi baisser sa Défense.", "Schneideangriff mit einer scharfen\nMuschelschale. Senkt eventuell die\nVerteidigung des Zieles.", "Una afilada vieira ataca al objetivo.\nTambién puede hacer disminuir su Defensa.", "Chi la usa colpisce il bersaglio con il suo\nguscio affilato. Il colpo può anche ridurre\nla Difesa del bersaglio.", "The user cuts its target with sharp\nshells. This attack may also lower the\ntarget's Defense stat.") },
            { PBEMove.HeatCrash, new PBELocalizedString("もえる　からだで　あいてに　ぶつかって\nこうげきする。じぶんが　あいてより\nおもいほど　いりょくが　あがる。", "불타는 몸으로 상대에게 부딪쳐서\n공격한다. 자신이 상대보다\n무거울수록 위력이 올라간다.", "Le lanceur projette son corps enflammé\ncontre l'ennemi. S'il est plus lourd que\nl'ennemi, l'effet augmente en conséquence.", "Rempelattacke mit brennendem Körper.\nJe schwerer der Anwender im Vergleich\nzum Ziel ist, desto stärker die Attacke.", "El usuario ataca con su cuerpo ardiente.\nCuanto mayor sea su peso comparado\ncon el del objetivo, más daño causará.", "Chi la usa carica con il suo corpo rovente.\nPiù è pesante rispetto al bersaglio e più\ndanni causa.", "The user slams its target with its flame-\ncovered body. The more the user outweighs\nthe target, the greater the damage.") },
            { PBEMove.LeafTornado, new PBELocalizedString("するどい　はっぱで　あいてを\nつつみこんで　こうげきする。\nめいちゅうりつを　さげることが　ある。", "날카로운 잎사귀로 상대를\n둘러싸서 공격한다.\n명중률을 떨어뜨릴 때가 있다.", "L'ennemi est pris dans un tourbillon de\nfeuilles acérées. Peut aussi baisser\nla Précision de l'ennemi.", "Anwender greift an, indem er das Ziel\nin scharfes Blattwerk einwickelt. Senkt\neventuell die Genauigkeit.", "Tritura con afiladas hojas y puede bajar\nla Precisión del objetivo.", "Chi la usa avvolge e attacca il bersaglio\ncon foglie affilate che possono anche\nridurne la precisione.", "The user attacks its target by\nencircling it in sharp leaves. This attack\nmay also lower the target's accuracy.") },
            { PBEMove.Steamroller, new PBELocalizedString("まるめた　からだで　かいてんして\nあいてを　おしつぶす。\nあいてを　ひるませる　ことが　ある。", "둥글게 뭉친 몸을 회전하여\n상대를 뭉개 버린다.\n상대를 풀죽게 만들 때가 있다.", "Le lanceur se roule en boule et\nécrase son ennemi. Peut aussi\napeurer l'ennemi.", "Anwender rollt mit rundlichem Körper\nüber das Ziel und drückt es platt.\nZiel schreckt eventuell zurück.", "El usuario se hace una bola y arrolla\nal objetivo con su cuerpo.\nPuede hacerlo retroceder.", "Chi la usa ruota su se stesso ad alta\nvelocità e schiaccia il bersaglio. Può\nanche farlo tentennare.", "The user crushes its targets by rolling\nover them with its rolled-up body.\nThis attack may make the target flinch.") },
            { PBEMove.CottonGuard, new PBELocalizedString("フワフワの　わたげで　じぶんの\nからだを　つつみこんで　まもる。\nぼうぎょを　ぐぐーんと　あげる。", "푹신푹신한 솜털로 자신의\n몸을 둘러싸서 지킨다.\n방어를 매우 크게 올린다.", "Le lanceur se protège en s'emmitouflant\ndans du coton. Sa Défense augmente\nfortement.", "Anwender schützt sich, indem er sich in\neinen luftigen Flaum hüllt. Erhöht die\nVerteidigung drastisch.", "Cubre al Pokémon con una madeja\nprotectora. Aumenta muchísimo\nla Defensa.", "Chi la usa avvolge il proprio corpo con\ndel cotone molto morbido, proteggendosi\ne aumentando moltissimo la propria Difesa.", "The user protects itself by wrapping\nits body in soft cotton, drastically\nraising the user's Defense stat.") },
            { PBEMove.NightDaze, new PBELocalizedString("あんこくの　しょうげきはを\nとばして　あいてを　こうげきする。\nめいちゅうりつを　さげることが　ある。", "암흑의 충격파를\n날려서 상대를 공격한다.\n명중률을 떨어뜨릴 때가 있다.", "Le lanceur attaque l'ennemi avec une onde\nde choc ténébreuse. Peut aussi baisser la\nPrécision de l'ennemi.", "Anwender greift Ziel mit finsteren\nSchockwellen an. Senkt eventuell die\nGenauigkeit.", "Ataca al objetivo con una onda siniestra.\nPuede bajar su Precisión.", "Chi la usa attacca il bersaglio con un'onda\nd'urto oscura che può ridurne\nla precisione.", "The user lets loose a pitch-black shock\nwave at its target. It may also lower the\ntarget's accuracy.") },
            { PBEMove.Psystrike, new PBELocalizedString("ふしぎな　ねんぱを　じったいかして\nあいてを　こうげきする。\nぶつりてきな　ダメージを　あたえる。", "이상한 염력파를 실체화해서\n상대를 공격한다.\n물리적인 데미지를 준다.", "Le lanceur matérialise des ondes\nmystérieuses qu'il projette sur\nl'ennemi. Inflige des dégâts physiques.", "Anwender erzeugt seltsame Energiewellen,\ndie dem Ziel physischen Schaden\nzufügen.", "Crea una onda psíquica que golpea\nal objetivo provocándole un daño físico.", "Chi la usa attacca il bersaglio facendo\nmaterializzare un misterioso raggio\npsichico che provoca danni fisici.", "The user materializes an odd\npsychic wave to attack the target.\nThis attack does physical damage.") },
            // { PBEMove.541, new PBELocalizedString("かたい　しっぽで\nあいてを　たたいて　こうげきする。\n\xFF12ー\xFF15かいの　あいだ　れんぞくで　だす。", "단단한 꼬리로\n상대를 때려서 공격한다.\n2-5회 동안 연속으로 쓴다.", "Le lanceur frappe l'ennemi de 2 à 5 fois\nd'affilée avec sa queue robuste.", "Anwender greift das Ziel mit\nseiner schlagfesten Rute 2- bis 5-mal\nhintereinander an.", "Golpea con la cola u otras\npartes de su cuerpo de dos\na cinco veces seguidas.", "Chi la usa colpisce il bersaglio con la sua\ncoda dura da due a cinque volte di fila.", "The user attacks by striking the target\nwith its hard tail. It hits the target two\nto five times in a row.") },
            { PBEMove.Hurricane, new PBELocalizedString("きょうれつな　かぜで　あいてを\nつつみこんで　こうげきする。\nあいてを　こんらん　させることが　ある。", "강렬한 바람으로 상대를\n둘러싸서 공격한다.\n상대를 혼란시킬 때가 있다.", "Le lanceur déclenche une tempête de\nvents violents qui s'abat sur l'ennemi.\nPeut aussi le rendre confus.", "Anwender greift das Ziel an, indem er\nes mit heftigen Windböen umgibt.\nZiel wird eventuell verwirrt.", "Golpea al objetivo con un fuerte\ntorbellino que envuelve al rival\ny puede confundirlo.", "Chi la usa attacca il bersaglio\navvolgendolo con un vento fortissimo.\nPuò anche confonderlo.", "The user attacks by wrapping its opponent\nin a fierce wind that flies up into the sky.\nIt may also confuse the target.") },
            { PBEMove.HeadCharge, new PBELocalizedString("すごい　アフロの　あたまで\nあいてに　とっしんして　こうげきする。\nじぶんも　すこし　ダメージを　うける。", "굉장한 아프로 머리로\n상대에게 돌진하여 공격한다.\n자신도 조금 데미지를 입는다.", "Le lanceur donne un coup avec sa tête\ncouronnée d'une fière crinière.\nBlesse aussi légèrement le lanceur.", "Rempelattacke mit ausgeflippter\nRetrofrisur. Anwender nimmt selbst\nleichten Schaden.", "Propina un tremendo cabezazo.\nTambién daña al usuario un poco.", "Chi la usa carica il bersaglio con la sua\ntesta in stile afro, ma subisce un po' di\ndanni per il contraccolpo.", "The user charges its head into its\ntarget, using its powerful guard hair.\nIt also damages the user a little.") },
            // { PBEMove.544, new PBELocalizedString("こうてつの　ギアを　あいてに\nなげつけて　こうげきする。\xFF12かい\nれんぞくで　ダメージを　あたえる。", "강철의 기어를 상대에게\n던져서 공격한다.\n2회 연속으로 데미지를 준다.", "Le lanceur jette deux écrous d'acier qui\nfrappent l'ennemi deux fois d'affilée.", "Anwender greift an, indem er stählerne\nZahnräder auf das Ziel schleudert.\nAngriff erfolgt zweimal hintereinander.", "Rota dos engranajes de hierro sobre\nel objetivo. Golpea dos veces.", "Chi la usa colpisce il bersaglio due volte\ndi fila lanciandogli contro dei dischi\nd'acciaio.", "The user attacks by throwing\ntwo steel gears at its target.") },
            { PBEMove.SearingShot, new PBELocalizedString("まっかな　ほのおで　じぶんの\nまわりに　いるものを　こうげきする\nやけど　じょうたいに　することが　ある。", "새빨간 불꽃으로 자신의\n주위에 있는 포켓몬을 공격한다.\n화상 상태로 만들 때가 있다.", "Des flammes rougeoyantes s'abattent\nsur tous les Pokémon autour du lanceur.\nPeut aussi brûler.", "Greift alles in seiner Umgebung mit\ntiefroten Flammen an. Opfer erleidet\neventuell Verbrennungen.", "Un infierno de llamas daña a los Pokémon\nde alrededor en combate. Puede quemar.", "Chi la usa lancia fiamme scarlatte sui\nPokémon intorno a sé. Può anche scottarli.", "An inferno of scarlet flames torches\neverything around the user. It may\nleave targets with a burn.") },
            { PBEMove.TechnoBlast, new PBELocalizedString("こうだんを　あいてに\nほうしゅつする。じぶんの　もつ\nカセットに　より　タイプが　かわる。", "광탄을 상대에게 방출한다.\n자신이 지니고 있는\n카세트에 의해 타입이 바뀐다.", "Le lanceur projette un rayon lumineux sur\nl'ennemi. Le type varie selon le Module\nque tient le lanceur.", "Anwender feuert ein Lichtgeschoss auf das\nZiel ab. Der Typ der Attacke hängt von\ndem des Moduls ab.", "Ataca al objetivo con un gran láser.\nEl tipo del ataque lo determina el\ncartucho que porta el usuario.", "Chi la usa rilascia un colpo di luce contro\nil bersaglio. Il tipo varia a seconda del\nmodulo tenuto.", "The user fires a beam of light at\nits target. The type changes depending\non the Drive the user holds.") },
            // { PBEMove.547, new PBELocalizedString("いにしえのうたを　あいてに　きかせて\nこころに　うったえて　こうげきする。\nねむり　じょうたいに　することが　ある。", "옛노래를 상대에게 들려주고\n마음에 호소하여 공격한다.\n잠듦 상태로 만들 때가 있다.", "Le lanceur attaque l'ennemi en lui\nchantant une chanson d'un autre temps.\nPeut endormir l'ennemi.", "Anwender greift mit Urgesang an, der\nGegner in der Nähe im tiefsten Inneren\nanspricht. Diese schlafen eventuell ein.", "Ataca conmoviendo a los rivales de\nalrededor con un antiguo canto.\nPuede dormirlos.", "Chi la usa attacca i nemici intonando\nun'antica melodia che colpisce il loro\nspirito. Può anche farli addormentare.", "The user sings an ancient song and attacks\nby appealing to the hearts of those\nlistening. It may also induce sleep.") },
            { PBEMove.SecretSword, new PBELocalizedString("ながい　つので　きりつけて　こうげきする。\nつのが　まとった　ふしぎな　ちからは\nぶつりてきな　ダメージを　あたえる。", "긴 뿔로 베어 공격한다.\n뿔이 머금은 이상한 힘은\n물리적인 데미지를 준다.", "L'ennemi est lacéré par une longue lame.\nLe pouvoir mystérieux de la lame inflige\ndes dégâts physiques.", "Schneideangriff mit dem langen Schwert des\nAnwenders. Die mysteriöse Kraft aus dem\nHorn erzeugt physischen Schaden.", "Ensarta al objetivo con un sable,\nhiriéndolo con su místico poder.\nProduce daño físico.", "Chi la usa attacca il bersaglio tagliandolo\ncon una spada mistica. La misteriosa\nenergia sprigionata provoca danni fisici.", "The user cuts with its long horn. The odd\npower contained in the horn does physical\ndamage to the target.") },
            { PBEMove.Glaciate, new PBELocalizedString("こごえる　ような　れいきを\nあいてに　ふきつけて　こうげきする。\nあいての　すばやさを　さげる。", "차가운 냉기를\n상대에게 내뿜어 공격한다.\n상대의 스피드를 떨어뜨린다.", "Un souffle de vent qui congèle tout\nsur son passage s'abat sur l'ennemi.\nRéduit aussi sa Vitesse.", "Anwender greift an, indem er dem Ziel\nklirrend kalte Luft entgegenbläst. Senkt\ndie Initiative des Zieles.", "Ataque con aire helado que baja\nla Velocidad del objetivo.", "Chi la usa attacca i nemici con una folata\nd'aria gelida e ne riduce anche la Velocità.", "The user attacks by blowing freezing cold\nair at opposing Pokémon. This attack\nreduces the targets' Speed stat.") },
            { PBEMove.BoltStrike, new PBELocalizedString("ぼうだいな　でんきを　みに　まとって\nあいてに　とっしんして　こうげきする。\nまひ　じょうたいに　することが　ある。", "방대한 전기를 몸에 둘러\n상대에게 돌진해서 공격한다.\n마비 상태로 만들 때가 있다.", "S'enveloppe d'une charge électrique\nsurpuissante et se jette sur l'ennemi.\nPeut aussi le paralyser.", "Lädt seinen Körper mit einer gewaltigen\nMenge an Elektrizität auf und rammt damit\ndas Ziel. Ziel wird evtl. paralysiert.", "Ataca envolviéndose de una gran\ncarga eléctrica y embistiendo al\nobjetivo con ella. Puede paralizar.", "Colpisce il bersaglio con una possente\ncarica elettrica e può anche paralizzarlo.", "The user charges its target, surrounding\nitself with a great amount of electricity.\nIt may leave the target with paralysis.") },
            { PBEMove.BlueFlare, new PBELocalizedString("うつくしくも　はげしい　あおいほのおで\nあいてを　つつみこんで　こうげきする。\nやけど　じょうたいに　することが　ある。", "아름다우면서도 격렬한 푸른불꽃으로\n상대를 둘러싸서 공격한다.\n화상 상태로 만들 때가 있다.", "De magnifiques et redoutables flammes\nbleues fondent sur l'ennemi.\nPeut aussi le brûler.", "Anwender greift an, indem er das Ziel in\nwunderschöne, intensiv blaue Flammen\nhüllt, die es eventuell verbrennen.", "Ataca con una bella pero potente\nllama azul que rodea al objetivo.\nPuede quemarlo.", "Chi la usa attacca il bersaglio\navvolgendolo con magnifiche e intense\nfiamme blu che possono anche scottarlo.", "The user attacks by engulfing the target\nin an intense, yet beautiful, blue flame.\nIt may leave the target with a burn.") },
            { PBEMove.FieryDance, new PBELocalizedString("ほのおを　まとい　はばたいて　あいてを\nこうげきする。じぶんの　とくこうが\nあがることが　ある。", "불꽃을 둘러 날개를 쳐서\n공격한다. 자신의 특수공격이\n오를 때가 있다.", "Le lanceur enveloppe l'ennemi de flammes.\nPeut aussi augmenter l'Attaque Spéciale\ndu lanceur.", "Hüllt das Ziel mit einer Feuerhose\nin Flammen. Erhöht eventuell den\nSpezial-Angriff des Anwenders.", "Envuelve en llamas y daña al objetivo.\nPuede aumentar el Ataque Especial\nde quien lo usa.", "Il bersaglio viene avvolto dalle fiamme.\nPuò anche aumentare l'Attacco Speciale\ndi chi la usa.", "Cloaked in flames, the user dances\nand flaps its wings. It may also\nraise the user's Sp. Atk stat.") },
            // { PBEMove.553, new PBELocalizedString("でんきを　まとった　こおりの　かたまりで\n\xFF12ターンめに　あいてを　たたきつける。\nまひ　じょうたいに　することが　ある。", "전기를 두른 얼음 덩어리로\n2턴째에 상대를 내리친다.\n마비 상태로 만들 때가 있다.", "Projette un bloc de glace électrifié\nsur l'ennemi au second tour.\nPeut aussi le paralyser.", "Feuert in der zweiten Runde elektrisch\ngeladene Eisklumpen auf das Ziel ab.\nParalysiert das Ziel eventuell.", "El usuario carga un bloque de hielo con\nelectricidad en el primer turno y ataca\ncon él en el segundo. Puede paralizar.", "Chi la usa lancia contro il nemico al turno\nsuccessivo una sfera di ghiaccio ricoperta\ndi elettricità. Può anche paralizzarlo.", "On the second turn, the user hits the\ntarget with electrically charged ice.\nIt may leave the target with paralysis.") },
            // { PBEMove.554, new PBELocalizedString("すべてを　こおらせる　はげしい　れいきで\n\xFF12ターンめに　あいてを　つつみこむ。\nやけど　じょうたいに　することが　ある。", "모든 것을 얼려버리는 격렬한 냉기로\n2턴째에 상대를 둘러싼다.\n화상 상태로 만들 때가 있다.", "Au second tour, le lanceur projette un\nsouffle de vent glacial dévastateur\nsur l'ennemi. Peut le brûler.", "Umgibt das Ziel in der nächsten Runde\nmit heftigen, alles gefrierenden Eisböen.\nFügt dem Ziel eventuell Verbrennungen zu.", "Ataca al objetivo en el segundo turno\nrodeándolo de un aire gélido.\nPuede causar quemaduras.", "Chi la usa attacca il bersaglio al turno\nsuccessivo e lo avvolge in un soffio\nd'aria congelata. Può anche scottarlo.", "On the second turn, an ultracold,\nfreezing wind surrounds the target.\nThis may leave the target with a burn.") },
            { PBEMove.Snarl, new PBELocalizedString("まくしたてる　ように　どなりつけて\nあいての　とくこうを　さげる。\n", "호되게 호통을 쳐서\n상대의 특수공격을 떨어뜨린다.", "Le lanceur hurle sur l'ennemi.\nBaisse l'Attaque Spéciale de l'ennemi.", "Wäscht Gegnern in der Nähe mit einer\nausführlichen Standpauke den Kopf\nund senkt dabei deren Spezial-Angriff.", "Ataca lanzando un chillido insoportable\nque baja el Ataque Especial de\nlos objetivos.", "Chi la usa si mette a urlare per un po',\nriducendo l'Attacco Speciale dei nemici.", "The user yells as if it is ranting about\nsomething, making the targets' Sp. Atk\nstat decrease.") },
            { PBEMove.IcicleCrash, new PBELocalizedString("おおきな　つららを\nはげしく　ぶつけて　こうげきする。\nあいてを　ひるませる　ことが　ある。", "큰 고드름을\n격렬하게 부딪쳐서 공격한다.\n상대를 풀죽게 만들 때가 있다.", "Envoie de gros blocs de glace sur\nl'ennemi pour lui infliger des dégâts.\nPeut aussi l'apeurer.", "Lässt große, schwere Eiszapfen\nauf das Ziel herabregnen.\nZiel schreckt eventuell zurück.", "Lanza grandes carámbanos.\nPuede hacer retroceder al objetivo.", "Chi la usa attacca violentemente il nemico\ncon grosse stalattiti di ghiaccio che\npossono anche farlo tentennare.", "The user attacks by harshly dropping\nan icicle onto the target.\nIt may also make the target flinch.") },
            { PBEMove.VCreate, new PBELocalizedString("しゃくねつの　ほのおを　ひたいから\nはっせいさせて　すてみの　たいあたり。\nぼうぎょ　とくぼう　すばやさが　さがる。", "작열하는 불꽃을 이마에서\n발생시켜 이판사판으로 몸통박치기한다.\n방어, 특수방어, 스피드가 떨어진다.", "Le lanceur projette une flamme ardente de\nson front et se jette sur l'ennemi. Baisse\nla Défense, la Déf. Spé. et la Vitesse.", "Eine Verzweiflungsattacke. Anwender\nentfacht glühend heißes Feuer. Senkt\ndessen Vert., Spez.-Vert. und Initiative.", "Golpea con una V de llamas al objetivo.\nBaja la Defensa, la Defensa Especial\ny la Velocidad de quien lo usa.", "Chi la usa carica emettendo fiamme ardenti\ndalla fronte, a costo di una riduzione di\nDifesa, Difesa Speciale e Velocità.", "With a hot flame on its forehead, the user\nhurls itself at its target. It lowers the\nuser's Defense, Sp. Def, and Speed stats.") },
            // { PBEMove.558, new PBELocalizedString("きょだいな　ほのおを　たたきつける。\nきょだいな　いかずちの　えいきょうをうけ\nわざの　いりょくが　あがる。", "거대한 불꽃을 내리친다.\n거대한 우뢰의 영향을 받아\n기술의 위력이 올라간다.", "Projette une boule de feu\ngigantesque. L'effet augmente\nsous l'influence d'Éclair Croix.", "Feuert eine monströse Flamme ab. Wird\ndie Attacke durch einen gigantischen\nBlitz modifiziert, steigt die Stärke.", "Ataca con una llamarada gigantesca.\nAumenta su potencia si es influenciada\npor una gran energía eléctrica.", "Chi la usa lancia una fiammata enorme.\nSe usata in combinazione con Incrotuono,\nil danno provocato dalla mossa aumenta.", "The user brings down a giant flame.\nThis attack does greater damage when\ninfluenced by an enormous thunderbolt.") },
            // { PBEMove.559, new PBELocalizedString("きょだいな　いかずちを　たたきつける。\nきょだいな　ほのおの　えいきょうをうけ\nわざの　いりょくが　あがる。", "거대한 우뢰를 내리친다.\n거대한 불꽃의 영향을 받아\n기술의 위력이 올라간다.", "Projette un orbe électrique\ngigantesque. L'effet augmente\nsous l'influence de Flamme Croix.", "Feuert einen monströsen Blitz ab.\nWird die Attacke durch eine gigantische\nFlamme modifiziert, steigt die Stärke.", "Ataca con una enorme descarga eléctrica.\nAumenta su potencia si es influenciada\npor una gigantesca llamarada.", "Chi la usa lancia un fulmine enorme.\nSe usata in combinazione con Incrofiamma,\nil danno provocato dalla mossa aumenta.", "The user throws down a giant thunderbolt.\nThis attack does greater damage\nwhen influenced by an enormous flame.") }
        });
    }
}
